INSERT INTO `articles` VALUES ('1', 'Battle For The Play-Offs', 'Battle For The Play-Offs', '<p>Finishing second in the group will not guarantee Scotland a place in the Play-Offs for the 2010 World Cup Finals.  From the 9 groups, only 8 will occupy the Play-Offs.  These 8 teams will be determined by that team\'s results against 1st, 3rd, 4th, and 5th in their groups.  The 8 groups that have 6 teams will have their results against the bottom team discounted.  Their standings will be decided by points, followed by goal difference, goals scored, away goals, disciplinary record, and finally drawing of lots.</p>\r\n\r\n<p>The current standings are as follows: </p>\r\n<table width=\'100%\'>\r\n<tr>\r\n<th class=\'left\'>Grp</th>\r\n<th class=\'left\'>Team</th>\r\n<th class=\'right\'>P</th>\r\n<th class=\'right\'>W</th>\r\n<th class=\'right\'>D</th>\r\n<th class=\'right\'>L</th>\r\n<th class=\'right\'>F</th>\r\n<th class=\'right\'>A</th>\r\n<th class=\'right\'>Pts</th>\r\n<th class=\'right\'>GD</th>\r\n</tr>\r\n<tr>\r\n<td>4</td>\r\n<td>Russia</td>\r\n<td class=\'right\'>5</td>\r\n<td class=\'right\'>4</td>\r\n<td class=\'right\'>0</td>\r\n<td class=\'right\'>1</td>\r\n<td class=\'right\'>11</td>\r\n<td class=\'right\'>3</td>\r\n<td class=\'right\'>12</td>\r\n<td class=\'right\'>+8</td>\r\n</tr>\r\n<tr>\r\n<td>6</td>\r\n<td>Croatia</td>\r\n<td class=\'right\'>6</td>\r\n<td class=\'right\'>3</td>\r\n<td class=\'right\'>2</td>\r\n<td class=\'right\'>1</td>\r\n<td class=\'right\'>10</td>\r\n<td class=\'right\'>7</td>\r\n<td class=\'right\'>11</td>\r\n<td class=\'right\'>+3</td>\r\n</tr>\r\n<tr>\r\n<td>7</td>\r\n<td>France</td>\r\n<td class=\'right\'>6</td>\r\n<td class=\'right\'>3</td>\r\n<td class=\'right\'>2</td>\r\n<td class=\'right\'>1</td>\r\n<td class=\'right\'>8</td>\r\n<td class=\'right\'>7</td>\r\n<td class=\'right\'>11</td>\r\n<td class=\'right\'>+1</td>\r\n</tr>\r\n<tr>\r\n<td>2</td>\r\n<td>Greece</td>\r\n<td class=\'right\'>6</td>\r\n<td class=\'right\'>3</td>\r\n<td class=\'right\'>1</td>\r\n<td class=\'right\'>2</td>\r\n<td class=\'right\'>9</td>\r\n<td class=\'right\'>6</td>\r\n<td class=\'right\'>10</td>\r\n<td class=\'right\'>+3</td>\r\n</tr>\r\n<tr>\r\n<td>8</td>\r\n<td>Republic of Ireland</td>\r\n<td class=\'right\'>6</td>\r\n<td class=\'right\'>2</td>\r\n<td class=\'right\'>4</td>\r\n<td class=\'right\'>0</td>\r\n<td class=\'right\'>6</td>\r\n<td class=\'right\'>4</td>\r\n<td class=\'right\'>10</td>\r\n<td class=\'right\'>+2</td>\r\n</tr>\r\n<tr>\r\n<td>9</td>\r\n<td>SCOTLAND</td>\r\n<td class=\'right\'>7</td>\r\n<td class=\'right\'>3</td>\r\n<td class=\'right\'>1</td>\r\n<td class=\'right\'>3</td>\r\n<td class=\'right\'>6</td>\r\n<td class=\'right\'>10</td>\r\n<td class=\'right\'>10</td>\r\n<td class=\'right\'>-4</td>\r\n</tr>\r\n<tr>\r\n<td>5</td>\r\n<td>Bosnia</td>\r\n<td class=\'right\'>5</td>\r\n<td class=\'right\'>3</td>\r\n<td class=\'right\'>0</td>\r\n<td class=\'right\'>2</td>\r\n<td class=\'right\'>14</td>\r\n<td class=\'right\'>6</td>\r\n<td class=\'right\'>9</td>\r\n<td class=\'right\'>+8</td>\r\n</tr>\r\n<tr>\r\n<td>3</td>\r\n<td>Northern Ireland</td>\r\n<td class=\'right\'>6</td>\r\n<td class=\'right\'>2</td>\r\n<td class=\'right\'>2</td>\r\n<td class=\'right\'>2</td>\r\n<td class=\'right\'>6</td>\r\n<td class=\'right\'>7</td>\r\n<td class=\'right\'>8</td>\r\n<td class=\'right\'>-1</td>\r\n</tr>\r\n<tr>\r\n<td>1</td>\r\n<td>Hungary</td>\r\n<td class=\'right\'>5</td>\r\n<td class=\'right\'>2</td>\r\n<td class=\'right\'>1</td>\r\n<td class=\'right\'>2</td>\r\n<td class=\'right\'>5</td>\r\n<td class=\'right\'>4</td>\r\n<td class=\'right\'>7</td>\r\n<td class=\'right\'>+1</td>\r\n</tr>\r\n</table>', 'Battle-For-The-Play-Offs', '2016-05-22 00:03:03', '2016-05-22 00:03:03', '2016-05-22 00:00:00');
INSERT INTO `articles` VALUES ('2', 'Qualification Draw For Euro 2012', 'Qualification Draw For Euro 2012', '<p>The draw for the qualifying round for Euro 2012 will take place on 7th February 2010 in Nyon.<p/>\r\n<p>Of UEFA\'s 53 member countries, 51 will take part in the draw as both Poland and Ukraine automatically qualify as host countries.  The remaining countries will be drawn into 9 groups, 6 groups of 6 and 3 groups of 5.  The 9 group winners plus the best 2nd placed team will qualify.  The remaining 8 2nd placed teams will play-off with the 4 winners qualifying.</p>\r\n<p>For the draw, the teams will be put into 6 pots, 5 of 9 and 1 of 6.  They will be decided on the UEFA Coefficient following the World Cup qualification campaign.  Spain will be top seeds.</p>\r\n<p>\r\n<table width=\'100%\'>\r\n<tr>\r\n<td>\r\n<u>Pot 1</u><br />\r\nSpain<br />\r\nGermany<br />\r\nHolland<br />\r\nItaly<br />\r\nEngland<br />\r\nCroatia<br />\r\nPortugal<br />\r\nFrance<br />\r\nRussia</td/>\r\n<td>\r\n<u>Pot 2</u><br />\r\nGreece<br />\r\nCzech Republic<br />\r\nSweden<br />\r\nSwitzerland<br />\r\nSerbia<br />\r\nTurkey<br />\r\nDenmark<br />\r\nSlovakia<br />\r\nRomania</td/>\r\n<td>\r\n<u>Pot 3</u><br />\r\nIsrael<br />\r\nBulgaria<br />\r\nFinland<br />\r\nNorway<br />\r\nRepublic of Ireland<br />\r\nSCOTLAND<br />\r\nNorthern Ireland<br />\r\nAustria<br />\r\nBosnia</td/>\r\n<td>\r\n<u>Pot 4</u><br />\r\nSlovenia<br />\r\nLatvia<br />\r\nHungary<br />\r\nLithuania<br />\r\nBelarus<br />\r\nBelgium<br />\r\nWales<br />\r\nMacedonia<br />\r\nCyprus</td/>\r\n<td>\r\n<u>Pot 5</u><br />\r\nMontenegro<br />\r\nAlbania<br />\r\nEstonia<br />\r\nGeorgia<br />\r\nMoldova<br />\r\nIceland<br />\r\nArmenia<br />\r\nKazakhstan<br />\r\nLiechtenstein</td/>\r\n</tr>\r\n<tr><td colspan=\'5\'>&nbsp;</td></tr>\r\n<tr>\r\n<td><u>Pot 6</u><br />\r\nAzerbaijan<br />\r\nLuxembourg<br />\r\nMalta<br />\r\nFaroe Islands<br />\r\nAndorra<br />\r\nSan Marino</td/>\r\n<td colspan=\'4\'></td></tr>\r\n</table></p>', 'Qualification-Draw-For-Euro-2012', '2016-05-22 00:03:05', '2016-05-22 00:03:05', '2016-05-22 00:00:00');
INSERT INTO `articles` VALUES ('3', 'Qualification Draw For World Cup 2014', 'Qualification Draw For 2014 World Cup', '<p>The draw for the European qualifying round for World cup 2014 will take place on 30th July in Rio de Janeiro.<p/>\r\n<p>UEFA\'s 53 member countries will be drawn into 9 groups, 8 groups of 6 and 1 group of 5.  The 9 group winners will qualify and the 8 best 2nd placed teams will play-off with the 4 winners also qualifying.</p>\r\n<p>For the draw, the teams will be put into 6 pots, 5 of 9 and 1 of 8.  They will be decided on June\'s FIFA Rankings.</p>\r\n<p>\r\n<table width=\'100%\'>\r\n<tr>\r\n<td>\r\n<u>Pot 1</u><br />\r\nSpain<br />\r\nHolland<br />\r\nGermany<br />\r\nEngland<br />\r\nItaly<br />\r\nPortugal<br />\r\nCroatia<br />\r\nNorway<br />\r\nGreece</td/>\r\n<td>\r\n<u>Pot 2</u><br />\r\nFrance<br />\r\nMontenegro<br />\r\nRussia<br />\r\nSweden<br />\r\nDenmark<br />\r\nSlovenia<br />\r\nTurkey<br />\r\nSerbia<br />\r\nSlovakia</td>\r\n<td>\r\n<u>Pot 3</u><br />\r\nSwitzerland<br />\r\nIsrael<br />\r\nRepublic of Ireland<br />\r\nBelgium<br />\r\nCzech Republic<br />\r\nBosnia<br />\r\nBelarus<br />\r\nUkraine<br />\r\nHungary</td>\r\n<td>\r\n<u>Pot 4</u><br />\r\nBulgaria<br />\r\nRomania<br />\r\nGeorgia<br />\r\nLithuania<br />\r\nAlbania<br />\r\nSCOTLAND<br />\r\nNorthern Ireland<br />\r\nAustria<br />\r\nPoland</td>\r\n<td>\r\n<u>Pot 5</u><br />\r\nArmenia<br />\r\nFinland<br />\r\nEstonia<br />\r\nCyprus<br />\r\nLatvia<br />\r\nMoldova<br />\r\nMacedonia<br />\r\nAzerbaijan<br />\r\nWales</td>\r\n</tr>\r\n<tr><td colspan=\'5\'>&nbsp;</td></tr>\r\n<tr>\r\n<td><u>Pot 6</u><br />\r\nFaroe Islands<br />\r\nLiechtenstein<br />\r\nIceland<br />\r\nKazakhstan<br />\r\nLuxembourg<br />\r\nMalta<br />\r\nAndorra<br />\r\nSan Marino</td/>\r\n<td colspan=\'4\'></td></tr>\r\n</table></p>', 'Qualification-Draw-For-World-Cup-2014', '2016-05-22 00:03:09', '2016-05-22 00:03:09', '2016-05-22 00:00:00');
INSERT INTO `articles` VALUES ('4', 'Qualification Draw For Euro 2016', 'Qualification Draw For Euro 2016', '<p>The draw for the qualifying round for Euro 2016 will take place on 23rd February in Nice.<p/>\r\n<p>This tournament will be expanded to include 24 finalists from UEFA\'s 54 member countries.  The 53 teams going through the qualification process, will be drawn into 9 groups, 8 groups of 6 and 1 group of 5.  The top 2 teams in each group, plus the best third placed team will qualify and the 8 remaining third placed teams will play-off with the 4 winners also qualifying.  The group with 5 teams will also play friendlies home and away against hosts France.</p>\r\n<p>For the draw, the teams will be put into 6 pots, 5 of 9 and 1 of 8.</p>\r\n<p>\r\n<table width=\'100%\'>\r\n<tr>\r\n<td>\r\n<u>Pot 1</u><br />\r\nSpain<br />\r\nGermany<br />\r\nNetherlands<br />\r\nItaly<br />\r\nEngland<br />\r\nPortugal<br />\r\nGreece<br />\r\nRussia<br />\r\nBosnia\r\n</td/>\r\n<td>\r\n<u>Pot 2</u><br />\r\nUkraine<br />\r\nCroatia<br />\r\nSweden<br />\r\nDenmark<br />\r\nSwitzerland<br />\r\nBelgium<br />\r\nCzech Republic<br />\r\nHungary<br />\r\nRepublic of Ireland \r\n</td>\r\n<td>\r\n<u>Pot 3</u><br />\r\nSerbia<br />\r\nTurkey<br />\r\nSlovenia<br />\r\nIsrael<br />\r\nNorway<br />\r\nSlovakia<br />\r\nRomania<br />\r\nAustria<br />\r\nPoland\r\n</td>\r\n<td>\r\n<u>Pot 4</u><br />\r\nMontenegro<br />\r\nArmenia<br />\r\nSCOTLAND<br />\r\nFinland<br />\r\nLatvia<br />\r\nWales<br />\r\nBulgaria<br />\r\nEstonia<br />\r\nBelarus\r\n</td>\r\n<td>\r\n<u>Pot 5</u><br />\r\nIceland<br />\r\nNorthern Ireland<br />\r\nAlbania<br />\r\nLithuania<br />\r\nMoldova<br />\r\nMacedonia<br />\r\nAzerbaijan<br />\r\nGeorgia<br />\r\nCyprus \r\n</td>\r\n</tr>\r\n<tr><td colspan=\'5\'>&nbsp;</td></tr>\r\n<tr>\r\n<td><u>Pot 6</u><br />\r\nLuxembourg<br />\r\nKazakhstan<br />\r\nLiechtenstein<br />\r\nFaroe Islands<br />\r\nMalta<br />\r\nAndorra<br />\r\nSan Marino<br />\r\nGibraltar\r\n</td/>\r\n<td colspan=\'4\'></td></tr>\r\n</table></p>', 'Qualification-Draw-For-Euro-2016', null, null, '2017-10-04 00:00:00');
INSERT INTO `articles` VALUES ('5', 'Battle for World Cup Play-Offs', 'Battle for World Cup Play-Offs', '<p>The current standings for the second placed teams for the World Cup play-offs are as follows: </p>\r\n<table>\r\n<tr><td width=\"40\">Group</td><td>Team</td><td width=\"40\">P</td><td width=\"40\">GD</td><td width=\"40\">F</td><td width=\"40\">Pts</td></tr>\r\n<tr><td>B</td><td>Portugal</td><td>6</td><td>+18</td><td>21</td><td>15</td></tr>\r\n<tr><td>G</td><td>Italy</td><td>7</td><td>+3</td><td>11</td><td>14</td></tr>\r\n<tr><td>E</td><td>Denmark</td><td>7</td><td>+7</td><td>12</td><td>13</td></tr>\r\n<tr><td>C</td><td>Northern Ireland</td><td>7</td><td>+5</td><td>10</td><td>13</td></tr>\r\n<tr><td>D</td><td>Wales</td><td>7</td><td>+2</td><td>7</td><td>11</td></tr>\r\n<tr><td>I</td><td>Croatia</td><td>7</td><td>+2</td><td>6</td><td>11</td></tr>\r\n<tr><td>F</td><td>SCOTLAND</td><td>7</td><td>-1</td><td>8</td><td>11</td></tr>\r\n<tr><td>A</td><td>Sweden</td><td>6</td><td>+3</td><td>10</td><td>10</td></tr>\r\n<tr><td>H</td><td>Bosnia</td><td>6</td><td>+2</td><td>10</td><td>8</td></tr>\r\n</table>\r\n<p>The results against the bottom placed teams are not taken into account.  If Scotland beat Slovenia, they have a decent chance of finishing above Wales if they fail to beat Ireland, Croatia if they fail to beat Ukraine, and most likely Bosnia if they fail to beat Belgium.</p>', 'Battle-For-World-Cup-Play-Offs', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '2017-10-04 00:00:00');
INSERT INTO `articles` VALUES ('6', 'UEFA Nations League 2019 Draw', 'UEFA Nations League 2019 Draw', '<p>The draw for the first UEFA Nations League will take place on 24th Jaunary 2018 at Lausanne, Switzerland. The 4 leagues will be made up of the following teams:</p><p>League A:<br />Germany, Portugal, Belgium, Spain, France, England, Switzerland, Italy, Poland, Iceland, Croatia, Holland</p><p>League B:<br />Austria, Wales, Russia, Slovakia, Sweden, Ukraine, Republic of Ireland, Bosnia Herzegovina, Northern Ireland, Denmark, Czech Republic, Turkey</p><p>League C:<br />Hungary, Romania, SCOTLAND, Slovenia, Greece, Serbia, Albania, Norway, Montenegro, Israel, Bulgaria, Finland, Cyprus, Estonia, Lithuania</p><p>League D:<br />Azerbaijan, Macedonia, Belarus, Georgia, Armenia, Latvia, Faroe Islands, Luxembourg, Kazakhstan, Moldova, Liechtenstein, Malta, Andorra, Kosovo, San Marino, Gibraltar</p><p>Within each league, 4 groups containing three or four teams will be drawn. These teams will play each other home and away in a group, with the top team being promoted to the league above, and the bottom team being relegated to the league below.</p>', 'nations-league-2019-draw', '2017-10-11 00:00:00', '0000-00-00 00:00:00', null);
