INSERT INTO `competitiontype` VALUES ('1', 'FIFA World Cup', '1', 'The first World Cup took place in 1930, but it was not until 1950 that Scotland took part. It consisted of a qualifying tournament followed by the finals held in a neutral country every four years.', 'World football\'s premier tournament, that every footballing country takes part in.', 'Finals First Round 1974', 'C', 'world-cup', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:74.915825% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/56656966?et=Ocw-ZvtSQNV144q-YZSTGg&viewMoreLink=off&sig=ccpTdMq8KEPf_YO6tzo3Ix4v4VLMcte2isDbn7WiQZI=\" width=\"594\" height=\"445\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/56656966\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>\r\n<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:63.299663% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/79046666?et=frMWTxt8Qi5Blv7DSSuB3Q&viewMoreLink=off&sig=Rtdayam3JnnU9QWkzWjnC5KUZZpq27c7X3fQrw1ucXk=\" width=\"594\" height=\"376\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/79046666\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', '<div class=\"getty localGetty\"><img src=\"/storage/getty/56656966.jpg\" /></div>\r\n<div class=\"getty localGetty\"><img src=\"/storage/getty/79046666.jpg\" /></div>', null, null, null);
INSERT INTO `competitiontype` VALUES ('2', 'UEFA European Championships', '2', 'The European Nations Cup was started in 1959-60, but it was not until the 1968 event that Scotland took part and the name of the tournament was changed to the European Championships. Then it consisted of eight groups and the winners played in the quarter finals. The semi-finals were then played at a later date in one of the four remaining countries. The format was changed for the 1980 event, where there was a qualifying event before the finals, similar to the World Cup.', 'Europe\'s international continental championship, second only to the World Cup in World football.', 'Finals First Round 1996', 'C', 'european-championships', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:65.488215% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/2730826?et=pfu9bj2IQN5idB7unzw8Mw&viewMoreLink=off&sig=15UJX7jJDX17CR8VYgQS9zYyD9hJB9zXeVaXECvg3uM=\" width=\"594\" height=\"389\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/2730826\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>\r\n<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-widt