INSERT INTO `competitiontype` VALUES ('3', 'British Championships', '4', 'The British Championships, also known as the Home International Championships, was a tournament held annually between the four home nations. The matches were alternated between home and away each year, for example if Scotland played England at Hampden one year, the following year they would play at Wembley. The tournament started in 1883/84 and ended in 1983/84 due to falling crowds, as this tournament was not as important as the World Cup or the European Championships. One match which did not have falling crowds was the Scotland - England match, and for this reason the Rous Cup was created.', 'The World\'s oldest International football tournament, contested by all of the home nations from 1884 - 1984.', null, 'F', 'british-championships', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:56.397306% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/88615093?et=GBGovnDQTydUji8zEDxJ_w&viewMoreLink=off&sig=MuDAuX6xfaByHIRSlGQzNUxiHTCG0DtF2x29BuMQeIM=\" width=\"594\" height=\"335\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/88615093\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>\r\n<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:66.161616% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/80748694?et=mY-UDYXoScJNw0ZybOGVPA&viewMoreLink=off&sig=Mcz9AHqql9e5AAcP_NDqX2m0HuqmKg723q5A5WJ6B_Y=\" width=\"594\" height=\"393\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/80748694\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', '<div class=\"getty localGetty\"><img src=\"/storage/getty/88615093.jpg\" /></div>\r\n<div class=\"getty localGetty\"><img src=\"/storage/getty/80748694.jpg\" /></div>', null, null, null);
INSERT INTO `competitiontype` VALUES ('4', 'Rous Cup', '5', 'After the British Championships was ended in 1984, the Rous Cup was created to continue the annual Scotland - England match. The trophy was named after Sir Stanley Rous a former FA secretary and President of FIFA. The first two years (1985 & 1986) the tournament was just a one off game between Scotland & England, with Scotland winning in 1985 , and England winning in 1986 . From 1987-89, it was turned into a three team tournament, with a South American country invited to play.', 'A tournament created to continue the Scotland - England match until 1989.', null, 'F', 'rous-cup', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:60.269360% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/91272247?et=2dZuuwuVTf9sGMoF4dNiuA&viewMoreLink=off&sig=lAw1qGOQidM8u1Y5eODaWZMjX8cWcY3LCyjxufxlHHc=\" width=\"594\" height=\"358\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/91272247\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>\r\n<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"overflow:hidden;position:relative;height:0;pa