INSERT INTO `competitiontype` VALUES ('5', 'Kirin Cup', '6', 'The Kirin Cup is an annual tournament played in Japan, which consists of Japan and two other countries. It is named after the Kirin Organisation who organize the tournament.', 'An annual friendly tournament that Japan plays, along with two other guest countries.', null, 'F', 'kirin-cup', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:66.666667% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/57603525?et=HII3lmn9T6JkQAyK_W6DrA&viewMoreLink=off&sig=TYKfq7llKLCkqBaKzoh9Z8L2v54DNN00IZD2E2I2UNU=\" width=\"594\" height=\"396\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/57603525\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>\r\n<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:88.215488% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/57582698?et=IPOM22y2Tn9_RmIgTrHWlA&viewMoreLink=off&sig=jlraWqifG0ZTRgipR-FYSISBRCfjQp5UgDVLEPFrDXc=\" width=\"594\" height=\"524\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute