INSERT INTO `competitiontype` VALUES ('6', 'Brazilian Independence Cup', '8', 'The Brazilian Independence Cup was a tournament held in Brazil to commemorate the 150th anniversary of Brazil\'s Independence from Portugal. It consisted of 18 countries (and two continental teams), who took part in two group rounds before the winners of each group played in the final. Scotland started in the final round.', 'A friendly tournament to commemorate Brazil\'s 150th anniversary of gaining independence from Portugal.', null, 'F', 'brazilian-independence-cup', null, null, null, null, null);
INSERT INTO `competitiontype` VALUES ('7', 'Hong Kong Reunification Cup', '9', 'The Hong Kong Reunification Cup was a tournament held in Hong Kong to commemorate the 5th anniversary of Hong Kong\'s return to Chinese rule.', 'A friendly tournament to mark the fifth anniversary of Hong Kong\'s return to Chinese rule.', null, 'F', 'hong-kong-reunification-cup', null, null, null, null, null);
INSERT INTO `competitiontype` VALUES ('8', 'Friendly', '11', null, null, null, 'F', 'friendly', null, null, null, null, null);
INSERT INTO `competitiontype` VALUES ('9', 'Nations Cup', '7', 'The Nations Cup was created to re-introduce the Home Championships along with Republic of Ireland.  England though, refused to take part in the tournament as they would prefer to play friendlies against bigger opposition.  The competition was only played once, with the Republic of Ireland being the winners.', 'A tournament that was created to re-introduce the home internationals, with England refusing to take part.', null, 'F', 'nations-cup', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:64.309764% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/108940601?et=7zI3mp7_R2hTYG7R05rdIg&viewMoreLink=off&sig=bXQDJ_1n9JsARhesnXtlnKQSECxM5rMeOSYvLx6lj_4=\" width=\"594\" height=\"382\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/108940601\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>\r\n<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:63.468013% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/108940722?et=luvcPijyTH9YeeIpRKXgOQ&viewMoreLink=of