INSERT INTO `competitiontype` VALUES ('10', 'Qatar Airways Cup', '10', 'The Qatar Airways Cup was set up as an annual event between Scotland and Qatar.  After Scotland won the first tournament, it cut ties with Qatar as reports came out about their human rights.', 'A friendly tournament set up between Scotland and Qatar', null, 'F', 'qatar-airways-cup', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:68.518519% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/476024476?et=W84-nb4FRexQZjoCNivfGw&viewMoreLink=off&sig=xwm2olphWrHQllHmsMjj18L3J4_Zpad1B82VwwD-t40=\" width=\"594\" height=\"407\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/476024476\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>\r\n<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:66.498316% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/476024526?et=4MsNKRBuSdpCWe89EdEE9w&viewMoreLink=off&sig=_bcEXiDkeJuST07nn5HSGt4RHKDauvF9fn_werFwQwU=\" width=\"594\" height=\"395\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position: