INSERT INTO `competitiontype` VALUES ('11', 'UEFA Nations League', '3', 'The UEFA Nations League is a third competitive competition created to reduce the number of meaningless friendly matches.  It is a European league system with promotion and relegation that contributes towards qualification for the European Championship finals.', 'A European league system with promotion and relegation that contributes towards qualification for the European Championship finals.', null, 'C', 'nations-league', null, null, null, null, null);
