INSERT INTO `history` VALUES ('1', 'Post-War Years', '(1946-1959)', '1946', 'The years following the Second World War which included the withdrawl from the 1950 World Cup Finals, Scotland playing in their first World Cup Finals, and The Munich Air Disaster that included the then Scotland Manager Matt Busby.', 'post-war-years', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/56612554\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:71.548822% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/56612554?et=meT8WejzRTJTKinxmcfOQA&viewMoreLink=off&sig=4528NgjGjzW6exg-hGQntJTLWiZfElHfi6T1ZuoXN_o=\" width=\"594\" height=\"425\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', '202,209,252,254,262', null, null, null);
INSERT INTO `history` VALUES ('2', 'The 1960s', null, '1960', 'The decade during which Scotland failed to quallfy for any World Cup Finals. They were successful against England though as they defeated the Auld Enemy four times, including 1967 when they were World Champions.', '1960s', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/80748694\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:66.161616% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/80748694?et=26AdQ0T9RJ1qtR1d7I6opA&viewMoreLink=off&sig=fM7CqOmo09wKRnC1CK7WJFINwj95J7dUoHiHS3CRdz4=\" width=\"594\" height=\"393\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', '288,292,296,311,320', null, null, null);
INSERT INTO `history` VALUES ('3', 'The 1970s', null, '1970', 'The decade during which Scotland gained many fans after the 1974 World Cup Finals, and suffered heartbreak in Argentina \'78. There were also some famous victories over England.', '1970s', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/518690345\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:66.161616% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/518690345?et=XD2AAoGqQ2NnHsSt7DKDrA&viewMoreLink=off&sig=oZOxxlr0k0dPArWJmJ-I5VHlDQ1DDicjcmEDkIcP4Dk=\" width=\"594\" height=\"393\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', '366,375,393,400,413', null, null, null);
INSERT INTO `history` VALUES ('4', 'The Early 1980s', null, '1980', 'A period during which Scotland qualified for the 1982 and 1986 World Cup Finals. Tragedy also occured, with he death of Jock Stein.', 'the-early-1980s', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/79033354\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:68.181818% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/79033354?et=ymTpQVU0QgxJynh9F3nCeA&viewMoreLink=off&sig=Q7Zncgq2tStmSXx6Rc4VZVtBMDJGRaPx94gnSTJ5xXw=\" width=\"594\" height=\"405\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', '439,448,470,473,484', null, null, null);
INSERT INTO `history` VALUES ('5', 'The Andy Roxburgh Years', '(1986-1993)', '1986', 'An era during which Scotland qualified for the 1990 World Cup Finals, and also qualified for the European Championship finals for the first time in 1992.', 'the-andy-roxburgh-years', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/79034687\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:66.498316% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/79034687?et=eN_n6fR0TYl57NX5mmjxiA&viewMoreLink=off&sig=10oDJLCyMfrVGOt22YtBcObktqLMNdhe6BD2BgPs3YM=\" width=\"594\" height=\"395\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', '506,512,513,519,537', null, null, null);
INSERT INTO `history` VALUES ('6', 'The Craig Brown Years', '(1993-2001)', '1993', 'The era of arguably the greatest ever Scotland manager, who took Scotland to the Euro \'96 Finals, followed by France \'98. He was not as successful in the following two tournaments, but he did defeat England at Wembley in a Euro 2000 Play-Off.', 'the-craig-brown-years', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1268648\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:66.329966% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1268648?et=r-nBcosSRiJ1csqC9UpqjA&viewMoreLink=off&sig=lfEiJoWGmo4wE81obtv5IdnclPuAbVylyDhBOaCpKz0=\" width=\"594\" height=\"394\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', '561,571,577,589,604', null, null, null);
INSERT INTO `history` VALUES ('7', 'The Berti Vogts Years', '(2002-2004)', '2002', 'A dark time for Scotland when they dropped to 86 in the World Rankings under a foreign manager. The only high point in this era was a 1-0 victory over Holland in the Play-Offs.', 'the-berti-vogts-years', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/2730826\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:65.488215% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/2730826?et=IfkBvJQ8RvZX_H6FcJO-hg&viewMoreLink=off&sig=H0Kl86pnPzLRpkpby9gOFzHYsJjk68xqGF9eifo5n0Y=\" width=\"594\" height=\"389\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', '633,637,638', null, null, null);
INSERT INTO `history` VALUES ('8', 'The Smith & McLeish Years', '(2005-2007)', '2005', 'A renaissance period which saw Scotland recover from the brink of death to rise as high as 13th in the world. This included the Euro 2008 campaign in which Scotland defeated France home and away, and came so close to qualification.', 'the-smith-and-mcleish-years', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/76706989\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:77.777778% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/76706989?et=lj1eYv9YSW5EPbEdkifSFg&viewMoreLink=off&sig=pohFj2wcmAzwjGSGNKRZyknbndQtQWc2gE86AF3mI-c=\" width=\"594\" height=\"462\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', '656,663,665,673,674', null, null, null);
INSERT INTO `history` VALUES ('9', 'The Burley & Levein Years', '(2008-2012)', '2008', 'A period full of controversy, from managerial appointments to players quitting, to players receiving lifetime bans.  To make things worse, the results were poor on the pitch as Scotland failed to qualify for the World Cup 2010 and Euro 2012 Finals.', 'the-burley-and-levein-years', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/105216954\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:66.666667% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/105216954?et=Msl9WnHZQflVu5WwTjOEew&viewMoreLink=off&sig=sdh0KkgztL_mmsSLEhaw9lFssOytiQ9kbHG7dIm_4xY=\" width=\"594\" height=\"396\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', '696,698,700,703', null, null, null);
INSERT INTO `history` VALUES ('10', 'The Gordon Strachan Years', '(2013-2017)', '2013', 'A period where Scotland rose from 78th in the world to as high as 22nd in April 2014.  This also contained Euro 2016 qualification, where Scotland came close to qualification in the \"Group of Death\", and World Cup 2018 qualification where Scotland were 1 goal away from the play-offs.', 'the-gordon-strachan-years', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/176512576\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:66.666667% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/176512576?et=mlmtoff8Tg1POtIKwEUSyA&viewMoreLink=off&sig=zM8IkwLUc3drFe1wbeRB-z2fwAoHisJ_b5QMNN1pCTU=\" width=\"594\" height=\"396\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', '715,718,730,735,746', null, null, null);
INSERT INTO `historypages` VALUES ('1', '1', '1', 'World Cup 1950', 'world-cup-1950', '<p>In 1946 after WWII, Scotland and the other British teams rejoined FIFA and wished to take part in the 1950 World Cup.  What they did not want to do was take part in a qualifying tournament.  For this reason FIFA let the 1950 British Championships double as a qualifying tournament with the top two teams qualifying.  Scotland though said that they would only take part in the finals if they qualified as British Champions.  Wales and Ireland went down a similar path.  In the previous year\'s British Championships, Scotland defeated all of their opponents, therefore Scotland were confident going into the 1950 tournament.  It began with an 8-2 win away to Ireland, which was Scotland\'s biggest victory in 48 years.  A home win over Wales followed, before the Championship decider at Hampden with England.  England won 1-0 and therefore won the tournament and as a result Scotland would not play in the World Cup finals.  A month after the England match Scotland travelled to Paris for a friendly, and came back with an impressive 1-0 win.  The following year Scotland won the British Championships with a 3-1 win over Wales, 6-1 over Ireland and a 3-2 win at Wembley.  This meant that Scotland were the champions in 1949 and 1951, but the year that mattered was 1950.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/2694563\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:78.282828% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/2694563?et=zQYFXqOmTXVUYg4Bn8QipA&viewMoreLink=off&sig=prmMNYhMvW4vFQ726wmCGBpwid2HsizIvYwzekfDOOk=\" width=\"594\" height=\"465\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'George Young is helped from the pitch after Scotland defeat England 3-1 at Wembley in 1949.', null, null, null);
INSERT INTO `historypages` VALUES ('2', '1', '2', 'World Cup 1954', 'world-cup-1954', '<p>By the time the next World Cup had come around, the qualifying competition was the same, and this time Scotland had agreed to take part even if they were runners-up.  The first match was a 3-1 win in Belfast, followed by a 3-3 draw with Wales.  On 1st February 1954, the SFA appointed the first ever Scotland manager Andy Beattie, who was the current boss at Huddersfield Town.  His official title was \"Official In Charge\", as it was still a committee that selected the team.  Beattie\'s task was to handle training and brief the players.  The first match under Beattie was the decider against England, which was lost 4-2 at Hampden, but this time second place was enough for Scotland.  In the finals, the 16 finalists were drawn into four groups of four, with two seeds and two unseeded teams.  Both seeds would not play each other, and likewise for the unseeded teams.  This meant that there were only two matches, against the two seeds who were holders Uruguay and Austria, which meant that qualification to the next round would be a hard task for Scotland.  In the opening match Scotland suffered a narrow 1-0 defeat to Austria.  The day before the match with Uruguay, Andy Beattie announced that he was quitting after the finals.  It was thought that his lack of control over team selection was a major factor in his decision. In the next game Scotland were well and truly taught a lesson by the World Champions as Uruguay won 7-0 to give Scotland their heaviest ever defeat, and end Scotland\'s World Cup run.  In the following British Championships things did not get better as Scotland lost 7-2 at Wembley.  In the same tournament, Ireland now played under the name Northern Ireland, as FIFA had forbid both north and south playing under the same name of Ireland.  South was now Republic of Ireland.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/3423383\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:78.114478% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/3423383?et=wGgSqvCaTPRG4Yu8J2Iypw&viewMoreLink=off&sig=QycCsW1jp-yLwZEPcIHAFzlsvUPp053u85_FXVcL9Dk=\" width=\"594\" height=\"464\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Uruguay come close to scoring against Scotland in the infamous 7-0 defeat in the 1954 World Cup Finals.', null, null, null);
INSERT INTO `historypages` VALUES ('3', '1', '3', 'World Cup 1958 Qualifiers', 'world-cup-1958-qualifiers', '<p>For the 1958 World Cup, FIFA had decided that Britain should not be guaranteed any places in the finals.  For this reason the British Championships was not the qualification campaign for this tournament.  Scotland were drawn in a group with Spain and Switzerland, with only one qualifying for the finals.  After Andy Beattie had resigned, the SFA had not appointed a new manager; therefore it would be a selection committee that ran the Scotland team in this qualification campaign.  The first match was at home to Spain, who were not only favourites to qualify, but favourites to win the World Cup.  A hat-trick from Jackie Mudie helped Scotland to a 4-2 victory.  Eleven days later, Scotland visited Switzerland and Mudie and Collins gave Scotland a 2-1 win.  Scotland travelled to Spain a week later where they were convincingly beaten 4-1.  Going into the last match Scotland were a point ahead of Spain, meaning that a win would take Scotland to the finals.  A draw would probably leave Scotland needing a play-off with Spain on a neutral venue.  A close match ended 3-2 for Scotland, and therefore Scotland had qualified for their second World Cup finals.  England, Wales, and Northern Ireland also qualified, which meant that this new qualification format had helped the Home Nations.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/79657011\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:67.171717% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/79657011?et=ve9NNlbGRrl2364AYkHRpw&viewMoreLink=off&sig=oKPaftp3i4CknajrDleZTpW1MaJo1ZvyeXe31zcKT9E=\" width=\"594\" height=\"399\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Tommy Ring has a shot at goal in the 3-1 friendly victory over West Germany in Stuttgart.', null, null, null);
INSERT INTO `historypages` VALUES ('4', '1', '4', 'Matt Busby &amp; World Cup 1958 Finals', 'matt-busby-and-world-cup-1958-finals', '<p>On 15th January 1958 the SFA appointed Matt Busby, the current Manchester Utd manager, as the Scotland manager.  On 5th February, after a European Cup quarter-final away to Red Star Belgrade, the Manchester Utd team made a stopover at Munich.  When the plane attempted to take off it crashed.  21 people were immediately killed and Scotland manager Matt Busby was severely injured before he fell into a coma.  Scotland\'s trainer Dawson Walker took charge while Busby recuperated.  Scotland were drawn with Yugoslavia, Paraguay, and France.  In the opening game, Scotland scored their first World Cup final goal through Jimmy Murray, which in turn gained Scotland their first World Cup point in a 1-1 draw.  Three days later, goals from Mudie and Collins were not enough to defeat Paraguay, who won 3-2.  In the final game Scotland needed a victory over France to have a chance of making the next round.  France took a 2-0 lead at half time.  Sammy Baird pulled one back in the second half, but it was not enough for Scotland, and another World Cup campaign had ended early for Scotland.  For the start of the 1959 British Championships, Matt Busby was fit to finally manage the Scots.  A 3-0 win over Wales and a 2-2 draw with Northern Ireland were the only matches he had in charge, as he resigned in December 1958 to concentrate on Manchester Utd.  In March 1959, Andy Beattie took charge for the second time.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/56612554\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:71.548822% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/56612554?et=FPTtclEiTlpRSA7QcR-JPw&viewMoreLink=off&sig=AD8C6MxLoIhEBZvByda2fNvpJUAcNG81IMF90D0ldvs=\" width=\"594\" height=\"425\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'The Scotland team ready to face Yugoslavia in Scotland\'s opening game in the 1958 World Cup Finals.', null, null, null);
INSERT INTO `historypages` VALUES ('5', '2', '1', 'World Cup 1962 Qualifiers', 'world-cup-1962-qualifiers', '<p>The 1960s did not start well for Scotland.  In their first eight matches Scotland only won once, and lost five.  This bad run of matches included a 9-3 defeat at Wembley.  That defeat was the first match in charge for Scotland\'s new manager Ian McColl.  Andy Beattie had decided that managing both Scotland and Nottingham Forest was too much, and resigned for a second time.  The qualifying campaign for the 1962 World Cup finals began with a 4-1 victory over the Republic of Ireland at Hampden, which was Scotland\'s first meeting with an independent Irish Republic.  Four days later Scotland won the return game 3-0 in Dublin.  A week later Scotland travelled to Prague where they were defeated 4-0 by Czechoslovakia.  When the Czechs came to Hampden, Scotland won 3-2 to finish the group joint top with the Czechs.  With there being only one qualifier from the group, there would be a one legged play-off against Czechoslovakia in Brussels.  At this time goal difference was not used to separate teams, unless they were tied after extra-time in the play-off.  With Czechoslovakia having a superior goal difference, they only needed to draw, whereas Scotland needed to win.  A double from St John gave Scotland a 2-1 lead with less than 20 minutes remaining, but with eight minutes left the Czechs equalised to take the match into extra-time.  Two goals by the Czechs in the first half of extra time sealed a 4-2 win and meant that they and not Scotland would be playing in Chile.  Before and after the play-off there was the 1962 British Championships.  A 6-1 win in Belfast was followed by a 2-0 victory over Wales at Hampden.  In the final match, which was one day short of a year on from the 9-3 defeat, Scotland won 2-0 over England at Hampden to win the 1962 British Championships.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/52696280\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:72.390572% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/52696280?et=Uyjtf63YT2d4Hmra-0MPxQ&viewMoreLink=off&sig=KBm50QTr_OZ25IxJArRSDU6wgBGXe_wAla7e0EJE0dg=\" width=\"594\" height=\"430\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Captains Eric Caldow and Norman Haynes lead Scotland and England out at Wembley before the 9-3 defeat in 1961. ', null, null, null);
INSERT INTO `historypages` VALUES ('6', '2', '2', '1963 &amp; 1964 British Championships', '1963-and-1964-british-championships', '<p>It would be two years before the qualifying campaign for the 1966 World Cup would begin; therefore Scotland had two years of friendly matches.  In the 1963 British Championships, a 3-2 win over Wales was followed by a 5-1 win over Northern Ireland in which Law scored four times.  In the deciding match at Wembley a double from Jim Baxter gave Scotland a 2-1 win, their first at Wembley in 12 years.  Some impressive friendly results followed, a 4-1 home win over Austria, a 6-2 win away to Spain, and a 6-1 home win over Norway.  The following British Championship was shared between Scotland, England, and Northern Ireland.  In the final game at Hampden an Alan Gilzean goal was enough to defeat England 1-0.  Since the 9-3 defeat, Scotland had won all three matches against the Auld Enemy.  Dennis Law was to score 16 goals in this two-year period, including four in the win over Norway, four against Northern Ireland, and a hat-trick in a 4-3 defeat away to Norway.  This took his tally to 21 goals, two short of Hughie Gallacher\'s record.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/564686177\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:80.134680% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/564686177?et=EppsDgT5Rttg8X2RfEdoxQ&viewMoreLink=off&sig=h-oDqhW7qK_kHWhsIkyas1H4XccbMB_0nMSLqlwQfc8=\" width=\"594\" height=\"476\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'The Scotland team do a lap of honour at Hampden Park after defeating England 1-0 in 1964.', null, null, null);
INSERT INTO `historypages` VALUES ('7', '2', '3', 'World Cup 1966 Qualifiers', 'world-cup-1966-qualifiers', '<p>In the autumn of 1964, the qualifiers for the 1966 World Cup, which was to be held in England, began.  The first match was a 3-1 win over Finland at Hampden.  The following April, Scotland drew 2-2 at Wembley, and Dennis Law equalled Hughie Gallacher\'s record of 23 goals.  During the preparations for the next qualifier away to Poland, manager Ian McColl was sacked, and Celtics new manager Jock Stein took charge for the remainder of the World Cup.  In his first game in charge Scotland gained a 1-1 draw away in Poland, where Law scored a late equaliser to break Hughie Gallacher\'s record and become Scotland\'s all time leading goalscorer with 24 goals.  Four days later Scotland defeated Finland 2-1 in Helsinki.  In the autumn of 1965, Poland visited Hampden and left with a 2-1 victory due to two late goals.  Because of that defeat Scotland needed to win both games against Italy to qualify, three points would see a play-off similar to four years earlier.  Italy spent most of the match frustrating the Scots, until with two minutes left on the clock, Baxter played a perfect pass through the Italian defence for Greig to score the winner and give Scotland a famous victory.  A month later Scotland travelled to Naples, and injuries and clubs refusing to release players meant that Scotland only had 14 players to play with.  The Italians ran out 3-0 winners and Scotland\'s hopes of playing in England the following summer ended.\r\n\r\nIn March 1966, John Prentice was appointed as Scotland\'s new manager. His first three matches in charge were all defeats, and his fourth was a 1-1 draw with current World Champions Brazil, where Pele made an appearance at Hampden. His reign in charge was to only last six months. Reports are that the SFA discovered that he travelled to Canada for a job interview at the same time he was negotiating terms with them.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:586px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/79033833\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:101.365188% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/79033833?et=jh9VFflqTIJIddNwzbZBEw&viewMoreLink=off&sig=zl8qrsYcTBL4U51_MzLRB4WcNiD5O4KTtOab4JQOIDc=\" width=\"586\" height=\"594\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Captains John Greig and Bellini shake hands before the 1-1 draw between Scotland and Brazil at Hampden Park.', null, null, null);
INSERT INTO `historypages` VALUES ('8', '2', '5', 'England 2-3 Scotland &amp; Euro \'68', 'england-2-3-scotland-and-euro-68', '<p>Malky MacDonald took over as Scotland manager in October 1966, and his first matches in charge were the European Championships, that Scotland was taking part in for the first time.  The group stages for the European Championships were to double as the 1967 and the 1968 British Championships.  A 1-1 draw with Wales was followed by a 2-1 win over Northern Ireland.  For the next game against England, Scotland had another new manager, former Scotland keeper Bobby Brown was appointed as Scotland\'s first full-time manager.  In the visit to Wembley, England were playing all but one of the players who won the World Cup a year earlier.  On 27 minutes a Law shot was blocked by Banks but the rebound was not and Scotland were 1-0 up. 12 minutes from time McCalliog passed to Lennox in the penalty area to hit a low shot past Banks and double Scotland\'s lead.  Next came a famous moment in Scottish football, when Jim Baxter collected the ball out on the left, before he started playing keepy-uppy with the ball and showboating.  Six minutes from time Jack Charlton pulled one back, but three minutes later Lennox and McCalliog played the one-two before McCalliog beat Banks.  A minute later Hurst pulled another one back, but it was too late and Scotland won 3-2 to be crowned British Champions and unofficial World Champions, in what some might say is their greatest ever result.  A 1-0 defeat in Belfast did not help Scotland\'s chances of qualifying.  A month later Wales were defeated 3-2 at Hampden.  Going into the final match at home to England, Scotland needed a win to qualify.  A record attendance for a European Championship match of 134,000 saw a 1-1 draw, which was not enough for Scotland to qualify.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/80748694\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:66.161616% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/80748694?et=3CeTwxJtTzxcPSh1dywCTQ&viewMoreLink=off&sig=28v7xp85kuOWeXJXP0re_ADOL5QyHJUZzFyCF-Lhj7Q=\" width=\"594\" height=\"393\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Denis Law scores Scotland\'s second goal in their famous 3-2 win at Wembley in 1967.', null, null, null);
INSERT INTO `historypages` VALUES ('9', '2', '6', 'World Cup 1970 Qualifiers', 'world-cup-1970-qualifiers', '<p>Scotland\'s first qualifier for the 1970 World Cup Finals was a 2-1 home win over Austria.  This was the first World Cup match during which substitutes were allowed.  The next qualifier was away to Cyprus, who was a minute away from holding the Germans to a draw.  Scotland were therefore weary of this trip into the unknown.  These fears were laid to rest after 3 minutes when Gilzean put Scotland ahead.  Cyprus gave Scotland no problems and Scotland came away with a 5-0 victory, with both Gilzean and Stein bagging a double each.  The West Germans then visited Hampden with an outstanding record as they had never lost a World Cup qualifier, but they had never beaten Scotland.  Gerd Muller put the Germans ahead just before half time, but Bobby Murdoch equalised with two minutes remaining to earn a 1-1 draw.  A month later Cyprus visited Hampden, and Scotland equalled their World Cup record and won 8-0, with Colin Stein scoring four.  Going into the away tie with West Germany, Scotland needed a win to keep their hopes of topping the group alive, a draw would mean that Scotland would need a play-off to qualify at best.  A defeat would end Scotland\'s qualification hopes.  Scotland could not have asked for a better start as Jimmy Johnstone put Scotland ahead after three minutes, when an Eddie Gray shot was spilled by the keeper into Johnstone\'s path.  The Germans equalised seven minutes before the break, and on the hour mark Muller put them 2-1 ahead.  Four minutes later Gilzean headed in the equaliser, which looked like it would be enough for a draw, until Libuda put the Germans 3-2 ahead with nine mines remaining.  Just to rub salt into the wound, Tommy Gemmell was sent off for lashing out at Haller and kicking him, it marked the end of Scotland\'s qualification hopes.  In the final game Scotland were defeated 2-0 in Vienna.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/501566065\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:67.676768% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/501566065?et=qLsGl8xFTglgTH7VVF6WnQ&viewMoreLink=off&sig=eEbJFYjQZfDvCU6RPbzaulq8buuFMLLdyOonNo_R9FI=\" width=\"594\" height=\"402\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Jim Herriot makes a save during the 1969 Home International at Wembley.', null, null, null);
INSERT INTO `historypages` VALUES ('10', '3', '1', 'The Early 1970s', 'the-early-1970s', '<p>The start of the 70s was not a successful period for Scotland and manager Bobby Brown.  Even although they shared the 1970 British Championships with England and Wales, Scotland only won two of their first eleven games of the decade and only scored three goals.  Brown had to cope with many depleted squads due to the club v country battle, but in the summer of \'71 Scotland and Brown parted company.</p>\r\n\r\n<p>On 12th September 1971 Tommy Docherty became Scotland\'s caretaker manager, and was appointed full time manager in November.  Scotland\'s results transformed and Scotland won five of their first six games under Docherty.  Scotland won their final two qualifiers for Euro \'72 under Docherty, but it was too late as Scotland had lost three of their first four games, and therefore they failed to qualify for the latter stages.  The 1972 British Championships was shared with England, before Scotland took part in the Brazilian Independence Cup with games against Yugoslavia, Czechoslovakia, and Brazil.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1631875\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:66.329966% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1631875?et=UtvdxmnORWdw07RnwWXpsg&viewMoreLink=off&sig=2xCb9UyK84HyBYmdydw1YJKtBgmOlKn4ynW0HaHJ5E8=\" width=\"594\" height=\"394\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Billy Bremner waits for a cross in the Home International at Wembley in 1971.', null, null, null);
INSERT INTO `historypages` VALUES ('11', '3', '2', 'World Cup 1974 Qualifiers', 'world-cup-1974-qualifiers', '<p>The qualifiers for the 1974 World Cup Finals began with a 4-1 win over Denmark in Copenhagen, followed by a 2-0 win at Hampden.  In December 1972, Man Utd sacked their manager Frank O\'Farrell, and Tommy Docherty took over at Old Trafford on 22nd December.  On 5th January 1973, a former Scotland teammate of Docherty, Willie Ormond was appointed as Scotlands manager.  Ormond\'s reign did not get off to a good start as it began with a 5-0 defeat to England in the Centenary match.  Things did not get much better as Scotland only won one of their following five matches, and lost the other four.  Ormond was under pressure by the time the next World Cup qualifier came around against Czechoslovakia at Hampden.  A win would mean Scotland qualifying for the World Cup finals for the first time in sixteen years.  Things did not start well as keeper Ally Hunter flapped at a Nehoda shot, which flew past him and into the net to give the Czechs a 1-0 lead.  Seven minutes later a Jim Holton header levelled the tie.  Fifteen minutes from time a Morgan cross was headed in by substitute Joe Jordan who was only winning his fourth cap to send Scotland to the World Cup finals.  The final group match finished 1-0 to Czechoslovakia in Prague.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/79664654\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:73.400673% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/79664654?et=XynIdSccSnFUHat2kj3wrw&viewMoreLink=off&sig=5fZ3_dmgO5QN9vd-SxkWvcWRiXI51NaewRA06q976lI=\" width=\"594\" height=\"436\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Jairzinho controls the ball during a friendly against Brazil at Hampden Park in 1973.', null, null, null);
INSERT INTO `historypages` VALUES ('12', '3', '3', 'World Cup 1974 Finals: Build-up &amp; Zaire', 'world-cup-1974-finals-build-up-and-zaire', '<p>Scotland had an eventful period before the World Cup finals.  Firstly there was the British Championships during which there was an infamous incident at Largs, which ended in Jimmy Johnstone being swept out to sea in a rowing boat and needing to be rescued.   Two days later Scotland defeated England 2-0 at Hampden to share the 1974 British Championships.  On the lap of honour, Johnstone directed a V-sign at the press box in response to the heavy criticism that he had received.  Scotland then travelled to Belgium for a friendly, but created more controversy as Jimmy Johnstone and Billy Bremner both became involved in an incident in a student bar.  Both players were close to being sent home.</p>\r\n\r\n<p>Scotland\'s World Cup began on 14th June against Africa\'s only representatives Zaire.  Twenty-six minutes into the game, McGrain crossed the ball into the box for Jordan to head into the path of Lorimer who scored a great volley from the edge of the penalty area.  Seven minutes later a free-kick was floated in to the box by Bremner, for Jordan who made an early run and headed the ball at the keeper; but he fumbled the ball and gifted Scotland their second goal.  Scotland had chances to build on their lead, but the match finished 2-0 giving Scotland their first victory in the World Cup finals.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/518690345\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:66.161616% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/518690345?et=OJDUzdV1Qzxs40-41Zi_pQ&viewMoreLink=off&sig=_8Tk5X2SNqz6UrdmeVz9Pm6ZzlBYBn8C7uOPOIpSs64=\" width=\"594\" height=\"393\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'The Scotland and Zaire teams lineup before Scotland\'s opening match of the 1974 World Cup Finals.', null, null, null);
INSERT INTO `historypages` VALUES ('13', '3', '4', 'World Cup 1974 Finals: Brazil &amp; Yugoslavia', 'world-cup-1974-finals-brazil-and-yugoslavia', '<p>Four days later Scotland took on the holders Brazil.  For the first half hour Scotland were riding their luck.  In the second half Scotland turned the tables and piled on the pressure.  Firstly a long-range shot from Hay was touched over the bar.  From the resulting corner by Lorimer, Jordans header was saved by Le&atilde;o.  Lorimer then had a powerful free-kick from midway inside the Brazil half also touched over the bar.  Midway through the half Lorimer floated in a corner which was headed by Jordan, the header was spilled by Le&atilde;o onto the feet of Bremner who put it inches past the post.  Scotland had further chances, but the game finished goalless. At the same time the other match had finished Yugoslavia 9 Zaire 0, which meant that Scotland would need to beat Yugoslavia if Brazil were to win 3-0.</p>\r\n\r\n<p>The day before the Yugoslavia match, the team received a letter claiming to be from the IRA.  It stated that two members of the squad would be killed.  This meant that security was stepped up.  The IRA came out and officially said that it was nothing to do with them.  It was hardly good preparation for the match.  In the match chances were scarce, and with nine minutes left Yugoslavia took the lead when Karasi headed in a Dzajic cross.  With 88 minutes on the clock, Hutchison made it to the byline and put in a low cross.  Lorimer miss-hit it and it fell to Jordan, who controlled it and scored a left foot shot at the far post to earn a 1-1 draw.  The Scotland players thought that they had qualified, as the last time that they heard Brazil were 2-0 up.  Unbeknown to the Scotland players, Brazil had scored a third to win 3-0, and therefore Scotland went out on goal difference, becoming the first team to go out unbeaten in the history of the tournament.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/98747768\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:64.646465% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/98747768?et=bnQaOTbHSr1kK2GpXqbuaw&viewMoreLink=off&sig=-fC_pL4PnRbRm4J_3ltGYIVn7cSoBTSMzcIpZBBgnaw=\" width=\"594\" height=\"384\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Joe Jordan scores Scotland\'s 88th minute equaliser against Yugoslavia in the 1-1 draw.', null, null, null);
INSERT INTO `historypages` VALUES ('14', '3', '5', 'Euro \'76 &amp; 1976 British Championships', 'euro-76-and-1976-british-championships', '<p>The European Championships got off to a poor start with a home defeat by Spain, followed by a draw in the return match in Spain.  The 1974/75 season was not a very successful one, and it ended with a 5-1 defeat at Wembley.  The next season was more successful, two draws against Romainia, and two wins against Denmark in Euro \'76 was not enough to qualify for the latter stages.  In the British Championships, home wins against Wales and Northern Ireland was followed by a famous 2-1 win over England at Hampden, with Dalglish nutmegging Clemence for the winner, to win the Championships for Scotland.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/95685502\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:67.340067% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/95685502?et=bLd5l0uUQOJwEB24S5ErjQ&viewMoreLink=off&sig=rgpfpPt0hp6ExpETpbingPD0Xi9OPiG-FL3WiI7J3_4=\" width=\"594\" height=\"400\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Archie Gemmill is chased by Roy McFarland in the 1976 Home International at Hampden Park.', null, null, null);
INSERT INTO `historypages` VALUES ('15', '3', '6', 'World Cup 1978 Qualifiers', 'world-cup-1978-qualifiers', '<p>The qualifiers for the 1978 World cup finals started with a 2-0 defeat away to the current European Champions Czechoslovakia.  That was followed by a 1-0 win at home to Wales.  On 6th May 1977, Willie Ormond resigned as he wished to go back into club management with Hearts.  Jock Stein was the SFA\'s preferred choice, but he did not wish to part with Celtic.  On 18th May Aberdeen manager Ally MacLeod was appointed.  His first task was the 1977 British Championships, which started with a goalless draw away to Wales, followed by a 3-0 win over Northern Ireland at Hampden.  At Wembley Scotland beat England 2-1 to win the British Championship for the second year running.  After the match, the Scotland fans invaded the pitch and demolished the goal, taking pieces of turf home as souvenirs.  Overnight Ally MacLeod became a hero.  A tour of South America followed with a win over Chile, a draw with Argentina, and defeat to Brazil.  The next World Cup qualifier was at home to Czechoslovakia, and a 3-1 win put Scotland within touching distance.  The Wales game was switched to Anfield to accommodate the expected crowd.  The Czechs needed a Welsh win to have a chance of qualifying, while a draw would leave Wales needing a victory in Prague.  A win for Scotland would mean them qualifying for the second consecutive finals.  Eleven minutes from time Scotland were awarded a penalty kick, when the referee adjudged that a Welsh player had handled the ball, but replays showed that it was Jordan.  Masson scored the resulting penalty.  Three minutes from time a great sweeping movement from the Scotland half, ended with Dalglish heading in a Buchan cross to make sure that Scotland would be in Argentina.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/79654117\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:62.794613% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/79654117?et=AjKPtlJKQoZ097rR0o54Jw&viewMoreLink=off&sig=G-BQYvRWK3SMluxbco-YHDj2JzIakCN-R2f8Z3Ws26Y=\" width=\"594\" height=\"373\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'The famous pitch invasion after Scotland defeated England 2-1 at Wembley in 1977.', null, null, null);
INSERT INTO `historypages` VALUES ('16', '3', '7', 'World Cup 1978 Finals: Build-up, Peru &amp; Iran', 'world-cup-1978-finals-peru-and-iran', '<p>On 14th January 1978 the draw for the finals was made in Buenos Aires, grouping Scotland with Holland, Peru and Iran.  It was believed that this would be an easy group for Scotland to qualify from, and the bookmakers gave Scotland odds of 8-1 to win the World Cup.  Before Scotland left for Argentina, they turned up at Hampden for a farewell appearance, where a crowd of 25,000 watched the Scotland squad do a lap of honour in an open-topped bus.</p>\r\n\r\n<p>Scotland travelled to Argentina with Ally MacLeod and the squad full of confidence, and MacLeod was quoted as saying that he believed Scotland would win a medal.  In the first match against Peru, fifteen minutes had gone when a shot by Rioch was parried by the keeper, who was nicknamed El Loco, and Joe Jordan scored the rebound.  Three minutes before half time a neat move by Peru was finished with Cueto slotting the ball past Rough to equalise.  On 62 minutes, Rioch was fouled in the penalty area, and Masson\'s penalty was saved.  Eight minutes later Cubillas scored a great shot from outside the penalty area to put Peru ahead.  Thirteen minutes from time the result was secured, when Cubillas curled a free-kick round the wall and into the top corner of the net, with the outside of his boot, to give Peru a 3-1 victory.</p><p>If Scotland losing to Peru was not bad enough, more controversy was to arise after the match, when Willie Johnston failed a drugs test.  He claimed that he did not know that the substance Fancamfamin was a banned substance, and that it was prescribed for hay fever.  FIFA gave Johnston a one-year ban from international football, and had Scotland not been defeated, FIFA would have awarded Peru the win.  Luckily for Johnston, Scotland had lost the match, because otherwise he could not step foot in Scotland again.  He would never play for Scotland again, as the SFA banned him for life.</p>\r\n\r\n<p>Scotland\'s second match was against Iran, and two minutes before half time Scotland took the lead, when confusion in the Iran penalty area led to Eskandarian scoring an own-goal.  In the second half, Scotland could not add to their lead, and thirteen minutes from time the unthinkable happened.  Poor defending by Scotland in their own penalty area, led to Danaifar scoring from a tight angle to make it 1-1.  At the final whistle, the players were jeered as they walked off the pitch.  For Scotland to progress to the next round, they would have to beat Holland by three goals.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:422px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/80751357\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:140.758294% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/80751357?et=grHq_fK_TjZRi1Ay3FwMpw&viewMoreLink=off&sig=JgSMsl88iAXf2HQ8R9sVMmKbXB33HD2wZ6lG3e0y-XY=\" width=\"422\" height=\"594\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Dalglish swaps shirts with Peru\'s Cubillas after the 3-1 defeat to Peru.', null, null, null);
INSERT INTO `historypages` VALUES ('17', '3', '9', 'World Cup 1978 Finals: Holland', 'world-cup-1978-finals-holland', '<p>For Scotland to progress to the next round, they would have to beat Holland by three goals, and that looked unlikely after 34 minutes as Rensenbrink converted a penalty after Rep was brought down in the box.  Nine minutes later Souness crossed a ball to the back post for Jordan to head into the path of Dalglish, to score a half volley on the turn.  Two minutes into the second half, Souness was fouled in the penalty area, and Gemmill scored the resulting penalty to put Scotland 2-1 ahead.  Midway through the second half, possibly the greatest Scotland goal of all time was scored. Dalglish collected the ball near the right corner flag before Krol tackled him.  The ball fell to Gemmill on the edge of the penalty area, who skipped past Jansen, avoided the tackle from Poortvliet, and nutmegged Krol.  He was through one on one with the keeper Jongbloed, and he lifted the ball over the diving keeper to put Scotland 3-1 ahead and send the Scotland fans into ecstasy.  Scotland now only needed one more goal to qualify.  That joy was short lived as three minutes later Rep collected the ball midway in the Scotland half before he unleashed an outstanding shot from 30 yards that beat Rough to make it 3-2. After that Scotland\'s spirit was dejected, and they couldn\'t score the other goals that they needed.  At the final whistle Scotland walked off with their heads held high after defeating arguably the best team in the world; but for the second World Cup in a row, Scotland went out on goal difference.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/56656966\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:74.915825% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/56656966?et=f9IECTH9TAFDZ_rilc16Ig&viewMoreLink=on&sig=DjAq364ZXUNA4wKgpzsW2I-6KNdDAwvy5WrMcmzJD0U=\" width=\"594\" height=\"445\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Archie Gemmill scoring his famous second goal, and Scotland\'s third, to give Scotland a 3-1 lead.', null, null, null);
INSERT INTO `historypages` VALUES ('18', '3', '10', 'Euro \'80 Qualifiers', 'euro-80-qualifiers', '<p>The result against Holland saved MacLeod\'s job, as had Scotland come home with only one point against Iran, he would have surely been sacked.  MacLeod would therefore lead Scotland into the qualifiers for Euro \'80, which was now a similar format to the World Cup, with a qualification campaign, followed by the Finals.  The first qualifier was a 3-2 defeat away to Austria, and six days later on 26th September 1978, Ally MacLeod quit as Scotland manager.  Jock Stein had quit Celtic in May, and since then had taken a post at Leeds Utd.  On 4th October, Jock Stein was made the Scotland manager for the second time, after only 45 days in charge at Elland Road.  In Stein\'s first game in charge Scotland defeated Norway 3-2 at Hampden, with a Gemmill penalty three minutes from time.  A month later Scotland travelled to Portugal where they suffered their second defeat of the campaign after they lost 1-0.  After a poor British Championships, Argentina visited Hampden for a friendly, and a young 18-year-old called Diego Maradona scored on his debut for Argentina to give them a 3-1 victory.  Scotland\'s next qualifier was away to Norway, and unlike the home tie, Scotland swept them aside, winning 4-0.  Austria were then the visitors to Hampden, and a goal 15 minutes from time by Gemmill rescued a point after Krankl had given the Austrians a first half lead.  A 2-0 defeat away to Belgium followed, before they won 3-1 at Hampden.  In the final match at Hampden Scotland defeated Portugal 4-1, but it was too little too late, as Scotland finished fourth in a group of five and therefore failed to qualify for the finals.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/79649456\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:65.993266% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/79649456?et=-lk0TiC5QWBCPUTmE1DqCg&viewMoreLink=on&sig=8hyhqPFvdG7ChPmES0qD1mp79z4HCLjUKjYwC9bnFXM=\" width=\"594\" height=\"392\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Archie Gemmill scores Scotland\'s third in a 3-2 victory over Norway at Hampden Park, in Jock Stein\'s first match as manager. ', null, null, null);
INSERT INTO `historypages` VALUES ('19', '4', '1', 'World Cup 1982 Qualifiers', 'world-cup-1982-qualifiers', '<p>After failing to qualify for the finals for Euro \'80, and only winning five games in eighteen and losing eleven, pressure was mounting on Jock Stein before he embarked on his first World Cup as full-time manager.  This qualification campaign began with a 1-0 win in Sweden, thanks to a solitary Gordon Strachan goal.  A goalless draw at home to Portugal followed, before a 1-0 win in Israel where Kenny Dalglish scored the winner.  A 1-1 draw with Northern Ireland followed, where John Wark equalised Billy Hamilton\'s strike.  A month later Israel visited Hampden and two John Robertson penalties and a Davie Provan strike gave Scotland a 3-1 win.  The following month the 1981 British Championships took place, and it climaxed with a famous 1-0 win at Wembley thanks to a John Robertson penalty.  The tournament was not completed though as England and Wales both refused to play in Northern Ireland due to problems with the IRA  When the next qualifier came around, a win against Sweden would all but guarantee qualification.  Scotland took the lead with a diving header from Joe Jordan, and seven minutes from time Andy Gray was deemed to have been fouled in the box, and John Robertson scored the resulting penalty to win 2-0.  After the game Andy Gray admitted that he had dived, that infuriated the Swedes and Jock Stein.  Scotland\'s qualification was guaranteed a month later with a 0-0 draw at Windsor Park.  In the final match Scotland were defeated 2-0 in Portugal, but Scotland topped the group, with Northern Ireland in second place, and both the home nations qualified for the World Cup finals.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/88615093\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:56.397306% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/88615093?et=n8KHBPvXQR9kJvC1HQJjkg&viewMoreLink=on&sig=U3-y2aCktrs32ta2zSY0VU9cx5hUKL2cRAf6GF71TAw=\" width=\"594\" height=\"335\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'John Robertson scores the winning penalty kick in a famous 1-0 victory at Wembley.', null, null, null);
INSERT INTO `historypages` VALUES ('20', '4', '2', 'World Cup 1982 Finals: Build-up &amp; New Zealand', 'world-cup-1982-finals-build-up-and-new-zealand', '<p>In April 1982, Scotland\'s participation in the World Cup was thrown into doubt as Argentina invaded the Falkland Islands and the Falklands War began.  There were people who didn\'t think that any of the home nations should be taking part in the World Cup while the country was at war.  Graeme Souness and Danny McGrain said that Scotland should withdraw, but many members of the British Armed Forces wanted them to take part, as it would boost morale among the troops.  Because of this the Scotland team had no problems taking part.  On 15th June, the day that Scotland played their first match against New Zealand, Argentina surrendered, and the war was over.</p>\r\n\r\n<p>Scotland took the lead after 18 minutes when Gordon Strachan went on a solo run before passing to Kenny Dalglish who slotted it home.  Fourteen minutes later the keeper parried an Alan Brazil shot, and John Wark scored the rebound.  Wark got his second three minutes later when he headed in a Strachan cross.  In the first twenty minutes of the second half, poor defending let New Zealand score twice, before John Robertson scored a free-kick seventeen minutes from time.  Steve Archibald completed the scoring with a header from a Strachan corner ten minutes from time, to give Scotland a 5-2 victory.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/79046437\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:64.309764% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/79046437?et=GUxD9ch5RftVxwQ_6fiBTQ&viewMoreLink=on&sig=TprnNzflCDD0ruTH77TF0jSF0axDN57WwHmbIHf9Y2I=\" width=\"594\" height=\"382\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'The Scotland team line up before the opening game against New Zealand.', null, null, null);
INSERT INTO `historypages` VALUES ('21', '4', '3', 'World Cup 1982 Finals: Brazil &amp; USSR', 'world-cup-1982-finals-brazil-and-ussr', '<p>The following match was against Brazil, who were heavy favourites, it was therefore a shock when Scotland took the lead after eighteen minutes.  A long ball from Souness, was headed into the path of David Narey by John Wark.  Narey took a touch before unleashing a perfect shot into the top corner of the net.  English pundit Jimmy Hill cheekily described Narey\'s goal as a toe-poke, which caused him to be alienated from the Scotland fans.  Fifteen minutes later, Brazil equalised through a fantastic free-kick from Zico, which left Alan Rough stranded on the goal line.  Brazil took the lead from an Oscar header at the start of the second half, and that was followed by Eder chipping Rough who was off his line to make it 3-1.  Four minutes from time a low shot from Falcao went in off the post to give Brazil a 4-1 victory.</p>\r\n\r\n<p>Four days later, Scotland went into the match with USSR, level on points but behind on goal difference.  Therefore Scotland needed a win to qualify.  They got off to a great start when after fifteen minutes, a defensive mistake let Steve Archibald nip in and slip a pass to Joe Jordan to slot the ball into the bottom left hand corner.  This meant that Jordan had scored in the last three World Cup finals.  After an hour Chivadze equalized after a goalmouth scramble.  With six minutes remaining, Scotland looked to be in no trouble when a lack of communication caused both Willie Miller and Alan Hansen to go for the same ball out on the left, before they both collided, leaving Shengelia free to round Alan Rough and score USSR\'s second.  Four minutes later Souness picked up the ball on the edge of the Soviet box, and hit a low shot that went in off the post to make it 2-2.  It was too little too late, as for the third World Cup in a row, Scotland went out on goal difference.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/79045203\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:64.814815% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/79045203?et=C7vUgr-KSbpV3J6k3PhnmA&viewMoreLink=on&sig=9h6UOVagpnNOwS-7-zQigTBXphSLlC3mKZN5FQHqotQ=\" width=\"594\" height=\"385\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'David Narey scoring his famous \"Toe Poke\" to give Scotland a 1-0 lead against Brazil.', null, null, null);
INSERT INTO `historypages` VALUES ('22', '4', '4', 'Euro \'84 Qualifiers', 'euro-84-qualifiers', '<p>The qualification campaign for Euro \'84 began with a 2-0 home win over East Germany, which was followed by a 2-0 defeat away to Switzerland.  In the next game away to Belgium, Scotland led twice through a Dalglish double, but Belgium won the match 3-2.  In the home match against Switzerland, Scotland were 2-0 down before they scored twice in the last twenty minutes with goals from John Wark and Charlie Nicholas.  The campaign was finished with a 1-1 draw with Belgium and a 2-1 away defeat to East Germany.  Scotland finished bottom of the group with only one win in six matches, which was very poor.  After the Euro \'84 campaign was over for Scotland, they focused on the 1984 British Championships, which was the last ever tournament as it had been decided to end the British Championships due to falling crowds.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/89113456\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:74.242424% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/89113456?et=BwFZ75vLREZoCukW7TCgyQ&viewMoreLink=on&sig=D7rFrVCadqTWNCGpY7oa2DcN1O4w083fPs2Gom8FOvU=\" width=\"594\" height=\"441\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Alan Hansen challenges Van Der Elst in the Euro qualifying match in Brussels that Belgium won 3-2.', null, null, null);
INSERT INTO `historypages` VALUES ('23', '4', '5', 'World Cup 1986 Early Qualifiers', 'world-cup-1986-early-qualifiers', '<p>When the qualifiers for the 1986 World Cup came around, Jock Stein had Aberdeen\'s highly successful manager Alex Ferguson as his assistant, and in their first game together Scotland thrashed Yugoslavia 6-1 in a friendly at Hampden.  In the opening qualifier, a Paul McStay double and a Charlie Nicholas goal gave Scotland a 3-0 victory over Iceland.  The next visitors to Hampden were the group favourites Spain.  Scotland went 2-0 up thanks to a double by Mo Johnston, before Spain pulled one back.  With fifteen minutes remaining Kenny Dalglish received the ball on the right hand side of the box, before he shimmied past three defenders and turned and hit a powerful left foot shot into the top left hand corner.  It was Dalglish\'s 30th international goal, equalling Dennis Law\'s all time record, and it gave Scotland a 3-1 victory.  In the return match Spain won 1-0, and that was followed by a 1-0 defeat by Wales at Hampden.  The 1984/85 season finished with the first ever Rous Cup, which kept up the annual Scotland-England match after the British Championships was ended.  In this match, Scotland beat England 1-0 at Hampden thanks to a Richard Gough header, to win their first trophy in eight years. Three days later a late Jim Bett goal gave Scotland a 1-0 win in Iceland.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/91272247\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:60.269360% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/91272247?et=_rVNirCmQfBF0DCG66f2gg&viewMoreLink=on&sig=3xYIDm7_vdSbqD0MPHaqiXV0vjdbjjJ_8Xzvrc0Ro_Q=\" width=\"594\" height=\"358\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Scotland line up for the first ever Rous Cup match against England at Hampden Park, which Scotland won 1-0.', null, null, null);
INSERT INTO `historypages` VALUES ('24', '4', '6', 'World Cup 1986 Qualification &amp; Jock Stein', 'world-cup-1986-qualification-and-jock-stein', '<p>Going into the final qualifier, Scotland, Wales and Spain were all on six points, with Scotland having the superior goal difference.  But with Spain at home to Iceland, barring a shock result, Scotland needed a draw in Cardiff to qualify for the play-offs, but with Scotland four goals better than Spain, a win would almost certainly win the group for Scotland.  The match got off to a bad start for Scotland when Mark Hughes put Wales ahead after thirteen minutes.  With nine minutes remaining, a David Speedie shot was handled in the box, and up stepped substitute Davie Cooper for the most important penalty kick of his career.  He hit the penalty low into the right hand corner, and Wales keeper Neville Southall got to the ball but couldn\'t keep it out.  While the Scotland players were celebrating at full time, Jock Stein got into an argument with a photographer, before he collapsed in the dugout.  He was carried into the medical room where the doctors tried to resuscitate him, and after half an hour he was pronounced dead.  A time of celebration was turned into mourning.</p>\r\n\r\n<p>For the remainder of the World Cup campaign, Alex Ferguson took charge.  As Spain defeated Iceland in the last qualifier, Scotland now faced a two-legged play-off against Oceania\'s group winners, which was Australia.  In the first leg at Hampden, a free-kick from Davie Cooper after 58 minutes, and a goal from debutant Frank McAvennie two minutes later gave Scotland a 2-0 result to take to Melbourne.  The second leg finished goalless for Scotland to qualify for the finals in Mexico.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1633598\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:67.171717% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1633598?et=dMKeV6WbQVph3USbSrKyBw&viewMoreLink=on&sig=fm_vwpIuQ_ZCJf3z-ii-j9zR0TgWrepSM8iLjKmS2jo=\" width=\"594\" height=\"399\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Davie Cooper scores the vital penalty that gave Scotland a 1-1 draw with Wales, and took them to the play-offs for the World Cup Finals.', null, null, null);
INSERT INTO `historypages` VALUES ('25', '4', '7', 'World Cup 1986 Finals', 'world-cup-1986-finals', '<p>The draw for the finals were made on 15th December, and Scotland were grouped with West Germany, Denmark, and Uruguay, in what was dubbed the Group of Death.  In the build up to the finals, Scotland defeated Romania 3-0 at Hampden, in a game which saw Kenny Dalglish receive his 100th cap, but he would miss the finals due to a knee injury.</p>\r\n\r\n<p>In the opening game, a low shot in off the post by Elkjaer gave Denmark a 1-0 win.  Four days later, Scotland played West Germany in Querataro, and after seventeen minutes, a great move by Scotland was started when Gough received a headed clearance on the right hand edge of the box, before he passed to Roy Aitken who played a great ball into the path of Gordon Strachan.  He ran into the box and hit a great shot into the opposite end of the net to give Scotland a 1-0 lead. What was just as famous as the goal itself was the celebration, as Strachan ran to an advertisement board and considered jumping over it, before he put his right leg on top of it.  Five minutes later a great passing move by the Germans finished with Voller knocking a crossed ball into an empty net to equalise.  Five minutes into the second half, slack defending let Allofs score the winning goal for West Germany.  Going into the final match, Scotland knew that a draw with Uruguay would be enough to qualify in third place, which was now a possibility because of an increase in the number of countries in the competition.  The game got off to a good start for Scotland as Uruguay had a player sent-off after only 45 seconds, but for the rest of the match a series of fouls by Uruguay were unnoticed by the referee, and as a result the match ended 0-0, and Scotland finished bottom of their group and went home early from another World Cup finals.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/79033354\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:68.181818% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/79033354?et=0cZm9imbQpJfJEk2Qwl3Aw&viewMoreLink=on&sig=wrkZ0klLAFEW5jbvnUAQeX3xhJx2_LQNOOpQYSFPw4A=\" width=\"594\" height=\"405\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'The Scotland team line up before the 2-1 defeat by West Germany in Querataro.', null, null, null);
INSERT INTO `historypages` VALUES ('26', '5', '1', 'Euro \'88 Qualifiers', 'euro-88-qualifiers', '<p>After Alex Ferguson resigned as Scotland manager, the favourites to take over were Billy McNeill who was at Manchester City, and Jim McLean at Dundee Utd.  On 16th July 1986 the shock appointment was Andy Roxburgh, who was the director of coaching at the SFA, and unknown to most of the Scotland fans.  As his assistant, Craig Brown from Clyde was appointed.</p>\r\n\r\n<p>Roxburgh\'s first task as manager was the Euro \'88 qualifiers and Scotland made a poor start which saw them only get 4 points out of the first 10.  These matches were goalless draws at home to Bulgaria and away to Republic of Ireland, and a 3-0 win at home to Luxembourg, before a 1-0 home defeat to Republic of Ireland.  Scotland then went 12 years without losing a competitive game at home.  In the away match to Belgium, Scotland were thrashed 4-1 with Paul McStay scoring the consolation goal.  The 1987 Rous Cup followed with Scotland getting a 0-0 draw with England before they were defeated 2-0 by guests Brazil.  The new season started with a 2-0 victory over Hungary in a friendly, with Ally McCoist scoring his first two goals for Scotland.  Scotland then gained two very good results in the qualifiers; firstly a 2-0 home win over Belgium, with McCoist and McStay the scorers.  In the following game Scotland won 1-0 away in Bulgaria thanks to a late Gary Mackay goal.  That victory also gave Republic of Ireland qualification in Bulgaria\'s place.  The campaign finished with a disappointing goalless draw in Luxembourg.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1918022\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:65.656566% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1918022?et=MZA1_bqHSBhIV8RvTRaDvQ&viewMoreLink=on&sig=gOpphXzo2BXlD2o9jz43Z4npuMD9nHZ77j0PjZyxijs=\" width=\"594\" height=\"390\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Kenny Dalglish holds off a Luxembourg player in a Euro Qualifier that was the last of his 102 caps.', null, null, null);
INSERT INTO `historypages` VALUES ('27', '5', '2', 'World Cup 1990 Qualifiers', 'world-cup-1990-qualifiers', '<p>When the 1990 World Cup qualifiers came around, Scotland were drawn in a very hard group, in which Scotland would be considered third favourites.  Scotland started with a 2-1 win away to Norway, and that was followed by a 1-1 draw with Yugoslavia at Hampden.  The next qualifier was away to Cyprus and in a controversial match it was 2-2 until six minutes into injury time Richard Gough scored the winning header for Scotland. After the match there were riots and the East German referee was attacked. The next visitor to Hampden was group favourites France and a double by Mo Johnston on a wet evening gave Scotland a famous 2-0 victory.  Johnston opened the scoring with a spectacular overhead kick in the next qualifier against Cyprus that was won 2-1, with Ally McCoist scoring the second goal.  After five games Scotland had nine points out of ten and Mo Johnston had scored six times.  Yugoslavia were second with eight points, but Norway and France only had four points, and with the top two qualifying, Scotland were almost there.  The day before Scotland played Yugoslavia, Norway and France drew 1-1 meaning that Scotland only needed one point from their last three games to qualify. Scotland took the lead away to Yugoslavia, but in a space of ten minutes, they totally fell apart conceding three goals, two of which were own goals to loose 3-1.  A month later in Paris Scotland were beaten convincingly 3-0.  In the final mach at home to Norway, Ally McCoist lobbed Erik Thorstvedt just before half time to put Scotland 1-0 up.  In the last minute a shot from the halfway line beat Jim Leighton to make it 1-1 and make most of Hampden very nervous at the end, until the final whistle blew and Scotland had qualified for the finals.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1281875\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:68.013468% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1281875?et=vllMPVMKTfZ90UaytfN6gQ&viewMoreLink=on&sig=0O6ShFiNpWJS-NI8nJMvWw7watGwwPMiKrHJDXs93wU=\" width=\"594\" height=\"404\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Ally McCoist lobs Erik Thorstvedt to score the goal that took Scotland to Italia \'90. ', null, null, null);
INSERT INTO `historypages` VALUES ('28', '5', '3', 'World Cup 1990 Finals', 'world-cup-1990-finals', '<p>In the build up to the finals, Scotland had some poor results, with the only exception being a famous 1-0 victory over World Champions Argentina at Hampden thanks to a goal from full-back Stuart McKimmie.  When the draw for the finals was made, things looked very promising for Scotland as they were grouped with Brazil, Sweden, and unknown Costa Rica.  Scotland\'s opening match was against Costa Rica, who only qualified because Mexico were disqualified.  In what is probably the most humiliating result in Scotland\'s history, they were defeated 1-0.  The headline in the Daily Record the next day was <em>Stop The World We Want To Get Off!</em>  The following match was against Sweden, who won England\'s qualifying group.  Stuart McCall gave Scotland an early lead, and seven minutes from time Roy Aitken was brought down in the penalty area and Mo Johnston scored the penalty.  Two minutes later Sweden pulled a goal back to make it a nervy last five minutes, but Scotland held on for a 2-1 win.  In the final game both Scotland and Brazil only needed a point to qualify.  Things were going to plan until the 82nd minute when Jim Leighton spilled a shot that was narrowly tucked in by Muller.  In the 90th minute Taffarel made a point blank save from Mo Johnston to prevent Scotland from getting the point they needed.  As 16 teams qualified from six groups, four of the six third placed teams would qualify.  The day after the Brazil game, a last minute goal by Uruguay against South Korea meant that they qualified in third place in Group E, and a 1-1 draw between Holland and Republic of Ireland meant that they both qualified with England in Group F, therefore Scotland were one of the two third placed teams that did not qualify.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/79034687\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:66.498316% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/79034687?et=S9YKUGJBTEFMc684mzmt7g&viewMoreLink=on&sig=BziHd7asVmPwVgyn4vvq41E3tPXJUUIjeoIVGI_jb5c=\" width=\"594\" height=\"395\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'The Scotland team line up before the Brazil game, which they lost 1-0.', null, null, null);
INSERT INTO `historypages` VALUES ('29', '5', '4', 'Euro \'92 Qualifiers', 'euro-92-qualifiers', '<p>The first game of the Euro \'92 qualifiers was at home to a favoured Romania side, but goals from John Robertson and Ally McCoist gave Scotland a 2-1 victory. In the following game a John Robertson penalty and a Gary McAllister goal were enough for a 2-1 home win over Switzerland.  When Scotland travelled to Bulgaria, Ally McCoist gave them an early lead, but Bulgaria equalised 16 minutes from time with a deflected shot to earn a 1-1 draw.  In the return game at Hampden John Collins scored with six minutes left to put Scotland ahead, but a minute from time Bulgaria equalised for the game to end 1-1.  Scotlands next outing was to the tiny republic of San Marino, situated in the north of Italy, who were playing in their first tournament.  A Gordon Strachan penalty and a Gordon Durie header gave Scotland a 2-0 win.  In the following game away to Switzerland, a win would guarantee qualification for Scotland, and a draw would still put them in a strong position.  Things didnt start well for Scotland as they went 2-0 down at half time.  Gordon Durie pulled one back at the start of the second half, and seven minutes from time Ally McCoist completed a great fightback to earn a 2-2 draw.  Away to Romania Scotland lost their first and only game of the qualification campaign 1-0 due to a Hagi penalty.  In Scotland\'s final match they won 4-0 at home to San Marino with goals from Paul McStay, Richard Gough, Gordon Durie and Ally McCoist; but qualification was still undecided.  On the same day, a win for Switzerland over Romania would have meant qualification for Switzerland, but they lost 1-0. Then a week later Romania needed to beat Bulgaria by 2 goals, but a 1-1 draw saw Scotland through to the finals for the first time, with the help of Bulgaria, whose hopes were ended by Scotland four years ago.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:401px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1272059\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:148.129676% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1272059?et=ePWnKVhRRfF4g3AXcTOulQ&viewMoreLink=on&sig=1l6zsy8bt6iFYxfVzbzkLGjABCAfk1eCOerF5k2DZD0=\" width=\"401\" height=\"594\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Ally McCoist takes on Nikolay Iliev of Bulgaria during the 1-1 draw at Hampden Park.', null, null, null);
INSERT INTO `historypages` VALUES ('30', '5', '5', 'Euro \'92 Finals', 'euro-92-finals', '<p>The draw for the finals couldn\'t have been any harder as they were drawn with the World Champions Germany, the current European Champions Holland, and the Olympic Champions USSR.  Towards the end of the qualification campaign, there had been political unrest in USSR, with various republics gaining independence.  There was a doubt if USSR would participate, and if they didn\'t, Italy would take their place, but they did participate but under the name of CIS (Commonwealth of Independent States).</p>\r\n\r\n<p>In Scotland\'s first game they held Holland until fourteen minutes from time when Dennis Bergkamp beat Andy Goram to give Holland a 1-0 win. But Scotland\'s hopes were high after a good performance.  In the next game against Germany, German keeper Illgner made three saves in the first fifteen minutes, but after 28 minutes Riedle put Germany ahead.  A minute into the second half a deflected cross from Effenberg lobbed Andy Goram and put Germany 2-0 up.  Moller and Hassler hit the post for Germany and Scotland came close with a Richard Gough header, but Scotland could not score and were unlucky to loose the game 2-0.  That result ended Scotland\'s chances of qualifying for the next round.  In the final game against CIS, a shot from Paul McStay hit the post and hit off the back of Kharin in the CIS goal to give Scotland a 1-0 lead after only six minutes, but the goal was awarded to McStay.  Eleven minutes later Brian McClair scored his first goal for Scotland to make it 2-0.  Seven minutes from the end, the tie was settled when Pat Nevin mas tripped in the box and Gary McAllister scored the resulting penalty kick to give Scotland a 3-0 win.  Even although Scotland went out, they gained a lot of admirers, and the fans that received a lot of praise, won an award for fair play.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/145880399\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:67.003367% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/145880399?et=Xq9ZA3rXSMFZb-FxRbljFA&viewMoreLink=on&sig=U4slw1TMLUIji323zzIv-tdH94QjWoLAzxCNRUuPHkg=\" width=\"594\" height=\"398\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Stuart McCall runs past Steffan Effenberg of Germany in the match Scotland lost 2-0 in the Euro \'92 Finals.', null, null, null);
INSERT INTO `historypages` VALUES ('31', '5', '6', 'World Cup 1994 Qualifiers', 'world-cup-1994-qualifiers', '<p>The qualifiers for USA \'94 started away to Switzerland and Scotland went behind after only seventy seconds, but Ally McCoist equalised eleven minutes later.  The Swiss scored twice in the last twenty minutes to win 3-1 in a match, which saw Richard Gough sent off for catching the ball.  Scotland\'s next two games were at home to Portugal and Italy, and both ended goalless. When Malta visited Ibrox, as work was being done at Hampden, a McCoist double and one from Pat Nevin gave Scotland a 3-0 win.  Scotland\'s next qualifier was at Estadio da Luz (Stadium of Light) in Lisbon, but it was a very dark day for Scotland.  Portugal took an early lead after five minutes, which was doubled just before half time.  Then in the space of five minutes, Scotland fell apart and conceded three goals to go 5-0 down.  Just to rub salt into the wounds McCoist was stretchered off late on with a broken leg, but Scotland had already used their two substitutes.  A fight between Roxburgh and Gough after the match saw Gough quit the national team.  That result had all but ended Scotland\'s chances of qualification, but Scotland fought on and gained wins over Estonia, 3-0 away and 3-1 at home.  In the game at home to Switzerland, Scotland needed to win for it to remain mathematically possible to qualify.  A 1-1 draw with goals from John Collins and Bregy, ended Scotland\'s chances of qualifying.  After the match SFA Chief Executive Jim Farry stated that Andy Roxburgh\'s job was secure, but a few days later on 11th September 1993 Andy Roxburgh resigned.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1230101\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:65.656566% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1230101?et=aln9g1T5Qd9I6SSb92DQFQ&viewMoreLink=on&sig=thwFVllCNeXixjZpb5aAtr0fxTCI2Z-Mrapikstk9_0=\" width=\"594\" height=\"390\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Ally MCoist and Andy Egli of Switzerland both challenge for the ball in Scotland\'s 3-1 defeat in Berne.', null, null, null);
INSERT INTO `historypages` VALUES ('32', '6', '1', 'Brown\'s Early Reign', 'brown-early-reign', '<p>At the same press conference that Andy Roxburgh resigned, it was announced that his assistant Craig Brown was to be temporarily put in charge.  There was still two World Cup Qualifiers to be played against Italy and Malta, and Craig Brown\'s first game in charge was at the Stadio Olimpico in Rome with a crowd of 61,000.  That game finished 3-1 to Italy.  Just hours before the game away to Malta, Craig Brown was confirmed as the new Scotland Manager, and he completed the 1994 World Cup campaign with a 2-0 win. </p>\r\n\r\n<p>When Craig Brown took charge it was not just a new manager that Scotland was getting, there was a change in the line-up also.  Players such as Richard Gough, Maurice Malpas, and Alex McLeish had played their last game for Scotland and a new set of players that included Colin Hendry, Colin Calderwood, and Craig Burley had taken their place.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1214480\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:75.757576% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1214480?et=AUt4fvosTGVnZpAsTLqC5A&viewMoreLink=on&sig=wpHm2SJsa_75Q5_7I0IYoHEnjCTFfNINkNIkZXPG4yA=\" width=\"594\" height=\"450\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Stuart McCall challenges Franco Baresi of Italy in the 3-1 defeat at Stadio Olimpico in Rome.', null, null, null);
INSERT INTO `historypages` VALUES ('33', '6', '2', 'Euro \'96 Qualifiers', 'euro-96-qualifiers', '<p>The Euro \'96 Qualification campaign started with a 2-0 win over Finland in Helsinki due to goals from Duncan Shearer and John Collins.  The next match was at a newly refurbished Hampden against the Faroe Islands, their first competitive match there in almost three years.  The match was a convincing 5-1 win.  The next visitor to Hampden was arguably the strongest team in the group, Russia.  Their superior quality was obvious from the start, but against the run of play Scott Booth put Scotland ahead.  The lead was not for long, as they equalised six minutes later.  Scotland then held out for a 1-1 draw.  The next two games were on the road; the first was a 1-0 defeat to Greece because of a controversial penalty kick, and the other was a 0-0 draw in Moscow, where Jim Leighton was the hero.   The next big game was at home to Greece, but before then there were away wins to San Marino and the Faroe Islands.  Greece was the team that was competing with Scotland for second place, therefore this match was important.  71 minutes had elapsed and it was still goalless when Craig Brown brought on Ally McCoist to make his first appearance since his leg break in Portugal.  A minute later a cross in to the box has headed in by McCoist to win the match 1-0.  That win almost certainly guaranteed that Scotland would finish in second place.  The qualifying campaign was completed with two home wins, 1-0 over Finland, and 5-0 over San Marino.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1579227\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:66.666667% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1579227?et=H0hFmJzpQl5sJlbznwrXoQ&viewMoreLink=on&sig=K_7kQsROfYwp5wbiu8Mb-cUdjN553TsMRY-2OkezmW8=\" width=\"594\" height=\"396\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'John Collins in action against San Marino in the 5-0 victory at Hampden Park.', null, null, null);
INSERT INTO `historypages` VALUES ('34', '6', '3', 'Euro \'96 Finals: Holland &amp; England', 'euro-96-finals-holland-and-england', '<p>The eight group runners-up were then put in a table where their results against first, third, and fourth in their group was taken into account.  The top six all qualified, with Scotland being third, while the bottom two were in a one-legged play-off, they were Holland and the Republic of Ireland.  When the draw for the finals being held in England was made, Scotland were drawn in the same group as England, Holland, and Switzerland.  This would be the first time in seven years that Scotland would play their old enemy.</p>\r\n<p>The Euro \'96 Finals started with a well earned 0-0 draw with Holland who were one of the pre-tournament favourites.  A choice that Craig Brown made for this match was replacing Jim Leighton, who had played in most of the qualifiers, with Andy Goram who most felt was the better keeper.  This choice looked to have paid off.  The next game was England, and Scotland played well in the first half but it was goalless at half time.  Eight minutes into the second half Alan Shearer put England ahead.  With just over ten minutes remaining, Gordon Durie was brought down in the England penalty area to give Scotland a chance.  Gary McAllister stepped up and blasted the penalty, but David Seaman saved it.  Just to rub salt into the wounds, England went up the other side of the pitch and Paul Gascoigne chipped the ball over Colin Hendry\'s head before he volleyed it past Andy Goram to score the goal of the tournament and make it 2-0.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1280065\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:64.141414% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1280065?et=x7424LrOQvxVzGHtM5yVKQ&viewMoreLink=on&sig=K9YX0UTp8eXy2O_QlMpTokKcOQDpLJoppFLJyv1gj3E=\" width=\"594\" height=\"381\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Gary McAllister holds his head in his hands after he missed a penalty against England in the 2-0 defeat at Wembley.', null, null, null);
INSERT INTO `historypages` VALUES ('35', '6', '4', 'Euro \'96 Finals: Switzerland', 'euro-96-finals-switzerland', '<p>Going into the Switzerland game, Scotland knew that to qualify they needed to beat Switzerland, and also needed England to beat Holland, but they also needed a five goal swing in their favour which seemed like a big ask.  For this reason Craig Brown started with Ally McCoist and he had two great chances in the opening ten minutes.  It was not until the 37th minute that he received a pass from McAllister outside the box before he hit a great shot into the top corner before he ran to the Scotland bench to celebrate with Craig Brown.  At this time England were already 1-0 up on Holland, and after an hour that was 4-0.  When England\'s fourth goal came through, the Scotland fans were celebrating like Scotland had just scored, as at this moment in time Scotland were through to the next round for the first time in their history.  Fifteen minutes later though, Kluivert scored for Holland and that changed everything.  For the last fifteen minutes Scotland were throwing everything at Switzerland, and hoping that England could score.  Neither Scotland nor England could score another though, and Scotland were out on goals scored.  Scotland had lived up to their tag of gallant losers.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1246419\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:66.666667% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1246419?et=GrhprDF2QMFmm1FsBDtrrA&viewMoreLink=on&sig=xUkM-sWLRUMA_DSvtiLtAtFLSJZvatRIGBg_ReQ4u3Y=\" width=\"594\" height=\"396\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Colin Hendry shows his despair as Scotland go out of Euro \'96 on goals scored, after the 1-0 victory over Switzerland.', null, null, null);
INSERT INTO `historypages` VALUES ('36', '6', '5', 'World Cup 1998 Qualifiers', 'world-cup-1998-qualifiers', '<p>The Qualifiers for France \'98 began in Vienna where Scotland came away with a 0-0 draw with Austria.  Next up there was a Baltic double header first Latvia were defeated 2-0 and then came the infamous match against Estonia.  The match was to kick-off at 18:45 local time, but because of the poor floodlights the kick-off time was brought forward to 15:00.  When kick-off time arrived, only Scotland had shown up and they kicked off and three seconds later the referee blew his whistle to end the match.  Later on Estonia showed up at the original kick-off time and it was thought that Scotland would be awarded a 3-0 win.  After a UEFA meeting though, it was decided that the game would be replayed.  Due to the winter weather in Estonia, it was to be played in Monaco.  The next game was at home to Sweden, who finished third at the last World Cup Finals, and Scotland won 1-0 thanks to a John McGinlay goal after 8 minutes.  Three months later the match with Estonia took place in Monaco, and ended 0-0 after a poor performance.  The home game at Rugby Park was better as Scotland won 2-0.  Four days later Austria were the visitors to Parkhead and an impressive Scotland performance resulted in a 2-0 win thanks to two goals from Kevin Gallacher.  When Scotland travelled to Sweden they were defeated 2-1 but were unlucky not to get a penalty late on.  It was a penalty that decided the next qualifier, which was won 1-0 away to Belarus.  The return match was won 4-1 at Pittodrie.  The final group match was switched from Easter Road to Parkhead against Latvia, and goals from Kevin Gallacher and Gordon Durie sealed the match 2-0.  Spain beating the Faroe Islands in Group 6 meant that Scotland were the best second placed team, and therefore they qualified without the need for a play-off.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1529718\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:58.585859% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1529718?et=Y4oFR_uUTTp1nsOMsetu0g&viewMoreLink=on&sig=4gs_UYQ2wvm2ccPkgRBZjO-U2devTAF-MK_sHKKY3kc=\" width=\"594\" height=\"348\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Scotland kick-off in the farcical game against Estonia, when they did not turn up in Tallinn.', null, null, null);
INSERT INTO `historypages` VALUES ('37', '6', '6', 'World Cup 1998 Finals', 'world-cup-1998-finals', '<p>On 4th December 1997 the draw was made for the finals and it grouped Scotland with Brazil, Norway, and Morocco.  Scotland were thrown into chaos just before the finals as their number 1 Andy Goram announced his retirement from the Scotland team.  Jim Leighton would take his place.  The opening match of France \'98 was Brazil v Scotland on 10th June 1998.  The game didn\'t start well for Scotland as Cesar Sampaio put Brazil ahead after four minutes.  Seven minutes before half time Scotland were awarded a penalty, and John Collins hit a low shot past Taffarel to his right to equalise.  Things were going well for Scotland until the 73rd minute when a Brazil shot was blocked by Jim Leighton and the rebound hit Tom Boyd and went into his own net to make it 2-1 to Brazil.  In the next game against Norway, Scotland played well in the first half but went in goalless at half time.  Just a minute into the second half Norway took the lead, but after 66 minutes Craig Burley equalised to get a 1-1 draw.  After two games Scotland were strong favourites to qualify for the next round, all they needed was to beat Morocco, and hope that Norway didn\'t beat Brazil.  As far as Scotland are concerned though, things never go to plan.  Scotland were destroyed 3-0 by Morocco, with Burley being sent off.  Even if Scotland beat Morocco it would not have been enough, as Norway Beat Brazil 2-1.  It was a poor end to a tournament that held so much promise.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1268648\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:66.329966% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1268648?et=1w01ZSEXR-pFvO7EDZK85Q&viewMoreLink=on&sig=ARY6OlJv2CVLlkHj3QXiKYsE0ZThZkQ0Qvc4GmO9-m4=\" width=\"594\" height=\"394\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'John Collins celebrates after equalising against Brazil from the penalty spot in the opening match of France \'98. ', null, null, null);
INSERT INTO `historypages` VALUES ('38', '6', '7', 'Euro 2000 Qualifiers', 'euro-2000-qualifiers', '<p>After France \'98 a lot of people were calling for Craig Brown\'s head, but he decided to stay in the job for the Euro 2000 campaign.  It started with a goalless draw in Vilnius away to Lithuania where Barry Ferguson, Neil McCann and Callum Davidson all made their debuts.  This was followed by a narrow 3-2 win over Estonia where Scotland went behind twice.  It was substitute Billy Dodds who scored twice after replacing Ally McCoist on his 61st and final appearance for Scotland.  The match was also Jim Leighton\'s final appearance after he was blamed for the Estonian goals.  Four days later Craig Burley and Billy Dodds scored in a 2-1 victory over the Faroe Islands at Pittodrie.  Scotland\'s next qualifier was against Czech Republic at Parkhead and Scotland were defeated 2-1, Scotland\'s first home defeat in a competitive match in 12 years.  The defeat was also Gary McAllister\'s last match after a section of the home support booed him.   Before Scotland\'s next qualifier, an inexperienced team played European Champions Germany and won 1-0 away thanks to a goal from Don Hutchison. In their next qualifier, they suffered a humiliating 1-1 draw away to the Faroe Islands after conceding a late equaliser.  Czech Republic were Scotland\'s next opponents in Prague, and in what was Scotland\'s best performance of the group, they went 2-0 up with goals from Paul Ritchie and Alan Johnston.  In the last 25 minutes Scotland ran out of steam and conceded three goals to loose 3-2.  Scotland\'s next matches were victories home and away to Bosnia, 2-1 away, and 1-0 at home, and sandwiched in between was a goalless draw away to Estonia.  The group was completed with a 3-0 home win over Lithuania, played at the new Hampden, with Scotland qualifying for the play-offs.</p><p>In the play-offs Scotland were drawn against England, with the first leg at Hampden.  A Paul Scholes double gave England a 2-0 win in their first game at Hampden in ten years.  Going into the second leg, Craig Brown was convinced that the tie was not over, and just before half time Neil McCann crossed in from the left and English-born Don Hutchison headed past David Seaman at the far post.  Late on Seaman made a point blank save from a Christian Dailly header to prevent the match going into extra time.  The victory at Wembley gave the Scotland players pride and stopped Craig Brown from resigning.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1204850\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:71.043771% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1204850?et=MV7c7Id8SkVjAVGc_ybxkQ&viewMoreLink=on&sig=MV8b23oz9LUfeqovC8rFQj53pxhN8gZMtTilz4mr2fw=\" width=\"594\" height=\"422\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Don Hutchison scores the winning goal against England at Wembley.', null, null, null);
INSERT INTO `historypages` VALUES ('39', '6', '9', 'World Cup 2002 Qualifiers', 'world-cup-2002-qualifiers', '<p>The qualifying campaign for the 2002 World Cup started with a 1-0 away win to Latvia with a last-minute goal by Neil McCann.  Scotland\'s following two matches were also on the road, the first being a 2-0 victory over San Marino, which was followed by a 1-1 draw in Croatia to the group favourites.  The next group match was at home to Belgium, and things couldnt have got off to a better start as Billy Dodds scored after 60 seconds.  He doubled Scotland\'s lead after 28 minutes with a penalty.  Into the second half Belgium pulled one back after 58 minutes, and then deep into stoppage time they equalised, to rob Scotland of two valuable points against one of their main rivals.  Four days later they defeated San Marino 4-0, with Colin Hendry scoring twice, but the game ended on a sour note for him, as he was lucky not to be sent off after elbowing an opponent in the throat.  The next double header had the two make or break ties of the campaign, firstly a goalless draw with Croatia at home, followed by a 2-0 defeat to Belgium in Brussels.  That left it almost impossible that Scotland would qualify.  In the last matches they needed Belgium to beat Croatia, and Scotland to beat Latvia with a ten-goal swing in Scotland\'s favour to finish ahead of Croatia on goal difference.  This was not to happen though as Scotland beat Latvia 2-1, and Croatia beat Belgium 1-0.  For the second tournament in a row, Scotland had not qualified, and after the match Craig Brown resigned as Scotland manager to end his eight-year reign as arguably Scotland\'s greatest manager.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1067641\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:81.649832% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1067641?et=ENWmPzRxQlht5gBzlg5yXA&viewMoreLink=on&sig=Dffu0CHxdXsOmSmxL5bccdZsyoo0Aj3sbeKkfaPvpek=\" width=\"594\" height=\"485\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Kevin Gallacher celebrates his equaliser away to Croatia. ', null, null, null);
INSERT INTO `historypages` VALUES ('40', '7', '1', 'Vogts\' Early Reign', 'vogts-early-reign', '<p>After Craig Brown, Scotland looked to follow England\'s example and appoint a foreign manager, due to the success of Sven Goran Eriksson.  The front-runner was former German manager Berti Vogts who won Euro \'96 in his reign.  Vogts though was currently manager of Kuwait, and the SFA had to negotiate with their FA to terminate his contract.  After negotiations, Vogts was free to take over as Scotland manager on 1st March 2002.</p>\r\n\r\n<p>Vogts had little knowledge of the Scottish game, therefore Tommy Burns was recruited as his assistant.  Unlike previous managers, he had no knowledge of the pool of players, therefore he searched the English Premiership for players who were eligible to play, and many of the players that he recruited were unknown to the Scottish fans as they did not play any first team football.  They were players such as Kevin Kyle, Michael Stewart, Paul Devlin, and Robbie Stockdale; and at the end of Vogts\' reign, not many of these players were still playing for Scotland.  He also persuaded captain Paul Lambert to come out of international retirement.</p>\r\n\r\n<p>His first game in charge couldn\'t have been any harder, World and European Champions France in Paris, and the Scotland team showed their inexperience, as they were defeated 5-0.  In Vogts\' first six matches in charge, Scotland lost five and their only victory was against a Hong Kong XI.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/51958588\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:78.787879% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/51958588?et=FZILHTl1R_BOYf8zT1rWBA&viewMoreLink=on&sig=HHZwLe3gKFc9XclQH4koTbi8KwfeltYcO53lJ-C2OlY=\" width=\"594\" height=\"468\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'France celebrate after scoring against Scotland in Berti Vogts\' first game as manager.', null, null, null);
INSERT INTO `historypages` VALUES ('41', '7', '2', 'Euro 2004 Qualifiers', 'euro-2004-qualifiers', '<p>When the qualifying campaign for Euro 2004 started, things got worse as Scotland went 2-0 down in the Faroe Islands after only 12 minutes.  In the second half Paul Lambert and Bary Ferguson scored to gain a 2-2 draw.  After the match defender David Weir publicly criticised the manager before he quit the national team.  The next match was away to Iceland, and in a match that Scotland were not favourites, they won 2-0 with goals from Christian Dailly and Gary Naysmith.  In the return match at Hampden, Kenny Miller and Lee Wilkie scored to win 2-1.  Four days later, a poor refereeing decision let Lithuania score the winner from the penalty spot in a 1-0 defeat.  In the next qualifier, group favourites Germany visited Hampden, and Kenny Miller equalised a Fredi Bobic goal to gain a 1-1 draw.  A 3-1 home win over the Faroe Islands followed, before the away match in Germany.  Bobic and Ballack put the Germans 2-0 up before Neil McCann pulled one back for the match to finish 2-1, with Maurice Ross being sent off for Scotland.  In the final group match against Lithuania, the winner and only goal was scored by substitute Darren Fletcher, on his second appearance to take Scotland to the play-offs.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1471812\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:63.299663% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1471812?et=58Bel7f3QSdFjw2_FFg2nw&viewMoreLink=on&sig=fABWGekcI8Bd1zr-Lgi1h7HeZkgYk86z7YwYhn67ntc=\" width=\"594\" height=\"376\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Gary Naysmith celebrates scoring the second goal in the 2-0 victory away to Iceland.', null, null, null);
INSERT INTO `historypages` VALUES ('42', '7', '3', 'Euro 2004 Play-Offs &amp; Vogts\' Demise', 'euro-2004-play-offs-and-vogts-demise', '<p>In the play-offs, Scotland were drawn against the mighty Holland, with the first leg at Hampden.  After 22 minutes, a James McFadden shot from the right, took a deflection off Frank de Boer to put Scotland ahead after 22 minutes.  For the remaining 68 minutes Scotland prevented the Dutch from scoring to record one of their greatest ever victories that shocked the rest of Europe.  In the four days between both legs, the Dutch press were brutally criticising the team and manager Dick Advocaat, and the criticism worked as in the second leg, Holland destroyed Scotland in a 6-0 mauling.  Scotland were well and truly put in their place, and again they would not be participating in a major finals.</p>\r\n\r\n<p>Things did not get any better in the following matches as Scotland were humiliated 4-0 by Wales and lost a handful of friendlies including a 3-0 defeat at home to Hungary.  At this time pressure was on the SFA to sack Berti Vogts, but they decided to stick with him.  Before the World Cup qualifiers started, Scotland put in a good performance away to Spain to gain a well-earned 1-1 draw in a match that was abandoned after an hour, due to a floodlight failure.  When the qualifiers started they began with a poor 0-0 draw at home to Slovenia, followed by a 1-0 defeat at home to Norway, their first defeat at home in a World Cup match since 1985.  Four days later Scotland could only get a 1-1 draw in Moldova, which meant that with only 2 points out of 9, Scotland\'s qualification hopes already looked over.  On 1st November 2004 Berti Vogts resigned, stating that a major factor was recent criticism and abuse that he had suffered.  Tommy Burns took charge for the following friendly match against Sweden.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/2730826\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:65.488215% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/2730826?et=IfkBvJQ8RvZX_H6FcJO-hg&viewMoreLink=off&sig=H0Kl86pnPzLRpkpby9gOFzHYsJjk68xqGF9eifo5n0Y=\" width=\"594\" height=\"389\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'James McFadden celebrates scoring the winning goal in the 1-0 victory over Holland in the play-offs.', null, null, null);
INSERT INTO `historypages` VALUES ('43', '8', '1', 'Smith &amp; World Cup 2006 Qualifiers', 'smith-and-world-cup-2006-qualifiers', '<p>The two front-runners for the Scotland manager\'s post after Vogts resigned were Gordon Strachan, who was successful at Southampton, and former Rangers and Everton manager Walter Smith.  On 2nd December 2004, Walter Smith was appointed as Scotland\'s new manager, and Ally McCoist became coach, with Tommy Burns remaining as assistant manager.  One of the first things that he did as national manager was entice David Weir out of international retirement for Smith\'s first game in charge away to Italy in the San Siro.  Two free-kicks from Pirlo gave Italy a 2-0 win.  The following game was a 2-0 victory at home to Moldova with goals from Christian Dailly and James McFadden, before a 0-0 draw away to Belarus.  When Italy came to Hampden, a much-improved Kenny Miller coached by Ally McCoist, put Scotland ahead, but a late equaliser meant the game finished 1-1.  Four days later Kenny Miller put Scotland 2-0 up away to Norway, but a minute from time Norway pulled one back to make it 2-1.  With only two games remaining, Scotland were only two points off second place, which meant that there was some belief that Scotland could do what after three games seemed impossible, and qualify for the play-offs.  These hopes were ended in the next game when Scotland went down 1-0 at home to Belarus in a shock result.  Four days later Scotland put in a fine performance to gain an impressive 3-0 win away to Slovenia, with goals from Darren Fletcher, James McFadden, and Paul Hartley to finish the qualifying campaign on a high.  It made people wonder what would have happened if Walter Smith had taken over sooner.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/55312113\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:75.420875% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/55312113?et=wh5JUnSZSWZ9ECj5py5DcA&viewMoreLink=on&sig=oREXg2Mn5BkoWpxIIMsO7FTfgjzvQWOpM4-87sGUeU8=\" width=\"594\" height=\"448\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Kenny Miller celebrates his first goal against Norway in the 2-1 victory in Oslo.', null, null, null);
INSERT INTO `historypages` VALUES ('44', '8', '2', 'Kirin Cup &amp; Early Euro 2008 Qualifiers', 'kirin-cup-and-early-euro-2008-qualifiers', '<p>The following May, Scotland were invited to take part in the Kirin Cup in Japan, where they would play Japan and Bulgaria.  In the first game Scotland beat Bulgaria 5-1, and both debutants Kris Boyd and Chris Burke scored a double, with James McFadden scoring the other.  In the final game Scotland drew 0-0 with the hosts to win their first trophy since the 1985 Rous Cup.</p>\r\n\r\n<p>In the Euro 2008 qualifying campaign, Scotland were drawn in the Group of Death with both World Cup finalists Italy and France, and quarter-finalists Ukraine.  In their first game they destroyed the Faroe Islands 6-0 at Parkhead, with goals from Fletcher, McFadden, Boyd(2), Miller, and O\'Connor.  That was followed with a 2-1 win away to Lithuania, with Christian Dailly and Kenny Miller the scorers.  A month later, the mighty France visited Hampden and a second half goal by Gary Galdwell gave Scotland one of their greatest results of all time, winning 1-0.  Four days later Scotland lost their 100% record when they lost 2-0 away to Ukraine.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/72112285\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:67.508418% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/72112285?et=Q8XN68vuS9R6M9IrKbNfnw&viewMoreLink=on&sig=zVNmwRq1ng5Br_Nxv_e7zMS3Qvmp78X-7Rzr5iULY2A=\" width=\"594\" height=\"401\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Craig Gordon and Gary Caldwell celebrate at the final whistle as Scotland defeat France 1-0 at Hampden.', null, null, null);
INSERT INTO `historypages` VALUES ('45', '8', '3', 'McLeish\'s Early Reign', 'mcleish-early-reign', '<p>In January 2007, Rangers parted company with manager Paul Le Guen, and immediately Walter Smith was being linked to the position.  On 10th January, Walter Smith quit his post as Scotland manager to be appointed Rangers manager.  Ally McCoist joined him as his assistant.  The two main candidates to take Smith\'s place were current assistant Tommy Burns, who was also Vogts\' assistant; and former Rangers manager, and Scotland legend Alex McLeish.  McLeish was appointed on 29th January, with Andy Watson his assistant, and former captain Roy Aitken as coach.  Tommy Burns had earlier quit his role as assistant as the SFA did not contact him about the manager\'s role.</p>\r\n\r\n<p>In McLeish\'s first game as manager, Scotland were at home to Georgia, where they went ahead through Kris Boyd, before former Ranger Shota Arveladze equalized.  It looked like the match would finish all square before Craig Beattie scored the winner in the last minute.  Four days later Scotland travelled to Italy where a Luca Toni double won it 2-0 for Italy.  For the next two games, Garry O\'Connor was recalled after going AWOL before the Ukraine match.  He repaid McLeish\'s loyalty by scoring the winning goal in a 1-0 friendly win over Austria in Vienna.  A week later, Scotland were visiting the dreaded hill in the Faroes where they had drawn their previous two matches.  Two first half goals from Maloney and O\'Connor assured that Scotland go home with a 2-0 victory.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/73691180\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:68.518519% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/73691180?et=ZP-_cVviQt52CbEyomGLNA&viewMoreLink=on&sig=Vb_d9kaNmX1_YCzXnXD2QSPR4cwzbqaOoh6A65t5Oow=\" width=\"594\" height=\"407\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Craig Beattie scores a late winner against Georgia to win 2-1 in Alex McLeish\'s first game in charge.', null, null, null);
INSERT INTO `historypages` VALUES ('46', '8', '4', 'Euro 2008 Qualification Run-In', 'euro-2008-qualification-run-in', '<p>The next qualifier was at home to Lithuania where a Kris Boyd header put Scotland ahead. Lithuania equalised with a penalty after a dive from Hearts\' player Mikoliunas.  Two late goals from McManus and McFadden sealed a 3-1 win.  Four days later Scotland travelled to Paris to play group leaders France.  Midway through the second half a fantastic shot from 35 yards by McFadden went in to the top corner and gave Scotland a 1-0 victory, their greatest result of all time, and put Scotland top of Group B.  A month later Ukraine came to Hampden needing at least a point to keep their hopes of qualification alive.  Scotland got off to a great start when Kenny Miller and Lee McCulloch put Scotland 2-0 up after ten minutes.  Shevchenko pulled one back midway through the first half, before James McFadden sealed the win in the second half to make it 3-1 to Scotland.  Four days later, with the whole nation on a high, Scotland\'s run of six consecutive wins came to an end when a poor performance away to Georgia resulted in a 2-0 defeat.  This meant that Scotland had to beat Italy at Hampden in their final game to qualify.  A draw would mean that Scotland would need the Ukraine to defeat France in Kiev.  The Italy game was built-up to be possibly the biggest match in Scotland\'s history, with most of the Scotland fans positive that Scotland would get at least a draw.  The match did not get off to a good start as Italy took the lead after only 70 seconds.  Scotland deservedly equalised after 65 minutes when a loose ball in the Italian box was prodded home by captain Barry Ferguson.  It looked like it was going to finish 1-1 when in injury-time Panucci struck a cruel blow to give Italy an undeserving 2-1 win, and end Scotland\'s qualification hopes.  Even although Scotland would not be playing at Euro 2008, the Scotland team had restored pride in the nation.  Ten days later McLeish resigned to take over at Birmingham City.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/76706989\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:77.777778% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/76706989?et=2VUE65-yT7lSQ6gju1LrYA&viewMoreLink=on&sig=_43OTzF_EiWji290YpYm4ZijE31qIlbWndRbEBbl2xg=\" width=\"594\" height=\"462\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'James McFadden celebrates after scoring his famous goal which defeated France 1-0 in Paris.', null, null, null);
INSERT INTO `historypages` VALUES ('47', '9', '1', 'Burley\'s Early Reign', 'burley-early-reign', '<p>There were no outstanding candidates to succeed McLeish, but the SFA narrowed it down to Scotland legend Graeme Souness, Motherwell manager Mark McGhee, Southampton\'s George Burley, and former assistant Tommy Burns.  The bookies favourite was McGhee, but the sudden death of Motherwell captain Phil O\'Donnell lay doubt over whether he would leave Motherwell.  On 24th January George Burley was appointed as the Scotland manager.  Controversy followed when 77 times capped, former England captain Terry Butcher was appointed as his assistant, along with Steven Pressley.</p>\r\n<p>The George Burley era began with a creditable 1-1 draw with Croatia, but things did not get much better as a 3-1 defeat to Czech Republic was followed by a 0-0 draw at home to 10 man Northern Ireland.  Things were not looking promising going into the World Cup Qualifiers, as Scotland had gone five games without a win.  The qualification campaign got off to a terrible start as Scotland lost 1-0 away to Macedonia, and people were already calling for Burley\'s head.  Four days later Scotland gained a much needed 2-1 victory in Reykjavik, but Scotland were holding on at the end after McManus had been sent off.  When Norway visited Hampden, nothing more than a victory would be good enough.  Scotland could only get a 0-0 draw though, after debutant Chris Iwelumo missed an open goal.  After the match Kris Boyd retired from international football for as long as Burley was manager as he had only played 28 minutes in six games.  The year ended with a 1-0 defeat to Argentina in Diego Maradona\'s first match as their manager.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/83756938\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:63.636364% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/83756938?et=RYZrReNMSVFXIwSawIS6UQ&viewMoreLink=on&sig=eDdd-7XW73a9-yTCVsbh0tnCTpfWoy5TRcf4nBFVPtM=\" width=\"594\" height=\"378\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'James McFadden is tackled by Cristian Villagra of Argentina in the 1-0 defeat at Hampden Park.', null, null, null);
INSERT INTO `historypages` VALUES ('48', '9', '2', 'World Cup 2010 Qualification Run-In', 'world-cup-2010-qualification-run-in', '<p>In March 2009, there was a big World Cup double header away to Holland and at home to Iceland.  In the first match, Scotland were outclassed by the Dutch and defeated 3-0.  There was some controversy as a perfectly good headed goal by Gary Caldwell has disallowed.  There was even more controversy for the following match.  Both Barry Ferguson and Allan McGregor were dropped as they had been out drinking after the team arrived back in Scotland.  It was later revealed that a large part of the team had been out drinking and that Burley had sanctioned it.  Scotland won the game 2-1, which was only Burley\'s second win. More controversy followed as both Ferguson and McGregor sat on the bench making hand gestures during the match.  This led to both players being banned for life from playing for Scotland, and both players being reprimanded by Rangers.</p>\r\n<p>In August Scotland faced an important qualifier away to Norway.  Two goals in either half gave Norway a 4-0 victory and all but ended Scotland\'s World Cup campaign.  The following month Scotland faced Macedonia at Hampden needing a win.  A great second half display gave Scotland a much deserved 2-0 win with Brown and McFadden the scorers.  Four days later they faced the Dutch.  A great performance by Scotland saw them have chance after chance, but a late winner by the Dutch ended Scotland\'s qualification chances.  To rub salt into the wounds, a Norwegian victory over Macedonia saw them leapfrog Scotland on goal difference.  If only Scotland had performed in their first six matches the same as they had in their last two, they could have easily won a play-off place.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/85698197\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:67.845118% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/85698197?et=rJznERQFTzVVhcQcqwndDg&viewMoreLink=on&sig=OkL2BqhpKFLaMiAz8UxlfXAmatgnP2AxttkDTzfXMag=\" width=\"594\" height=\"403\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'The Scotland team line up before the 3-0 defeat to Holland in Amsterdam.', null, null, null);
INSERT INTO `historypages` VALUES ('49', '9', '3', 'Burley\'s Downfall & Levein\'s Appointment', 'burley-downfall-and-levein-appointment', '<p>Six days after the defeat by Holland, following crunch talks with the SFA, it was decided that Burley would remain as manager.  Pressley quit as his assistant.  Former Dundee Utd manager Paul Hegarty took over as coach.  Scotland then travelled to Japan for a friendly,  with a depleted squad after 10 players withdrew.  An inexperienced side lost 2-0.  The following month Scotland travelled to Cardiff and suffered a humiliating 3-0 defeat to an average Welsh side.  Following the match many people were calling for Burley\'s head, and two days later their wishes were granted when George Burley was sacked.  When Burley took charge, Scotland were ranked 14th in the World.  They were now ranked 46th in the World.</p>\r\n<p>When the search for a new manager began, Walter Smith and Dundee Utd manager Craig Levein were the two front runners.  Walter Smith quickly ruled himself out of the job, but as his contract at Rangers was near an end, the SFA still considered him.  There was interest from abroad as Romanian Dan Petrescu and Italian Nevio Scala put themselves forward for the Job.  On 23rd December, Craig Levein was named as the new Scotland manager.  Following Levein\'s appointment, exiled players Kris Boyd, Allan McGregor and Lee McCulloch returned to the Scotland setup.  In Levein\'s first game, Scotland defeated Czech Republic at Hampden in a friendly.  This was followed by a 3-0 defeat away to Sweden in the build up to the Euro 2012 qualifiers.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/97407858\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:72.390572% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/97407858?et=lKqbGU4FRgNg_Z9-VLsw0Q&viewMoreLink=on&sig=WrQ6UoSV_Aj7uJn_JuyEj_3mjWmRgdeJyYRFJ__As5c=\" width=\"594\" height=\"430\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Scott Brown, Kenny Miller, Darren Fletcher, and Graham Dorrans celebrate after Scott Brown scores the winner in the 1-0 victory over Czech Republic.', null, null, null);
INSERT INTO `historypages` VALUES ('50', '9', '4', 'Early Euro 2012 Qualifiers & Nations Cup', 'early-euro-2012-qualifiers-and-nations-cup', '<p>Scotland\'s Euro 2012 qualification campaign started with a goalless draw away to Lithuania.  This was followed by an embarrassing home match against minnows Liechtenstein.  It needed a 97th minute winner from Stephen McManus to earn a 2-1 win after Liechtenstein had earlier gone ahead.  In the next match away to Czech Republic, there was controversy regarding the lineup and formation when in-form Kenny Miller was dropped and Craig Levein chose a 4-6-0 formation with no strikers.  The match ended in a 1-0 defeat and Levein was slated for his tactics.  Four days later, World and European Champions Spain came to Hampden and took a 2 goal lead.  Scotland then fought back to level the tie, before Spain scored a late winner.  The following month, a side full of inexperienced players put on a fine performance in a 3-0 victory against the Faroe Islands in a friendly. The following spring the inaugural Nations Cup took place in Dublin, with Scotland, Wales, Northern Ireland, and Republic of Ireland taking part. Scotland began with an impressive 3-0 win over Northern Ireland.  This was followed by a 3-1 win over Wales, which was Scotland\'s first victory over the Welsh since 1984.  In the deciding match, Scotland were defeated 1-0 by Republic of Ireland, to finish as runner-up.  Sandwiched in-between these games was a friendly against Brazil that ended 2-0 to Brazil at Arsenal\'s Emirates Stadium.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/105216954\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:66.666667% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/105216954?et=ppdCjG7qRU9VqHz3hxJF4g&viewMoreLink=off&sig=2a418P0riWhY1wgNCMyhI_eXP-G5j1RgXhGCdL7Z3FU=\" width=\"594\" height=\"396\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'The Scotland team line up before the 3-2 defeat to World Champions Spain at Hampden Park.', null, null, null);
INSERT INTO `historypages` VALUES ('51', '9', '5', 'Euro 2012 Qualification Run-In', 'euro-2012-qualification-run-in', '<p>The new season started with an impressive 2-1 win against Denmark, who were 40 places above Scotland in the FIFA World Rankings. This was followed by the must win double header against Czech Republic and Lithuania in the Euro 2012 Qualifiers.  Against the Czechs Scotland twice went ahead through Miller and Fletcher but a blatant dive handed them a penalty in injury time that gave them a 2-2 draw.  A few days later a weakened Scotland team earned a 1-0 victory against Lithuania through a second half goal by Steven Naismith. A month later Spain did Scotland a favour by defeating the Czechs 2-0 in Prague.  This meant that Scotland\'s 1-0 victory in Liechtenstein thanks to a Craig Mackail-Smith header, put Scotland in second place with one game remaining. In the final round of matches, Scotland had to at least match Czech Republic\'s scoreline, who were away to Lithuania, while Scotland were away to World and European Champions Spain. Only five minutes into the game Scotland\'s hopes were crushed as just as Czech Republic took the lead, so did Spain.  Spain went on to win 3-1, with Scotland\'s consolation coming through a Goodwillie penalty.  In the other match the Czechs won 4-1 to claim the play-off spot making it seven tournaments in a row that Scotland failed to qualify for.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/123470358\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:69.023569% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/123470358?et=HVeEozRcSXlKIrRH4paZ8Q&viewMoreLink=on&sig=Xm5aQy8Lu2HDa-nTmTt7qJCXJtoW5x9veOhdBXWJ1Ps=\" width=\"594\" height=\"410\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Darren Fletcher scores Scotland\'s second goal in the 2-2 with Czech Republic at Hampden Park.', null, null, null);
INSERT INTO `historypages` VALUES ('52', '9', '6', 'Craig Levein\'s Downfall', 'craig-levein-downfall', '<p>Following the Euro 2012 qualifiers, Scotland played friendlies away to Cyprus (2-1), Slovenia (1-1), and USA (1-5) which did not symbolise a good end to the season.  The new season started with a good win at home to Australia (3-1), which was a good build up to the 2014 world cup campaign.  The campaign did not get off to a good start with Scotland drawing their first two games at home, firstly 0-0 with Serbia and then 1-1 with Macedonia.  Scotland were at crisis point and needed at least 3 points from their next 2 away games.  They looked to have got 3 points away to Wales before a poor refereeing display handed Wales all three points in a 2-1 defeat.  Four days later Scotland were completely outplayed in Brussels to recieve a 2-0 defeat to Belgium.  Many people were calling for Levein\'s head, who had only recorded 3 competitive wins in 12 games; with these games being home and away to Liechtenstein and at home to Lithuania.  It was three weeks later when the SFA decided to sack Craig Levein.  Billy Stark was put in temporary charge for the friendly against Luxembourg.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/150315533\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:68.181818% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/150315533?et=3z7H8ZeRRbphcKVf-FaBZg&viewMoreLink=on&sig=YpFhbrWEH79byU5ovrmEvQ8UWTvJHNTHodrAJkQ1y1U=\" width=\"594\" height=\"405\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Scotland celebrate Jordan Rhodes\' equaliser against Australia in the 3-1 victory.', null, null, null);
INSERT INTO `historypages` VALUES ('53', '10', '1', 'Strachan\'s Early Reign', 'strachan-early-reign', '<p>Following Craig Levein\'s sacking a list of potential replacements was drawn up.  The early favourites were Gordon Strachan, Walter Smith and Alex McLeish.  McLeish ruled himself out early on as did Smith, but he still remained a possible candidate, as did Joe Jordan and Owen Coyle.  On 15th January, legend Gordon Strachan was named as Scotland manager.  Soon after, his former Aberdeen team-mate Mark McGhee was named as his assistant, with current Motherwell manager Stuart McCall also part of his team.</p><p>In his first match, Scotland defeated Estonia 1-0 in a friendly at Pittodrie. Next there was a World Cup double header, first Wales came visiting and left with a 2-1 victory that all but ended Scotland\'s qualification hopes.  Four days later they travelled to Serbia and were defeated 2-0, leaving Scotland bottom of the group. At the end of the season, Scotland travelled to Zagreb to play Croatia who were ranked 4th in the World. Against all odds, Scotland, who were ranked 74th, won 1-0 with a Robert Snodgrass goal. The new season started with a friendly against The Auld Enemey at Wembley.  It was their first meeting in 14 years and Scotland were up for the game.  Morrison put Scotland ahead before Walcott equalised.  Kenny Miller again put Scotland ahead but goals from Wellbeck and Lambert gave England a 3-2 victory when Scotland deserved at least a draw.  Scotland\'s next qualifier saw them defeated 2-0 at Hampden by a quality Belgium side.  Four days later Scotland travelled to Skopje and put in an impressive display to win 2-1, with goals from Anya and Maloney. Scotland ended their qualification campaign with a 2-0 win over Croatia at Hampden. Goals from Snodgrass and Naismith gave Scotland their first home win of the campaign and filled the Tartan Army with hope for Euro 2016.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/176512576\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:66.666667% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/176512576?et=mlmtoff8Tg1POtIKwEUSyA&viewMoreLink=off&sig=zM8IkwLUc3drFe1wbeRB-z2fwAoHisJ_b5QMNN1pCTU=\" width=\"594\" height=\"396\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Kenny Miller celebrates after putting Scotland 2-1 up against England at Wembley.  The game finished 3-2 to England.', null, null, null);
INSERT INTO `historypages` VALUES ('54', '10', '2', 'Early Euro 2016 Qualifiers', 'early-euro-2016-qualifiers', '<p>On the build-up to the Euro 2016 campaign, Scotland recorded some good away victories against Norway and their Group D rivals Poland, which gave the team more confidence.</p><p>The campaign started with&nbsp; a good performance away to World Champions Germany, but resulted in a 2-1 defeat.&nbsp; A month later Scotland put in a good performance, but had to rely on an own-goal to defeat Georgia 1-0 at Ibrox.&nbsp; A few days later Scotland were unlucky not to defeat Poland In Warsaw, but came away with a 2-2 draw thanks to goals by Maloney and Naismith.&nbsp; A month later, The Republic came to Parkhead and a mammoth battle was decided by a great team goal by Shaun Maloney, to put Scotland in a strong position for qualifying.&nbsp; Before the next qualifier, Scotland played two friendlies that resulted in a defeat to England and a victory over Northern Ireland.&nbsp; The next qualifier saw UEFA\'s newest members Gibraltar come to Hampden.&nbsp; Scotland won 6-1, with Steven Fletcher scoring Scotland\'s first hat-trick since Colin Stein in 1969.&nbsp; Shaun Maloney also scored two penalties and Steven Naismith scored the other.&nbsp; There was some embarassment as&nbsp; Gibraltar equalised with their first ever competitive goal.&nbsp; Scotland finished the season&nbsp; with a poor performance in Dublin, but they came away with a 1-1 draw.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/459365118\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:66.666667% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/459365118?et=E_eg_lteR-5AOoJTWjprNg&viewMoreLink=on&sig=Gnc1q8jfJac6QRqr6zIsqckGrFFoMFkGR-ot_9nZOK8=\" width=\"594\" height=\"396\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Shaun Maloney scores the winning goal in the 1-0 win over Republic of Ireland at Parkhead.', null, null, null);
INSERT INTO `historypages` VALUES ('55', '10', '3', 'Euro 2016 Qualification Run In', 'euro-2016-qualification-run-in', '<p>The new season was started with the low point of the campaign.&nbsp; A poor performance away to Georgia resulted in a 1-0 defeat, which brought back memories of Euro 2008, and allowed Republic of Ireland back in with a chance of qualification.&nbsp; A few days later, Scotland put in a fine performance at home to Germany, but a Hummels og, and a fine goal by James McArthur were not enough to stop the Germans leave with all three points in a 3-2 defeat.&nbsp; That result, along with victories for Poland and Ireland ended Scotland\'s chances of automatic qualification.&nbsp; They still had a good chance of finishing third.&nbsp; Going into the final two matches, Scotland were four points adrift of Ireland, but Scotland were at home to Poland and away to Gibraltar, while Ireland were at home to Germany and away to Poland.&nbsp; This meant as long as Scotland got a better result against Poland than Ireland did against Germany, a victory for Scotland over Gibraltar would be enough.&nbsp; Scotland made a poor start to the Poland match as Lewandowski put the poles ahead after three minutes, although there was a hint of offside.&nbsp; Two outstanding goals by Matt Ritchie and Steven Fletcher gave Scotland a deserving 2-1 lead, and with it being goalless in Dublin, Scotland would be through.&nbsp; Ireland then took a shock 1-0 lead over Germany, but Scotland would still be in it, if Ireland defeated Poland in the final game.&nbsp; At the end of the Scotland game, in the fourth minute of injury time, the unthinkable happened and Poland equalised with the last kick of the ball, for the match to finish 2-2.&nbsp; As Ireland pulled off a shock 1-0 victory over Germany, Scotland\'s hopes of qualification were over.&nbsp; They had no luck on their side while the Irish and Poles did.&nbsp; In the final game, Scotland travelled to the Algarve to play Gibraltar, and they recorded their biggest away victory since 1949, when they won 6-0, with Steven Fletcher scoring another hat-trick and Chris Martin, Shaun Maloney and Steven Naismith scoring the others.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/491863080\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:67.003367% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/491863080?et=aBjNlCmmSrBIk4g49EJm5Q&viewMoreLink=on&sig=EXJ5IS52ar_FAJemQDKERHMA3rXbm4r5Hc1AEbxbp1Q=\" width=\"594\" height=\"398\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', 'Matt Ritchie scores Scotland\'s first goal in the 2-2 draw with Poland at Hampden Park.', null, null, null);
INSERT INTO `historypages` VALUES ('56', '10', '4', 'Early World Cup 2018 Qualifiers', 'early-world-cup-2018-qualifiers', '<p>The qualification campaign for the 2018 World Cup Finals began with a convincing 5-1 victory in Malta, with Robert Snodgrass scoring a hat-trick, along with Chris Martin scoring his first goal for Scotland and Steven Fletcher scoring the other.  The next game was against Lithuania at Hampden, and a woeful performance ended with James McArthur scoring an 89th minute equaliser to secure a 1-1 draw.  Things did not get much better when Scotland were then thrashed 3-0 in Slovakia.  The result flattered Slovakia though as Scotland started well in the game.  For the game at Wembley, Scott Brown came out of international retirement as Scotland\'s qualification campain was in trouble.  There was also some controversy, as both teams wore black armbands as it was Rememberence Day, even although FIFA forbid them.  The game finished 3-0 England with goals from Sturridge, Lallana, and Cahill.  The result flattered England as Scotland put in a good performance.  Things were not looking good for Scotland though as they had only 4 points from their first 4 games.  The next qualifier at home to Slovenia was a must win game.  The starting 11 contained 6 Celtic players, who were playing well under Brendan Rogers, this included debutant Stuart Armstrong and youngster Kieran Tierney.  Scotland put in a good performance, but could not score, until the 88th minute, when substitute Chris Martin hit a low shot that took a deflection before going in off the post, to give Scotland a crucial 1-0 victory. </p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.co.uk/detail/658070864\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:67.508415% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/658070864?et=vfnts9CdRMtdiRG6VjZ0Lw&tld=co.uk&sig=l4Yzh7Cfjcn2OwqUyOCZSRgksz9PCUbyKs0NC3KxItU=&caption=true&ver=1\" scrolling=\"no\" frameborder=\"0\" width=\"594\" height=\"401\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div></div>', 'Chris Martin celebrates his late winner against Slovenia at Hampden.', null, null, null);
INSERT INTO `historypages` VALUES ('57', '10', '5', 'World Cup 2018 Qualification Run-in', 'world-cup-2018-qualification-run-in', '<p>The season ended with the Auld Enemy visiting Hampden for the first time since 1999.  With 20 minutes remaining, Oxlade-Chamberlain gave England the lead until 3 minutes from the end, when Leigh Griffiths curled a free-kick from the edge of the box, over the wall and into the top right hand corner.  It sent Hampden into a state of delerium.  Things got better 3 minutes later when Scotland won a free-kick in the same position, and again Griffiths curled the ball, this time into the left hand corner, to beat Joe Hart and make it 2-1 Scotland.  All Scotland had to do was hold on for 4 minutes of injury time, but in the 94th minute, poor defending led to Harry Kane equalising and making it 2-2.  The next season started with Scotland full of confidence following the England game, for the trip to Lithuania.  A convincing performance gave Scotland a 3-0 victory, thanks to goals from Armstrong, Robertson, and McArthur.  A few days later group minnows Malta visited Hampden, and goals from Berra and Griffiths gave Scotland a 2-0 victory.  With ten points from their last 12, Scotland were confident that they could get a play-off place.  They had to win their final two games, the first being Slovakia\'s visit to Hampden. Midway through the first half, Slovakia were reduced to ten men.  The Slovak keeper then had the game of his life, pulling off save after save.  Scotland also hit the bar twice.  It looked like it was not going to be their night, until Martin Skrtel directed an Anya cross past his own keeper with 1 minute remaining to give Scotland a 1-0 victory.  Two days later, Belgium defeated Bosnia to guarantee Scotland a play-off place, if they win in Slovenia.  Griffiths gave Scotland a half-time lead, but two goals from Bezjak put Slovenia into the lead.  It was a poor performance from Scotland, and Snodgrass equalised with 2 minutes remaining to give them some hope.  It was too little to late though, as Slovakia defeated Malta 3-0 to finish 2nd on goal difference.  It was Scotland\'s best qualification campaign in 10 years.  Their best World cup in 16 years, but they missed out on qualification again, and there were questions about Strachan\'s future as manager.  These questions were answered 4 days later, when Strachan left by mutual consent.</p>', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.co.uk/detail/694551452\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:59.42761% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/694551452?et=j0nFKLEsTQF8VEjeUXNMbQ&tld=co.uk&sig=t879oTtxDifNn6lkIMAoDyOl3d5uisg_upGcKZVkt_s=&caption=true&ver=1\" scrolling=\"no\" frameborder=\"0\" width=\"594\" height=\"353\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div></div>', 'Leigh Griffiths scores Scotland\'s second in the 2-2 draw with England at Hampden.', null, null, null);
