INSERT INTO `managers` VALUES ('1', 'Beattie', 'Andy', null, '1954', '1954', null, '1 February 1954', '19 June 1954', 'Resigned', '1913-08-11 00:00:00', 'Kintore', '20 September 1983', 'Andy Beattie was appointed as the first Scotland manager in 1954 to take charge for the World Cup Finals plus the build-up.  The group of selectors still chose the team though.  Beattie announced a shock resignation hours before Scotland\'s final group match, although he took charge until after the 90 minutes.', '0', '0', null, 'andy-beattie-1954', null, null, null, null);
INSERT INTO `managers` VALUES ('2', 'Walker', 'Dawson', null, '1958', '1958', '6 February 1958', null, '15 June 1958', null, '1916-03-14 00:00:00', 'Dundee', '17 August 1973', 'Dawson Walker was the Scotland trainer, who took charge of the team after manager Matt Busby was injured in the Munich Air Disaster.  This was until after the 1958 World Cup Finals when Matt Busby took charge.', '1', '0', null, 'dawson-walker', null, null, null, null);
INSERT INTO `managers` VALUES ('3', 'Busby', 'Matt', 'Sir', '1958', '1958', 'September 1958', '15 January 1958', 'December 1958', 'Resigned', '1909-05-26 00:00:00', 'Orbiston', '20 January 1994', 'Matt Busby was appointed in January 1958, but because of the Munich Air Disaster, he could not take charge of the team until September.  He was only in charge for two games before he resigned in December.', '0', '1', null, 'matt-busby', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:315px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:141.428571% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/94111373?et=KDNtlioARIJTkenKTUjSPw&viewMoreLink=off&sig=PiLZxrdZh-qoZvGH7lixNPn4xFC_i0vvdRHqkysowQ4=\" width=\"315\" height=\"445\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/94111373\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', null, null, null);
INSERT INTO `managers` VALUES ('4', 'Beattie', 'Andy', null, '1959', '1960', null, 'March 1959', 'September 1960', 'Resigned', '1913-08-11 00:00:00', 'Kintore', '20 September 1983', 'Andy Beattie\'s second spell as Scotland manager only lasted 18 months.  His appointment was a shock to the public, with whom he had no credibility.  When he moved to Nottingham Forest, he was forced to give up the Scotland job.', '0', '0', null, 'andy-beattie-1959', null, null, null, null);
INSERT INTO `managers` VALUES ('5', 'McColl', 'Ian', null, '1960', '1965', null, 'November 1960', 'May 1965', 'Sacked', '1927-06-07 00:00:00', 'Alexandria', '25 October 2008', 'Ian McColl, who was still a Rangers player when he was appointed, got off to a terrible start as manager with a 9-3 defeat to England.  Although he had three famous victories against England and a good record as Scotland manager, he was mysteriously sacked in 1965 only a week and a half before a World Cup Qualifier.', '0', '0', null, 'ian-mccoll', null, null, null, null);
INSERT INTO `managers` VALUES ('6', 'Stein', 'Jock', 'CBE', '1965', '1965', 'May 1965', null, '7 December 1965', null, '1922-10-05 00:00:00', 'Burnbank', '10 September 1985', 'In May 1965, Jock Stein, who was currently the Celtic manager, took charge of Scotland on a caretaker basis for the rest of the World Cup campaign.  After Scotland failed to qualify for the 1966 finals, Stein\'s reign as caretaker manager ended.', '1', '0', null, 'jock-stein-1965', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:278px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:160.107817% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/80749470?et=9F50bnEMQ0p5u71bHi6_mQ&viewMoreLink=off&sig=ujeQ9ns9F_pTLNCJmlVDQ8Zs8JKg_NBzKnDJD_k4uvU=\" width=\"278\" height=\"445\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/80749470\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', null, null, null);
INSERT INTO `managers` VALUES ('7', 'Prentice', 'John', null, '1966', '1966', null, 'March 1966', 'October 1966', 'Resigned', '1926-08-02 00:00:00', 'Shotts', '10 February 2006', 'John Prentice took charge in March 1966. His unsuccessful reign in charge was to only last six months, as he mysteriously resigned in October 1966.', '0', '0', null, 'john-prentice', null, null, null, null);
INSERT INTO `managers` VALUES ('8', 'MacDonald', 'Malky', null, '1966', '1966', 'October 1966', null, 'November 1966', null, '1913-10-26 00:00:00', 'Glasgow', '26 September 1999', 'Malky MacDonald was an interrum manager, who took charge for two matches in the autumn of 1966.  He was also the Kilmarnock manager at this time.', '1', '0', null, 'malky-macdonald', null, null, null, null);
INSERT INTO `managers` VALUES ('9', 'Brown', 'Bobby', null, '1967', '1971', null, '18 February 1967', 'July 1971', 'Resigned', '1923-03-19 00:00:00', 'Dunipace', null, 'Bobby Brown was appointed as Scotland\'s first full-time manager in 1967.  His first match in charge was defeating world champions England at Wembley.  With pressure from fans and club managers; Bobby Brown, who was liked by many people, resigned in 1971.', '0', '0', null, 'bobby-brown', null, null, null, null);
INSERT INTO `managers` VALUES ('10', 'Docherty', 'Tommy', null, '1971', '1972', '12 September 1971', 'November 1971', '22 December 1972', 'Resigned', '1928-04-24 00:00:00', 'Glasgow', null, 'After obtaining a caretaker position in September 1971, Tommy Docherty was appointed in November.  Scotland then won five of their next six games and all four of their competitive matches, before Docherty departed for Manchester Utd in December 1972.', '0', '0', null, 'tommy-docherty', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:445px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:69.865320% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/79660262?et=oJSu5eueT5FpacxP-gWYgw&viewMoreLink=off&sig=j8z6ilt8Cd-hG_xv3qPl_ggxMRRVVTJABgLwQRQFkZs=\" width=\"445\" height=\"311\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/79660262\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', null, null, null);
INSERT INTO `managers` VALUES ('11', 'Ormond', 'Willie', 'OBE', '1973', '1977', null, '5 January 1973', '6 May 1977', 'Resigned', '1927-02-23 00:00:00', 'Falkirk', '4 May 1984', 'Willie Ormond took the manager\'s reign after a successful period with St Johnstone.  He guided Scotland to the 1974 World Cup Finals, where Ormond and his team gained worldwide praise. They are still thought off as the greatest ever Scotland team. In May 1977 he resigned to go back into club management with Hearts.', '0', '0', null, 'willie-ormond', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:445px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:81.818182% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/79023188?et=JrZEUMgHRh5a5Qk5TtyW8Q&viewMoreLink=off&sig=fJJN9Iy2Swu4XFYoKiVIVb3rJsX4F73dUKa8v_PMbbY=\" width=\"445\" height=\"364\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/79023188\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', null, null, null);
INSERT INTO `managers` VALUES ('12', 'MacLeod', 'Ally', null, '1977', '1978', null, '18 May 1977', '26 September 1978', 'Resigned', '1931-02-26 00:00:00', 'Glasgow', '1 February 2004', 'Aberdeen manager Ally MacLeod, was appointed in 1977 and the fans immediately took to him after he defeated England at Wembley.  After World Cup qualification, he built up the hype of Scotland winning the World Cup, which was to lead to his downfall.  After a poor World Cup and a losing start to Euro \'80, he resigned.', '0', '0', null, 'ally-macleod', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:409px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:145.232274% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/3292292?et=Sd_eJWKeS4R_jMJPsoqKgA&viewMoreLink=off&sig=T3VwSZCBpkWrdp7ZSBAEF-lzM1Ht9J9IADkZQCqosek=\" width=\"409\" height=\"594\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/3292292\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', null, null, null);
INSERT INTO `managers` VALUES ('13', 'Stein', 'Jock', 'CBE', '1978', '1985', null, '4 October 1978', '10 September 1985', 'Last Match', '1922-10-05 00:00:00', 'Burnbank', '10 September 1985', 'In the autumn of 1978, Jock Stein quit Leeds Utd to become the new Scotland Manager.  After a poor start, he guided Scotland to the 1982 World Cup Finals.  In the following World Cup campaign, he guided Scotland to the play-offs. During the final group match in Wales, he collapsed and died of a heart attack.', '0', '0', 'Jim McLean, Alex Ferguson (1984-1985)', 'jock-stein-1978', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:292px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:152.307692% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1565528?et=bSwAk0byTi1XBNY0MImUWA&viewMoreLink=off&sig=PZe9QjtJ3VZptMtBkrKmdLO1JQ7rV4llCk1Ts-QhNEE=\" width=\"292\" height=\"445\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1565528\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', null, null, null);
INSERT INTO `managers` VALUES ('14', 'Ferguson', 'Alex', 'Sir', '1985', '1986', '10 September 1985', null, '13 June 1986', null, '1941-12-31 00:00:00', 'Glasgow', null, 'In the wake of Jock Stein\'s death, his assistant Alex Ferguson took charge temporarily until the end of the 1986 World Cup Campaign, guiding Scotland through the Play-Offs and the Finals.', '1', '0', 'Walter Smith (1986)', 'alex-ferguson', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:297px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:150.000000% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/88614850?et=XwkCjNOBSJNu5H-8zZLiow&viewMoreLink=off&sig=cLQWYboqxSq9J7ugdLookJw17UIHe2C1SCCY0EoA5MM=\" width=\"297\" height=\"445\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/88614850\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', null, null, null);
INSERT INTO `managers` VALUES ('15', 'Roxburgh', 'Andy', null, '1986', '1993', null, '16 July 1986', '11 September 1993', 'Resigned', '1943-08-01 00:00:00', 'Glasgow', null, 'Andy Roxburgh was unknown to most of the Scotland fans, part of the coaching staff at Mexico, he was appointed in July 1986.  He took Scotland to Italia \'90 and qualified for the European Championships for the first time in 1992.  Failure to qualify for USA \'94, and criticism from the media led him to resign in 1993.', '0', '0', 'Craig Brown', 'andy-roxburgh', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:300px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:148.500000% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/78962857?et=P2Zhb_C9Rw1oHKqVrBK-EA&viewMoreLink=off&sig=HpGRRyD0NpfDaE2EC15J98_zzRbM7T-f7fVVuu_MPSo=\" width=\"300\" height=\"445\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/78962857\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', null, null, null);
INSERT INTO `managers` VALUES ('16', 'Brown', 'Craig', 'CBE', '1993', '2001', '11 September 1993', '17 November 1993', '6 October 2001', 'Resigned', '1940-07-01 00:00:00', 'Hamilton', null, 'Arguably Scotland\'s greatest ever manager.  With limited resorces Craig Brown, who was a shock appointment, guided Scotland to Euro \'96 and France \'98.  Throughout his reign, many people were calling for him to go and after Scotland failed to qualify for the following two tournaments he resigned.', '0', '0', 'Alex Miller (1993-1999), Archie Knox (2000-2001)', 'craig-brown', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:282px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:157.978723% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/79021372?et=o7a2bY-aSNR59lHlYXpUQA&viewMoreLink=off&sig=7-sCKpwMvFd8scTv72yxIJrOwCx3EkjAR1jRf7SFvU4=\" width=\"282\" height=\"445\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/79021372\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', null, null, null);
INSERT INTO `managers` VALUES ('17', 'Vogts', 'Berti', null, '2002', '2004', null, '1 March 2002', '1 November 2004', 'Resigned', '1946-12-30 00:00:00', 'Buttgen, Germany', null, 'In March 2002, Scotland appointed Berti Vogts as their first foreign manager.  He picked inexperienced youngsters which led to poor results.  His only high point was a 1-0 win over Holland in the Euro 2004 play-offs.  A poor start to the World cup campaign led to calls for his head, and on 1st November 2004 he resigned due to the criticism and abuse he was receiving from the media and the fans.', '0', '0', 'Tommy Burns', 'berti-vogts', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:332px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:134.085779% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/490805314?et=e-Le8Q_vRml6_j94aRT2dA&viewMoreLink=off&sig=-C1-adaoh52L2BiCa2__314qwKIFuw_PaIoNa1VVjno=\" width=\"332\" height=\"445\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/490805314\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', null, null, null);
INSERT INTO `managers` VALUES ('18', 'Burns', 'Tommy', null, '2004', '2004', '1 November 2004', null, '2 December 2004', null, '1956-12-16 00:00:00', 'Glasgow', '15 May 2008', 'Tommy Burns was Berti Vogts\' assistant and he took charge after Vogts resigned, until Walter Smith was appointed.', '1', '0', null, 'tommy-burns', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:294px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:151.530612% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1626188?et=i1AjcdLkT2hAq2MR3dUjOQ&viewMoreLink=off&sig=UrxhqgLoYWG0N-7pnKElfReGc_-uKuZ2usCN_JXxpYw=\" width=\"294\" height=\"445\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1626188\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', null, null, null);
INSERT INTO `managers` VALUES ('19', 'Smith', 'Walter', 'OBE', '2004', '2007', null, '2 December 2004', '10 January 2007', 'Resigned', '1948-02-24 00:00:00', 'Lanark', null, 'Walter Smith was appointed in December 2004 to take over from Berti Vogts.  Smith immediately rejuvenated the Scotland team and installed confidence, which saw them rise from 86 to 26 in the World Rankings in 2 years.  He took Scotland close to World Cup qualification, and also got the Euro 2008 campaign off to a great start, before he quit to take over at Rangers for a second time.', '0', '0', 'Tommy Burns & Ally McCoist', 'walter-smith', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:297px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:150.000000% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/55905743?et=IYqOwuPnTkleXKBiv3qa9w&viewMoreLink=off&sig=kchbs20QJh53ivjAhHbfa-XwOQ-JFYXPZlSjNMQs0Uc=\" width=\"297\" height=\"445\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/55905743\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', null, null, null);
INSERT INTO `managers` VALUES ('20', 'McLeish', 'Alex', null, '2007', '2007', null, '29 January 2007', '27 November 2007', 'Resigned', '1959-01-21 00:00:00', 'Barrhead', null, 'Alex McLeish started where Walter Smith left off.  He continued on the road to Euro 2008, where they rose to 13th in the World Rankings.  This attracted interest from down south, and 10 days after Scotland failed to qualify for Euro 2008, McLeish resigned to take over at Birmingham City.', '0', '0', 'Andy Watson & Roy Aitken', 'alex-mcleish', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:439px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.co.uk/detail/77314500\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:135.30751% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/77314500?et=12JpW3nYRiFw8bzGYIQKcw&tld=co.uk&sig=-tBfPd3IsfGNsMk3zv2wmL8UgDsTlLH_c6BNhcNPahs=&caption=true&ver=1\" scrolling=\"no\" frameborder=\"0\" width=\"439\" height=\"594\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div></div>', null, null, null);
INSERT INTO `managers` VALUES ('21', 'Burley', 'George', null, '2008', '2009', null, '24 January 2008', '16 November 2009', 'Sacked', '1955-12-17 00:00:00', 'Cumnock', null, 'George Burley was a surprise appointment in January 2008, and controversy followed when he appointed Terry Butcher as his assistant.  Poor results followed in Scotland\'s World Cup campaign, as Burley made some unpopular team selections.  After humiliating defeats in Norway and Wales and failure to qualify for the World Cup Finals, he was sacked.', '0', '0', 'Terry Butcher & Steven Pressley (2008 - 2009), Paul Hegarty (2009)', 'george-burley', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:275px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:161.852861% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/91730393?et=JXaskUYPQK5OJZgVFyFqfQ&viewMoreLink=off&sig=O59DeWIWDP1xCgBD3rpG5w8ERgbBXKhWvmm5BAKrUe4=\" width=\"275\" height=\"445\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/91730393\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', null, null, null);
INSERT INTO `managers` VALUES ('22', 'Levein', 'Craig', null, '2009', '2012', null, '23 December 2009', '5 November 2012', 'Sacked', '1964-10-22 00:00:00', 'Dunfermline', null, 'Craig Levein was the fans\' favourite when he took over, but certain formations and the exclusion of some players led to heavy criticism.  Only 3 wins in 12 competitive games led to his sacking.', '0', '0', 'Peter Houston', 'craig-levein', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:334px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:133.183857% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/97406642?et=ALXgStISS7hsZ5nivJIkrw&viewMoreLink=off&sig=Pqtlpuv_ENfbz-N6G0S9aQ0QC6UktEkDV9teQok6klE=\" width=\"334\" height=\"445\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/97406642\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', null, null, null);
INSERT INTO `managers` VALUES ('23', 'Stark', 'Billy', null, '2012', '2013', '5 November 2012', null, '15 January 2013', null, '1956-12-01 00:00:00', 'Glasgow', null, 'Billy Stark was Scotland\'s U21 manager when he took over for the friendly against Luxembourg following Craig Levein\'s dismissal.', '1', '0', 'Donald Park', 'billy-stark', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:297px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:150.000000% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/156497501?et=7iCcAPA0RmFnKSiDcy0BLA&viewMoreLink=off&sig=RlAn6s_4q3mor9HoRLGAtKbZLyRHaYDOS2r2Em5zaqQ=\" width=\"297\" height=\"445\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/156497501\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', null, null, null);
INSERT INTO `managers` VALUES ('24', 'Strachan', 'Gordon', 'OBE', '2013', '2017', null, '15 January 2013', '12 October 2017', 'Left Job', '1957-02-02 00:00:00', 'Edinburgh', null, 'Gordon Strachan took over Scotland when they were on their knees, following George Burley and Craig Levein.  He ended the 2014 qualification on a high with impressive victories over Croatia.  He was then unlucky not to qualify for Euro 2016 when Scotland played well in a tough group, and likewise for World Cup 2018, when they just missed the play-offs.  After 2 failed campaigns, Strachan left by mutual consent.', '0', '0', 'Mark McGhee & Stuart McCall (2013-2015)', 'gordon-strachan', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:297px;\"><div style=\"overflow:hidden;position:relative;height:0;padding:150.000000% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/492435594?et=nS3fr-UyRq9RSG38keNXAQ&viewMoreLink=off&sig=Z_QsM6gqbQz_zw9g95Nqbc68GVVpNa7Zh_8QIR2RvSo=\" width=\"297\" height=\"445\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;\"></iframe></div><p style=\"margin:0;\"></p><div style=\"padding:0;margin:0 0 0 10px;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/492435594\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">View image</a> | <a href=\"http://www.gettyimages.com\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">gettyimages.com</a></div></div>', null, null, null);
INSERT INTO `managers` VALUES ('25', 'Mackay', 'Malky', null, '2017', '2017', '13 October 2017', null, null, null, '1972-02-19 00:00:00', 'Bellshill', null, 'Malky Mackay, who was the SFA Performance director, took charge for the friendly against Holland, after Scotland parted company with Gordon Strachan.', '1', '0', 'Eric Black', 'malky-mackay', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:Roboto,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:396px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.co.uk/detail/460990156\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:150% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/460990156?et=QYNddSPqTppokTz_Zal-Ow&tld=co.uk&sig=RR9O7jlphzupy1sIPWj49jNPFU_AFTiW35Q1mW5vl-w=&caption=true&ver=1\" scrolling=\"no\" frameborder=\"0\" width=\"396\" height=\"594\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div></div>', null, null, null);
