INSERT INTO `matchsummary` VALUES ('413', '<p>Scotland went into their final group game knowing that, to progress to the next round they would have to beat Holland by three goals.  That looked unlikely after 34 minutes as Rensenbrink converted a penalty after Rep was brought down in the box.  Nine minutes later Souness crossed a ball to the back post for Jordan to head into the path of Dalglish, to score a half volley on the turn.  Two minutes into the second half, Souness was fouled in the penalty area, and Gemmill scored the resulting penalty to put Scotland 2-1 ahead.  Midway through the second half, possibly the greatest Scotland goal of all time was scored. Dalglish collected the ball near the right corner flag before Krol tackled him.  The ball fell to Gemmill on the edge of the penalty area, who skipped past Jansen, avoided the tackle from Poortvliet, and nutmegged Krol.  He was through one on one with the keeper Jongbloed, and he lifted the ball over the diving keeper to put Scotland 3-1 ahead and send the Scotland fans into ecstasy.  Scotland now only needed one more goal to qualify.  That joy was short lived as three minutes later Rep collected the ball midway in the Scotland half before he unleashed an outstanding shot from 30 yards that beat Rough to make it 3-2. After that Scotland\'s spirit was dejected, and they couldn\'t score the other goals that they needed.  At the final whistle Scotland walked off with their heads held high after defeating arguably the best team in the world; but for the second World Cup in a row, Scotland went out on goal difference.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('571', '<p>Going into the Switzerland game, Scotland knew that to qualify they needed to beat Switzerland, and also needed England to beat Holland, but they also needed a five goal swing in their favour which seemed like a big ask.  For this reason Craig Brown started with Ally McCoist and he had two great chances in the opening ten minutes.  It was not until the 37th minute that he received a pass from McAllister outside the box before he hit a great shot into the top corner before he ran to the Scotland bench to celebrate with Craig Brown.  At this time England were already 1-0 up on Holland, and after an hour that was 4-0.  When England\'s fourth goal came through, the Scotland fans were celebrating like Scotland had just scored, as at this moment in time Scotland were through to the next round for the first time in their history.  Fifteen minutes later though, Kluivert scored for Holland and that changed everything.  For the last fifteen minutes Scotland were throwing everything at Switzerland, and hoping that England could score.  Neither Scotland nor England could score another though, and Scotland were out on goals scored.  Scotland had lived up to their tag of gallant losers.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('663', '<p>Before the game started there was some controversy about the location.  On the same day as the Faroe Islands match, there was a Robbie Williams concert arranged for Hampden.  For this reason the Scotland match would be played at Parkhead.\r\nScotland made a bright start to the game when Fletcher put Scotland 1-0 up after only six minutes.  Miller made a run down the right and put a low cross into the box for Fletcher to meet at the back post and knock over the line.  Four minutes later Scotland\'s lead was doubled when McFadden latched on to a loose ball at the edge of the penalty area and hit a low shot into the bottom corner of the net. After 24 minutes, Boyd was tripped in the box, and the resulting penalty by Boyd creeps in under the keeper.  Six minutes later Fletcher was also fouled, and this penalty by Miller was also a weak one that squeezed in under the keeper.  Seven minutes before half time Boyd latched on to a great pass by Fletcher in the box.  Boyd\'s first shot was saved by the keeper, but he knocked the rebound into an empty net to make it 5-0.  In the second half, Scotland took their foot off the gas.  They had a couple of chances from McFadden that were saved, and Mikkelsen in goal also prevented Boyd from getting his hat-trick when he saved a header.  With five minutes remaining substitute Gary O\'Connor completed the scoring, when he slotted home a low ball from McFadden in the penalty area to make it 6-0 and record Scotland\'s highest win since 1976.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('664', '<p>For the Lithuania game, Smith chose a more defensive formation and Boyd was dropped to the bench.  After only two minutes, a volley by Zvirgzduaskas was headed off the line by Naysmith.  At the other end a shot by Quashie was parried by the keeper.  A Miller header was cleared off the line before a long range effort by McFadden was saved.  Two minutes into the second half, Scotland took the lead.  A corner by Naysmith was met by Dailly, who outjumped the defence to score a powerful header.  Just after the hour mark, Miller doubled Scotland\'s lead.  A free kick by Gordon was headed into the penalty area by Boyd, into the path of Miller, who controlled the ball with his chest before he hit a great shot on the turn past the keeper.  Lithuania came close when a shot by Poskus was touched round the post by Gordon.  There were some tense moments at the end after Lithuania pulled a goal back.  Substitute Miceika scored a spectacular overhead kick with five minutes remaining.  Scotland held on though to record a 2-1 away victory.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('665', '<p>After two victories against weaker opposition, now came the big test, France at Hampden.  The last game between both countries ended in a 5-0 defeat for Scotland in Paris.  After only 11 minutes France came close when a curling free kick by Henry hit the post.  France then had the ball in the net twice, but the linesman\'s flag saved Scotland.  The first was a header by Viera, and the second was an overhead kick by Trezeguet.  Gordon saved a shot by Malouda on 30 minutes as the French continued to dominate play.  In the second half, Scotland got a rare chance when McFadden nipped in behind the French defence but he miss hit his shot wide.  In the 67th minute the unthinkable happened.  Against the run of play Scotland took the lead.  A corner by Hartley on the right was swung into the box for Gary Caldwell to slide in past Coupet and send Hampden, and all of Scotland into a state of jubilation.  France piled everyone forward looking for an equaliser, and with only three minutes remaining Henry had a great chance to equalise, but his header was straight at Gordon.  The Scotland defence held out, and the full time whistle blew to record arguably their greatest result to date, and send shockwaves throughout the football world.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('666', '<p>With Scotland flying high at the top of Group B, they now faced a tough trip to Ukraine to play the World Cup quarter finalists.  In the first half Ukraine had a couple of chances to take the lead, but both times Gordon came to Scotland\'s rescue.  Two minutes into the second half Shevchenko hit the post.  On the hour mark Ukraine finally broke down the Scotland defence.  A free kick was floated into the box, and a clearence by McFadden took a deflection off Sviderskiy to fall into the path of Kucher, who drilled a low shot past Gordon.  Miller came close to equalising, when he crossed the ball in and it deceived the keeper and hit the bar. With ten minutes remaining, Robbie Neilson floated in a cross for Miller to head a glorious chance just wide.  Six minutes later, Pressley received a red card in a harsh decision for fouling Shevchenko as he ran towards goal.  In the last minute Shevchenko went down in the box after a challenge by Neilson, and a penalty was given in another harsh decision.  Shevchenko sent Gordon the wrong way to give Ukraine a 2-0 victory and end Scotland\'s 100% record.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('667', '<p>Alex McLeish\'s first game in charge was at home to Georgia, and the McLeish era got off to a flyer, when after only 11 minutes Scotland took the lead.  Teale collected the ball down the left, before he crossed the ball into the middle for Boyd to score a low header into the bottom corner.  Scotland had chances to double their lead firstly from Teale and then from Miller.  Georgia came into the game towards the end of the half and had a Demetradze volley saved, before Khizanishvilli hit the bar.  Georgia got a deserved equaliser 4 minutes before the interval when Demetradze beat Weir on the left to cross the ball into the middle for ex Rangers striker Shota Arveladze to score a diving header.  With 20 minutes remaining Miller laid the ball on to Boyd who hit the bar.  Boyd was replaced by Beattie with less than 15 minutes remaining, and in the 89th minute Naysmith headed the ball into the box to Miller, who in turn headed the ball into Beattie\'s path.  Beattie hit the ball with what appeared to be his left shin and the keeper got a hand to the ball but couldn\'t keep it out.  It was a vital goal to give Scotland a 2-1 win in McLeish\'s first match.  It put Scotland top of Group B and kept their qualification hopes alive.', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('668', '<p>With Scotland top of Group B, they now faced their toughest task away to the World Champions.  At the start of the game Scotland struggled to hold on to possession, and therefore it was not a surprise when Italy took the lead after 12 minutes.  Oddo floated a free kick on the right into the box to the head of Luca Toni, who headed it past Gordon.  Italy controlled the first half, but Scotland had some chances.  The closest was a dipping shot by McCulloch that was saved by Buffon.  In the second half Gordon made two saves from Di Natale, the first was a shot from an angle that Gordon saved with his hand; while the second was saved by his leg.  Gordon also saved a deflected shot from Camoranesi.  With 20 minutes left on the clock, slack passing from Scotland let the Italians get the ball to Camoranesi on the right.  He crossed the ball to the back post where Toni escaped from his marker to head in Italy\'s second.  McLeish threw on both Boyd and Beattie in the last ten minutes to play three up front.  It was to no avail though as the Italians ran out comfortable 2-0 winners.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('669', '<p>For the friendly with Austria Alex McLeish recalled Garry O\'Connor, who had previously gone AWOL before the match in Ukraine.  In the first half Boyd missed two good chances, the first came after a good run and cross by Naysmith.  The second came after Ferguson found O\'Connor, who laid it off for Boyd.  Austria also had a good chance with a Linz header, but it failed to trouble debutant Allan McGregor.  In the second half, Gordon replaced McGregor and was immediately called into action with a save from Haas.  On the hour mark, O\'Connor repaid McLeish\'s faith and put Scotland ahead.  Hartley hit a high ball to Boyd, who knocked the ball into O\'Connor\'s path.  He turned Samuel before he drilled a low shot past Payer in the Austrian goal.  At the end, Katzer hit the bar with a header from a corner, but Scotland ran out worthy winners. </p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('670', '<p>Scotland travelled to the dreaded hill in the Faroes which was the location of the Svangaskard Stadion, where Scotland had drawn in their previous two visits to the Faroes.  In the early stages of the game Scotland had chances to take the lead.  The first was when ex-Partick keeper Mikkelsen, palmed away a Maloney free kick.  Following that O\'Connor had a strong shot tipped onto the post.  On the half hour mark, Scotland took the lead when Maloney curled a free kick over the wall and into the keeper\'s right hand corner.  Mikkelsen was left rooted to the spot.  Five minutes later Hartley knocked the ball to Fletcher in the box, who crossed to O\'Connor.  O\'Connor\'s header was parried by Mikkelsen, and O\'Connor scored a tap-in at the second attempt.  In the second half the Faroes piled on the pressure, and were unlucky not to score when a Jacobsen header came off the post and into Gordon\'s arms.  Flotum was also through one-on-one with Gordon, only to hit the bar with two minutes remaining.  Scotland recorded a 2-0 victory to end their hoodoo in the Faroes.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('671', '<p>The first game of the season saw South Africa visiting Pittodrie.  In the first half Scotland failed to create any good chances.  After half an hour, South Africa came close when a cross by Carnell was headed over by Nomvethe.  Scotland\'s only chance of the first half was when McFadden fired a free kick over the bar.  With 22 minutes remaining, McLeish made a double change up front bringing on Boyd and Beattie for Miller and O\'Connor.  Three minutes later one of the substitutions paid off when Fletcher played a great ball over the top to Boyd, who timed his run well before he hit a half-volley into the keeper\'s left hand side of the net, to give Scotland the lead.  With ten minutes remaining Robson clears a header off the line to keep Scotland ahead, and ultimately give Scotland a 1-0 victory.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('672', '<p>In the first qualifier of the season Scotland welcomed a Lithuania side with six Hearts players in their squad.  McLeish played a 4-4-2 with Boyd and O\'Connor up front.  Scotland\'s first good opportunity came after 19 minutes when a corner by Fletcher was headed by O\'Connor and directed on target by Boyd, for their keeper to touch it onto the bar.  McCulloch headed the rebound but the keeper made a second save.  Scotland made the breakthrough just after the half hour, when O\'Connor was fouled on the right wing. Fletcher took a quick free kick, which was floated into the box for Boyd to score a diving header.  The free kick was taken so quick that McLeish missed the goal.  The Lithuanians had spent the whole game diving and trying to con the referee, and just after the hour mark it paid off when Hearts\' player Mikoliunas had a blatant dive in the penalty area and the referee gave them a penalty kick.  Danilevicius scored the resulting penalty kick.  With 20 minutes remaining a great header by McManus almost put Scotland ahead, but for a fine save by Karcemarskas. In the 77th minute a corner by Fletcher was passed to substitute Maloney, and with his first touch of the ball he floated in a cross to the back post that was half-volleyed in by McManus with his knee. Six minutes later McFadden killed the tie, when he collected the ball out on the right wing and took it past two defenders and unleashed a great shot from the edge of the penalty area that went into the top corner, to give Scotland a deserved 3-1 win.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('673', '<p>At the time of the France - Scotland match, the Rugby World cup was being played in the 80,000 capacity Stade de France.  For this reason, the match was moved to France\'s old national stadium, the Parc des Princes which only holds 49,000.  This was a benefit to Scotland who brought a large travelling support that was outsinging the French.</p>\r\n<p>Scotland made a promising start, preventing the French from making any impact even although they had most of the possession.  Midway through the first half there was a blow to Scotland, as Fletcher was taken off injured and replaced by Pearson.  At the start of the second half, the French had two good chances.  A great passing move ended with Ribery having a shot parried by Gordon, and Ribery shot the rebound over the bar.  A minute later Gordon tipped a shot by Anelka over the bar.  Just after the hour mark, the amazing happened and Scotland scored.  It was route one football; a goal kick by Gordon was superbly brought down by McFadden midway inside the French half, before he turned and unleashed a great shot into the top corner.  Landreau got a hand to the ball but couldn\'t keep out.  It sent the whole of Scotland into a state of euphoria.  For the remainder of the game France piled on the pressure, but they couldn\'t find a way through the Scotland rearguard.  Scotland held on to record arguably the greatest result in their history.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('674', '<p>Scotland were full of confidence going into the Ukraine game after defeating the French in Paris.  Ukraine needed three points to keep alive their hopes of qualification.  In the third minute, Scott Brown was fouled on the right wing; and the resulting free-kick by McFadden was headed home by Kenny Miller at the near post, to give Scotland a great start.  Seven minutes later Scotland won a free-kick in a central position.  Ferguson passed to McCulloch  just inside the box on the left hand side, and he curled the ball into the far corner to give Scotland a 2-0 lead after only 10 minutes.  In the 24th minute, a cross was put into the Scotland box, and slack defending let Shevchenko drill the ball into the roof of the net from close range.  Three penalty claims then followed.  The first one was when Hutton was fouled in the box.  Following this, Shevchenko was brought down by Naysmith. And just before half time, McFadden was also brought down by Tymoschuk.  The referee dismissed all three claims.  The match was decided on the 68th minute when Hutton played a great pass for McFadden to bring down on the edge of the box and drill a low shot in at the keeper\'s right hand post to give Scotland a 3-1 victory and kill off Ukraine.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('675', '<p>Scotland went into the Georgia game missing four players due to injury and suspension.  They were still confident though, as they knew that victory would mean a draw against Italy would be enough to qualify.  Scotland played the match in their new claret third strip.  Scotland made a poor start and after 16 minutes Mchedlidze headed in a corner from Menteshashvili to give Georgia the lead.  After 34 minutes, Scotland were denied a certain penalty when ex Ger Khizanishvili fouled McFadden, but all penalty claims were waved away by the referee.  The game was finished after 64 minutes when a low cross was put in by Kvirkvelia for Siradze to tap home and make the score 2-0.  It ended Scotlands run of six wins in a row.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('676', '<p>Following the defeat to Georgia, Scotland had to beat Italy at Hampden in their final game to qualify. A draw would mean that Scotland would need the Ukraine to defeat France in Kiev. The Italy game was built-up to be possibly the biggest match in Scotland\'s history, with most of the Scotland fans positive that Scotland would get at least a draw. The weather was torrential rain, which probably suited Scotland more than Italy.</p>\r\n<p>The match did not get off to a good start as Italy took the lead after only 70 seconds.  An Italian throw in on the left near the touchline went to Di Natale, who passed the ball into the middle for Luca Toni to stab the ball home. Fifteen minutes later a shot by McCulloch played Zambrotta\'s arm in the penalty area, but the referee waved play on.  In first half injury time, a David Weir header was headed off the line by Pirlo.  In the 65th minute, a free kick on the edge of the penalty area by McFadden, took a deflection off a defender and fell to McCulloch, whose shot was parried by Buffon.  Barry Ferguson prodded home the rebound to give Scotland a deserved equaliser. Scotland were looking for a winner and with ten minutes remaining, McFadden played the one-two with Miller and missed an open goal at the back post, which he was stretching to get.  It looked like it was going to finish 1-1 when in injury-time Hutton was barged off the ball near the corner flag, and bizarrely the referee gave the free-kick Italy\'s way.  From the resulting free-kick the ball was crossed into the box for Panucci to chest the ball over Gordon and into the net to give Italy an undeserving 2-1 win, and end Scotland\'s qualification hopes.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('677', '<p>Controversy preceded George Burley\'s first match as Scotland manager, as four out of five of the Rangers players pulled out of the squad leaving Boyd the only Ger in the squad.  McFadden also had to withdraw as he had undergone surgery on an ankle injury at Birmingham City.  Burley picked a 4-5-1 formation with Kenny Miller the sole striker.  Celtic captain Stephen McManus was given the captain\'s armband in the absence of Barry Ferguson.</p>\r\n<p>On a night of torrential rain, the game did not start well for Scotland, as only 10 minutes had passed when Croatia took the lead.  Niko Kranjcar collected the ball on the edge of the Scotland penalty area, turned and unleashed a powerful shot that deceived Gordon.  On the half hour mark Steven Fletcher played a long pass from inside the Scotland half down the left wing, and a slip from Robert Kovac let Kenny Miller through on goal.  A shot from a tight angle was deflected past Pletikosa in the Croatia goal to give Scotland an equaliser.  In the second half a Kenny Miller header from a Shaun Maloney corner was headed off the line.  Following this, a long rang shot from Kranjcar was parried by Gordon, and Gary Caldwell made an excellent point blank tackle to prevent Croatia from scoring a second.  At the other end substitute Kris Boyd had a shot well saved by Pletikosa, meaning that the game would finish 1-1. </p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('678', '<p>A depleted Scotland team travelled to Prague for an end of season friendly.  Many players had pulled out of the squad after they had a long and tiring season, especially Rangers players.  This let Burley select many uncapped players and give five players their debuts.</p>\r\n\r\n<p>Debutant James Morrison, who looked impressive, had a couple of chances early in the second half, but Petr Cech prevented him from scoring on his debut.  On the hour mark, ex-Ranger Libor Sionko burst through the defence and slotted it past Gordon to give the Czechs the lead.  With six minutes remaining substitute Kadlec cut in from the left and unleashed an unstoppable shot past Gordon to double the Czech\'s lead.  A minute later Naysmith crossed a ball in from the left, and debutant David Clarkson brought the ball down with his right foot, before he turned and drilled a low shot past Cech.  It was a Bergkamp-esque goal which gave Scotland a boost to try and get something from the game.  In the final minute, with Scotland pushing forward they were left bare at the back and Sionko beat Dailly before he buried it past Gordon to give the Czechs a flattering 3-1 win.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('679', '<p>Before the first international of the new season, both Scotland and Northern Ireland suffered many call offs.  Scotland were able to replace these players while Northern Ireland couldn\'t.  The Scotland squad included Rangers\' Kevin Thomson and Steven Whittaker, Falkirks Darren Barr, plus Derby County\'s Kris Commons, who qualified through his grandparents.  All were looking for their first cap.</p>\r\n\r\n<p>In the first half, there was not much action.  James McFadden came closest with two half chances.  In the second half Scotland continued to dominate the possession, and things were not helped for Northern Ireland when McGivern was sent off for a second booking after 56 minutes.  Not long after, it was the ten men who had the best chance of the game, when Scotland\'s substitute keeper Allan McGregor brought down Warren Feeney in the box.  McGregor was lucky only to receive a yellow card.  He then made amends, by diving to his right to save a David Healy penalty.  Near the end McFadden almost snatched the winner, when a Robson corner was nodded on by Barr to McFadden who unleashed a powerful shot only to be denied by Taylor in the opposition goal.  It was a game of two keepers.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('680', '<p>Before Burley\'s first competitive match, he created some controversy by deciding not to travel to Macedonia until 24 hours before before the match.  Many people thought that they should have travelled earlier to acclimatise themselves with the warmer climate.</p>\r\n<p>Scotland made a poor start to the match and after only 5 minutes, Macedonia took the lead.  They were awarded a debatable free kick on the edge of the box, which was touched onto the post by Gordon.  Naumoski was the first to react and put the ball into the back of the net.  Scotland\'s best chance in the first half came from McFadden, who had his shot blocked after he went on a solo run.  In the second half, Scotland continued to have most of the play, but had no finish. At the other end, Craig Gordon pulled off two great saves to keep Scotland in the game.  Scotland then came close after a great run and cross by Naysmith was missed by Fletcher in the box.  Controversy followed as Scotland were denied a stone-wall penalty when Miller and McFadden were both fouled in the box.  A late drive from substitute Maloney caused their keeper to make a save.  It was not enough though, and Scotland made a poor start to the qualifying campaign.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('681', '<p>Pressure was mounting on Burley going into the Iceland game, nothing more than a win would be good enough.  He started with an attacking 4-3-3 formation, with Commons and Maloney supporting McFadden.  Rangers\' Kirk Broadfoot made his international debut.  The game started with Iceland having a few good chances but poor finishing and a good save from Gordon kept it goalless.  As Scotland began to control the possession, they took the lead after 18 minutes.  Robson curled in a corner from the right, for Broadfoot to run in and score a low header.  Scotland had alot of possession down the left wing through Maloney, but Scotland failed to add to their lead.  After almost an hour, McFadden was brought down in the penalty area, and the ref pointed to the spot.  Up stepped McFadden, and a poor penalty was palmed away by the Icelandic keeper, only for both McFadden and Robson to follow in the rebound and put Scotland 2-0 ahead.  It appeared to be McFadden who got the final touch, but it is disputed.  Scotland were cruising at this point and looked to be heading for a comfortable victory.  That all changed in the 77th minute, when a deliberate handball by McManus resulted in a penalty for Iceland, and a red card for the captain.  Gudjohnsen sent Gordon the wrong way to give Iceland a lifeline.  The remaining 13 minutes was backs to the wall football with 10 men behind the ball.  Scotland held on though to give George Burley his first victory.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('682', '<p>The home match against Norway was billed as a must win match for Scotland, if they were to have a chance of qualification.  Scotland were still missing captain Barry Ferguson and Alan Hutton.  Added to that list was suspended Stephen McManus and injured Kenny Miller.</p>\r\n\r\n<p>Scotland started the match the stronger team, but they were weak in the final third.  Norway on the other hand were dangerous on the break.  Most of Scotland\'s attacks came through Maloney who looked a class above the rest.  In the second half Burley substituted McFadden to be replaced by debutant Chris Iwelumo.  Iwelumo made his mark on the game a few minutes later when a Naysmith cross found him free in the box.  With an open goal gaping he side footed the ball past the post when it was easier to score.  It was an absolutely shocking miss.  With a few minutes left, Scotland survived a scare when a Carew shot went just over the bar.  At the other end Maloney also had a shot go just over.  Right at the death, a great low ball in from the right by Broadfoot was missed by both Steven Fletcher and Iwelumo by a matter of centimeters.  It summed up the game, which was a dissapointing performance and put more pressure on Burley.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('683', '<p>The run-up to the glamour friendly between Scotland and Argentina was not about some of the world\'s greatest playing at Hampden, but about the appointment of Diego Maradona as Argentina\'s new manager.  Furthermore there was controversy as Scotland\'s assistant, former England captain Terry Butcher spoke out about his anger of the infamous \"Hand of God\" back in 1986.</p>\r\n\r\n<p>Argentina made a lively start and a powerful volley from Mascherano was well saved by McGregor. It was only eight minutes on the clock when the Argentines took the lead.  A great passing move was finished by Maxi Rodriguez latching on to a one-two in the box and slotting the ball past McGregor.  James McFadden had two chances before half time but to no avail.  Firstly he latched on to a Commons cross, but his shot on the turn was deflected over.  Just before half time Scotland\'s best chance of the game came when a defensive mix-up led to McFadden gaining possession in the box, but his shot was saved.  In between both chances a Stephen McManus header was blocked by Gabriel Heinze.  McFadden came close early in the second half but keeper Carrizo prevented him from scoring.  Lee Miller was close to scoring when he latched on to a Shaun Maloney corner, but his header went past the post. For most of the game Argentina held on to possession preventing Scotland from getting an equaliser, as they played out the game for a 1-0 win.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('684', '<p>In the run up to the clash in Amsterdam, George Burley had a squad crisis.  Firstly McFadden, Robson, and O\'Connor did not make the squad through injury.  Hartley, Broadfoot, Weir and Commons all withdrew, and McManus was not deemed fit to play in the Dutch clash.  McGregor was given the goalkeeper\'s gloves as Gordon was not getting a game at Sunderland.</p>\r\n\r\n<p>The first big chance of the game fell to Scotland, when Darren Fletcher played a great through ball to Miller, who beat the offside trap and was through on goal.  A great tackle from Mathijsen prevented Scotland from taking the lead.  A great piece of skill by Arjen Robben resulted in McGregor making a great low save with his legs; before the Dutch went ahead on 30 minutes. Van Bommel crossed to the back post for an unmarked Huntelaar to head past McGregor.  Things got worse in first half injury time, when a Robben corner was headed in by Van Persie, who had lost his marker.  With quarter of an hour remaining, McCormack floated in a corner for Caldwell to head in a powerful header.  The referee bizarrely disallowed the goal for no apparent reason.  Just to rub salt into the wounds, a few minutes later Berra brought down Huntelaar in the box.  From the resulting penalty, Kuyt sent McGregor the wrong way to seal a 3-0 victory for the Dutch.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('685', '<p>The big news that broke on the day of the Iceland match was that both Barry Ferguson and Allan McGregor were being dropped.  This was because they stayed out late drinking after the Holland match.  The positive news was that Stephen McManus was fit enough to play, and he was given the captain\'s armband.  Craig Gordon was also recalled.</p>\r\n\r\n<p>Early in the game, Scotland had the lion\'s share of the possession but had no great chances to take the lead.  After 39 minutes Scotland took a deserved lead.  Alan Hutton went on a run down the right wing, before he put in a low ball across the penalty area, which was dummied by Steven Fletcher.  Ross  McCormack collected the ball and hit a high shot past the keeper.  Nine minutes into the second half, the visitors silenced the Hampden crowd when they equalised.  Palmason beat McManus in defence, before unleashing a powerful shot that rebounded off Gordon\'s right hand post.  Sigurdsson was on hand to volley the rebound past Gordon to level the scores.  Eleven minutes later Scotland regained their lead.  A corner from McCormack was headed back into the penalty area by McManus, to be met by the head of Steven Fletcher to power home a header for his first international goal.  Scotland had a couple of scares late on.  Firstly Gary Naysmith had to make a clearing header off the line, and then in the final minute Craig Gordon made a double save from Jonsson and Hreidarsson before Palmason hit the loose ball over the bar.  Scotland held on though to gain a vital three points and give George Burley only his second win.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('686', '<p>Before the vital World Cup qualifier there was anger that such an important match should be played before the football season had started, whereas in Norway they were halfway through the season.  There were also major injury problems for Scotland including goalkeeper.  Gordon was injured and McGregor\'s exile led to David Marshall going in goals for the first time in five years.  Outfield, Stephen Caldwell gained his first cap in 3 years, while Callum Davidson gained his first in 7 years.  Another decision that baffled many was why Burley did not start with McFadden.</p>\r\n<p>Scotland made a bright start and the first chance of the match fell to Miller who had a close range shot blocked.  Everything went pear-shaped after half an hour when Gary Caldwell gained two quick bookings to reduce Scotland to 10 men.  From the resultant free-kick, a Riise shot was delected past Marshall by Brown to give Norway the lead.  On the stroke of half time Norway doubled their lead when a good passing move was finished with Pedersen hitting a low shot past Marshall.  On the hour mark a Carew shot came off both posts for Huseklepp to score the rebound.  A few minutes later a Carew shot appeared to cross the line but the linesman said otherwise.  Norway got their fourth in injury time when Pedersen curled a freekick round the wall to beat a flat-footed Marshall.  It was a miserable night for Scotland that all but ended their hopes of qualification for the play-offs.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('687', '<p>For the important double header against Macedonia and Holland, 39 year old David Weir was called up as Gary Caldwell was suspended.  Gordon was back from injury and Garry O\'Connor was called up for the first time in Burley\'s reign.  Prior to the match the SFA stated that Burley\'s position would be under review after the qualification campaign.</p>\r\n<p>The first half was a poor affair for Scotland with Craig Gordon being their saviour on more than one occasion.  At the end of the first half there was controversy, as at a drop ball Scott Brown kicked the ball off the opposing player to win a corner.  This infuriated the Macedonians and caused the match to heat up.  In the second half, Scotland came out a totally changed team.  First McFadden then Miller missed great chances before the deadlock was broken on the 56th minute.  Steven Fletcher floated a ball into the box from the left, for Scott Brown to score a diving header into the far corner.  Both Steven Whittaker and Kenny Miller had chances to double the lead before James McFadden did just that 10 minutes from time.  He collected the ball inside his own half ran past an opponent, beat both central defenders, before he rounded the keeper and slid the ball into the net.  It was a great way to cap off a fine display.  To make things better Norway and Iceland had drawn, leaving Scotland in pole position for second place.  The only bad point was that McFadden would miss the Holland match after picking up a yellow card.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('688', '<p>In the build up to the final group match, Gordon was withdrawn due to injury meaning Marshall would be in goals.  Davidson, Alexander and Steven Fletcher were also injured.</p>\r\n<p>The Dutch made a positive start with Kuyt hitting the post after 3 minutes.  Scotland came back though and five minutes later a Hutton cross was narrowly hit past the post by Brown.  Marshall then made saves from Sneijder and Van Persie.  Scotland hit back, and a shot by Miller hit the bar after 30 minutes. Less than 10 minutes later Naismith hit the post before Vorm recovered to make a point blank save from Miller.  At the start of the second half Kuyt headed over from close range and Marshall saved from Robben.  With 20 minutes remaining Miller went close when his shot spun off the keeper\'s hands to go just wide.  Ten minutes later the Dutch broke the deadlock.  A clearance from inside the Dutch half caught David Weir flat-footed and his header fell into the path of Elia who rounded Marshall and beat Hutton on the line to score.  With five minutes remaining Garry O\'Connor tried to lob Vorm, but his attempt went just wide for the match to finish 1-0 and end Scotland\'s qualification hopes.  To make things worse, Norway had defeated Macedonia, meaning that they would leapfrog Scotland into second place.  If only Scotland had played this way in their previous matches.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('689', '<p>The build up to the friendly against Japan was eventful.  When the squad was first named players such as McFadden, Miller, Weir and Alexander were rested.  In the next week 10 players withdrew from the squad including Darren Fletcher, Hutton, Brown, Maloney, Naismith and O\'Connor.  This left Burley with a very depleted squad full of fringe players that he could experiment with.</p>\r\n<p>Scotland started with 4 debutants, and a further 3 came off the bench.  The first half had litte action but the inexperienced Scotland team held their own.  In the second half Japan upped the pressure.  They came close when Gordon palmed away a free kick by Honda and Uchida put the rebound past the post from a tight angle.  Scotland\'s best chance of the match came with 20 minutes remaining.  Debutant Don Cowie played the ball through to Steven Fletcher who rounded the keeper only for him to stick a foot out and tackle him.\r\nCalamity struck with 8 minutes remaining.  Komano played a great ball into the box, only for Berra to stick out his foot and divert it past Gordon for an own goal.  In the final minute McManus blocked a Komano shot and the rebound fell to Honda who placed the ball past Gordon to seal a 2-0 win.  The result was unfair to many inexperienced players who played well, and are hoping to challenge for a regular place for Scotland.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('690', '<p>The build up to the friendly in Cardiff had the usual calloffs, notably Craig Gordon who suffered a fractured arm while playing for Sunderland.  Many of the players who missed the Japan game were back, including McFadden, Miller, and Hutton.</p>\r\n<p>Scotland made a bright start, taking the game to Wales.  Inside the first five minutes a low cross by debutant Danny Fox was met by McFadden and the Welsh keeper made a point blank save.  Scotland continued to press, but were met by a succerpunch in the 16th minute when an Aaron Ramsay cross was met by David Edwards to score a great volley.  15 minutes later Wales doubled their lead when a Ledley cutback was finished by Church.  Scotland then fell apart as it only took Wales three minutes to get their third.  Aaron Ramsey strolled through the non-existent Scotland defence to knock the ball past Marshall even as Fletcher was trying to pull him to the ground.  Things could have been even worse two minutes later as Ched Evans was bundled to the ground by Dorrans.  The referee waved play on even although it was a blatant penalty.  In the second half Wales continued to dominate, but as Evans ran through on goal Marshall came running out of the box and handled the ball.  Everyone was then shocked as he only got a yellow card.  In the last 10 minutes Scotland got two great chances to add some respectability to the scoreline.  Firstly Barry Robson had a shot saved by Hennessey, then Kevin Kyle had a great header tipped over the bar.  With a couple of minutes left on the clock, referee Cyrill Zimmermann made it a hat-trick of shocking decisions in Scotland\'s favour, when Hutton made no attempt to get the ball and tackled David Cotterill from behind.  He didn\'t even get a booked.  At the end of the match Scotland were booed off the pitch after probably their most shocking performance in recent years.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('691', '<p>When Craig Levein named his first Scotland squad, the big news was that exiled players Kris Boyd and Lee McCulloch had been included.  Allan McGregor was due to be named in the squad but an injury sustained during an incident in Glasgow ruled him out.</p><p>The Czechs started the brighter side having numerous chances but failed to trouble Gordon. Midway through the first half Gordon prevented Sverkos after a mistake by Fletcher.  Following this Dorrans made a goalline clearence.  Just on half time Robson curled a free kick round the wall for the Czech keeper to touch it past the post.  Early in the second half Gordon touched a Sverkos shot over the bar.  After an hour the tide turned.  Wallace sent a cross in from the left that was headed down by Robson at the back post for Scott Brown to drive home and put Scotland ahead.  Following the goal, Kris Boyd\'s international excile was ended and he came on to a welcome reception.  Scotland were now on top as Boyd put the ball in the net but was flagged offside.  Right at the end, Drobny made a great save to deny Steven Whittaker his first international goal.  But one goal was enough to give Levein a winning start and give Scotland their first victory in a friendly at Hampden since 1996.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('692', '<p>Scotland suffered many withdrawls prior to the Sweden match. Keeper David Marshall had an elbow injury, Lee McCulloch had a viral infection, Andy Webster injured his hamstring, Alan Hutton his groin and Graham Dorrans also withdrew.  They added to Craig Gordon and Gary Caldwell who were already injured. Gordon broke his arm in pre-season training and Caldwell had a long term inury. </p><p>The match couldn\'t have got off to a worse start as after only 3 minutes Sweden went ahead.  A great passing move down the left ended with Wermbloom passing to Ibrahimovic who was right in front of goal to pass the ball into the net. McGregor then made two saves to prevent Sweden going further ahead.  Scotland\'s first chance came after half an hour when the keeper fumbled a McFadden cross that fell to Adam but the keeper recovered to save his shot.  Sweden doubled their lead just before half time. Bajrami got in behind the defence and scored the rebound shot after McGregor had saved his first.  In the second half Mellberg hit the bar before Toivonen made it three, heading in an Ibrahimovic cross.  Midway through the second half, substitute Kris Boyd forced a save from Isaksson, but it was all that Scotland could do in a poor performance.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('693', '<p>Veterans David Weir and Paul Hartley were recalled to the Scotland squad along with Lee McCulloch for the double header against Lithuania and Liechtenstein.  One surprise was that Levein dropped McFadden from the starting lineup and had Miller up front alone.  Lithuania almost took the lead after 18 minutes when the ref allowed play to go on after Weir was fouled.  The ball fell for Mikoliunas who had his shot saved by McGregor.  Barry Robson then had a long range shot parried by the keeper.  Fletcher latched on to the rebound and passed to Naismith who went down in the penalty area.  His pleas for a penalty were waved away by the ref. 10 minutes before half time, Fletcher floated a free kick into the penalty area for McManus to volley it just past the post.  Just into the second half, a great passing move by Scotland was finished by Hutton crossing into the penalty area for Kenny Miller to head straight at the keeper.  On the 58th minute, Fletcher found Hutton with a great crossfield pass.  He in turn picked out Naismith in the middle, but his shot was straight at the keeper. With 10 minutes remaining Miller headed a Whittaker cross high over the bar for the match to end goalless.  It was a promising performance by Scotland and also their first clean sheet on the road in 10 games, since the victory in Paris.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('694', '<p>Scotland went into the Liechtenstein match knowing that anything less than a win would be a humiliation.  Levein started with 3 up front as McFadden and Boyd joined Miller. Scotland\'s first chance came after 14 minutes when McCulloch headed a McFadden cross over the bar.  A poor first half followed and McFadden was substituted at half time.  Things got worse when Liechtenstein shockingly took the lead.  Striker Frick controlled a cross ball in the penalty area before he curled the ball round both McManus and McGregor in goal.  The turning point for Scotland was when Barry Robson made his appearance and started to control the midfield.  Captain Darren Fletcher had a shot tipped over the bar before Scotland drew level just after the hour mark.  A Robson cross from the left was headed into the path of Kenny Miller who shot in off the bar to level the scores.  With 15 minutes remaining Scotland had a penalty claim rejected and the referee also let a disgraceful tackle on Hutton go unpunished.  It looked like this was going to be a humiliating result for Scotland, but due to timewasting the referee gave seven minutes of injury time.  With 30 seconds left of the seven minutes, a corner from Robson was floated into the box for Stephen McManus to leap above everyone else and power a header into the net. This sent Hampden into sheer delirium and relief.  The whistle was blown as soon as Liechtenstein kicked off.  Memories of Richard Gough and Cyprus came flooding back.  Scotland had very luckily avoided an embarrassing draw that would have ended their qualification hopes.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('695', '<p>The build up to the Czech Republic and Spain double header focused solely on team choice.  Firstly McFadden suffered an injury in training for Birmingham City.  Next Craig Levein made it known that he would not pick an out of form Kris Boyd.  It was then reported by The Sun two days prior to the match in Prague, that in form striker Kenny Miller would be dropped from the starting lineup and replaced by debutant Jamie Mackie from QPR.  More controversy followed before the match when Levein lined up with a 4-6-0 formation with no strikers.</p><p>The best chance of the first half fell to Thomas Rosicky who ran into the box before shooting wide.  Scotland\'s best chance of the half came on the half hour mark when Hutton made a run down the right before crossing into the middle. Suchy made a mess of his clearance and only the face of an unsuspecting Petr Cech prevented Scotland from taking the lead.  McGregor then made a low save to prevent Hubnik followed by another to prevent Necid.  In the second half McGregor had to push a Kadlec header over ther bar.  Midway through the second half McGregor made an astonishing save that Gordon Banks would have been proud of.  A cross into the box by Rosicky was med by the head of Polak and McGregor dived low to his right to claw the ball out of the net.  A few minutes later a corner from Rosicky was headed on by Bednar for Hubnik to sneak in and head past McGregor to give the Czechs the lead.  Levein then brought on Miller and Iwelumo and switched to a 4-4-2 but it was too late as the Czechs gained their first victory of the campaign.  Following the match Levein was slated for his tactics and formation that he played against a team that Scotland could have beaten.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('696', '<p>Following the game in Prague, Craig Levein received alot of criticism for his 4-6-0 formation.  Therefore he started with a 4-5-1 formation, recalling Kenny Miller.  Spain started with 9 of the 11 players who started in the World Cup final.</p><p>Spain started on the attack with David Villa shooting over the bar. Following this David Silva finished an intricate move that McGregor saved.  Just before the half hour Scotland had their first real chance when Dorrans passed to Fletcher who crossed for Morrison who had his shot blocked.  At the other end Villa turned in the box and shot only for McGregor to make a great save. Kenny Miller was then sent running down the wing and Dorrans was waiting in the middle but Miller\'s pass was blocked. Just before half time Ramos attempted to cross the ball into the middle but it was blocked by Whittaker\'s raised arm.  The referee awarded a penalty and McGregor got a hand to Villa\'s penalty but couldn\'t keep it out. In the second half McGregor made another save from Silva before Iniesta doubled Spain\'s lead.  A shot was blocked before the loose ball fell to Iniesta who side footed the ball past McGregor.  Three minutes later Kenny Miller collected the ball on the right wing before he crossed into the middle for Naismith to beat the offside trap and score a diving header past Casillas. Eight minuteslater, what seemed impossible happened as Scotland came from 2-0 down to level at 2-2.  Fletcher and Morrison played the one-two on the right, before Morrison crossed it in to the middle only for Pique to stick out a foot and direct it past his own keeper.  With eleven minutes remaining, McManus misjudged a cross from the left that fell to substitute Llorente who side footed it past McGregor to give Spain a 3-2 lead. With a minute remaining, Whittaker made a rash challenge only to receive a second booking and be sent off.  It was a disappointing end to the match, but Scotland could go away with their heads held high as they were eleven minutes away from holding the World and European champions.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('697', '<p>Before the friendly against the Faroes, Craig Levein had nine withdrawls from the squad. Christophe Berra, Chris Burke, Gary Caldwell, Graham Dorrans, Matt Gilks, Alan Hutton, James Morrison, Steven Naismith and Steven Whittaker pulled out. This meant that there were callups for Dundee Utd\'s David Goodwillie, Aston Villa\'s Barry Bannan, and Liverpool\'s Danny Wilson.</p>\r\n<p>The Faroes gave Scotland a scare after 8 minutes when a free kick 35 yards out struck the bar. A few minutes later, Maloney found Commons at the back post, but he headed across the goal and just wide. On 24 minutes Fletcher forced a corner and from the resulting corner by Adam debutant Danny Wilson beat his marker to side foot past the keeper. Seven minutes later, Adam put a low cross into the middle for Commons to poke the ball past the keeper and double Scotland\'s lead. A couple of minutes later debutant Barry Bannan fired in a shot from 25 yards out that cracked off the post. Just before half time Bannan floated a ball in from the right and Wilson headed the ball back across goal for Jamie Mackie to get his first international goal and give Scotland a 3-0 lead at half time.Just into the second half a thunderous shot by Steven Crainey 25 yards out was excellently saved by Gunnar Nielsen. Ten minutes later Bannan heads a Commons cross just over the bar. Midway through the second half, Maloney spurns a great chance when he picks up a poor backpass and chips the ball just past the post.The match ended 3-0 and along with it being a confidence booster, it showed that there is some promise for Scotland in the future.</p>', '1', null, '2017-10-09 21:37:37', null);
INSERT INTO `matchsummary` VALUES ('698', '<p>Craig Levein called up some inexperienced players for the first Nations Cup match against Northern Ireland. Blackburn\'s Grant Hanley and Aberdeen\'s Chris Maguire were included along with Leeds Utd\'s Robert Snodgrass. Experienced players like captain Darren Fletcher withdrew due to injury, along with Craig Gordon, Graham Dorrans and Lee McCulloch. This meant that Kenny Miller, who was the only player with 20+ caps, captained Scotland.</p>\r\n<p>The first good chance of the match fell to Scotland when Commons made a good run down the left and crossed in the middle only for Kenny Miller to shoot over the bar. Five minutes later Scotland took the lead. A corner from Adam was headed on by Bardsley to bounce off two defenders, and the loose ball was slotted home by Miller who was only a yard off the line. Stephen Caldwell had a header clip the bar and Commons had a goalbound shot blocked by McAuley before Scotland doubled their lead. Hutton on the right hand side passed to McArthur on the edge of the box. He played a high ball to the back post that fortunately lobbed the keeper and went in the top corner to make it 2-0. Bardsley then had a shot from the edge of the box that was tipped over the bar by the keeper Tuffey. Six minutes into the second half, a great passing move by Scotland was finished by Morrison passing to Naismith on the edge of the box, who played a quick ball into the path of Commons who slotted the ball through the legs of Tuffey to make it 3-0. Substitute Bannan had a free-kick touched over the bar by Tuffey, and debutant Snodgrass shot just wide of the right hand post. With eight minutes remaining Northern Ireland had their only clear chance of the match when a cross by Norwood was headed straight at McGregor by Patterson. It was another fine display by a Scotland team that is gaining confidence after the performances against Spain, Faroe Islands and now Northern Ireland.</p>', '1', null, '2017-10-09 21:35:42', null);
INSERT INTO `matchsummary` VALUES ('699', '<p>Twenty minutes into the match Scotland are sliced apart when Elano slips a ball to Jadson and his shot is spilled by McGregor but there are no Brazillians to get the loose ball. A minute later Leandro Damiao heads just over the bar from a corner.  Just before half time Neymar collected a low cross just inside the penalty area to curl a low shot past McGregor and give Brazil a half time lead.  Just seconds into the second half Neymar almost doubled his goal tally when he clipped the bar. With 15 minutes remaining Adam was judged to have fouled Neymar in the box, who clearly dived.  From the resulting penalty Neymar sent McGregor the wrong way to double Brazil\'s lead.  With less than ten minutes remaining, Gary Caldwell made two great interceptions to prevent Neymar from getting a hat-trick.  The game finished 2-0, but there was some controversy as after the game Neymar accused the Scotland fans of being racist.  The Tartan Army replied by saying it was for the relentless diving and play acting.  There was also a banana thrown onto the pitch, but a German tourist later owned up to that.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('702', '<p>The talking point before the friendly with Denmark was that controversial striker David Goodwillie was selected by Craig Levein.  Captain Darren Fletcher did not make the team as he was recovering from a virus. The first proper chance of the match fell to the Danes after 20 minutes when Eriksen layed off a ball to Rommedahl and his shot was saved by McGregor.  A minute later Scotland took the lead when substitute Don Cowie was fouled on the edge of the box.  The resulting free-kick was taken by Charlie Adam who fired the ball into the penalty area only for the ball to be deflected into his own net by Kvist. Ten minutes later Adam fouled Krohn-Dehli out on the left.  Eriksen then floated the ball into the middle over everyone, including McGregor who was caught off his line to level the scores at 1-1.  A few minutes before half time McGregor pulled off a great save from a low shot by Krohn-Dehli.  A minute later Scotland took the lead.  Cowie played a great ball to Miller who was out on the left wing.  Miller then put a great cross into the back post for Robert Snodgrass to dive in and head the ball past Danish keeper Sorensen to score his first international goal for Scotland in his third cap.  In the second half the Danes continue to press Scotland, and a long distance shot by Schone almost caught McGregor off guard as he parried the ball over the bar.  Just on the hour mark, substitute Craig Mackail-Smith almost scored his first goal for Scotland when a Danish back pass stuck in the mud.  Sorensen raced out and saved Mackail-Smith\'s shot.  McGregor made further saves from Krohn-Dehli and Schone before Barry Bannan had an excellent shot saved by Sorensen.  Scotland held on for the win, which was their first win over the Danes in six games since 1975, and also the first time they scored against them since then.  Something that made the victory more impressive was the fact that the Danes were ranked 40 places higher than Scotland in the FIFA Rankings.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('700', '<p>Scotland went into the Wales game with a poor record against the Welsh in recent years their last three games were 0-3, 0-4, and 0-1.  Scotland made the brighter start with chances for McCormack, Naismith, and Adam.  It was Wales who took the lead though nine minutes before half time. A long ball was played into the Scotland half and a poor back header from Crainey was picked up by Robert Earnshaw who nutmegged Scott Brown before he ran into the penalty area and lifted the ball over McGregor to give the Welsh a half time lead.  Ten minutes into the second half Scotland equalised.  Adam played a great ball through to James Morrison who curled the ball past the Welsh keeper into the bottom left hand corner.  Eight minutes later Scotland took a deserved lead when a great passing move was completed when James Morrison played a square ball into the box for Kenny Miller to slot the ball home.  Six minutes later Scotland  finished the tie when Christophe Berra headed Steven Whittaker\'s cross into the net at the back post to make it 3-1.  Wales had a late chance when Earnshaw fired the ball over.  Scotland put in an impressive second half performance to record their first win over Wales since 1984.  It also setup a Carling Cup decider against Republic of Ireland four days later.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('701', '<p>For the deciding Carling Cup match, Scotland made four changes with Grant Hanley replacing injured Gary Caldwell.  Barry Robson and Phil Bardsley also started along with debutant James Forrest.</p><p>Scotland made a bright start with Charlie Adam shooting just over Shay Given\'s goal and after 18 minutes Phil Bardsley hit a thunderbolt from long range that Shay Given tipped onto the bar. Five minutes later the Republic took the lead when Robbie Keane picked up the ball in his own half and ran towards the Scotland goal before he hit a low shot that went through McGregor\'s arms.  A couple of minutes later Kenny Miller came close to connecting with a Robson cross just six yards out. Just before half time Steven Naismith forced a save from Given but the Irish went into the break ahead.  Midway through the second half James Forrest made contact with a Barry Robson cross at the back post, but his volley was wide of the goal.  With 15 minutes remaining, Miller controlled the ball in the box before he was pulled down.  His penalty claims were waved away by the referee. A few minutes later Miller had a deft flick palmed away by Given.  With less than ten minutes remaining Miller had a great chance to level the tie when he was one on one with Given, but his shot went just wide of the post.  The match finished 1-0 to Ireland handing them the inaugral Carling Nations Cup.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('703', '<p>In the build up to the Czech Republic match, the only major team news was that captain Darren Fletcher was back in the squad, even although he hadn\'t featured for Man Utd this season.</p><p>The Czechs made a bright start to the match and after 5 minutes Baros had a great chance to put them ahead but he sliced the ball over the bar from just 8 yards. Midway through the first half Scotland were lucky not to concede a penalty as Charlie Adam had a late tackle on Baros in the box. A minute before half time, Scotland took the lead. Fletcher collected a loose ball in the midfield before he timed a great pass to Kenny Miller who hit a low show that the keeper failed to keep out.  In the second half, Baros had another great chance that went just wide of the post.  At the other end Miller should have doubled Scotland\'s lead when he made contact with Morrison\'s cross just a few yards out, but the ball went just wide.  With 12 minutes remaining disaster struck as the Czechs equalised.  A great passing move ended with Rezek sending a low cross into the box that deflected off Plasil\'s chest and went into the net.  Five minutes later Scotland regained their lead when Danny Wilson played a long pass down the wing and Czech defender Rajnoch slipped and allowed Kenny Miller to collect the ball and slide the ball across the penalty area for Fletcher to hit a low shot past the Czech keeper.  In injury time at the end, calamity struck when Rezek blatantly dived in the box and the Dutch referee pointed to the spot, to the disgust of 50,000 Scots.  Kadlec hit a great penalty that McGregor had no chance of saving to level the match at 2-2.  Scotland then went up to the other end and Berra went down in the box.  Contact was made but the referee rounds off a terrible performance by waving away the penalty and booking Berra.  The referee now made it very difficult for Scotland to qualify.  There is still a glimmer of hope though.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('704', '<p>Scotland went into the Lithuania match with a weakened team as Miller and Brown were both suspended and Hutton was not fit enough.  The big dilemma was who would play up front, and Levein chose David Goodwillie to win his second cap.</p><p>Scotland started the game well on top of Lithuania and after only 15 minutes a Bannan corner was headed on to Berra, but he scooped the ball over the bar. A couple of minutes later Don Cowie blazed a shot over the bar after some good build up play from Scotland. With only seven minutes left of the half, Fletcher went on a run on the left that ended in him checking in and unleashing a shot at the near post that was saved. A Bannan corner was then headed just over by Naismith.  A minute before half time a Bannan free kick was floated into the box only for it to be handled by the defender.  This time the referee pointed to the spot.  As both Miller and Adam were missing up stepped Fletcher, but he had a poor penalty saved by the keeper.  Five minutes into the second half Scotland took the lead.  Bannan played a great ball into the box for Naismith to time his run brilliantly and put the ball in off the post on the half volley.  With 15 minutes left on the clock Scotland should have had another penalty when Lithuania again handled the ball in the penalty area.  With the loose ball Naismith could have doubled his goal tally but he headed another Bannan cross over the bar.  A few minutes later Lithuania could have scored but a Danilevicius header went just wide.  Scotland then just played down the clock to record a vital 1-0 win which left Scotland with a small chance of qualifying.</p>', '1', null, null, null);
INSERT INTO `matchsummary` VALUES ('705', '<p>In the build up to the double header against Liechtenstein and Spain, the big talking point was whether Kenny Miller and Darren Fletcher would take part. Miller picked up a thigh injury playing for Cardiff while Fletcher was suffering from tonsilitis. Both travelled but Miller was ruled out while Fletcher was given the green light. The night before, Spain did a big favour for Scotland by defeating the Czechs 2-0 in Prague, meaning a victory for Scotland would put them in second place.</p>\r\n<p>After only five minutes, Scotland had a shout for a penalty when Mackail-Smith was pushed in the box, but the ref waved play on. Five minutes later Scotland came close when Naismith headed an Adam free-kick just past the post. McGregor was then called into action when he made a great save from a long range shot. In the next five minutes Scotland had three chances to take the lead, first a Naismith header from close range, followed by Naismith rounding the keeper but putting it wide, and then Bannan shot just past the post. Just after the half hour mark, all of Scotland\'s pressure payed off when they took the lead. Bardsley floated the ball into the box for Craig Mackail-Smith to head over the keeper, who was caught off his line, and into the net. In the second half, Bardsley came close when he headed just over the bar and Mackail-Smith had a low shot saved. With less than two minutes left on the clock, the Liechtenstein keeper pulled off a great save from a Naismith header to put it behind for a corner. From the resulting corner the keeper made another great save from a Berra downward header to keep the score at 1-0, which flattered Liechtenstein and kept Scotland\'s qualification hopes alive.</p>', '1', null, '2017-10-09 21:36:17', null);
INSERT INTO `matchsummary` VALUES ('706', '<p>Scotland went into their final qualifying match knowing that they had to at least match the Czech Republic\'s score away to Lithuania to qualify for the play-offs.&nbsp; Craig Levein named an unchanged team from the one that defeated Liechtenstein three days earlier.</p>\r\n<p>Things did not start well as after only five minutes Czech Republic had gone 1-0 up on Lithuania and just as that news filtered through, Spain took the lead. Jordi Alba crossed the ball in from the left to David Silva who put the ball through McGregor\'s legs from 10 yards.&nbsp; A few minutes later Scotland had the chance to level the scores when a Barry Bannan cross was headed wide by Naismith.&nbsp; McGregor had to save a deflected shot from Pedro, before Fletcher had a great chance at the other end that he put over the bar after a flick on by Naismith.&nbsp; Five minutes before the break McGregor pulled off a great save from a low shot by Cazorla.&nbsp; Spain\'s pressure paid off just before half time when Silva played a one-two with Pedro before hitting a low shot past McGregor to give Spain a 2-0 lead.&nbsp; Nine minutes into the second half Spain end the game when Villa gets on the end of a Silva pass to hit a low shot past McGregor and make it 3-0.&nbsp; Ten minutes later Craig Mackail-Smith gets fouled in the box by keeper Victor Valdes and the referee points to the penalty spot.&nbsp; Up steps substitute David Goodwillie to put the ball in the top corner of the net and make it 3-1.&nbsp; Five minutes later Scotland had a great chance but Goodwillie went for glory and shot over instead of passing to Mackail-Smith who just had to tap it into the net.&nbsp; With five minutes remaining Cazorla put the ball over the bar from close range after some poor defending from Scotland.&nbsp; The Ref then blew his whistle to end the match and end Scotland\'s qualifying campaign as Czech Republic had defeated Lithuania 4-1, and they would go into the play-offs.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('707', '<p>The talking points about the squad that Craig Levein were that Barry Bannan had been left out due to the fact that he had been arrested for drink driving. The other main point was that Jordan Rhodes had been included in the squad. He qualified to play due to the fact that he was educated in Scotland for more than 5 years.</p>\r\n<p>The first real chance of the match came after 20 minutes when McGregor touched a shot onto the crossbar. Five minutes later it was first blood to Scotland. Berra played a long pass to Miller from deep inside the Scotland half. Miller controlled the ball before hitting a looping ball over the keeper into the top corner. A few minutes later Cyprus come close to equalising when a rocketing shot comes back off McGregor\'s left hand post. Jamie Mackie then goes on an amazing run which ends in their keeper touching his shot over the bar. From the resulting corner, a Cypriot handled the ball in the box but the ref waved play on. Just before half time, James Morrison tries to chip the keeper, but his shot is tipped over. Ten minutes into the second half Mackie picks up the ball wide on the left before he weaves past the defenders and hits a low shot past the keeper to double Scotland\'s lead. Three minutes later Cyprus pull one back, when a low pass is played through the Scotland defence to Christofi on the right, who drilled a low shot past McGregor. With three minutes remaining, Rhodes came on for his debut, and had a shot saved. Scotland saw out the game to get a 2-1 victory to take back to Scotland.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('708', '<p>Slovenia started the match better and it took them just 3 minutes to threaten McGregor\'s goal but McGregor made a save with an outstretched foot. Midway through the first half a shot from James Morrison is palmed onto the bar by the keeper, and a couple of minutes later McGregor tips a curling free kick over the bar. Five minutes later Slovenia took the lead. Brecko crosses the ball in to the middle from the right for Kirm to head past McGregor whilst he was being challenged by Russell Martin. Their lead did not last for long as 7 minutes later Christophe Berra powers a header past their keeper from an Adam corner. A couple of minutes later Berra almost scores a carbon copy but his header goes over the bar. In the second half Radosavljevic has a shot straight at McGregor, and substitute Barry Bannan has a long range shot saved. With 15 minutes left, Mackie has a header shave the outside of the post, and 5 minutes later Slovenia have a shot go just past the post. The match finished 1-1 which was a fair reflection of a match that just fizzled out in the second half.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('715', '<p>In the build up to the qualifier in Zagreb, Scotland had 6 players drop out the squad. There was also some disrespectful remarks coming from the Croatian camp such as \"You will not cross the halfway line\" as stated by Igor Stimac, the Croatian manager. With Croatia being ranked 4th in the world to Scotland\'s 74th, some people may have agreed.</p>\r\n<p>In the early stages Scotland kept good possession of the ball and Croatia failed to trouble the Scotland defence. In the 26th minute the unthinkable happened and Scotland took the lead. Maloney picked up the ball inside the Croatian half and made a burst forward, before the ball takes a deflection off a defender to fall in front of Snodgrass, who stretches out to volley the ball into the back of the net. Just before half time the Scotland defence was opened up but a Srna shot was cleared off the line by Russell Martin, and Scotland went in at half time worthy leaders. Just before the hour mark, Bannan shot wide from the edge of the box. A few minutes later Croatia should have equalised when Olic crosses in from the left and Mandzukic slides in at the back post and slices the ball inches wide when it looked easier to score. Croatia pushed forward in the closing stages, but the Scotland defence was solid and held on for Scotland\'s greatest victory since France in Paris in 2007.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('713', '<p>Scotland went into Gordon Strachan\'s first competitive match knowing that they needed a victory to have any chance of qualification. Wales started the much better team and almost took the lead within the first minute. Minutes later Steven Fletcher went off injured to be replaced by Kenny Miller. McGregor then made a double save from Bellamy and Bale. Just before half time, against the run of play Scotland took the lead when a Mulgrew corner was headed in by Grant Hanley. Scotland started the second half much better and were unlucky not to double their lead when a Snodgrass shot came back off the post. Wales then had the ball in the net but the referee blew for a foul on McGregor. With 20 minutes remaining, Scotland\'s qualification hopes ended in a 3 minute spell. Firstly Snodgrass fouls Gunter in the penalty area to concede a penalty. Snodgrass recieved a second yellow and Aaron Ramsey stepped up to score from the penalty spot and make it 1-1. Things got even worse a minute later when straight from kick-off, Wales took the lead as Robson-Kanu headed in a King cross. In the last minute, Aaron Ramsey received his marching orders for pulling down McArthur to make it 10 v 10. It was too late though as the match ended a humiliating 2-1 defeat, and all but ended Scotland\'s qualification hopes.</p>', '0', null, '2017-10-08 21:49:16', null);
INSERT INTO `matchsummary` VALUES ('714', '<p>Scotland went into this game knowing that they needed a win to keep their qualification hopes alive. In a fairly uneventful first half, Marshall was called on to make saves from Basta and Duricic. Scotland also had a penalty shout when a George Boyd cross appeared to come of a hand, but nothing was given. Early in the second half Scotland had the ball in the net when Naismith hit a great shot past their keeper, but he was clearly offside. Just before the hour mark, the ball broke for Jordan Rhodes who was through on goal but he shot straight at the keeper. Serbia then went straight up the park and took the lead. Tosic crossed the ball in and Whittaker played a defensive tackle only for the ball to fall for Duricic who turned and put the ball into an empty net. A few minutes later a poor pass from Caldwell gave the ball away on the edge of the box to Tomovic, who had a shot stopped by Marshall only for the rebound to fall to Duricic who placed it into an empty net and make it 2-0. In the last minute Serbia almost got a third when a shot by Ivanovic went inches past the post. With both Croatia and Belgium winning, this meant that Scotland\'s qualification chances were officially over.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('723', '<p>Scotland went into the match with some renewed optimism after the appointment of Gordon Strachan as manager. It was also a coincidence that his first match in charge also took place at the ground where he played for seven years. After only three minutes, Maloney had a volley saved by the keeper after an inswinging corner was punched out by the keeper and headed back in by Burke to fall for Maloney. After 10 minutes, McGregor was called into action when he had to tip a shot by Teniste over the bar. 10 minutes later a great passing move by Scotland ends with a cross by Burke headed over by Steven Fletcher. Just before half time, Maloney was fouled on the left. Adam played the resulting free kick to the foot of Mulgrew, who played a low shot past the keeper to give Scotland a 1-0 lead. Just before the hour mark, Jordan Rhodes had a shot go over the bar, and soon after Naismith also had a shot go just over. Scotland comfortably played out the rest of the match, with the game ending in victory for Gordon Strachan\'s first game in charge.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('721', '<p>After Craig Levein\'s sacking, Under 21 coach Billy Stark took charge of the senior team for the friendly in Luxembourg. Jordan Rhodes started up front, and he was quick off the blocks. He came close after 8 minutes when he hit a shot just past the post. A couple of minutes later Dixon crossed the ball in and the ball came back off a defender for Rhodes to head in from close range and make it 1-0. Just over 10 minutes later, Rhodes doubled his and Scotland\'s goal tally. Andrew Shinnie played the ball across the goal and the ball came off the keeper into Rhodes\' path for him to knock it home. A minute into the second half, Luxembourg pulled one back when Gerson curled a free kick over the wall and past Gilks. With 20 minutes remaining, Gilks was called into action. Mutsch played a great ball to the head of Bensi, but his header was pushed past the post by Gilks. With 5 minutes remaining, Gilks made another save from a Bensi shot. Scotland held on to give Billy Stark a victory in his game in charge.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('711', '<p>Going into this game both managers were under pressure, especially Chris Coleman as Wales had lost their opening two matches, the last being 6-1 against Serbia. Craig Levein also needed a victory as anything else would make qualification for the World Cup very difficult. Within the first ten minutes, Gareth Bale hit a shot from outside the box that went just past the post. Midway through the first half Steve Morison headed just wide from a Bale cross, but a minute later Scotland took the lead. It was route 1 football as a kick out by McGregor was headed on by Fletcher to James morrison who hit a low shot into the bottom right corner. Just before half time, Morrison almost got a second, when a Hutton cross was headed down by Fletcher to Morrison who shot over the bar. Just past the hour mark, Morrison had another chance but his shot was saved my Lewis Price. A few minutes later Aaron Ramsey had a great chance but his chip over McGregor went just wide. With 15 minutes remaining Charlie Adam played a swinging cross to the back post for Steven Fletcher to head into the net, but the referee wrongly disallowed the goal. Things got even worse 5 minutes later when Gareth Bale made a mazy run before he dived in the penalty area, and the referee made another shocking decision and awarded a penalty. Bale stepped up and placed the ball past McGregor to make it 1-1 against the run of play. With a minute remaining, Bale made it a miserable night for Scotland when a superb shot from outside the box flew past McGregor to make it 2-1 for Wales. Some shocking refereeing decisions could come back to haunt Scotland and Craig Levein.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('712', '<p>Scotland went into this game knowing that they needed a victory to have a realistic chance of qualification. After only two minutes, McGregor had to make a treble save to keep the Belgians out. After 10 minutes he had to make another save from a Chadli shot. Belgium then came close when a Alderweireld cross was punched out by McGregor and the rebound was played in front of goal to Benteke who just failed to head the ball. Midway through the first half, Commons was fouled and the resulting free kick was curled in from Maloney and tipped just past the post. 15 minutes later Dembele came close but his shot went just wide. Five minutes before the break, Commons hit a low free kick that was pushed past the post by the keeper. In the second half, Benteke had a header come off McGregor\'s crossbar. With less than half an hour remaining, McGregor pulled off another save from a De Bruyne shot. A few minutes later the same man floated a cross to the back post where Benteke headed past McGregor to give the Belgians the lead. A couple of minutes later, their lead was doubled when Company picked up the ball on the edge of the penalty area and turned McArthur before unleashing a powerful shot past McGregor, to make the score 2-0 and all but end Scotland and Craig Levein\'s hopes.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('719', '<p>Scotland finished the season with a trip to Florida to play Jurgan Klinsmann\'s USA side.&nbsp; Things did not start well for Scotland as Landon Donovan put USA ahead after only 3 minutes when he smashed home the rebound from close range, after McGregor saved his initial shot.&nbsp; USA doubled their lead 8 minutes later when Bradley hit a powerful shot from outside the box that flew past McGregor.&nbsp; A few minutes later Scotland pulled one back when a Kenny Miller header deflected off Cameron for an own goal.&nbsp; On the hour mark, Landon Donovan got his second when he slotted home a low cross from Jones in the penalty area.&nbsp; Five minutes later Landon Donovan completed his hat-trick.&nbsp; He collected a through ball and slotted a low shot in off the post with McGregor routed to the spot.&nbsp; With 20 minutes remaining the rout was completed when Donovan chipped the ball into the box for Jones to head the ball past McGregor and make it 5-1 in a game that Scotland were dominated from start to finish.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('717', '<p>Scotland went into the Macedonia match bottom of the group, therefore a victory in Skopje was a must, to give Scotland a chance of not finishing in bottom place.&nbsp; They travelled to Skopje without a suspended Snodgrass, plus Jordan Rhodes who broke his hand and Charlie Adam who had a back strain.</p>\r\n<p>Scotland started the game the much stronger team and had a great chance to take the lead when Anya crossed the ball in to Naismith, but he headed high over the bar. On the half hour mark, Naismith played Scott Brown through on goal one on one with the keeper, but his shot was saved. Just before half time, Anya has a high shot from the edge of the box tipped away. A minute later a Scotland chance turned into a Macedonia attack on the break that luckily ended up in the side netting.&nbsp; Just before the hour mark, Bannan played a great ball through to Anya on the left who played a low shot from a tight angle past the keeper to give Scotland a well deserved lead. Midway through the second half, Matt Gilks pulled off a great save from Ivanovski and also tipped over the bar a shot from Jahovic, in a period of the game that was Macedonia\'s strongest.&nbsp; Maloney then had a shot go just past the post.&nbsp; With seven minutes remaining, Macedonia\'s pressure paid off when substitute Kostovski equalised.&nbsp; Maloney failed to clear and Pandev played the ball to Kostovsti, who knocked the ball past Gilks and slotted home. With two minutes remaining, McArthur was fouled on the edge of the box.&nbsp; From the resulting free kick, Maloney placed the ball into the top corner to put Scotland back in front.&nbsp; In injury time at the end, substitute Lee Wallace almost made it three when he slotted a low shot past the post.&nbsp; The game ended 2-1 and Scotland against the odds gained an impressive win in Skopje, and the progress under Strachan continued.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('718', '<p>Going into Scotland\'s final qualifier, they were without an injured Maloney and a suspended Whittaker.&nbsp; Jordan Rhodes also withdrew from the squad with injury.</p>\r\n<p>Scotland made a great start to the game with them controlling the match and passing the ball well.&nbsp; It was just before the half hour mark that this payed off.&nbsp; Naismith collected the ball down the left wing and passed to Mulgrew on the overlap, who crossed in to the back post for Snodgrass to head past Pletikosa and give Scotland a deserved lead. A couple of minutes later Snodgrass almost got his and Scotland\'s second.&nbsp; A well worked move with intricate passes ended with Morrison passing to Snodgrass, who played a one-two with Brown, before unleashing a low shot that Pletikosa touched onto the post.&nbsp; In the second half, Croatia upped their game and came close to equalising when Eduardo rounded McGregor but could only find the side netting. With 20 minutes remaining Anya was upended in the penalty area and the referee pointed straight to the spot.&nbsp; Up stepped Barry Bannan and his penalty was well saved, but Naismith was quick off the blocks to slot home the rebound and make it 2-0.&nbsp; Scotland saw out the rest of the match to end a disappointing campaign on a high and fill the Tartan Army full of hope for the Euro 2016 campaign.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('720', '<p>Scotland made a bright start to the friendly against Australia and were close to taking the lead after five minutes when James morrison crossed in to Jordan Rhodes whose back heel was collected by the keeper. Ten minutes later some controversy occured when Australia attacked down the left.&nbsp; It looked like the ball went out of play, but play continued only for an Australian shot to appear to hit Danny Fox\'s hand on the goalline and again the referee waved play on.&nbsp; The Australian\'s probably felt vindicated a minute later when they took the lead.&nbsp; A corner kick was headed away by Berra only to be volleyed past McGregor from outside the box by Bresciano.&nbsp; Ten minutes later Scotland equalised when Fox made a run down the left wing and played in a great cross that was met by a glancing header by Jordan Rhodes. Just before the hour mark, Matt Gilks was called into action when he tipped a shop over the bar. A few minutes later, Fox made another run down the wing and played in another great ball, but this one was headed in by Davidson for an own goal to give Scotland the lead.&nbsp; With 15 minutes remaining, substitute Ross McCormack killed the game off when he scored Scotland\'s third. He collected a throw in from Charlie Mulgrew before playing a one-two with Naismith, taking on two defenders, and hitting a low shot past the keeper.&nbsp; With five minutes remaining, Charlie Adam curled a shot just past the post, and could not add to the scoreline which ended 3-1 to Scotland, to gave them a morale boosting victory.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('709', '<p>Serbia were the first team to test the keeper after five minutes when a Kolarov free kick was parried by McGregor. Steven Naismith was then lucky to stay on the field as he appeared to elbow an opponent in the face.&nbsp; After 20 minutes, Snodgrass forced a save from Stojkovic when he latched on to a quick free kick from Caldwell.&nbsp; Naismith then headed just wide from a Snodgrass cross.&nbsp; Just before the break, McGregor saved a low shot by Lazovic.&nbsp; In the second half Morrison dinked the ball through to Miller, who had his shot blocked by the keeper. Just after an hour, Kolarov drilled a low shot just past McGregor\'s left hand post.&nbsp; A few minutes later, Caldwell played a great ball through to Naismith who lifted the ball over the outcoming keeper but just past the post.&nbsp; With a minute remaining, McGregor was called on to make a save from Tadic, who latched on to a great pass by Tosic. Scotland almost snatched it in injury time when Forrest collected a pass from Adam, and his resulting shot was saved by Stojkovic.&nbsp; The game finished goalless, and it was a disappointing result to a dissapointing match that Scotland should have won.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('710', '<p>Scotland went into this qualifier knowing that anything less than a victory would seriously damage their chances of qualifying for the World Cup.&nbsp; Things did not start well as Macedonia took the lead after only ten minutes.&nbsp;Trickovski played a one-two with Demiri, before he played a low ball across the goal for Noveski to knock past McGregor, although he looked offside.&nbsp; Five minutes later, Ibraimi came close to making it 2-0 when his shot curled just past the post.&nbsp; On the half hour mark, Ibraimi had a low shot saved by McGregor.&nbsp; Just before half time, Scotland equalised against the run of play.&nbsp; Morrison played a through ball to Mackie who was clear on goal, he passed to his left to Kenny Miller who slotted the ball into an empty net.&nbsp; In the second half, Georgievski had a shot blocked by Berra.&nbsp; From the resulting corner, McGregor palmed away a shot by Ibraimi that fell to Hasani whose shot struck the right hand post.&nbsp; With just over 20 minutes remaining Adam crossed the ball in for substitute Jordan Rhodes to head just past the post.&nbsp; A few minutes later Ivanovski was through on goal but his shot was saved by McGregor.&nbsp; Just before the end, James Forrest played a great ball to the back post, but a defender stuck a leg out to clear it before Rhodes made contact with it.&nbsp; The game ended 1-1 in what was a poor display from Scotland, who were even lucky to get a point.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('722', '<p>To mark the 150th anniversary of the English FA, the oldest international fixture was being played for the first time in 14 years.&nbsp; After only 11 minutes a Scotland corner was headed clear by Wellbeck to James Morrison who collected it outside the box and unleashed a shot that Hart could not keep out, to give Scotland a 1-0 lead.&nbsp; Just before the half hour mark, England equalised when Cleverly played a great ball though to Walcott, who took on Whittaker and slotted the ball past McGregor.&nbsp; A few minutes into the second half, Scotland regained the lead.&nbsp; Hutton passed to Kenny Miller on the edge of the penalty area, and with his back to goal he lost Cahill before turning and unleashing a great shot past Hart.&nbsp; Scotland\'s lead only lasted for four minutes this time, as Wellbeck latched on to a Gerrard free kick to head past McGregor.&nbsp; With 20 minutes remaining Baines floated in a corner and substitute Ricky Lambert met with a powerful header to beat McGregor and give England a 3-2 lead.&nbsp; In injury time at the end, Lambert almost doubled his tally when he hit the post.&nbsp; Although the game ended 3-2 to England, Scotland could go home with their heads held high.</p>\r\n<p></p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('716', '<p>The big news on the build up to the Belgium match was that Kenny Miller was retiring from international duty after 12 years, 69 caps and 18 goals.&nbsp; Gordon Strachan therefore had to find someone to take his place in the side and it was Leigh Griffiths who got the nod.</p>\r\n<p>Belgium almost got off to a grest start when Fellaini headed just wide in the first ten minutes.&nbsp; Scotland\'s first real chance came after half an hour when Scott Brown hit a thunderous shot from outside the penalty area, that went just past the post. Five minutes later Belgium took the lead when De Bruyne recieved a pass from Fellaini out wide, and he pulled the ball back for Defour in the penalty area who slotted the ball past Marshall.&nbsp; Just past the hour mark, substitute Ikechi Anya made an impact in the Scotland team and he made a great run down the wing before he crossed for Maloney, who shot just over the bar.&nbsp; With less that ten minutes remaining, Marshall had to make a finger tip save over the bar from a De Bruyne free kick.&nbsp; Belgium made sure of the points when they made it 2-0 with two minutes remaining.&nbsp; Benteke played a defence splitting pass through to Mirallas, who timed his run well before slotting the ball past Marshall.&nbsp; That added some gloss to the scoreline, in a match where Scotland were always going to be second best against one of the best in the World.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('724', '<p>Scotland were looking to record their third consecutive victory for the first time in seven years in a match that would be their last at Hampden Park until after the 2014 Commonwealth Games.</p>\r\n<p>In the first half both teams cancelled each other out and the only real chance came for Scotland just before half time.&nbsp; Snodgrass played the ball through to Fletcher who was through on goal, and instead of shooting, he passed to Conway who came in from the wing but he shot wide.&nbsp; In the second half Scotland came close when a Snodgrass free-kick was tipped over the bar by Tim Howard.&nbsp; Just before the hour mark, USA came close when a shot by Jose Altidore went just past the post.&nbsp; In the final ten minutes the USA came close twice.&nbsp; Firstly Johannsson picked up a stray ball from Greer and had his low shot saved by Marshall and as the rebound fell to Altidore, Grant Hanley made a goalline tackle to keep the ball out.&nbsp; A couple of minutes later Johannsson had another shot, this time it went just past the post.&nbsp; The game therefore finished goalless, which was better than the 5-1 thrashing 18 months ago.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('725', '<p>Scotland had some players pull out of the squad before the Norway match such as Fletcher, McCormack and Mulgrew.&nbsp; This led to a call-up for Kris Boyd, who had not played for Scotland in over 3 years.</p>\r\n<p>Scotland made a poor start to the game as they failed to make an impact in the first half.&nbsp; The dominant Norwegians had their best chance just before half time when Eikrem had a shot in the penalty area go just past the post.&nbsp; Ten minutes into the second half, David Marshall made a great save with his legs to prevent Marcus Pedersen after he was sent the wrong way.&nbsp; A few minutes later against the run of play, Scotland took the lead.&nbsp; Charlie Adam made a run into the box only to be tackled, and the loose ball fell to Scott Brown who hit a low shot into the bottom left corner.&nbsp; The keeper got a hand to it but could not keep it out.&nbsp; This boosted the Scotland performance and they started to control the midfield.&nbsp; Norway upped their game in the last 15 minutes, and Marshall made saves from Marcus Petersen and Morten Gamst Pedersen, and Konradssen shot wide when it was easier to hit the target.&nbsp; Scotland held on for a somewhat undeserving victory, due to a great defensive display and poor finishing.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('726', '<p>Scotland\'s pre-arranged friendly in Poland took on some extra meaning after they were both drawn together in the qualification campaign for Euro 2016.&nbsp; Darren Fletcher was recalled into the squad after a 16 month absence. The Poles were missing their main man Lewandowski.</p>\r\n<p>The hosts made a positive start with Marshall having to tip a shot over the bar from Obraniak after only 11 minutes.&nbsp; Just before the half hour mark, Marshall made another save this time from a Milik shot.&nbsp; Scotland grew into the game and passed the ball well, but the closest they came in the first half was when Szczesny saved a shot from Hutton at the near post, when Steven Fletcher was waiting for it in the middle.&nbsp; In the Second half, Scotland looked more positive.&nbsp; They came close after 54 minutes when Naismith cut the ball back to McCormack, who had his shot blocked by Piszczek.&nbsp; A few minutes later, Poland should have taken the lead when an unmarked Glik headed past the post.&nbsp; A couple of minutes later Milik also came close when he lifted a shot over the bar from close range. With 13 minutes remaining Scotland took the lead.&nbsp; A cross by Anya was headed down by Mulgrew.&nbsp; The clearance fell to Scott Brown on the edge of the box, who struck a great shot past a helpless Szczesny to score his second goal in two games. The goal was enough to give Scotland an impressive victory, with a well disciplined performance.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('727', '<p>After a run of six unbeaten games, Scotland were full of confidence.&nbsp; But they couldn\'t have asked for a harder start to the Euro 2016 campaign, with a match away to the newly crowned World Champions.</p>\r\n<p>The Germans start strong and come close after 10 minutes when Muller heads wide.&nbsp; Five minutes later the Scots give the Germans a fright when a shot by Bannan is deflected wide and from the resulting corner Charlie Mulgrew hits the woodwork.&nbsp; The linesman\'s flag would have saved the Germans anyway.&nbsp; In the 18th minute, the Germans took the lead when a cross by Rudy was met by the head of Muller, who outjumped Hutton and Martin, to loop a header over the outstretched Marshall.&nbsp; A few minutes before half time, Marshall needs to stretch and prevent a deflected cross from creeping in.&nbsp; Scotland make a positive start to the second half when Hutton went on a run down the right before passing to Naismith in the middle, who took it past the defenders and hit a low shot that hit the outside of the post and went wide.&nbsp; On the 66th minute, Scotland\'s pressure paid off.&nbsp; Anya ran on to a great ball down the left from Steven Fletcher, and was through one on one with Neuer.&nbsp; Anya then slotted the ball past the outrushing keeper to give Scotland a deserved equaliser.&nbsp; Four minutes later, a calamity of defending by Scotland allowed Muller to put the Germans back in front.&nbsp; Scotland failed to clear a corner, and the German slotted home from close range.&nbsp; A couple of minutes later, the Germans are very lucky when Durm, who was the last man pulls down Naismith, and only recieves a yellow card.&nbsp; At the end of the match Charlie Mulgrew recieves a yellow card for a bad tackle, and then a couple of minutes later, stupidly kicks the ball away to get a second yellow followed by a red card.&nbsp; The Germans see out the match for a 2-1 victory, but at least the Scots can take alot of positives away from pushing the World Champions in their own back yard.</p>', '0', null, '2017-10-09 21:36:47', null);
INSERT INTO `matchsummary` VALUES ('737', '<p>Scotland made a positive start to the game when Anya had a deflected shot hit the post after 4 minutes. A few minutes later McGregor had to make a save from Uchebo. With 10 minutes on the clock, a shot from outside the box by Morrison was flicked by Charlie Mulgrew\'s heel to loop over the keeper and into the net to give Scotland an early lead. After half an hour, Scotland had the ball in the net again, when Grant Hanley headed a Maloney corner into the net.&nbsp; The referee harshly judged Hanley to have fould the keeper though and ruled out the goal. Five minutes before the break, Nigeria equalised when a shot from outside the box by Uchebo took a deflection off Hanley to steer it past McGregor.&nbsp; Just into the second half, McGregor had to pull off a save from close range when Ameobi had a close shot. Scotland restored their lead after 52 minutes when a low cross from Hutton was knocked into his own goal from Egwuekwe.&nbsp; 15 minutes later substitute Chris Martin almost increased Scotland\'s lead when he had a close range shot palmed past the post by the keeper.&nbsp; In the final minute, some poor defending by Scotland left some space for Nwofor to hit a low shot past McGregor into the opposite corner. Scotland had to settle for a draw, which had they won, it would have been the first Scotland team since 1951 to win 4 consecutive away matches.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('731', '<p>Scotland went into the game with Gibraltar as overwelming favourites.&nbsp; The bookmakers were giving odds of 1/100 for a Scotland win over a team with only 1 professional player.&nbsp; Scotland made a slow start to the match, and they got a fright when Marshall had to punch an inswinging cross clear.&nbsp; Scotland took the lead after 18 minutes.&nbsp; Shaun Maloney was upended in the box by their keeper, and he converted the resulting penalty.&nbsp; Scotland led for only a minute, when some poor defending led to Casciaro latching on to a through ball and hitting a low shot past Marshall, to give them their first competitive goal.&nbsp; Scotland regained the lead 10 minutes later when some poor defending allowed Steven Fletcher to score a scrappy header that should have been saved.&nbsp; Five minutes later, Scotland got their second penalty of the match when Naismith was barged over in the box.&nbsp; Maloney converted the penalty which was a carbon copy of the first.&nbsp; Six minutes before half time, Scotland scored their fourth.&nbsp; Morrison passed to Anya down the wing, and he cut the ball back for Naismith to find the net.&nbsp; The second half was fairly uneventful until 13 minutes from time, when Steven Fletcher got his second and Scotland\'s fifth.&nbsp; Substitute Jordan Rhodes sent a cross to the back post where a downward header from Fletcher beat the keeper.&nbsp; In the 90th minute, Bannan passed to Fletcher on the edge of the box, and he hit a low shot into the far corner to make it 6-1.&nbsp; It was Fletcher\'s hat-trick, the first time in 46 years that a player had scored three or more for Scotland.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('739', '<p>Scotland made a bright start to the match.&nbsp; It was only three minutes on the clock when Anya made a run down the wing and he cut back to Steven Fletcher who forced a save out of the Irish keeper McGovern.&nbsp; Five minutes later, a shot by Anya was also saved by McGovern.&nbsp; After quarter of an hour, Anya had another shot at goal, but this was wide of the post.&nbsp; The same happened five minutes later, as Scotland were piling on the pressure.&nbsp; After half an hour, Maloney played a great ball through to Steven Flether, but his shot was saved by the outrushing McGovern.&nbsp; In the second half, Forsyth played a great ball into the box, for substitute Naismith to head just over the bar.&nbsp; With 20 minutes remaining, Naismith latched onto a corner from Ritchie, but his header was saved.&nbsp; With five minutes remaining, a corner from Ritchie met the head of Christophe Berra, and his downward header beat McGovern to give Scotland a deserving victory.&nbsp; It was a game Scotland dominated and a non attack minded Irish team could not achieve a single shot on target.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('738', '<p>After the win over the Republic, Scotland were hoping a similar result against the Auld Enemy.&nbsp; After five minutes a low shot by Welbeck was saved by Marshall.&nbsp; On the half hour mark, England took the lead when Wilshire played a great ball into the penalty area, where Oxlade-Chamberlain crept in unmarked, to direct a header past Marshall.&nbsp; Just into the second half, England doubled their lead, when some poor defending led to a loose ball being headed past Marshall by Rooney.&nbsp; Five minutes later, Russell Martin forced a save from Fraser Forster, when he latched on to a free kick from Mulgrew and had his header tipped over.&nbsp; With 13 minutes remaining, Wilshire should have made it three, but he shot wide of the post.&nbsp; With seven minutes remaining, Scotland\'s best player Andrew Robertson made a great run down the left, played a one-two with Johnny Russell, before hitting a low shot past Forster to make it 1-2.&nbsp; Scotland\'s hopes of getting something out of the game were short lived, when two minutes later Rooney got his second.&nbsp; A great passing move by England was finished with Lallana cutting back to Rooney who shot into an empty net to make it 3-1 to England, after a poor performance from an obviously tired Scotland team following the win over Ireland.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('730', '<p>Scotland went into this game knowing that it would go a long way to determining who would qualify for the finals.&nbsp; It was the Irish who started brighter, with Marshall saving a shot by Walters after only two minutes.&nbsp; Just after the half hour mark, Scotland should have taken the lead, when Maloney played a ball into the box to Mulgrew who had a powerful header go wide.&nbsp; Five minutes later, Steven Whittaker had a low shot saved by Forde.&nbsp; Ten minutes into the second half, Marshall made a save from a close range header from Shane Long.&nbsp; A few minutes later, Marshall made a great save from a low shot by McGeady.&nbsp; Ten minutes later, substitute Chris Martin came close to giving Scotland the lead when his shot from a Naismith pass went just past the post.&nbsp; With 17 minutes remaining, Jonathan Walters came close to scoring an own goal when he headed a Mulgrew free-kick onto his own bar and behind to give Scotland a corner.&nbsp; From the resulting corner, Scotland played a move straight from the training ground when Maloney hit a short corner to Anya, who passed pack to Maloney. Maloney then passed to Scott Brown, who back-heeled the ball back into Maloney\'s path.&nbsp; Maloney then curled a great shot into the far right corner to give Scotland a valuable 1-0 lead.&nbsp; Ireland came close to an equaliser when Grant Hanley headed a Brady free-kick against his own bar.&nbsp; Scotland held on though to gain a valuable well fought out victory against their close rivals in front of 60,000.&nbsp; Up next is a game against England.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('729', '<p>Scotland went to Poland, who had defeated Germany three days earlier to top the group.&nbsp; With only 11 minutes on the clock, the Poles took the lead, when sloppy defending from Hutton let Maczynski hit a low shot in off the post.&nbsp; Seven minutes later, Scotland equalised.&nbsp; Steven Fletcher played a great cross-field ball to Anya down the wing, who then cut the ball back for Maloney to side foot the ball past the keeper.&nbsp; 12 minutes into the second half, Scotland took the lead.&nbsp; James Morrison played a free-kick into the box, and Naismith slid in and diverted the ball past the keeper.&nbsp; With 15 minutes remaining, Scotland almost got their third, when Anya passed to Maloney just inside the box, and his shot was touched over by Szczesny.&nbsp; A minute later the Poles equalised when Milik latched on to a great pass by Jedrzejczyk, and hit a powerful shot past Marshall. A few minutes later, Marshall made a great save from a Lewandowski shot.&nbsp; With six minutes remaining, Poland should have gone ahead when Grosicki hit the post, and Mila sliced the rebound wide. Scotland held on though to gain a much deserved and credible draw in Poland.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('728', '<p>Scotland went into their second game at home to Georgia full of confidence after a good performance away to the World Champions. Scotland\'s first real chance came after 26 minutes when a passing move ended with Anya having his shot deflected wide.&nbsp; A minute later Scotland took the lead.&nbsp; Andrew Robertson played in inswining cross into the box, that the keeper palmed out.&nbsp; The ball then dropped to Maloney, whose shot deflected off the keeper and the defender, before it rolled in.&nbsp; It was awarded as an own goal.&nbsp; Seven minutes before half time, Scotland almost doubled their lead when a Scott Brown shot was deflected just past the post.&nbsp; Scotland continued to pile on the pressure in the second half, and just after the hour, Naismith had his shot saved after collecting a ball from Hutton.&nbsp; 15 minutes later, Naismith had another chance, but this time he hit a low shot past the post.&nbsp; A minute later Georgia gave Scotland a fright, when they had a shot go wide, when they should have hit the target.&nbsp; With seven minutes remaining, Morrison played a one-two with Steven Fletcher before his shot was saved by the keeper.&nbsp; A 1-0 win was enough to give Scotland their first win in the group.&nbsp;</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('735', '<p>Scotland went into the Poland match confident of qualifying for the play-offs.&nbsp; If Scotland were to get a better result against Poland than Ireland would at home to Germany, a victory over Gibraltar would be enough.&nbsp; The Poles were confident though as Robert Lewandowski was bang on form for both club and country.&nbsp; That form was to continue as the Poles took the lead after only three minutes when a pass sliced open the Scotland defence to find Lewandowski, who looked marginally offside, and he beat Marshall at his near post.&nbsp; Just before the half hour mark, Poland almost doubled their lead when Blaszczykowski hit a low shot that went just past the post.&nbsp; Just before half time Hampden errupted, when Matt Ritchie received a pass from Forrest just outside the penalty area, and he hit a superb shot that flew past Fabianski to make it 1-1.&nbsp; Right after kick off for the second half, Marshall pulled off a great save to prevent Milik from scoring.&nbsp; Scotland then came close when Whittaker played a great ball into the box for Naismith, but he could not direct the ball on target.&nbsp; Just after the hour mark, Steven Fletcher put Scotland ahead when he collected a pass from Ritchie at the right hand side of the box, before he curled the ball past Fabianski to score a superb goal.&nbsp; With it goalless in Dublin, things were looking bright for Scotland.&nbsp; That took a setback when Ireland took the lead against Germany with 20 minutes remaining.&nbsp; A victory for Ireland would still leave Scotland with a chance, as long as they could hold on against Poland.&nbsp; In the fourth minute of injury time at the end, things came crashing down for Scotland, when they conceded a free kick on the edge of the box.&nbsp; The resulting free kick took a deflection and hit the post, before it rolled along the goalline and Lewandowski forced it over to make it 2-2 with the last kick of the ball.&nbsp; With Ireland beating Germany 1-0, Scotland\'s hopes of qualification were over.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('736', '<p>Scotland went into the Gibraltar match with nothing to play for but pride.&nbsp; Strachan made seven changes to the starting eleven that played against Poland.&nbsp; Scotland almost took the lead after 11 minutes when Maloney shot over the bar from a Fletcher cross.&nbsp; 12 minutes later, Maloney had a header saved by their keeper.&nbsp; From the resulting corner, Greer headed on the ball to the back post, where Chris Martin headed it over the line to get his first international goal.&nbsp; Ten minutes later, Steven Fletcher hit the post when me latched on to a Chris Martin cross.&nbsp; Four minutes later, a blocked shot by Dorrans fell to Maloney, who curled the ball into the far corner to give Scotland a 2-0 lead at half time.&nbsp; Six minutes into the second half, Steven Fletcher made it three when he headed a Hutton cross past the keeper.&nbsp; Four minutes later, Fletcher got another when he received a pass from Chris Martin inside the box, and he hit a low shot past the keeper that went in off the post to make it 4-0.&nbsp; Midway through the second half, substitute Johnny Russell had a shot go just over the bar.&nbsp; With just over five minutes remaining, Naismith played a great ball into the path of Fletcher on the edge of the box, who hit a superb curling shot into the top corner off the bar, to het his second hat-trick against Gibraltar.&nbsp; A few minutes later, Russell was denied his first goal for Scotland when their keeper pulled off a great reflex save.&nbsp; In injury time at the end, Naismith collected the ball on the wing, before he played the one-two with Fletcher, and hit a low shot past their keeper, to round it off with a 6-0 victory.&nbsp; Scotland\'s biggest away victory since 1949.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('740', '<p>Scotland and Qatar set up an annual event between themselves and Qatar called the Qatar Airways Cup, with the inaugural tournament held at Easter Road.&nbsp; Scotland looked the much better team, and after 20 minutes, Naismith had a shot palmed over the bar.&nbsp; Five minutes later Ritchie shot wide after he received a Forsyth cross.&nbsp; Five minutes before half time, as Scotland pushed forward, Naismith had an intended ball for McArthur blocked by a defender, and the ball fell to Ritchie just outside the box, who hit a low shot into the bottom right hand corner of the net, to give Scotland a 1-0 lead.&nbsp; On the stroke of half time, McArthur played a ball through to Naismith who had a shot come back off the post.&nbsp; Five minutes into the second half, Naismith headed wide of the left hand post from a Ritchie corner.&nbsp; With 15 minutes remaining, Craig Gordon made a good save to prevent Qatar from equalising.&nbsp; Substitute Johnny Russell had two half chances late on, but the game ended 1-0.&nbsp; A couple of days later, Scotland cut their ties with Qatar, as reports of their human rights came out.</p>', '0', null, null, null);
INSERT INTO `matchsummary` VALUES ('744', '<p>There is normally a big build up to a Scotland - England game, but this one had more talking points.&nbsp; First there was the recall of Scott Brown, who came out of international retirement as Scotland\'s qualification campaign was in trouble.&nbsp; The next point was a dispute with FIFA, as they were not allowing any of the home nations to wear black armbands with poppies on them.&nbsp; FIFA stated that they do not allow teams to display political, religious or commercial messages.&nbsp; Both the SFA and English FA decided to defy FIFA though, and take the punishment that they dish out.</p>\r\n<p>Scotland made a positive start to the game, but after 24 minutes England took the lead.&nbsp; A shot by Sterling was blocked by Hanley, and the rebound fell to Walker, who crossed a low ball in for Sturridge to head past Gordon.&nbsp; A few minutes later, Scotland should have equalised when an unmarked Grant Hanley had a free header go over the bar.&nbsp; On the half hour mark, Scotland had another great chance go abegging.&nbsp; Lee Griffiths picked up a loose pass from Rooney, and instead of passing to his left to an unmarked Snodgrass, who was through on goal,&nbsp; Griffiths had a poor shot deflected into Hart\'s hands.&nbsp; At the start of the second half, Scotland had two more great chances.&nbsp; The first one after 49 minutes was when a Wallace cross was left by Griffiths, to fall to Forrest, who controlled the ball before hitting a low shot past the post.&nbsp; A minute later Scotland came closer.&nbsp; Lee Wallace played a one-two with Scott Brown, before putting a low ball into the box for Robert Snodgrass, who had his low shot blocked by John Stones.&nbsp; England then went up to the other side of the pitch and made it 2-0.&nbsp; Sterling played an overlapping ball to Danny Rose on the wing who played a great ball in for Adam Lallana to head past Gordon.&nbsp; It was a cruel blow to Scotland who were looking the better team at that moment.&nbsp; Eleven minutes later, England ended the contest when Gary Cahill scored a third, from a wayne Rooney corner, to make it 3-0.&nbsp; Nine minutes later Sterling could have made it four, when he hit a Henderson cross over the bar from close range.&nbsp; The game ended 3-0 to England, but that did not tell the story of the match.&nbsp; England took their chances and Scotland didn\'t.&nbsp; It was a cruel blow for Scotland and Gordon Strachan.</p>', '0', '2016-11-09 22:08:37', '2016-11-13 15:41:45', null);
INSERT INTO `matchsummary` VALUES ('751', '<p>Scotland travelled away to Prague for a friendly against an impressive Czech team who topped their group in the Euro 2016 qualifiers.&nbsp; The Czechs piled on the pressure early on and hit the bar after 8 minutes from a Dockal free-kick, and McGregor had to palm away the rebound.&nbsp; Two minutes later, against the run of play, Scotland took the lead. Ross McCormack held the ball up before he played a great ball through to the on running Anya who played a low shot through the keepers legs to give Scotland the lead.&nbsp; The Czechs continued to pile on the pressure and McGregor made saves from a header from Darida and a left foot shot from Frydek.&nbsp; At the start of the second half, debutant Kenny McLean hit a low shot past the left hand post.&nbsp; On the hour mark, substitute Matt Phillips had a header saved from a Snodgrass cross. With 8 minutes remaining, Kol&aacute;r had a low shot saved in the bottom right corner by McGregor.&nbsp; The game finished 1-0, in what was a credible result for Scotland</p>', '0', '2016-12-26 22:01:38', '2016-12-26 22:01:38', null);
INSERT INTO `matchsummary` VALUES ('752', '<p>Gordon Strachan\'s team for the friendly with Denmark was full of inexperienced players, of which three were given their debuts. Scotland took an early lead after only 8 minutes when a defensive slip up by Daniel Agger let Matt Ritchie through to slot the ball past Kasper Schmeichel. Just after the half hour mark, Gordon made a low save from a shot from J&oslash;rgensen. Three minutes before half time, Whittaker floated a ball in from the right for Schmeichel to save a low diving header from Steven Fletcher.&nbsp; Four minutes into the second half, Schmeichel had to make another save, this time a curling shot from Shaun Maloney was tipped over the bar.&nbsp; with less than 20 minutes remaining, Gordon had to make a double save, first a shot from outside the box by Eriksen was palmed out, and Gordon also saved the rebound from a Braithwaite header. A minute later J&oslash;rgensen had a great chance to score, but he hit the ball over the bar from close range. With 77 minutes on the clock, Ritchie should have got his second, but his shot from close range was blocked by Christensen.&nbsp; The game ended 1-0 with Scotland having two creditable wins in their last two games.</p>', '0', '2016-12-28 21:01:57', '2016-12-28 21:01:57', null);
INSERT INTO `matchsummary` VALUES ('754', '<p>It was debated whether Scotland should be playing two tough frendlies at the end of a long season, and it was shown in this game, when an obviously tired Scotland team put in a poor performance against an Italian team building up for Euro 2016.&nbsp; After only 6 minutes, David Marshall had to make a double save from Candreva and then Giaccherini.&nbsp; Just before the half hour mark, Giaccherini should have put Italy ahead, but he put the ball wide. 10 minutes later, Florenzi also put the ball wide with a shot from outside the box. 10 minutes into the second half, Italy took the lead when De Rossi passed to &Eacute;der, who laid the ball off to Pell&egrave;, who curled a shot past Marshall into the right hand corner.&nbsp; In the 77th minute, Scotland got their first shot at goal, when Steven Naismith passed to Matt Ritchie whose shot went past the left hand post.&nbsp; It was the best that Scotland could give in a poor performance, where the 1-0 scoreline flattered Scotland.</p>', '0', '2016-12-29 19:47:07', '2016-12-29 19:47:07', null);
INSERT INTO `matchsummary` VALUES ('753', '<p>Six days after the poor performance against Italy, it was more of the same against France.&nbsp; After only 8 minutes, France were 1-0 up.&nbsp; Bacary Sagna crossed a low ball in from the right for Olivier Giroud to flick a backheel past Marshall.&nbsp; 10 minutes later, Kingsley Coman had a right footed shot from outside the box saved by Marshall. 10 minutes before half time, Dimitri Payet had a shot from outside the box saved by Marshall, but the rebound fell to Giroud, who slotted it home to make it 2-0.&nbsp; Four minutes later it was 3-0, when Laurent Koscielny scored a header from a Patrice Evra assist from a corner.&nbsp; 10 minutes into the second half, Scotland had their best chance of the first half when Anya crossed the ball into the box for Steven Fletcher whose header went out for a throw in. 10 minutes later Paul Pogba hits the post direct from a free kick.&nbsp; With four minutes remaining Steven Naismith had Scotland\'s best chance of the match, but he shot over the bar.&nbsp; In the last minute, Antoine Griezmann headed the ball over the bar, after he connected with a Bacary Sagna cross. It meant that the game ended 3-0, and Scotland ended the season on a low with two poor performances.</p>', '0', '2016-12-29 20:00:10', '2016-12-29 20:25:21', null);
INSERT INTO `matchsummary` VALUES ('741', '<p>Scotland started their World Cup qualification campaign with a trip away to minnows Malta.&nbsp; After only 6 minutes, Robert Snodgrass came close with a shot that went just over the bar. Three minutes later, Snodgrass floated a ball in from the right, that deceived the keeper and ended up in the back of the net to give Scotland a 1-0 lead. Four minutes later, Malta equalised. Gareth Sciberras played a ball into the box for Alfred Effiong to head past David Marshall. Midway through the first half, Snodgrass almost put Scotland back on top, but his header from a Callum Paterson cross was saved. Eight minutes before half time, Grant Hanley should have put Scotland ahead when he headed a Matt Ritchie free kick past the post. Eight minutes into the second half, Scotland went back in front, when Chris Martin knocked in a low cross from Matt Ritchie from the left. On the hour mark, Andrew Robertson played a low ball into the middle for Chris Martin, who failed to make contact.&nbsp; To most people\'s amazement, the referee then reached for his back pocket and pulled out a red card for Jonathan Caruana of Malta, and pointed to the spot for what must have been a clip on Martin as he ran through. Snodgrass stepped up and placed the ball in the bottom right corner, while sending the keeper the wrong way.&nbsp; With 12 minutes remaining, a Matt Ritchie cross from the right was deflected to Steven Fletcher who headed it past the keeper to make it 4-1. Six minutes later, Matt Ritchie played a great ball through to Steven Fletcher, who rounded the keeper, before hitting the bar.&nbsp; The ball then fell into the path of the on running Snodgrass, who controlled the ball before slotting it home for his hat-trick.&nbsp; A minute into injury time at the end, Malta had a second player sent off when Luke Gambin kicked out at Snodgrass.&nbsp; It was a good result to start the campaign, but the performance could have been better.</p>', '0', '2016-12-31 20:15:02', '2016-12-31 20:15:02', null);
INSERT INTO `matchsummary` VALUES ('742', '<p>Scotland went into the Lithuania game sitting top of Group F after their 5-1 victory over Malta. Thirteen minutes into the game, Callum Paterson headed just wide from a Matt Ritchie free kick.&nbsp; A few minutes later, Snodgrass hits a free kick just past the right hand post. Midway through the first half, Chris Martin connects with a Snodgrass cross to hit a low shot past the post from a tight angle.&nbsp; At the start of the second half, David Marshall makes a low save from Arvydas Novikovas. A few minutes later, Scotland came close when a Snodgrass shot was blocked, from the follow up, Barry Bannan had a shot blocked, and then an Andrew Robertson cross was put out for a corner.&nbsp; Four minutes later, Andrew Robertson plays a great ball in from the left, and a Chris Martin header goes just past the post. On the hour mark, against the run of play, Lithuania took the lead. Fedor Cernych played a one-two with Vykintas Slivka before slotting the ball past David Marshall. A couple of minutes later, Scotland had a great chance to level, when a Robertson cross was palmed out to James Forrest, who hit a low shot that went just past the left hand post. With 17 minutes remaining, Lithuania almost got a second when Cernych hit a shot just past the right hand post. Six minutes later, Leigh Griffiths had a great chance when he headed straight into the keeper\'s hands from a Snodgrass cross.&nbsp; In the 89th minute, Callum Paterson took a long throw in to the box.&nbsp; It was headed on by Grant Hanley to James McArthur, who headed past the keeper to make it 1-1. In Injury time, Leigh Griffiths was pushed in the box, but no penalty was given.&nbsp; In the 96th minute, Lithuania cleared the ball off the line, when Grant Hanley tried to force the ball over the line.&nbsp; The game was to end 1-1, in what was an embarassing result.</p>\r\n<p></p>', '0', '2016-12-31 20:36:11', '2016-12-31 21:10:31', null);
INSERT INTO `matchsummary` VALUES ('743', '<p>After the embarassing 1-1 draw with Lithuania, many felt that the game away to Slovakia was a must win match for Scotland.&nbsp; With 12 minutes on the clock, Steven Fletcher had a great chance to put Scotland ahead, when he was free in the box but headed a Snodgrass ball wide of the left hand post.&nbsp; Two minutes later, David Marshall saved a shot from outside the box by Jan Durica. After 18 minutes, Slovakia took the lead.&nbsp; Jakub Holubek crossed the ball from the left to the back post, for Marek Hamsik\'s header to be saved by Marshall, but the rebound was fired into the net by Robert Mak.&nbsp; It looked like Steven Fletcher was fouled at the start of the move, but the referee played on.&nbsp; Two minutes later, Scotland almost equalised when a low shot by Snodgrass was saved at the left hand side of the goal.&nbsp; Five minutes before half time, Marshall made a great save from a&nbsp;Robert Mak shot from outside the box.&nbsp; From the resulting corner, Marshall made another save from Jan Durica. 11 minutes into the second half, Slovakia made it two. Jakub Holubek cut the ball back to Robert Mak, who side stepped Russell Martin and slotted the ball past Marshall.&nbsp; After 65 minutes, Barry Bannan had a shot saved after a Paterson throw in.&nbsp; Three minutes later, Adam Nemec made it 3-0 after he headed in a corner from Robert Mak.&nbsp; With 12 minutes remaining, substitute Leigh Griffiths shot wide past the right hand post, after he latched on to a pass from John McGinn.&nbsp; A minute later, Griffiths had a shot saved from the right hand side.&nbsp; With nine minutes remaining Barry Bannan also had a shot saved after a cross from Anya.&nbsp; It was another poor performance from Scotland, who travelled to Wembley next.</p>', '0', '2017-01-01 15:36:22', '2017-01-01 15:36:22', null);
INSERT INTO `matchsummary` VALUES ('746', '<p>Scotland went into the home match against the Auld Enemy knowing that defeat would all but end their qualification chances.&nbsp; It had been 32 years since Scotland\'s last victory over England in 1985, but Scotland were going into this match with some confidence after some good performances.&nbsp;</p>\r\n<p>Scotland made a promising start and but to no avail, as Griffiths\' shot was saved from Hart. It was after 17 minutes that the first proper chance came, and it was to Harry Kane, who shot over from inside the box.&nbsp; 11 minutes later England should have taken the lead&nbsp; when Tierney had to head off the line after Kane lobbed Gordon, and the follow up shot from Rashford was diverted wide.&nbsp; 5 minutes into the second half Livermore had a shot diverted on to the post, and then a Cahill shot was deflected wide. Scotland went up the other end and should have scored as Robertson hit the ball over the bar after receiving a pass from Griffiths on the edge of the box.&nbsp; On 66 minutes Gordon made a great save from a Kane header.&nbsp; A few minutes later, Gordon was at fault when Oxlade-Chamberlain gave England the lead.&nbsp; He dribbled in from the left and turned and unleashed a shot that Gordon should have kept out. With 8 minutes remaining, Griffiths was though in the box, but his shot was put wide of the post.&nbsp; A few minutes later substitute Ryan Fraser was fouled just outside the box when he took Cahill\'s high boot to the chest.&nbsp; Leigh Griffiths stepped up, and curled the ball over the wall and into the right hand corner past Hart, to send Hampden crazy.&nbsp; It was nothing more than Scotland deserved.&nbsp; The game was not over yet though.&nbsp; With 2 minutes left, Chris Martin was fouled in a similar position.&nbsp; Leigh Griffiths stepped up again, and this time curled the ball into the left hand corner past Hart to make it 2-1 to Scotland, and send the Tartan Army into a state of joy.&nbsp; All Scotland had to do now was hold on to the ball for a few minutes.&nbsp; They conceded a free kick just on the edge of the box.&nbsp; Gordon saved from Dier, and Scotland broke away.&nbsp; A poor pass from Armstrong game the ball back to England, who floated a ball to the back post to Kane who lost his marker and slotted the ball past Gordon to make it 2-2.&nbsp; It was a cruel blow to Scotland who were minutes away from recording a famous victory and giving their qualification chances a major boost.</p>', '0', '2017-06-30 21:14:30', '2017-06-30 21:14:30', null);
INSERT INTO `matchsummary` VALUES ('745', '<p>The qualifier at home to Slovenia was a must win game.&nbsp; Anything less would see qualification hopes over.&nbsp;&nbsp; Scotland were up for the game and almost took the lead in the first minute when Russell Martin had a shot saved from a Snodgrass corner.&nbsp; A few minutes later, Snodgrass floated in another corner and this time Russell Martin headed it into the net, but the ref blew his whistle for a foul.&nbsp; After 18 minutes, Slovenia broke away but Gordon stood up to block a shot from Bezjak.&nbsp; Just before the half hour mark, James Morrison came close when his shot went just wide of the post.&nbsp; 10 minutes before half time Scotland should have taken the lead.&nbsp; Robertson released Snodgrass down the left wing, and his cross was met at the back post by Leigh Griffiths, who with an open goal, hit the bar.&nbsp; A minute later Griffiths hit the woodwork again.&nbsp; A low ball from the right was met by Griffiths, who hit a low shot that came off the outside of the post.&nbsp; From the corner, Morrison had a header cleared off the line.&nbsp; Griffiths went off injured just after half time after taking a knee in the back off the keeper.&nbsp; With 15 minutes remaining, substitute Anya was through on goal, but his shot was saved by the keeper. With two minutes remaining on the clock, Armstrong collected the ball in the Slovenia half and took it past opposing players, before he slotted the ball through to substitute Chris Martin just inside the box.&nbsp; He turned and hit a low shot, that took a deflection past the keeper, and in off the post, to give Scotland a deserved 1-0 victory and keep their qualification hopes alive.&nbsp; Next up England at Hampden.</p>', '0', '2017-06-30 21:47:55', '2017-06-30 21:47:55', null);
INSERT INTO `matchsummary` VALUES ('749', '<p>The bad news for Scotland going into the must win game against Slovakia, was that both captain Scott Brown and Stuart Armstrong were out injured.&nbsp; They would both be replaced by Darren Fletcher and Barry Bannan.&nbsp; Scotland took the game to Slovakia, and could have won a penalty in the first 10 minutes when Mak fouled Kierney in the box.&nbsp; The ref waved play on though.&nbsp; Just before the 20 minute mark, the Slovak keeper Dubravka pulled off a great save to prevent Berra scoring a second header in two games.&nbsp; A few minutes later, Mak took a dive in the box.&nbsp; The referee was not fooled though, and he gave Mak a second yellow card, to reduce Slovakia to 10 men.&nbsp; 10 minutes before half time, Dubravka pulled off another good save, this time from a curling Griffiths shot from the edge of the box.&nbsp; On the hour mark, Chris Martin came on and boosted the Scotland attack.&nbsp; A minute later, a swerving shot from just outside the box by Griffiths, was again superbly saved by Dubravka.&nbsp; With just over 20 minutes remaining, Chris Martin beat Dubravka, but smacked the bar with a curling shot from outside the box.&nbsp; Four minutes later, Martin was fouled just outside the box, in a similar position to the England game.&nbsp; Up stepped Griffiths, but he also smacked the bar.&nbsp; The ball then came to James Morrison one on one with the keeper, but again Dubravka pulled off a superb save.&nbsp; Dubravka was having the game of his life and it was looking like this would not be Scotland\'s night.&nbsp; With 89 minutes on the clock, Griffiths turned the defender and then stretched to knock the ball to substitute Anya on the wing.&nbsp; He played a low ball in for Chris Martin, who was being marked by Martin Skrtel.&nbsp; The pressure from Chris Martin caused Skrtel to knock the ball past Dubravka into his own net, and send Hampden absolutely wild.&nbsp; Scotland then held on to get an important victory, with another late late winner, and put Scotland second in the group with one game remaining and two points ahead of Slovakia.</p>', '0', '2017-10-07 09:16:10', '2017-10-07 11:57:04', null);
INSERT INTO `matchsummary` VALUES ('747', '<p>Scotland were full of confidence after an impressive persormance against England and they knew that the game away to Lithuania was a must win game.&nbsp; The starting lineup had 6 Celtic players in it.&nbsp; Scotland piled the pressure on Lithuania right from the start, and Griffiths almost gave Scotland the lead after 6 minutes, with a shot that went just wide.&nbsp; Some slack defending almost let Lithuania in a few minutes later, but a poor finish saved Scotland. A minute later Matt Phillips went on a great run on the edge of the box, but his shot went over the bar.&nbsp; With 20 minutes on the clock, Craig Gordon had to make a great save from a free-kick by Novikovas.&nbsp; Five minutes later, Scotland took the lead.&nbsp; A corner by Griffiths was headed in by Stuart Armstrong at the back post to make it 1-0.&nbsp; Just before the half hour mark, Scotland doubled their lead.&nbsp; Forrest laid the ball off to Robertson on the edge of the box, who took a touch before he curled it in the top corner.&nbsp; At the start of the second half, Scotland almost got a third when a cross by Robertson was met by Griffiths at the back post.&nbsp; His volley only made the side netting though.&nbsp; Just before the hour mark, Lithuania should have scored, but they put the ball wide when Gordon was beat.&nbsp; With just under 20 minutes remaining, Scotland got a third.&nbsp; A quick throw-in by Richie was met by Griffiths, who layed the ball off for McArthur.&nbsp; His close range shot was deflected off the keeper into the back of the net, to give Scotland a deserved 3-0 victory.</p>', '0', '2017-10-07 13:19:46', '2017-10-07 13:19:46', null);
INSERT INTO `matchsummary` VALUES ('748', '<p>Scotland almost took the lead after 5 minutes when a Stuart Armstrong shot went just past the post.&nbsp; Two minutes later a McArthur shot was blocked, followed a minute later by a Forrest shot being palmed past the post.&nbsp; From the resulting corner by Griffiths, Berra scored a downward header at the back post to give Scotland the lead after only 9 minutes.&nbsp; Five minutes later, an Armstrong shot hit the side netting, and a minute before half time, a Phillips shot from outside the box was saved.&nbsp;&nbsp; At the start of the second hallf, Scotland got a second.&nbsp; Robertson played a low cross into the box that was met by Morrison.&nbsp; His shot hit the post and Griffiths tapped the rebound in.&nbsp; There was a hint of offside, but replays showed that the ball took a deflection of the defender before it hit the post.&nbsp; Five minutes later, James Forrest had a low shot tipped past the post.&nbsp; With 15 minutes remaining, Malta came close when Gordon saved a shot by Zerafa, and the rebound shot by Effiong was blocked at point blank range by Hanley.&nbsp; With a minute remaining, Phillips was put through on goal, but his shot went over the bar.&nbsp; So Scotland had to settle for a 2-0 win which was good enough.</p>', '0', '2017-10-07 13:45:24', '2017-10-07 13:45:24', null);
INSERT INTO `matchsummary` VALUES ('750', '<p>Following Belgium\'s defeat of Bosnia the previous day, Scotland knew that victory over Slovenia would guarantee a play-off place.&nbsp; Strachan started with a 4-4-2, which raised some eyebrows, with Chris Martin assisting Leigh Griffiths up front.&nbsp; After only 6 minutes, Gordon had to pull off a save from Ilicic to prevent Slovenia from taking the lead.&nbsp; At the other end Chris Martin had a low shot saved after 17 minutes.&nbsp; Just after the half hour mark, Scotland took the lead.&nbsp; McArthur headed the ball into the box, into the path of Griffiths who shot a half volley from a tight angle to beat the keeper at the far corner.&nbsp; Six minutes into the second half, some poor defending from a dubious free-kick, allowed Slovenia to equalise with a downward header at the back post from the substitute Bezjak.&nbsp; Slovenia were now on top, as Scotland were being pushed further back into their own half. A few minutes later, Gordon had to pull off a save from a deflected shot from Bezjak.&nbsp; With just under 20 minutes remaining, Scotland\'s hopes started to fade, when Slovenia and Bezjak got a second. Again, some poor defending at a corner let Ilicic roll the ball back to Bezjak, who picked his spot in the goal, while in a crowded box.&nbsp; With 77 minutes on the clock, Scotland had a great chance to equalise when McArthur layed the ball off to Fletcher who shot over from only 10 yards out.&nbsp; With only 2 minutes remaining, Fletcher played a great ball into the box, for substitute Snodgrass to chest down and beat the keeper, to make it 2-2. This put some life into a previously deflated Scotland side, and less than a minute later, Phillips played a low ball into the box, that was deflected off a defender and almost beat the keeper at the near post.&nbsp; Slovenia then went up the other end and called Craig Gordon into action with a great one-handed save.&nbsp; A minute into injury time, Cesar was shown a red card for violent conduct.&nbsp; Right at the death Snodgrass had a chance to get a winner, but his header was saved by Oblak.&nbsp; When the full time whistle went the Scotland players fell to the floor, as they had lost out on goal difference, as Slovakia beat Malta 3-0.&nbsp; It would now be more than 20 years since Scotland qualified for the finals of a tournament.</p>', '0', '2017-10-10 21:57:19', '2017-10-10 21:57:19', null);
INSERT INTO `matchsummary` VALUES ('755', '<p>Canada took the lead after only 11 minutes, when slack defending led to former Rangers player Fraser Aird slotting the ball past McGregor.&nbsp; A couple of minutes later, Snodgrass almost equalised, when he curled a ball in from the right that went through the whole defence and came back off the post.&nbsp; Canada almost got a second, just before the half hour mark, when Aird was allowed to go on a solo run before he shot just past the post. Oliver Burke made the keeper pull off a save a few minutes later to prevent an equaliser.&nbsp; 10 minutes before half time, Scotland got the equaliser. A Lee Wallace cross was met by Naismith, but the keeper saved his attempt.&nbsp; The rebound came out to Cairney, whose shot was steered into the net by Naismith to make it 1-1.&nbsp; Just after the hour mark, substitute Barry Bannan, had his shot saved, and his follow up went over the bar.&nbsp; With 12 minutes remaining, Fraser Aird made McGregor pull off a great save to keep it at 1-1 in what was a poor performance.</p>', '0', '2017-10-11 18:41:14', '2017-10-11 18:41:14', null);
INSERT INTO `matchsummary` VALUES ('732', '<p>Scotland went into this qualifier against Ireland knowing that a defeat would seriously damage their qualification hopes.&nbsp; After 10 minutes, Steven Fletcher had his shot tipped over the bar.&nbsp; Seven minutes before half time, Marshall tipped a header from Daryl Murphy over the bar.&nbsp; From the resulting corner, Murphy forced Marshall into another save, but the rebound fell to Jonathan Walters who put the ball into the back of the net.&nbsp; He was in an offside position, but the referee awarded the goal.&nbsp; Two minutes into the second half, Shaun Maloney played a one-two with Anya, before his shot was defelcted into the net by John O\'Shea to make it 1-1.&nbsp; Two minutes later, Ireland went up the other side, and Marshall had to make another save from Murphy.&nbsp; Shay Given then had to make a save from an Anya cross that was deflected. With 5 minutes remaining, James McLean headed just wide, for the game to finish 1-1.</p>', '0', '2017-10-11 18:42:11', '2017-10-11 18:42:11', null);
INSERT INTO `matchsummary` VALUES ('733', '<p>In the first game of the season, Scotland travel to Georgia, which was where a 2-0 defeat in 2007 seriously damaged the Euro 2008 campaign.&nbsp; Scotland\'s first real chance came midway through the first half, when Robertson whipped a low ball into the box that Steven Fletcher just missed.&nbsp; Nine minutes before half-time, Georgia took the lead when Qazaishvili collected a knock down on the edge of the box, before hitting a low shot past Marshall.&nbsp; Ten minutes into the second half, Maloney played the ball through to Steven Fletcher who hit the post, but the linesman\'s flag was up for offside.&nbsp; Midway through the second half, Georgia almost got a second, when Ananidze forced a great save from Marshall.&nbsp; With 10 minutes remaining, a Maloney free-kick was steered over the bar by the defender.&nbsp; In injury time at the end, Scotland had their best chance of the match when a Mulgrew corner was headed just past the post by Grant Hanley.&nbsp; The game finished 1-0 in what was a poor performance, and seriously damaged Scotland\'s qualification hopes.</p>', '0', '2017-10-11 20:48:37', '2017-10-11 20:48:37', null);
INSERT INTO `matchsummary` VALUES ('734', '<p>Following Scotland\'s defeat in Georgia, Scotland were hoping that they would take something from the home match against Germany.&nbsp; Things did not start well, as after only 18 minutes, Muller collected the ball in the Scotland half, and hit a low shot that took a deflection to take it past Marshall and give the Germans the lead.&nbsp; 10 minutes later Scotland were level.&nbsp; A free kick from Maloney was floated into the box and the Neuer palmed it out, only for it to go back in off Mats Hummels for an own goal.&nbsp; Five minutes later, the Germans were back in front.&nbsp; Emre Can shot from just inside the box, and his shot was palmed out by Marshall, and poor defending let Muller head the ball in off the post. Two minutes before the break, Scotland levelled again.&nbsp; A corner form Maloney was headed away only to fall to McArthur on the edge of the box, who half-volleyed the ball past Neuer to make it 2-2.&nbsp; Ten minutes into the second half, the Germans went ahead for the third time.&nbsp; G&uuml;ndogan passwed to Muller, who layed the ball off for G&uuml;ndogan in the middle to hit a low shot in off the post.&nbsp; Just after the hour mark, Marshall saved a powerful shot from Schweinsteiger.&nbsp; A few minutes later, Scotland had a great chance to equalise when Hutton played a one two with Steven Fletcher, but his shot hit the side netting.&nbsp; With just over 5 minutes remaining, Marshall pulled off another save from G&uuml;ndogan, for the game to finish 3-2 to Germany.&nbsp; It meant that Scotland would find it hard to qualify with Ireland beating Georgia.</p>', '0', '2017-10-12 18:39:56', '2017-10-12 18:39:56', null);
