INSERT INTO `news` VALUES ('1', '2008-12-15 00:00:00', 'Brown Opposes Team GB', 'Former Scotland manager Craig Brown is fronting a \"No To Team GB\" petition as he has said that he does not trust FIFA.  He believes that their overall plan is to create a GB team as they wish to reduce the number of teams.\r\nFIFA has stated that a unified British team for the Olympics would not threaten Scotland\'s identity, but Brown does not trust FIFA.  An alternative plan that Brown has stated is that each of the home nations take part.', 'News', '2016-05-21 10:13:54', '2016-05-21 10:13:54', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('2', '2008-12-22 00:00:00', 'The Door May Still Be Open For Boyd', 'Terry Butcher has stated that there may still be a Scotland career for Kris Boyd.  He believes that if Boyd were to withdraw his statement of international retirement, then George Burley may still pick him.', 'News', '2016-05-21 10:14:00', '2016-05-21 10:14:00', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('3', '2008-12-27 00:00:00', 'Butcher Appointed New Inverness Manager', 'Terry Butcher was named as the new ICT manager after Craig Brewster was sacked.  Maurice Malpas becomes his number two.  This has no bearing on his role for the national team as he will still continue as Burley\'s number two.', 'News', '2016-05-21 10:14:01', '2016-05-21 10:14:01', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('4', '2009-02-02 00:00:00', 'Burley Names Squad for Training', 'The following squad has been named for a training session at St. Andrews.<br />\r\n<br />\r\nCraig Gordon (Sunderland) <br />\r\nDavid Marshall (Norwich City) <br />\r\nAllan McGregor (Rangers) <br />\r\n<br />\r\nGraham Alexander (Burnley) <br />\r\nDarren Barr (Falkirk) <br />\r\nChristophe Berra (Wolves) <br />\r\nKirk Broadfoot (Rangers) <br />\r\nGary Caldwell (Celtic) <br />\r\nJamie McAllister (Bristol City) <br />\r\nStephen McManus (Celtic) <br />\r\nGary Naysmith (Sheffield United) <br />\r\nDavid Weir (Rangers) <br />\r\n<br />\r\nScott Brown (Celtic) <br />\r\nKris Commons (Derby County) <br />\r\nBarry Ferguson (Rangers) <br />\r\nDarren Fletcher (Manchester United) <br />\r\nPaul Hartley (Celtic) <br />\r\nJames Morrison (West Bromwich Albion) <br />\r\nGavin Rae (Cardiff City) <br />\r\nBarry Robson (Celtic) <br />\r\n<br />\r\nDavid Clarkson (Motherwell) <br />\r\nSteven Fletcher (Hibernian) <br />\r\nChris Iwelumo (Wolves) <br />\r\nRoss McCormack (Cardiff City) <br />\r\nKenny Miller (Rangers) <br />\r\nLee Miller (Aberdeen)', 'Squad', '2016-05-21 10:14:02', '2016-05-21 10:14:02', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('5', '2009-02-05 00:00:00', 'Gordon Hopeful About Scotland Return', 'Craig Gordon made his return for Sunderland against Blackburn.  His target is to be fit for the World Cup Qualifier against Holland in Amsterdam on March 28th after returning from an ankle injury.', 'News', '2016-05-21 10:14:03', '2016-05-21 10:14:03', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('6', '2009-02-06 00:00:00', 'McFadden Doubtful For Holland Match', 'Scotland striker James McFadden is a big doubt for the forthcoming World Cup Qualifier away to Holland.  Last Month he limped off in a match against Derby as he suffered medial ligament damage.  McFadden is looking to be back playing in 8 weeks.', 'News', '2016-05-21 10:14:04', '2016-05-21 10:14:04', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('7', '2009-03-01 00:00:00', 'SFA wish change to Eligability', 'SFA Chief Executive Gordon Smith is seeking a change to the eligibility of players who can play for Scotland.  He hopes to extend the criteria so that players who have spent five years in Scotland can wear the dark blue.', 'News', '2016-05-21 10:14:04', '2016-05-21 10:14:04', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('8', '2009-03-02 00:00:00', 'Scotland and Wales Euro Bid Is Ended', 'Due to the increase in teams to 24, plus the current economic climate, Scotland and Wales have decided to withdraw from the race for staging Euro 2016.  They feel that the amount of money that would have to be spent on upgrading stadia would be too much.', 'News', '2016-05-21 10:14:05', '2016-05-21 10:14:05', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('9', '2009-03-02 00:00:00', 'Burley Hoping For Hutton\'s Return', 'George Burley is hopeful that Alan Hutton will be fit to play against Holland on 28th March.  Hutton has been on the sidelines since he underwent foot surgery on a foot fracture in November.  Hutton aggravated a foot injury after playing 90 minutes against Argentina.', 'News', '2016-05-21 10:14:06', '2016-05-21 10:14:06', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('10', '2009-03-03 00:00:00', 'Gordon\'s Position Under Threat', 'George Burley has said that Craig Gordon\'s starting position is under threat after Gordon lost his first team place at Sunderland after an ankle injury.  Allan McGregor on the other hand has had a great spell with Rangers.', 'News', '2016-05-21 10:14:06', '2016-05-21 10:14:06', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('11', '2009-03-17 00:00:00', 'Hutton Recalled For Dutch Clash', 'Alan Hutton has been recalled to the Scotland Squad for the forthcoming World Cup double header.  He has not played since the last international against Argentina.  Craig Gordon has also been included in the squad, but McFadden, Robson, and O\'Connor are all missing through injury.', 'News', '2016-05-21 10:14:07', '2016-05-21 10:14:07', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('12', '2009-03-17 00:00:00', 'Squad For Holland & Iceland', 'Craig Gordon (Sunderland)<br />\r\nAllan McGregor (Rangers)<br />\r\nDavid Marshall (Norwich City)<br />\r\n<br />\r\nGraham Alexander (Burnley)<br />\r\nDarren Barr (Falkirk)<br />\r\nChristophe Berra (Wolves)<br />\r\nKirk Broadfoot (Rangers)<br />\r\nGary Caldwell (Celtic)<br />\r\nAlan Hutton (Tottenham Hotspur)<br />\r\nJamie McAllister (Bristol City)<br />\r\nStephen McManus (Celtic)<br />\r\nGary Naysmith (Sheffield United)<br />\r\nDavid Weir (Rangers)<br />\r\n<br />\r\nScott Brown (Celtic)<br />\r\nKris Commons (Derby County)<br />\r\nBarry Ferguson (Rangers)<br />\r\nDarren Fletcher (Manchester United)<br />\r\nPaul Hartley (Celtic)<br />\r\nJames Morrison (West Bromwich Albion)<br />\r\nGavin Rae (Cardiff City)<br />\r\nGary Teale (Derby County)<br />\r\n<br />\r\nDavid Clarkson (Motherwell)<br >\r\nSteven Fletcher (Hibernian)<br />\r\nChris Iwelumo (Wolves)<br />\r\nRoss McCormack (Cardiff City)<br />\r\nKenny Miller (Rangers)', 'Squad', '2016-05-21 10:14:09', '2016-05-21 10:14:09', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('13', '2009-03-27 00:00:00', 'McManus, Hutton & Gordon Miss Dutch Clash', 'Celtic Captain Stephen McManus has been ruled out of Saturday\'s clash with the Dutch as he has failed to recover from an ankle injury.  Christophe Berra is likely to take his place.  Alan Hutton, who has just recovered from a foot injury is not being risked for the Dutch game, but both him and McManus may be available for the Iceland match. Meanwhile Burley has chosen Allan McGregor ahead of Craig Gordon, who has failed to win back his starting place at Sunderland.', 'News', '2016-05-21 10:14:12', '2016-05-21 10:14:12', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('14', '2009-03-27 00:00:00', 'Revised Squad For Holland & Iceland', 'Craig Gordon (Sunderland)<br />\r\nAllan McGregor (Rangers)<br />\r\nDavid Marshall (Norwich City)<br />\r\n<br />\r\nGraham Alexander (Burnley)<br />\r\nDarren Barr (Falkirk)<br />\r\nChristophe Berra (Wolves)<br />\r\nGary Caldwell (Celtic)<br />\r\nAlan Hutton (Tottenham Hotspur)<i>(Iceland Only)</i><br />\r\nJamie McAllister (Bristol City)<br />\r\nStephen McManus (Celtic)<i>(Iceland Only)</i><br />\r\nGary Naysmith (Sheffield United)<br />\r\n<br />\r\nScott Brown (Celtic)<br />\r\nBarry Ferguson (Rangers)<br />\r\nDarren Fletcher (Manchester United)<br />\r\nJames Morrison (West Bromwich Albion)<br />\r\nGavin Rae (Cardiff City)<br />\r\nGary Teale (Derby County)<br />\r\nSteven Whittaker (Rangers)<br />\r\n<br />\r\nDavid Clarkson (Motherwell)<br >\r\nSteven Fletcher (Hibernian)<br />\r\nChris Iwelumo (Wolves)<br />\r\nRoss McCormack (Cardiff City)<br />\r\nKenny Miller (Rangers)', 'Squad', '2016-05-21 10:14:12', '2016-05-21 10:14:12', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('15', '2009-03-28 00:00:00', 'Scots Outclassed In Amsterdam', 'A decimated Scotland team suffered a 3-0 defeat away to Holland.  First half goals by Huntelaar and Van Persie, and a second half penalty by Kuyt kept up Holland\'s 100% record in the group.  There was also some controversy as Gary Caldwell had a goal disallowed for no known reason.', 'News', '2016-05-21 10:14:13', '2016-05-21 10:14:13', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('16', '2009-04-01 00:00:00', 'Ferguson And McGregor Dropped', 'Captain Barry Ferguson and goalkeeper Allan McGregor have both been dropped for the Iceland match.  This is because they went on a drinking session in the team hotel after the Holland match.  Returning defender Stephen McManus will be given the captain\'s armband and Craig Gordon will regain his place in goals.', 'News', '2016-05-21 10:14:14', '2016-05-21 10:14:14', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('17', '2009-04-01 00:00:00', 'Scotland See Off Iceland', 'Scotland gained a much needed three points after a close match against Iceland ended in a 2-1 victory.  Goals by Ross McCormack and Steven Fletcher either side of a Sigurdsson goal.  Scotland had Gordon to thank as he made two saves in the last minute.', 'News', '2016-05-21 10:14:14', '2016-05-21 10:14:14', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('18', '2009-04-03 00:00:00', 'Lifetime Bans For Ferguson And McGregor', 'Both Barry Ferguson and Allan McGregor have received lifetime bans from the SFA, meaning they will never play for Scotland again.  They have also been banned for two weeks from Rangers and Ferguson has been stripped of the captaincy.  This follows a late drinking session after the Holland game, plus hand gestures that were made during the Iceland game.', 'News', '2016-05-21 10:14:15', '2016-05-21 10:14:15', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('19', '2009-05-31 00:00:00', 'Team GB To Be All English', 'The proposal that Team GB will be all English has been approved by FIFA.  This was decided after Scotland, Wales and Northern Ireland all refused to take part.  After years of dispute, all three decided that they had no problems with England playing in Great Britain\'s place', 'News', '2016-05-21 10:14:15', '2016-05-21 10:14:15', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('20', '2009-06-06 00:00:00', 'Ferguson and McGregor May Be Chosen', 'SFA chief executive Gordon Smith has stated that the banned duo Barry Ferguson and Allan McGregor may be chosen for Scotland again if George Burley wants to.  He said that the ban was exaggerated by the media and it was never a life ban.', 'News', '2016-05-21 10:14:16', '2016-05-21 10:14:16', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('21', '2009-07-08 00:00:00', 'Scotland Line Up Friendly Against Japan', 'A friendly match between Scotland and Japan has been planned for the 10th October 2009 at the Nissan Stadium, Yokohama.  It will be their first meeting since the 2006 Kirin Cup.', 'News', '2016-05-21 10:14:17', '2016-05-21 10:14:17', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('22', '2009-08-01 00:00:00', 'Gordon Out Of Norway Match', 'Craig Gordon has been ruled out of the forthcoming World Cup Qualifier against Norway due to a knee injury.  With second choice Allan McGregor being dropped from the international team, the door is open for Neil Alexander at Rangers and David Marshall at Cardiff City to wear the number 1 jersey.', 'News', '2016-05-21 10:14:22', '2016-05-21 10:14:22', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('23', '2009-08-05 00:00:00', 'Squad For Norway Match', 'Neil Alexander (Rangers)<br />\r\nJamie Langfield (Aberdeen)<br />\r\nDavid Marshall (Cardiff City)<br />\r\n<br />\r\nDarren Barr (Falkirk)<br />\r\nChristophe Berra (Wolves)<br />\r\nGary Caldwell (Celtic)<br />\r\nSteven Caldwell (Burnley)<br />\r\nCallum Davidson (Preston North End)<br />\r\nAlan Hutton (Tottenham Hotspur)<br />\r\nJamie McAllister (Bristol City)<br />\r\nSteven Whittaker (Rangers)<br />\r\nGraham Alexander (Burnley)<br />\r\n<br />\r\nScott Brown (Celtic)<br />\r\nKris Commons (Derby County)<br />\r\nDarren Fletcher (Man Utd)<br />\r\nPaul Hartley (Bristol City)<br />\r\nShaun Maloney (Celtic)<br />\r\n<br />\r\nJames McFadden (Birmingham City)<br />\r\nDavid Clarkson (Bristol City)<br />\r\nSteven Fletcher (Burnley)<br />\r\nRoss McCormack (Cardiff City)<br />\r\nKenny Miller (Rangers)<br />\r\nSteven Naismith (Rangers)', 'Squad', '2016-05-21 10:14:22', '2016-05-21 10:14:22', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('24', '2009-08-25 00:00:00', 'Squad For Macedonia & Holland', 'Craig Gordon (Sunderland)<br />\r\nNeil Alexander (Rangers)<br />\r\nDavid Marshall (Cardiff City)<br />\r\n<br />\r\nDarren Barr (Falkirk)<br />\r\nStephen McManus (Celtic)<br />\r\nChristophe Berra (Wolves)<br />\r\nGary Caldwell (Celtic) <i>(Holland only)</i><br />\r\nSteven Caldwell (Burnley)<br />\r\nCallum Davidson (Preston North End)<br />\r\nAlan Hutton (Tottenham Hotspur)<br />\r\nJamie McAllister (Bristol City)<br />\r\nSteven Whittaker (Rangers)<br />\r\nDavid Weir (Rangers)<br />\r\n<br />\r\nGraham Alexander (Burnley)<br />\r\nScott Brown (Celtic)<br />\r\nKris Commons (Derby County)<br />\r\nDarren Fletcher (Manchester Utd)<br />\r\nPaul Hartley (Bristol City)<br />\r\nShaun Maloney (Celtic)<br />\r\n<br />\r\nJames McFadden (Birmingham City)<br />\r\nDavid Clarkson (Bristol City)<br />\r\nSteven Fletcher (Burnley)<br />\r\nKevin Kyle (Kilmarnock)<br />\r\nKenny Miller (Rangers)<br />\r\nSteven Naismith (Rangers)', 'Squad', '2016-05-21 10:14:23', '2016-05-21 10:14:23', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('25', '2009-08-25 00:00:00', 'Weir Called Up For Double Header', 'David Weir has been called in to the Scotland squad for the Macedonia and Holland double header.  The 39 year old will become Scotland\'s oldest outfield player since 1920 if he features.  Kevin Kyle has also been called into the squad, and number one Craig Gordon has returned from injury as has captain Stephen McManus.', 'News', '2016-05-21 10:14:24', '2016-05-21 10:14:24', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('26', '2009-08-31 00:00:00', 'O\'Connor Replaces Kyle In Squad For Double Header', 'Birmingham City striker Garry O\'Connor was called up to the Scotland squad to replace Kevin Kyle who was injured at the weekend.  O\'Connor has not played for Scotland in two years since the 3-1 victory over Ukraine.', 'News', '2016-05-21 10:14:24', '2016-05-21 10:14:24', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('27', '2009-08-31 00:00:00', 'Updated Squad For Macedonia & Holland', 'Craig Gordon (Sunderland)<br />\r\nNeil Alexander (Rangers)<br />\r\nDavid Marshall (Cardiff City)<br />\r\nJamie Langfield (Aberdeen)<br />\r\n<br />\r\nDarren Barr (Falkirk)<br />\r\nStephen McManus (Celtic)<br />\r\nChristophe Berra (Wolves)<br />\r\nGary Caldwell (Celtic) <i>(Holland only)</i><br />\r\nCallum Davidson (Preston North End)<br />\r\nAlan Hutton (Tottenham Hotspur)<br />\r\nJamie McAllister (Bristol City)<br />\r\nSteven Whittaker (Rangers)<br />\r\nDavid Weir (Rangers)<br />\r\n<br />\r\nGraham Alexander (Burnley)<br />\r\nScott Brown (Celtic)<br />\r\nKris Commons (Derby County)<br />\r\nDarren Fletcher (Manchester Utd)<br />\r\nPaul Hartley (Bristol City)<br />\r\nShaun Maloney (Celtic)<br />\r\n<br />\r\nJames McFadden (Birmingham City)<br />\r\nDavid Clarkson (Bristol City)<br />\r\nSteven Fletcher (Burnley)<br />\r\nGarry O\'Connor (Birmingham City)<br />\r\nKenny Miller (Rangers)<br />\r\nSteven Naismith (Rangers)', 'Squad', '2016-05-21 10:14:25', '2016-05-21 10:14:25', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('28', '2009-09-03 00:00:00', 'Langfield Called Up', 'Jamie Langfield has been called up to the squad as Neil Alexander took a knock in training.  Meanwhile Stephen Caldwell has pulled out of the squad due to an injury he sustained against Norway.', 'News', '2016-05-21 10:14:26', '2016-05-21 10:14:26', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('29', '2009-09-03 00:00:00', 'Holland Kick-Off Brought Forward', 'Kick-off in the vital World Cup Qualifier against Holland has been brought forward by half an hour to synchronise it with the Norway - Macedonia match.', 'News', '2016-05-21 10:14:26', '2016-05-21 10:14:26', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('30', '2009-09-03 00:00:00', 'SFA To Review Burley\'s Position', 'SFA president George Peat has confirmed that after the World Cup Qualification campaign is over, George Burley\'s position as Scotland Manager will be under review.', 'News', '2016-05-21 10:14:27', '2016-05-21 10:14:27', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('31', '2009-09-05 00:00:00', 'Boost For Scotland\'s Qualification Hopes', 'Scotland\'s qualification hopes were boosted with a inspirational 2-0 victory over Macedonia with goals from Scott Brown and James McFadden.  A booking for McFadden means he will miss the Holland game.  In the other game Norway were held by Iceland to cap off a fine day for Scotland.', 'News', '2016-05-21 10:14:28', '2016-05-21 10:14:28', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('32', '2009-09-09 00:00:00', 'Scotland\'s World Cup Hopes Are Over', 'A late goal by the Dutch gave Holland a 1-0 victory, ending Scotland\'s hopes of gaining a play-off spot.  A victory for Norway over Macedonia meant that Scotland would finish third in Group 9.', 'News', '2016-05-21 10:14:29', '2016-05-21 10:14:29', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('33', '2009-09-15 00:00:00', 'Burley To Remain In Charge', 'After crunch talks with George Burley, the SFA have announced that he is to remain in charge of the national side.  His position was under review after he failed to guide Scotland to the World Cup play-offs.', 'News', '2016-05-21 10:14:30', '2016-05-21 10:14:30', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('34', '2009-09-16 00:00:00', 'Pressley And Scotland Part Ways', 'Steven Pressley has quit his post as one of George Burley\'s assistants in a backroom reshuffle.  He has stated that the reason is because he was not being involved in tactical matters.', 'News', '2016-05-21 10:14:30', '2016-05-21 10:14:30', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('35', '2009-09-21 00:00:00', 'McAllister Offered Scots Role', 'Former Scotland captain Gary McAllister has been offered a role as one of George Burley\'s assistants, recently vacated by Steven Pressley.  McAllister has had previous managerial experience at Coventry and Leeds and has also helped Walter Smith in his time as manager.', 'News', '2016-05-21 10:14:31', '2016-05-21 10:14:31', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('36', '2009-09-25 00:00:00', 'McAllister Rejects Scotland Position', 'Former Scotland captain Gary McAllister has rejected the offer from George Burley to replace Steven Pressley as one of his assistants.  It is believed that McAllister is looking for a full time managerial position in England.', 'News', '2016-05-21 10:14:34', '2016-05-21 10:14:34', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('37', '2009-09-26 00:00:00', 'Hegarty Given Coaching Role', 'Former Dundee Utd and Livingston manager Paul hegarty has been given the coaching role vacated by Steven Pressley.  The former Dundee Utd player who won 8 caps for Scotland, was already involved in scouting for Burley.  His first mach will be against Japan, a match that Burley\'s assistant Terry Butcher will miss due to his position at Inverness.', 'News', '2016-05-21 10:14:35', '2016-05-21 10:14:35', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('38', '2009-10-01 00:00:00', 'Squad Named for Japan Friendly', 'Craig Gordon (Sunderland)<br />\r\nJamie Langfield (Aberdeen)<br />\r\nDavid Marshall (Cardiff City)<br />\r\n<br />\r\nDarren Barr (Falkirk)<br />\r\nChristophe Berra (Wolves)<br />\r\nGary Caldwell (Celtic)<br />\r\nDanny Fox (Celtic)<br />\r\nAlan Hutton (Tottenham Hotspur)<br />\r\nStephen McManus (Celtic)<br />\r\nSteven Whittaker (Rangers)<br />\r\n<br />\r\nCharlie Adam (Blackpool)<br />\r\nScott Brown (Celtic)<br />\r\nGraham Dorrans (West Bromwich Albion)<br />\r\nDarren Fletcher (Manchester United)<br />\r\nShaun Maloney (Celtic)<br />\r\nRobert Snodgrass (Leeds United)<br />\r\nKevin Thomson (Rangers)<br />\r\nRoss Wallace (Preston North End)<br />\r\n<br />\r\nSteven Fletcher (Burnley)<br />\r\nSteven Naismith (Rangers)<br />\r\nGarry O\'Connor (Birmingham City)<br />\r\nDerek Riordan (Hibernian)', 'Squad', '2016-05-21 10:14:36', '2016-05-21 10:14:36', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('39', '2009-10-07 00:00:00', 'Scotland Have Multiple Call Offs', 'George Burley has had up to 10 players withdraw from the squad prior to the Japan friendly.\r\nDarren Fletcher, Hutton, Brown, Naismith, Maloney and O\'Connor have withdrawn along with would-be debutants Danny Fox, Robert Snodgrass and Kevin Thomson.', 'News', '2016-05-21 10:14:36', '2016-05-21 10:14:36', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('40', '2009-10-07 00:00:00', 'Updated Squad For Japan', 'Craig Gordon (Sunderland)<br />\r\nJamie Langfield (Aberdeen)<br />\r\nDavid Marshall (Cardiff City)<br />\r\n<br />\r\nDarren Barr (Falkirk)<br />\r\nChristophe Berra (Wolves)<br />\r\nGary Caldwell (Celtic)<br />\r\nLee Wallace (Hearts)<br />\r\nStephen McManus (Celtic)<br />\r\nSteven Whittaker (Rangers)<br />\r\n<br />\r\nCharlie Adam (Blackpool)<br />\r\nGraham Dorrans (West Bromwich Albion)<br />\r\nCraig Conway (Dundee United)<br />\r\nStephen Hughes (Coventry City)<br />\r\nDon Cowie (Watford)<br />\r\nRoss Wallace (Preston North End)<br />\r\n<br />\r\nSteven Fletcher (Burnley)<br />\r\nLee Miller (Aberdeen)<br />\r\nDerek Riordan (Hibernian)', 'Squad', '2016-05-21 10:14:38', '2016-05-21 10:14:38', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('41', '2009-11-05 00:00:00', 'Squad For Wales Friendly', 'Craig Gordon (Sunderland)<br />\r\nJamie Langfield (Aberdeen)<br />\r\nDavid Marshall (Cardiff City)<br />\r\n<br />\r\nChristophe Berra (Wolves)<br />\r\nGary Caldwell (Celtic)<br />\r\nSteven Caldwell (Burnley)<br />\r\nDanny Fox (Celtic)<br />\r\nAlan Hutton (Tottenham Hotspur)<br />\r\nStephen McManus (Celtic)<br />\r\nLee Wallace (Hearts)<br />\r\nSteven Whittaker (Rangers)<br />\r\n<br />\r\nDon Cowie (Watford)<br />\r\nGraham Dorrans (West Bromwich Albion)<br />\r\nDarren Fletcher (Manchester United)<br />\r\nRoss McCormack (Cardiff City)<br />\r\nBarry Robson (Celtic)<br />\r\nKevin Thomson (Rangers)<br />\r\n<br />\r\nSteven Fletcher (Burnley)<br />\r\nKevin Kyle (Kilmarnock)<br />\r\nJames McFadden (Birmingham City)<br />\r\nKenny Miller (Rangers)<br />\r\nSteven Naismith (Rangers)<br />\r\nDerek Riordan (Hibernian)', 'Squad', '2016-05-21 10:14:39', '2016-05-21 10:14:39', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('42', '2009-11-10 00:00:00', 'Updated Squad For Wales Friendly', 'Paul Gallacher (St Mirren)<br />\r\nJamie Langfield (Aberdeen)<br />\r\nDavid Marshall (Cardiff City)<br />\r\n<br />\r\nChristophe Berra (Wolves)<br />\r\nGary Caldwell (Celtic)<br />\r\nSteven Caldwell (Burnley)<br />\r\nDanny Fox (Celtic)<br />\r\nAlan Hutton (Tottenham Hotspur)<br />\r\nStephen McManus (Celtic)<br />\r\nLee Wallace (Hearts)<br />\r\n<br />\r\nCharlie Adam (Blackpool)<br />\r\nDon Cowie (Watford)<br />\r\nGraham Dorrans (West Bromwich Albion)<br />\r\nDarren Fletcher (Manchester United)<br />\r\nRoss McCormack (Cardiff City)<br />\r\nBarry Robson (Celtic)<br />\r\n<br />\r\nSteven Fletcher (Burnley)<br />\r\nKevin Kyle (Kilmarnock)<br />\r\nJames McFadden (Birmingham City)<br />\r\nKenny Miller (Rangers)<br />\r\nSteven Naismith (Rangers)<br />\r\nDerek Riordan (Hibernian)', 'Squad', '2016-05-21 10:14:39', '2016-05-21 10:14:39', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('43', '2009-11-10 00:00:00', 'Gordon Fractures Arm', 'Scotland\'s number 1 Craig Gordon fractured his left arm after a collision with Jermaine Defoe in the Sunderland - Spurs match.  This rules him out of the Wales friendly.  Kevin Thomson and Steven Whittaker have also pulled out due to illness and a hamstring injury respectively.', 'News', '2016-05-21 10:14:40', '2016-05-21 10:14:40', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('44', '2009-11-14 00:00:00', 'Scotland Suffer Humiliating Defeat', 'Scotland were outplayed and outclassed by an average Wales team who thrashed Scotland 3-0 with goals from Edwards, Church and Ramsey.  Scotland were lucky not to have Marshall and Hutton sent off, and also concede a penalty in a match that marked an all time low for Burley and for Scotland.', 'News', '2016-05-21 10:14:40', '2016-05-21 10:14:40', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('45', '2009-11-16 00:00:00', 'SFA To Hold Crisis Talks Over Burley', 'The SFA will hold crisis talks regarding the future of George Burley.  It is believed that they will terminate the contract of Burley and his coaching staff following the humiliating defeat in Cardiff.', 'News', '2016-05-21 10:14:41', '2016-05-21 10:14:41', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('46', '2009-11-16 00:00:00', 'Burley Sacked As Scotland Boss', 'The SFA have terminated George Burley\'s contract, ending his 22 month spell as Scotland manager.  This follows a humiliating 3-0 defeat to Wales, to add to his terrible record of 3 wins in 14 games.  In his reign, Scotland have fallen from 14th to 46th in the FIFA rankings.  His assistants, Terry Butcher and Paul Hegarty are both to go also.', 'News', '2016-05-21 10:14:42', '2016-05-21 10:14:42', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('47', '2009-11-18 00:00:00', 'Smith Rules Himself Out', 'Walter Smith has ruled out a return as Scotland manager for a second time.  Smith\'s contract at Rangers expires in January, but Smith has said that we would continue until the end of the season without a contract.  Smith joins Graeme Souness on the list of managers who have ruled themselves out.  Dundee Utd manager Craig Levein is currently the bookmakers\' favourite.', 'News', '2016-05-21 10:14:42', '2016-05-21 10:14:42', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('48', '2009-12-03 00:00:00', 'Petrescu Applies For Scotland Job', 'Unirea Urziceni manager and former Chelsea player Dan Petrescu has applied for the Scotland job.  The Romanian international is one of 20 applicants for the job.', 'News', '2016-05-21 10:14:43', '2016-05-21 10:14:43', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('49', '2009-12-04 00:00:00', 'SFA To Approach Smith', 'The SFA will approach Rangers manager Walter Smith about the Scotland manager\'s job.  Smith has repeatedly stated that he has no interest in returning to the job that he left in January 2007.  The SFA wish to contact all possible candidates before drawing up a shortlist to choose George Burley\'s successor from.', 'News', '2016-05-21 10:14:44', '2016-05-21 10:14:44', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('50', '2009-12-21 00:00:00', 'Levein To Be Offered Scotland Job', 'Reports are that the SFA will offer Craig Levein the Scotland job in the next couple of days.  Worries are that Levein will refuse the job as he may feel that he will become bored with the job, as there is no day to day communication with the players.  If Levein were to accept the job, the SFA may have to pay Dundee Utd 250,000 compensation.', 'News', '2016-05-21 10:14:48', '2016-05-21 10:14:48', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('51', '2009-12-23 00:00:00', 'Craig Levein Becomes New Scotland Manager', 'Dundee Utd manager Craig Levein has been appointed as the new Scotland manager to replace George Burley.  The former Hearts and Scotland defender has managed Cowdenbeath, Hearts, Leicester City and Raith Rovers before taking over at Dundee Utd 3 years ago.', 'News', '2016-05-21 10:14:49', '2016-05-21 10:14:49', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('52', '2010-02-05 00:00:00', 'Boyd And McGregor Are Recalled', 'Craig Levein has revealed that he will be recalling Rangers\' pair Kris Boyd and Allan McGregor.  Boyd had previously refused to play for Scotland while George Burley was in charge and McGregor received a lifetime ban after the Boozegate scandal.', 'News', '2016-05-21 10:14:50', '2016-05-21 10:14:50', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('53', '2010-02-07 00:00:00', 'Scotland Given Tough 2012 Draw', 'Scotland have been drawn with reigning European Champions Spain in the qualification campaign for Euro 2012.  They have also been drawn with Czech Republic, Lithuania, and Liechtenstein.  There will be a meeting on 19th February in Madrid to arrange the group fixtures.', 'News', '2016-05-21 10:14:50', '2016-05-21 10:14:50', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('54', '2010-02-22 00:00:00', 'McGregor Left Out Of Scotland Squad', 'Rangers\' keeper Allan McGregor has been left out of Craig Levein\'s first Scotland squad due to an injury that was picked up during an incident in Glasgow on Saturday.  Fellow Gers Kris Boyd and Lee McCulloch have been included as has Andy Webster who is on loan at Dundee Utd.  Former Celtic captain Stephen McManus who is on loan at Middlesbrough has been left out.', 'News', '2016-05-21 10:14:51', '2016-05-21 10:14:51', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('55', '2010-02-22 00:00:00', 'Squad For Czech Republic Friendly', 'Neil Alexander (Rangers)<br />\r\nCraig Gordon (Sunderland)<br />\r\nDavid Marshall (Cardiff City)<br />\r\n<br />\r\nAlan Hutton (Sunderland)<br />\r\nChristophe Berra (Wolves)<br />\r\nGary Caldwell (Wigan)<br />\r\nPaul Dixon (Dundee Utd)<br />\r\nGary Kenneth (Dundee Utd)<br />\r\nLee Wallace (Hearts)<br />\r\nAndy Webster (Dundee Utd)<br />\r\nSteven Whittaker (Rangers)<br />\r\n<br /> \r\nCharlie Adam (Blackpool)<br />\r\nScott Brown (Celtic)<br />\r\nGraham Dorrans (West Brom)<br />\r\nDarren Fletcher (Manchester Utd)<br />\r\nPaul Hartley (Bristol City)<br />\r\nLee McCulloch (Rangers)<br />\r\nJames McFadden (Birmingham City)<br />\r\nBarry Robson (Middlesbrough)<br />\r\nKevin Thomson (Rangers)<br />\r\n<br />\r\nKris Boyd (Rangers)<br />\r\nSteven Fletcher (Burnley)<br />\r\nChris Iwelumo (Bristol City)<br />\r\nKenny Miller (Rangers)', 'Squad', '2016-05-21 10:14:52', '2016-05-21 10:14:52', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('56', '2010-03-03 00:00:00', 'Levein Off To A Winning Start', 'Craig Levein got his managerial reign off to a winning start when Scotland defeated the Czech Republic 1-0 at Hampden.  A second half strike from Scott Brown was enough to give Scotland their first friendly win at Hampden in 14 years.', 'News', '2016-05-21 10:14:53', '2016-05-21 10:14:53', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('57', '2010-03-04 00:00:00', 'SFA Arrange Fixture With Sweden', 'The SFA have arranged a friendly away to Sweden.  The match is to be played on 11th August, which is three days before the SPL starts.', 'News', '2016-05-21 10:14:53', '2016-05-21 10:14:53', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('58', '2010-07-06 00:00:00', 'Ferguson Ends Scotland Career', 'Former Scotland captain Barry Ferguson has decided not to play for Scotland again.  Craig Levein invited Ferguson to play for Scotland again after he received a lifetime ban after the \'Boozegate\' scandal, but he has decided not to take up Levein\'s offer.', 'News', '2016-05-21 10:14:54', '2016-05-21 10:14:54', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('59', '2010-07-15 00:00:00', 'Black Joins Levein\'s Staff', 'Former Airdrie manager Kenny Black has joined Levein\'s coaching staff for the 2012 campaign.  He joins Peter Houston as Levein\'s assistant.', 'News', '2016-05-21 10:14:55', '2016-05-21 10:14:55', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('60', '2010-07-16 00:00:00', 'Gordon Fractures Arm', 'Scotland and Sunderland Keeper Craig Gordon has suffered a fractured arm after a training incident.  This means that he will miss the first four matches of Scotland\'s Euro 2012 qualification campaign.', 'News', '2016-05-21 10:14:56', '2016-05-21 10:14:56', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('61', '2010-08-02 00:00:00', 'Scotland Squad For Sweden Friendly', 'Neil Alexander (Rangers)<br />\r\nDavid Marshall (Cardiff City)<br />\r\nAllan McGregor (Rangers)<br />\r\n<br />\r\nAlan Hutton (Tottenham Hotspur)<br />\r\nChristophe Berra (Wolves)<br />\r\nKirk Broadfoot (Rangers)<br />\r\nStephen McManus (Middlesbrough)<br />\r\nLee Wallace (Hearts)<br />\r\nAndy Webster (Rangers)<br />\r\nSteven Whittaker (Rangers)<br />\r\n<br /> \r\nCharlie Adam (Blackpool)<br />\r\nScott Brown (Celtic)<br />\r\nGraham Dorrans (West Brom)<br />\r\nDarren Fletcher (Manchester Utd)<br />\r\nLee McCulloch (Rangers)<br />\r\nJames Morrison (West Bromwich Albion)<br />\r\nBarry Robson (Middlesbrough)<br />\r\nKevin Thomson (Middlesbrough)<br />\r\n<br />\r\nKris Boyd (Middlesbrough)<br />\r\nSteven Fletcher (Wolves)<br />\r\nChris Iwelumo (Burnley)<br />\r\nJames McFadden (Birmingham City)<br />\r\nKenny Miller (Rangers)', 'Squad', '2016-05-21 10:14:57', '2016-05-21 10:14:57', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('62', '2010-08-09 00:00:00', 'Scotland Suffer Many Withdraws', 'Craig Levein has had many withdraws from the squad prior to the Sweden friendly. Keeper David Marshall (elbow) joins Lee McCulloch (viral infection), Andy Webster (hamstring), Alan Hutton (groin) and Graham Dorrans on a list of withdrawls.  Craig Gordon and Gary Caldwell were already injured and did not make Levein\'s original squad.  Dundee Utd pair Gary Kenneth and Scott Robertson have been called up along with Everton keeper Iain Turner as replacements.', 'News', '2016-05-21 10:14:57', '2016-05-21 10:14:57', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('63', '2010-08-09 00:00:00', 'Updated Squad For Sweden Friendly', 'Neil Alexander (Rangers)<br />\r\nAllan McGregor (Rangers)<br />\r\nIain Turner (Everton)<br />\r\n<br />\r\nChristophe Berra (Wolves)<br />\r\nKirk Broadfoot (Rangers)<br />\r\nGary Kenneth (Dundee United)<br />\r\nStephen McManus (Middlesbrough)<br />\r\nScott Robertson (Dundee United)<br />\r\nLee Wallace (Hearts)<br />\r\nSteven Whittaker (Rangers)<br />\r\n<br />\r\nCharlie Adam (Blackpool)<br />\r\nScott Brown (Celtic)<br />\r\nDarren Fletcher (Manchester United)<br />\r\nJames Morrison (West Bromwich Albion)<br />\r\nBarry Robson (Middlesbrough)<br />\r\nKevin Thomson (Middlesbrough)<br />\r\n<br />\r\nKris Boyd (Middlesbrough)<br />\r\nSteven Fletcher (Wolves)<br />\r\nChris Iwelumo (Burnley)<br />\r\nJames McFadden (Birmingham City)<br />\r\nKenny Miller (Rangers)', 'Squad', '2016-05-21 10:14:58', '2016-05-21 10:14:58', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('66', '2010-08-24 00:00:00', 'Squad For Lithuania And Liechtenstein', 'David Marshall (Cardiff)<br />\r\nAllan McGregor (Rangers)<br />\r\nMatt Gilks (Blackpool)<br />\r\n<br />\r\nAlan Hutton (Tottenham)<br />\r\nChristophe Berra (Wolves)<br />\r\nKirk Broadfoot (Rangers)<br />\r\nStephen McManus (Middlesbrough)<br />\r\nDavid Weir (Rangers)<br />\r\nLee McCulloch (Rangers)<br />\r\nLee Wallace (Hearts)<br />\r\nAndy Webster (Rangers)<br />\r\nSteven Whittaker (Rangers)<br />\r\nKevin McNaughton (Cardiff)<br />\r\n<br />\r\nCharlie Adam (Blackpool)<br />\r\nScott Brown (Celtic)<br />\r\nGraham Dorrans (West Brom)<br />\r\nDarren Fletcher (Man Utd)<br />\r\nJames Morrison (West Brom)<br />\r\nBarry Robson (Middlesbrough)<br />\r\nPaul Hartley (Aberdeen)<br />\r\n<br />\r\nKris Boyd (Middlesbrough)<br />\r\nSteven Fletcher (Wolves)<br />\r\nChris Iwelumo (Burnley)<br />\r\nJames McFadden (Birmingham)<br />\r\nKenny Miller (Rangers)<br />\r\nSteven Naismith (Rangers)', 'Squad', '2016-05-21 10:15:05', '2016-05-21 10:15:05', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('129', '2012-02-20 00:00:00', 'Scotland Squad For Slovenia Friendly', 'Allan McGregor (Rangers)<br />Craig Gordon (Sunderland)<br />Matt Gilks (Blackpool)<br /><br />Phil Bardsley (Sunderland)<br />Christophe Berra (Wolverhampton Wanderers)<br />Gary Caldwell (Wigan Athletic)<br />Alan Hutton (Aston Villa)<br />Charlie Mulgrew (Celtic)<br />Grant Hanley (Blackburn Rovers)<br />Russell Martin (Norwich City)<br /><br />Charlie Adam (Liverpool)<br />Barry Bannan (Aston Villa)<br />Scott Brown (Celtic)<br />Don Cowie (Cardiff City)<br />Graham Dorrans (West Bromwich Albion)<br />James Forrest (Celtic)<br />Barry Robson (Middlesbrough)<br />James Morrison (West Bromwich Albion)<br />Robert Snodgrass (Leeds United)<br />Matt Phillips (Blackpool)<br /><br />David Goodwillie (Blackburn Rovers)<br />Kenny Miller (Cardiff City)<br />Jamie Mackie (Queens Park Rangers)<br />Craig Mackail-Smith (Brighton and Hove Albion)', 'Squad', '2016-05-21 10:15:06', '2016-05-21 10:15:06', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('68', '2010-09-03 00:00:00', 'Scots Earn Goalless Draw In Kaunas', 'Scotland started their Euro 2012 qualification campaign with a 0-0 draw away to Lithuania. It was a promising performance but they could not get the win that they deserved.', 'News', '2016-05-21 10:15:07', '2016-05-21 10:15:07', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('69', '2010-09-07 00:00:00', 'McManus Spares Scots Blushes', 'Stephen McManus scored a 97th minute winner to defeat minnows Liechtenstein 2-1.  Kenny Miller had earlier levelled the score after Liechtenstein took a second half lead.', 'News', '2016-05-21 10:15:08', '2016-05-21 10:15:08', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('70', '2010-09-17 00:00:00', 'McFadden Suffers Injury', 'Birmingham forward James McFadden will face a lengthy spell out though injury after he suffered ligament damage to his knee in training.  He will miss the double header against Czech Republic and Spain.', 'News', '2016-05-21 10:15:10', '2016-05-21 10:15:10', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('71', '2010-09-26 00:00:00', 'Scotland Drop Boyd', 'Craig Levein has decided to drop striker Kris Boyd following a poor start to his Middlesbrough career. He has scored just once in eight games this season, but Levein stated that he would return to the squad when his form improved.', 'News', '2016-05-21 10:15:11', '2016-05-21 10:15:11', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('72', '2010-09-27 00:00:00', 'No Scotland Return For Ferguson', 'Following a discussion with Craig Levein, former Scotland Captain Barry Ferguson has decided not to return to the Scotland setup.', 'News', '2016-05-21 10:15:12', '2016-05-21 10:15:12', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('73', '2010-09-30 00:00:00', 'Gordon and Caldwell Recalled For Scotland', 'Keeper Craig Gordon and defender Gary Caldwell have both been recalled to the Scotland squad following injuries.  Caldwell may play in one of the games but Allan McGregor is favourite to play in goals ahead of Gordon who is still recovering from a broken arm.', 'News', '2016-05-21 10:15:12', '2016-05-21 10:15:12', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('74', '2010-09-30 00:00:00', 'Squad For Czech Republic and Spain', 'Allan McGregor (Rangers)<br />\r\nMatt Gilks (Blackpool)<br />\r\nCraig Gordon (Sunderland)<br />\r\n<br />\r\nAlan Hutton (Tottenham Hotspur)<br />\r\nChristophe Berra (Wolves)<br />\r\nKirk Broadfoot (Rangers)<br />\r\nStephen McManus (Middlesbrough)<br />\r\nGary Caldwell (Wigan)<br />\r\nDavid Weir (Rangers)<br />\r\nSteven Whittaker (Rangers)<br />\r\n<br />\r\nCharlie Adam (Blackpool)<br />\r\nScott Brown (Celtic)<br />\r\nGraham Dorrans (West Brom)<br />\r\nLee McCulloch (Rangers)<br />\r\nDarren Fletcher (Manchester Utd)<br />\r\nJames Morrison (West Brom)<br />\r\nBarry Robson (Middlesbrough)<br />\r\nJay McEveley (Barnsley)<br />\r\nShaun Maloney (Celtic)<br />\r\n<br />\r\nSteven Fletcher (Wolves)<br />\r\nChris Iwelumo (Burnley)<br />\r\nJamie Mackie (QPR)<br />\r\nKenny Miller (Rangers)<br />\r\nSteven Naismith (Rangers)', 'Squad', '2016-05-21 10:15:13', '2016-05-21 10:15:13', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('75', '2010-10-06 00:00:00', 'Brown Withdrawn From Squad', 'Scott Brown has withdrawn from the squad for the double header amid fears that he may aggravate an ankle injury.  Sunderland\'s Phil Bardsley has been called in to replace him.  The former Rangers player qualifies as his father is Scottish.', 'News', '2016-05-21 10:15:15', '2016-05-21 10:15:15', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('76', '2010-10-08 00:00:00', 'Defensive Scots Defeated In Prague', 'An ultra defensive Scotland suffered a 1-0 defeat to Czech Republic.  Craig Levein controversially started with a 4-6-0 formation with no strikers as he played for a 0-0 draw.', 'News', '2016-05-21 10:15:18', '2016-05-21 10:15:18', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('77', '2010-10-12 00:00:00', 'Brave Scots Suffer Narrow Defeat', 'A fighting Scotland team came close to holding World and European champions Spain at Hampden.  Scotland came from 2-0 down to level the match, before Spain scored a late winner.', 'News', '2016-05-21 10:15:20', '2016-05-21 10:15:20', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('78', '2010-11-15 00:00:00', 'Levein Suffers Nine Withdrawls', 'Nine players have withdrawn from the squad that was chosen to play the friendly against Faroe Islands.  Christophe Berra, Chris Burke, Gary Caldwell, Graham Dorrans, Matt Gilks, Alan Hutton, James Morrison, Steven Naismith and Steven Whittaker were the withdrawls.', 'News', '2016-05-21 10:15:21', '2016-05-21 10:15:21', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('79', '2010-11-15 00:00:00', 'Revised Squad For Faroe Islands', 'Cammy Bell (Kilmarnock)<br /> \r\nCraig Gordon (Sunderland)<br />\r\n<br />\r\nPhil Bardsley (Sunderland)<br />\r\nSteven Caldwell (Wigan)<br />\r\nDanny Wilson (Liverpool)<br />\r\nStephen Crainey (Blackpool)<br />\r\nGary Kenneth (Dundee Utd)<br />\r\nPaul Caddis (Swindon)<br />\r\nSteven Saunders (Motherwell)<br />\r\n<br />\r\nCharlie Adam (Blackpool)<br />\r\nBarry Bannan (Aston Villa)<br />\r\nKris Commons (Derby)<br />\r\nDarren Fletcher (Manchester United)<br />\r\nShaun Maloney (Celtic)<br />\r\nBarry Robson (Middlesbrough)<br />\r\nCraig Bryson (Kilmarnock)<br />\r\nMurray Davidson (St Johnstone)<br />\r\nJames McArthur (Wigan)<br />\r\n<br />\r\nDavid Goodwillie (Dundee United)<br />\r\nKevin Kyle (Hearts)<br />\r\nJamie Mackie (Queens Park Rangers)', 'Squad', '2016-05-21 10:15:21', '2016-05-21 10:15:21', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('80', '2010-11-16 00:00:00', 'Inexperienced Scots Defeat Faroes', 'A Scotland side that included 7 debutants put on an impressive display to defeat the Faroe Islands 3-0 at Pittodrie.', 'News', '2016-05-21 10:15:23', '2016-05-21 10:15:23', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('81', '2010-12-17 00:00:00', 'Fixtures for Nations Cup Announced', 'The Nations Cup fixtures have been announced.  The tournament which is held in Dublin, will have fixtures in February and May 2011.  Scotland will play Northern Ireland on February 9th, Wales on May 25th, and hosts Republic of Ireland on May 29th.', 'News', '2016-05-21 10:15:24', '2016-05-21 10:15:24', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('82', '2011-02-01 00:00:00', 'Squad For Northern Ireland Match', 'C Bell (Kilmarnock)<br />\r\nC Gordon (Sunderland)<br />\r\nA McGregor (Rangers)<br />\r\n<br />\r\nP Bardsley (Sunderland)<br />\r\nC Berra (Wolves)<br />\r\nG Caldwell (Wigan Athletic)<br />\r\nG Hanley (Blackburn Rovers)<br />\r\nA Hutton (Tottenham Hotspur)<br />\r\nD Wilson (Liverpool)<br />\r\nM Wilson (Celtic)<br />\r\n<br />\r\nC Adam (Blackpool)<br />\r\nB Bannan (Aston Villa)<br />\r\nS Brown (Celtic)<br />\r\nK Commons (Celtic)<br />\r\nG Dorrans (West Brom)<br />\r\nD Fletcher (Manchester Utd)<br />\r\nL McCulloch (Rangers)<br />\r\nJ Morrison (WBA)<br />\r\n<br />\r\nC Maguire (Aberdeen)<br />\r\nK Miller (Bursaspor)<br />\r\nS Naismith (Rangers)<br />\r\nR Snodgrass (Leeds Utd)', 'Squad', '2016-05-21 10:15:32', '2016-05-21 10:15:32', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('83', '2011-02-01 00:00:00', 'Hanley and Maguire Called Up For Nations Cup', 'Blackburn defender Grant Hanley and Aberdeen striker Chris Maguire have been included in Craig Levein\'s squad for the Nations Cup match against Northern Ireland.  Leeds Utd forward Robert Snodgrass has also been included.  Dundee Utd striker David Goodwillie, who was recently charged with sexual assault, has been left out of the squad.', 'News', '2016-05-21 10:15:33', '2016-05-21 10:15:33', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('128', '2012-02-15 00:00:00', 'Scotland Arrange Friendly In USA', 'The SFA have arranged a friendly match against USA on 26th May in Jacksonville, Florida.  Kick-off is arranged for 20:00 ET, which is 01:00 BST.', 'News', '2016-05-21 10:15:34', '2016-05-21 10:15:34', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('87', '2011-02-02 00:00:00', 'Fletcher Rejects Call-up By Text', 'Steven Fletcher pulled out of the Scotland squad by sending a text message to the SFA.  Fletcher previously criticised Levein\'s formation against Czech Republic but Levein held no grudge.  Following this it looks like Fletcher\'s international career may be over.', 'News', '2016-05-21 10:15:34', '2016-05-21 10:15:34', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('90', '2011-02-09 00:00:00', 'Miller To Captain Scotland', 'Kenny Miller is to captain Scotland in the absence of Darren Fletcher who withdrew due to injury.  He was also joined by Craig Gordon, Graham Dorrans and Lee McCulloch, who also withdrew.', 'News', '2016-05-21 10:15:35', '2016-05-21 10:15:35', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('91', '2011-02-09 00:00:00', 'Impressive Scots Thrash Irish', 'Scotland put on an impressive display in a 3-0 victory over Northern Ireland.  Goals by Miller, McArthur, and Commons put Scotland joint top of the Nations Cup with Republic of Ireland.', 'News', '2016-05-21 10:15:36', '2016-05-21 10:15:36', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('92', '2011-02-15 00:00:00', 'Scotland Line Up Brazil Friendly', 'The SFA have confirmed that Scotland will play Brazil in a glamour friendly on Sunday 27th March.  The match will be played at Arsenal\'s Emirates Stadium after Scotland have been away at a training camp in La Manga, Spain for five days. It will be Scotland\'s first match south of the border since they defeated England 1-0 at Wembley in 1999.', 'News', '2016-05-21 10:15:37', '2016-05-21 10:15:37', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('95', '2011-03-17 00:00:00', 'Squad For Brazil Match', 'Craig Gordon (Sunderland)<br />\r\nAllan McGregor (Rangers)<br />\r\nIain Turner (Everton)<br />\r\n<br />\r\nPhil Bardsley (Sunderland)<br />\r\nChristophe Berra (Wolvers)<br />\r\nGary Caldwell (Wigan Athletic)<br />\r\nStephen Crainey (Blackpool)<br />\r\nGrant Hanley (Blackburn Rovers)<br />\r\nAlan Hutton (Tottenham Hotspur)<br />\r\nSteven Whittaker (Rangers)<br />\r\nDanny Wilson (Liverpool)<br />\r\nMark Wilson (Celtic)<br />\r\n<br />\r\nCharlie Adam (Blackpool)<br />\r\nBarry Bannan (Aston Villa)<br />\r\nScott Brown (Celtic)<br />\r\nKris Commons (Celtic)<br />\r\nDon Cowie (Watford)<br />\r\nMurray Davidson (St Johnstone)<br />\r\nJames McArthur (Wigan Athletic)<br />\r\nJames Morrison (West Brom)<br />\r\n<br />\r\nChris Maguire (Aberdeen)<br />\r\nKenny Miller (Bursaspor)<br />\r\nSteven Naismith (Rangers)<br />\r\nRobert Snodgrass (Leeds United)', 'Squad', '2016-05-21 10:15:52', '2016-05-21 10:15:52', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('96', '2011-03-27 00:00:00', 'Scots Suffer Defeat To Brazil', 'Scotland were defeated 2-0 by Brazil at Arsenal\'s Emirates Stadium.  Two goals by Naymar, one in either half, was enough to give the former world champions a victory.', 'News', '2016-05-21 10:15:53', '2016-05-21 10:15:53', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('97', '2011-03-29 00:00:00', 'Naymar accuses Scots of Racism', 'Brazilian striker Naymar has accused the Scotland fans of being racist after he was booed throughout the match.  The Scotland fans said that this was the result of his unsporting behavour.  A banana was also thrown on the pitch, but this came from the Brazilian end.  A German tourist later admitted to throwing the banana.', 'News', '2016-05-21 10:15:53', '2016-05-21 10:15:53', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('100', '2011-04-13 00:00:00', 'Scotland Plummit In World Rankings', 'Scotland have fallen from 50th to 66th in the latest FIFA World Rankings.  This is Scotland\'s lowest since September 2005 and this may result in Scotland being in pot 4 for the draw for the 2014 World Cup Qualifiers.  This makes the remaining Nations Cup matches important for Scotland.', 'News', '2016-05-21 10:15:54', '2016-05-21 10:15:54', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('127', '2011-12-13 00:00:00', 'Fletcher Takes Break From Football', 'Scotland captain Darren Fletcher is taking a break from football due to a serious abdominal problem.  He is suffering from ulcerative colitis which is a chronic inflammatory bowel condition, and he is taking the extended break because of medical advice.  Hopefully the break will allow him to overcome this and play football again.', 'News', '2016-05-21 10:15:55', '2016-05-21 10:15:55', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('103', '2011-05-17 00:00:00', 'Squad For Nations Cup Games', 'Matt Gilks (Blackpool)<br />\r\nAllan McGregor (Rangers)<br />\r\nIain Turner (Everton)<br /> \r\n<br />\r\nPhil Bardsley (Sunderland)<br />\r\nChristophe Berra (Wolves)<br />\r\nGary Caldwell (Wigan Athletic)<br />\r\nStephen Crainey (Blackpool)<br />\r\nGrant Hanley (Blackburn Rovers)<br />\r\nRussell Martin (Norwich City)<br />\r\nSteven Whittaker (Rangers)<br />\r\nDanny Wilson (Liverpool)<br />\r\n<br />\r\nCharlie Adam (Blackpool)<br />\r\nBarry Bannan (Aston Villa)<br />\r\nScott Brown (Celtic)<br />\r\nKris Commons (Celtic)<br />\r\nJames Forrest (Celtic)<br />\r\nJames McArthur (Wigan Athletic)<br />\r\nJames Morrison (West Bromwich Albion)<br />\r\nBarry Robson (Middlesbrough)<br />\r\n<br />\r\nCraig Mackail-Smith (Peterborough)<br />\r\nChris Maguire (Aberdeen)<br />\r\nRoss McCormack (Leeds United)<br />\r\nKenny Miller (Bursaspor)<br />\r\nSteven Naismith (Rangers)', 'Squad', '2016-05-21 10:15:56', '2016-05-21 10:15:56', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('104', '2011-05-25 00:00:00', 'Scotland Defeat Wales', 'Scotland came from a goal behind to defeat Wales for the first time in 27 years.  Second half goals from James Morrison, Kenny Miller and Christophe Berra made it two wins out of two for Scotland after Robert Earnshaw gave Wales a half time lead.', 'News', '2016-05-21 10:15:57', '2016-05-21 10:15:57', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('107', '2011-05-29 00:00:00', 'Scots Lose Out To Irish', 'Scotland\'s hopes of winning the inaugural Nations Cup were killed when a first half strike by Robbie Keane gave Republic a 1-0 Win.', 'News', '2016-05-21 10:15:58', '2016-05-21 10:15:58', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('108', '2011-07-30 00:00:00', 'Scotland Get Favourable Draw', 'Scotland avoided any of the big guns in the qualifying draw for World Cup 2014.  They were drawn with Croatia, Serbia, Belgium, Macedonia and Wales.  At the same time though there are no minnows in the group with Wales being the lowest seeds.  Craig Levein was happy with the draw.', 'News', '2016-05-21 10:15:59', '2016-05-21 10:15:59', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('126', '2011-11-23 00:00:00', 'Fixture Dates Are Arranged', 'Scotland\'s fixture dates have been arranged for the 2014 qualification campaign.  Scotland\'s first two matches are at home to Serbia and Macedonia.  The full fixture list can be seen <a href=\"/competitions/world-cup/2014-qualifiers/\">here</a>.', 'News', '2016-05-21 10:16:00', '2016-05-21 10:16:00', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('110', '2011-08-10 00:00:00', 'Danes Are Defeated At Hampden', 'Scotland put on an impressive performance to defeat Denmark 2-1 in a friendly at Hampden.  This was Scotland\'s first win over Denmark since 1975.', 'News', '2016-05-21 10:17:21', '2016-05-21 10:17:21', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('111', '2011-08-26 00:00:00', 'Fletcher Returns To Squad', 'Scotland captain Darren Fletcher has returned to the Scotland squad for the double header against Czech Republic and Lithuania.  The Man Utd player has returned to full fitness after suffering an illness at the end of last season.', 'News', '2016-05-21 10:17:20', '2016-05-21 10:17:20', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('112', '2011-08-26 00:00:00', 'Squad For Czech Republic and Lithuania', 'Matt Gilks (Blackpool)<br />\r\nAllan McGregor (Rangers)<br />\r\nIain Turner (Preston North End)<br />\r\n<br />\r\nPhil Bardsley (Sunderland)<br />Christophe Berra (Wolverhampton Wanderers)<br />\r\nGary Caldwell (Wigan Athletic)<br />\r\nStephen Crainey (Blackpool)<br />\r\nGrant Hanley (Blackburn Rovers)<br />\r\nAlan Hutton (Tottenham Hotspur)<br />\r\nSteven Whittaker (Rangers)<br />\r\nDanny Wilson (Liverpool)<br />\r\n<br />\r\nCharlie Adam (Liverpool)<br />\r\nBarry Bannan (Aston Villa)<br />\r\nScott Brown (Celtic)<br />\r\nDon Cowie (Cardiff City)<br />\r\nGraham Dorrans (West Bromwich Albion)<br />\r\nDarren Fletcher (Manchester United)<br />\r\nJames Forrest (Celtic)<br />\r\nJames Morrison (West Bromwich Albion)<br />\r\nBarry Robson (Middlesbrough)<br />\r\nRobert Snodgrass (Leeds United)<br />\r\n<br />\r\nDavid Goodwillie (Blackburn Rovers)<br />\r\nCraig Mackail-Smith (Brighton and Hove Albion)<br />\r\nKenny Miller (Cardiff City)<br />\r\nSteven Naismith (Rangers)', 'Squad', '2016-05-21 10:17:19', '2016-05-21 10:17:19', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('113', '2011-09-03 00:00:00', 'Scots Are Robbed By Czechs', 'Scotland were cheated out of a victory in a must win game against Czech Republic when the referee  awarded a last minute penalty for a blatant dive.  Scotland went ahead twice through Miller and Fletcher but the Czechs equalised twice to gain a 2-2 draw.', 'News', '2016-05-21 10:17:18', '2016-05-21 10:17:18', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('114', '2011-09-06 00:00:00', 'Scots Gain Nervy Victory Over Lithuania', 'Scotland gained a vital 1-0 victory over Lithuania with a second half goal from Steven Naismith.  Captain Darren Fletcher missed a penalty in the first half in a match that Scotland needed to win to have the slightest chance to qualify. ', 'News', '2016-05-21 10:17:18', '2016-05-21 10:17:18', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('115', '2011-10-03 00:00:00', 'Scots Squad for Liechtenstein and Spain', 'David Marshall (Cardiff City)<br />\r\nAllan McGregor (Rangers)<br />\r\nCammy Bell (Kilmarnock)<br />\r\n<br />\r\nStephen McManus (Middlesbrough)<br />\r\nSteven Whittaker (Rangers)<br />\r\nAlan Hutton (Aston Villa)<br />\r\nPhil Bardsley (Sunderland)<br />\r\nGrant Hanley (Blackburn Rovers)<br />\r\nLee Wallace (Rangers)<br />\r\nChristophe Berra (Wolverhampton Wanderers)<br />\r\nGary Caldwell (Wigan Athletic)<br />\r\n<br />\r\nCharlie Adam (Liverpool)<br />\r\nBarry Bannan (Aston Villa)<br />\r\nDon Cowie (Cardiff City)<br />\r\nGraham Dorrans (West Bromwich Albion)<br />\r\nDarren Fletcher (Manchester United)<br />\r\nJames Forrest (Celtic)<br />\r\nJames Morrison (West Bromwich Albion)<br />\r\nSteven Naismith (Rangers)<br />\r\nBarry Robson (Middlesbrough)<br />\r\nRobert Snodgrass (Leeds United)<br />\r\nDanny Swanson (Dundee United)<br />\r\n<br />\r\nDavid Goodwillie (Blackburn Rovers)<br />\r\nCraig Mackail-Smith (Brighton and Hove Albion)<br />\r\nKenny Miller (Cardiff City)', 'Squad', '2016-05-21 10:17:17', '2016-05-21 10:17:17', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('116', '2011-09-07 00:00:00', 'Miller Looks To Miss Liechtensten', 'Kenny Miller looks to be out of the qualifier away to Liechtenstein due to a groin injury.  He may be fit for the Spain game.  Meanwhile captain Darren Fletcher has recovered from tonsilitis and looks likely to feature against Liechtenstein.', 'News', '2016-05-21 10:17:16', '2016-05-21 10:17:16', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('117', '2011-09-07 00:00:00', 'Spain Help Scots', 'Spain have given Scotland a chance of finishing in second place by defeating Czech Republic 2-0 in Prague.  If Scotland defeat Liechtenstein they will leapfrog the Czechs into second place.', 'News', '2016-05-21 10:17:15', '2016-05-21 10:17:15', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('121', '2011-10-13 00:00:00', 'Scotland To Arrange Friendly', 'Scotland are looking to arrange a friendly match when the Euro 2012 play-offs are being played, with Cyprus looking like possible opponents.  There is also talk of a fixture against England at Wembley in 2013 to mark the 150th birthday of the English FA.', 'News', '2016-05-21 10:17:15', '2016-05-21 10:17:15', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('118', '2011-09-08 00:00:00', 'Win In Liechtenstein Keeps Hopes Alive', 'Scotland got a 1-0 victory in Liechtenstein to keep their chances alive.  A first half header by Craig Mackail-Smith was enough to earn 3 points to leapfrog the Czechs.', 'News', '2016-05-21 10:17:14', '2016-05-21 10:17:14', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('119', '2011-10-11 00:00:00', 'Qualification Hopes Are Over', 'Scotland were defeated 3-1 by World and European Champions Spain in Alicante. At the same time the Czechs recorded a 4-1 victory over Lithuania to end Scotland\'s qualification hopes.  Goals by Silva (2) and Villa gave Spain a 3-0 lead before a Goodwillie penalty made the final scoreline 3-1.', 'News', '2016-05-21 10:17:13', '2016-05-21 10:17:13', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('120', '2011-10-13 00:00:00', 'Scotland to Arrange Fixtures with Rivals', 'Scotland, Belgium, Croatia, Serbia, Macedonia and Wales will hold a World Cup 2014 qualifying fixtures meeting on 23 November.', 'News', '2016-05-21 10:17:13', '2016-05-21 10:17:13', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('122', '2011-11-01 00:00:00', 'Bannan Left Out Of Scotland Squad', 'Barry Bannan has been left out of the Scotland squad to play Cyprus. This follows his arrest for drink driving.  Meanwhile Huddersfield striker Jordan Rhodes, son of former Dunfermline keeper Andy, has been included.  He qualifies to play for Scotland as he spent more than 5 years at school in Scotland.', 'News', '2016-05-21 10:17:10', '2016-05-21 10:17:10', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('123', '2011-11-01 00:00:00', 'Scotland Squad For Cyprus Friendly', 'Allan McGregor (Rangers)<br />\r\nDavid Marshall (Cardiff City)<br />\r\nMatt Gilks (Blackpool)<br />\r\n<br />\r\nPhil Bardsley (Sunderland)<br />\r\nChristophe Berra (Wolverhampton Wanderers)<br />\r\nGary Caldwell (Wigan Athletic)<br />\r\nGrant Hanley (Blackburn Rovers)<br />\r\nAlan Hutton (Aston Villa)<br />\r\nRussell Martin (Norwich City)<br />\r\nLee Wallace (Rangers)<br />\r\nSteven Whittaker (Rangers)<br />\r\n<br />\r\nCharlie Adam (Liverpool)<br />\r\nDon Cowie (Cardiff City)<br />\r\nGraham Dorrans (West Bromwich Albion)<br />\r\nDarren Fletcher (Manchester United)<br />\r\nJames McArthur (Wigan Athletic)<br />\r\nJames Morrison (West Bromwich Albion)<br />\r\nBarry Robson (Middlesbrough)<br />\r\nRobert Snodgrass (Leeds United)<br />\r\n<br />\r\nDavid Goodwillie (Blackburn Rovers)<br />\r\nCraig Mackail-Smith (Brighton and Hove Albion)<br />\r\nJamie Mackie (Queens Park Rangers)<br />\r\nKenny Miller (Cardiff City)<br />\r\nJordan Rhodes (Huddersfield Town)', 'Squad', '2016-05-21 10:17:08', '2016-05-21 10:17:08', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('124', '2011-11-11 00:00:00', 'Scots Get Narrow Win In Cyprus', 'Goals by Kenny Miller and Jamie Mackie were enough to earn Scotland a 2-1 victory in the friendly against Cyprus.', 'News', '2016-05-21 10:17:07', '2016-05-21 10:17:07', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('125', '2011-11-18 00:00:00', 'Scotland Setup Slovenia Friendly', 'Scotland have arranged a friendly away to Slovenia on 29th February.  The location and kick-off time have still to be determined.  The last meeting ended in a 3-0 victory for Scotland in Celje.', 'News', '2016-05-21 10:17:07', '2016-05-21 10:17:07', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('130', '2012-02-29 00:00:00', 'Scotland Earn Draw In Slovenia', 'A Christophe Berra header was enough to earn Scotland a 1-1 draw in an even friendly away to Slovenia.  Slovenia took the lead in the 33rd minute, only for Berra to equalise 6 minutes later.', 'News', '2016-05-21 10:17:06', '2016-05-21 10:17:06', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('131', '2012-03-05 00:00:00', 'Scotland Arrange Autumn Friendlies', 'Scotland have arranged friendlies against Australia and Luxembourg.  They will play Australia on 15th August at Easter Road, and they will travel to Luxembourg for a match on 14th November.', 'News', '2016-05-21 10:17:05', '2016-05-21 10:17:05', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('132', '2012-05-15 00:00:00', 'Scotland Squad For USA Friendly', 'Matt Gilks (Blackpool)<br />Craig Gordon (Sunderland)<br />Allan McGregor (Rangers)<br /><br />Phil Bardsley (Sunderland)<br />Steven Whittaker (Rangers)<br />Christophe Berra (Wolves)<br />Gary Caldwell (Wigan Athletic)<br />Russell Martin (Norwich City)<br />Charlie Mulgrew (Celtic)<br />Lee Wallace (Rangers)<br />Andy Webster (Hearts)<br /><br />Barry Bannan (Aston Villa)<br />Scott Brown (Celtic)<br />Craig Bryson (Derby County)<br />Don Cowie (Cardiff City)<br />James McArthur (Wigan Athletic)<br />Matt Phillips (Blackpool)<br />Shaun Maloney (Wigan Athletic)<br /><br />David Goodwillie (Blackburn Rovers)<br />Craig Mackail-Smith (Brighton)<br />Kenny Miller (Cardiff City)<br />Johnny Russell (Dundee United)', 'Squad', '2016-05-21 10:17:04', '2016-05-21 10:17:04', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('133', '2012-05-21 00:00:00', 'Scotland\'s Away Games on BBC', 'Scotland\'s matches away to Belgium (16th October), Serbia (26th March), Croatia (7th June), and Macedonia (10th September) will be shown live on the BBC.', 'News', '2016-05-21 10:17:04', '2016-05-21 10:17:04', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('134', '2012-05-27 00:00:00', 'Scotland Are Thrashed In America', 'Scotland suffered a 5-1 defeat to an impressive USA team in Florida.  A hat trick by Landon Donovan plus goals by Michael Bradley and Jermaine Jones piled the misery on Scotland, whose only consolation was a Geoff Cameron own goal.', 'News', '2016-05-21 10:17:03', '2016-05-21 10:17:03', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('135', '2012-06-17 00:00:00', 'Scotland To Face England At Wembley', 'To mark the 150th anniversary of the English FA, Scotland will play England at Wembley for a friendly on 14th August 2013.  It will be the first time they played since the Euro 2000 play offs in November 1999.', 'News', '2016-05-21 10:17:02', '2016-05-21 10:17:02', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('136', '2012-08-06 00:00:00', 'Fletcher To Train With Scots', 'Scotland captain Darren Fletcher will train with the Scotland squad before the friendly with Australia.  Fletcher has not played since November due to a chronic bowel condition that he has.', 'News', '2016-05-21 10:17:01', '2016-05-21 10:17:01', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('137', '2012-08-06 00:00:00', 'Scotland Squad To Face Australia', 'Allan McGregor (Besiktas)<br />\r\nMatt Gilks (Blackpool)<br />\r\nDavid Marshall (Cardiff)<br />\r\n<br />\r\nPhil Bardsley (Sunderland)<br />\r\nChristophe Berra (Wolves)<br />\r\nGary Caldwell (Wigan)<br />\r\nDanny Fox (Southampton)<br />\r\nGrant Hanley (Blackburn)<br />\r\nAlan Hutton (Aston Villa)<br />\r\nRussell Martin (Norwich)<br />\r\nCharlie Mulgrew (Celtic)<br />\r\nAndy Webster (Hearts)<br />\r\n<br />\r\nCharlie Adam (Liverpool)<br />\r\nBarry Bannan (Aston Villa)<br />\r\nDon Cowie (Cardiff)<br />\r\nGraham Dorrans (West Brom)<br />\r\nJames Forrest (Celtic)<br />\r\nJames Morrison (West Brom)<br />\r\nMatt Phillips (Blackpool)<br />\r\nRobert Snodgrass (Norwich)<br />\r\n<br />\r\nJamie Mackie (QPR)<br />\r\nShaun Maloney (Wigan)<br />\r\nSteven Naismith (Everton)<br />\r\nJordan Rhodes (Huddersfield)', 'Squad', '2016-05-21 10:17:01', '2016-05-21 10:17:01', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('138', '2012-08-15 00:00:00', 'Scotland Get Impressive Victory Over The Aussies', 'An impressive performance by Scotland saw them defeat Australia 3-1 at Easter Road.  Goals by Jordan Rhodes, Ross McCormack and an own goal by Jason Davidson cancelled out an opening goal by Mark Bresciano for the Aussies.', 'News', '2016-05-21 10:17:00', '2016-05-21 10:17:00', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('139', '2012-08-17 00:00:00', 'Scotland Set Up Estonia Friendly', 'Scotland have arranged a friendly against Estonia to be played on 6th February at Pittodrie.  It will be their first match against Estonia since a 1-0 victory in Tallinn in 2004.', 'News', '2016-05-21 10:16:59', '2016-05-21 10:16:59', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('140', '2012-08-30 00:00:00', 'Scotland Squad For Serbia and Macedonia', 'Matt Gilks (Blackpool)<br />\r\nAllan McGregor (Besiktas)<br />\r\nDavid Marshall (Cardiff City)<br />\r\n<br />\r\nChristophe Berra (Wolverhampton Wanderers)<br />\r\nGary Caldwell (Wigan Athletic)<br />\r\nDanny Fox (Southampton)<br />\r\nGrant Hanley (Blackburn Rovers)<br />\r\nAlan Hutton (Aston Villa)<br />\r\nRussell Martin (Norwich City)<br />\r\nCharlie Mulgrew (Celtic)<br />\r\nAndy Webster (Hearts)<br />\r\n<br />\r\nCharlie Adam (Stoke City)<br />\r\nDon Cowie (Cardiff City)<br />\r\nGraham Dorrans (West Bromwich Albion)<br />\r\nJames Forrest (Celtic)<br />\r\nShaun Maloney (Wigan Athletic)<br />\r\nJames Morrison (West Bromwich Albion)<br />\r\nMatt Phillips (Blackpool)<br />\r\nRobert Snodgrass (Norwich City)<br />\r\n<br />\r\nRoss McCormack (Leeds United)<br />\r\nJamie Mackie (QPR)<br />\r\nKenny Miller (Vancouver Whitecaps)<br />\r\nSteven Naismith (Everton)<br />\r\nJordan Rhodes (Blackburn Rovers) ', 'Squad', '2016-05-21 10:16:58', '2016-05-21 10:16:58', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('141', '2012-09-08 00:00:00', 'Scotland Suffer Stalemate With Serbia', 'Scotland opened their World Cup campaign with a goalless draw against Serbia in a poor match at Hampden.', 'News', '2016-05-21 10:16:55', '2016-05-21 10:16:55', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('142', '2012-09-11 00:00:00', 'Scotland Suffer Poor Draw With Macedonia', 'Scotland dropped another two points when they drew 1-1 at home to Macedonia.  Kenny Miller equalised after Macedonia took an early lead.', 'News', '2016-05-21 10:16:53', '2016-05-21 10:16:53', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('143', '2012-10-02 00:00:00', 'Levein Recalls Steven Fletcher', 'Sunderland striker Steven Fletcher has been recalled to the Scotland squad after a long exile.  After Fletcher withdrew from a squad via a text message, Levein refused to pick Fletcher even when he was scoring for Sunderland.', 'News', '2016-05-21 10:16:52', '2016-05-21 10:16:52', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('144', '2012-10-02 00:00:00', 'Scotland Squad For Wales And Belgium', 'Matt Gilks (Blackpool)<br />\r\nAllan McGregor (Besiktas)<br />\r\nDavid Marshall (Cardiff City)<br />\r\n<br />\r\nChristophe Berra (Wolves)<br />\r\nGary Caldwell (Wigan Athletic)<br />\r\nDaniel Fox (Southampton)<br />\r\nGrant Hanley (Blackburn Rovers)<br />\r\nAlan Hutton (Aston Villa)<br />\r\nRussell Martin (Norwich City)<br />\r\nCharlie Mulgrew (Celtic)<br />\r\nAndy Webster (Heart of Midlothian)<br />\r\n<br />\r\nCharlie Adam (Stoke)<br />\r\nScott Brown (Celtic)<br />\r\nDarren Fletcher (Manchester United)<br />\r\nJames Forrest (Celtic)<br />\r\nJames McArthur (Wigan Athletic)<br />\r\nShaun Maloney (Wigan Athletic)<br />\r\nJames Morrison (West Bromwich Albion)<br />\r\nRobert Snodgrass (Norwich City)<br />\r\n<br />\r\nSteven Fletcher (Sunderland)<br />\r\nJamie Mackie (Queens Park Rangers)<br />\r\nKenny Miller (Vancouver Whitecaps)<br />\r\nSteven Naismith (Everton)<br />\r\nMatt Phillips (Blackpool)<br />\r\nJordan Rhodes (Blackburn Rovers)', 'Squad', '2016-05-21 10:16:52', '2016-05-21 10:16:52', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('145', '2012-10-05 00:00:00', 'Naismith Recieves Two Match Ban', 'Steven Naismith was given a two match ban for elbowing Serbia\'s Srdan Mijailovic in an off the ball incident.  This means that Naismith will miss the double header against Wales and Belgium.', 'News', '2016-05-21 10:16:51', '2016-05-21 10:16:51', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('146', '2012-10-12 00:00:00', 'Scotland Suffer Embarrassing Defeat', 'The Scots World Cup hopes are all but over after they suffered a 2-1 defeat to Wales in Cardiff.  Morrison gave Scotland the lead before two late Bale goals handed victory to Wales.', 'News', '2016-05-21 10:16:50', '2016-05-21 10:16:50', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('147', '2012-10-16 00:00:00', 'Scots Are Outclassed In Brussels', 'Scotland were given a lesson in footballing by Belgium who defeated Scotland 2-0 in Belgium.  Goals by Benteke and Kompany all but ended Scotland\'s chances of qualifying for the 2014 World Cup Finals.', 'News', '2016-05-21 10:16:50', '2016-05-21 10:16:50', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('148', '2012-11-05 00:00:00', 'Levein Is Sacked As Scotland Manager', 'The SFA decided to sack Craig Levein as Scotland manager after a poor run of results.  With only 3 wins in 12 competitive games the SFA decided to find a new manager.  Billy Stark will take temporary charge for the Luxembourg friendly.', 'News', '2016-05-21 10:16:49', '2016-05-21 10:16:49', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('149', '2012-11-07 00:00:00', 'Scotland Squad For Luxembourg Friendly', 'Cammy Bell (Kilmarnock)<br /> Matt Gilks (Blackpool)<br /> David Marshall (Cardiff City)<br /> <br /> Phil Bardsley (Sunderland)<br /> Christophe Berra (Wolverhampton Wanderers)<br /> Grant Hanley (Blackburn Rovers)<br /> Charlie Mulgrew (Celtic)<br /> Andy Webster (Heart of Midlothian)<br /> Steven Whittaker (Norwich City)<br /> <br /> Charlie Adam (Stoke City)<br /> Barry Bannan (Aston Villa)<br /> Kris Commons (Celtic)<br /> Darren Fletcher (Manchester United)<br /> Shaun Maloney (Wigan Athletic)<br /> James Morrison (West Bromwich Albion)<br /> Matt Phillips (Blackpool)<br /> <br /> Steven Fletcher (Sunderland)<br /> Jamie Mackie (Queens Park Rangers)<br /> Kenny Miller (Vancouver Whitecaps)<br /> Steven Naismith (Everton)<br /> Jordan Rhodes (Blackburn Rovers)', 'Squad', '2016-05-21 10:16:48', '2016-05-21 10:16:48', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('150', '2012-11-14 00:00:00', 'Inexperienced Scots Win In Luxembourg', 'A Scotland team with 4 debutants and only 5 players with more than 5 caps struggled to a 2-1 victory in Luxembourg, with Billy Stark as caretaker manager.', 'News', '2016-05-21 10:16:47', '2016-05-21 10:16:47', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('151', '2013-01-15 00:00:00', 'Strachan Is Appointed Scotland manager', 'Former Celtic manager and Scotland legend Gordon Strachan was named as Craig Levein\'s successor. ', 'News', '2016-05-21 10:16:47', '2016-05-21 10:16:47', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('152', '2013-01-18 00:00:00', 'McGhee Becomes Strachan\'s Assistant', 'Former Motherwell and Aberdeen manager Mark McGhee has been named as Gordon Strachan\'s assistant.', 'News', '2016-05-21 10:16:46', '2016-05-21 10:16:46', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('153', '2013-01-31 00:00:00', 'Scotland Squad for Estonia Friendly', 'Matt Gilks (Blackpool)<br />\r\nDavid Marshall (Cardiff City)<br />\r\nAllan McGregor (Besiktas)<br />\r\n<br />\r\nPhil Bardsley (Sunderland)<br />\r\nChristophe Berra (Wolves)<br />\r\nGary Caldwell (Wigan)<br />\r\nGrant Hanley (Blackburn Rovers)<br />\r\nAlan Hutton (Real Mallorca)<br />\r\nRussell Martin (Norwich City)<br />\r\nCharlie Mulgrew (Celtic)<br />\r\nLee Wallace (Rangers)<br />\r\nAndy Webster (Hearts)<br />\r\n<br />\r\nCharlie Adam (Stoke City)<br />\r\nScott Brown (Celtic)<br />\r\nChris Burke (Birmingham City)<br />\r\nKris Commons (Celtic)<br />\r\nJames Forrest (Celtic)<br />\r\nJames McArthur (Wigan)<br />\r\nJames Morrison (West Brom)<br />\r\nMatt Philips (Blackpool)<br />\r\nRobert Snodgrass (Norwich City)<br />\r\n<br />\r\nSteven Fletcher (Sunderland)<br />\r\nRoss McCormack (Leeds Utd)<br />\r\nJamie Mackie (QPR)<br />\r\nShaun Maloney (Wigan)<br />\r\nKenny Miller (Vancouver Whitecaps)<br />\r\nSteven Naismith (Everton)<br />\r\nJordan Rhodes (Blackburn Rovers) ', 'Squad', '2016-05-21 10:16:45', '2016-05-21 10:16:45', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('154', '2013-02-06 00:00:00', 'Victory In Strachan\'s First Game', 'Gordon Strachan recorded a 1-0 victory over Estonia in his first match in charge.  A first half goal by Charlie Mulgrew was the only goal of the game at Pittodrie.', 'News', '2016-05-21 10:16:45', '2016-05-21 10:16:45', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('155', '2013-03-07 00:00:00', 'Scotland Squad for Wales and Serbia', 'Matt Gilks (Blackpool)<br />\r\nDavid Marshall (Cardiff City)<br />\r\nAllan McGregor (Besiktas)<br />\r\n<br />\r\nChristophe Berra (Wolves)<br />\r\nGary Caldwell (Wigan Ath)<br />\r\nDanny Fox (Southampton)<br />\r\nGrant Hanley (Blackburn Rovers)<br />\r\nAlan Hutton (Real Mallorca)<br />\r\nRussell Martin (Norwich City)<br />\r\nCharlie Mulgrew (Celtic)<br />\r\nAndy Webster (Hearts)<br />\r\n<br />\r\nCharlie Adam (Stoke City)<br />\r\nLiam Bridcutt (Brighton)<br />\r\nChris Burke (Birmingham City)<br />\r\nKris Commons (Celtic)<br />\r\nGraham Dorrans (West Brom)<br />\r\nJames Forrest (Celtic)<br />\r\nGary Mackay-Steven (Dundee Utd)<br />\r\nJames McArthur (Wigan Ath)<br />\r\nJames Morrison (West Brom)<br />\r\nRobert Snodgrass (Norwich City)<br />\r\n<br />\r\nGeorge Boyd (Hull City)<br />\r\nSteven Fletcher (Sunderland)<br />\r\nRoss McCormack (Leeds Utd)<br />\r\nShaun Maloney (Wigan Ath)<br />\r\nKenny Miller (Vancouver Whitecaps)<br />\r\nSteven Naismith (Everton)<br />\r\nJordan Rhodes (Blackburn Rovers)', 'Squad', '2016-05-21 10:16:44', '2016-05-21 10:16:44', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('156', '2013-03-22 00:00:00', 'Scotland Suffer Humiliating Defeat', 'Wales came from behind to inflict a 2-1 defeat for Scotland at Hampden. Grant Hanley gave Scotland the lead before Snodgrass conceded a penalty and was sent off.  Aaron Ramsay equalised before Robson-Kanu scored the winner.', 'News', '2016-05-21 10:16:43', '2016-05-21 10:16:43', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('157', '2013-03-26 00:00:00', 'Scotland are defeated in Serbia', 'Two second half goals in a 5 minute spell officially ended Scotland\'s qualification hopes, as Serbia recorded a 2-0 win.', 'News', '2016-05-21 10:16:43', '2016-05-21 10:16:43', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('158', '2013-06-07 00:00:00', 'Scotland Pull Off Shock In Croatia', 'A largely depleted Scotland side defeated the much fancied Croatia, who are 70 places above Scotland in the World rankings, 1-0 away in Zagreb.', 'News', '2016-05-21 10:16:40', '2016-05-21 10:16:40', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('159', '2013-06-02 00:00:00', 'Scotland Squad For Croatia Match', 'Matt Gilks (Blackpool)<br />\r\nDavid Marshall (Cardiff City)<br />\r\nAllan McGregor (Besiktas)<br />\r\n<br />\r\nGordon Greer (Brighton and Hove Albion)<br />\r\nDanny Fox (Southampton)<br />\r\nSteven Hammell (Motherwell)<br />\r\nGrant Hanley (Blackburn Rovers)<br />\r\nAlan Hutton (Real Mallorca)<br />\r\nRussell Martin (Norwich City)<br />\r\nLee Wallace (Rangers)<br />\r\nAndy Webster (Heart of Midlothian)<br />\r\nSteven Whittaker (Norwich City)<br />\r\n<br />\r\nStuart Armstrong (Dundee United)<br />\r\nBarry Bannan (Aston Villa)<br />\r\nChris Burke (Birmingham City)<br />\r\nCraig Conway (Cardiff City)<br />\r\nRyan Jack (Aberdeen)<br />\r\nGary Mackay-Steven (Dundee United)<br />\r\nJames McArthur (Wigan Athletic)<br />\r\nJames Morrison (West Bromwich Albion)<br />\r\nShaun Maloney (Wigan Athletic)<br />\r\nRobert Snodgrass (Norwich City)<br />\r\n<br />\r\nLeigh Griffiths (Hibernian)<br />\r\nSteven Naismith (Everton)<br />\r\nJordan Rhodes (Blackburn Rovers)<br />\r\nTony Watt (Celtic) ', 'Squad', '2016-05-21 10:16:38', '2016-05-21 10:16:38', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('160', '2013-07-22 00:00:00', 'Scotland Squad for England Game', 'Matt Gilks (Blackpool)<br /> David Marshall (Cardiff City) <br />Allan McGregor (Hull City) <br /><br />Gordon Greer (Brighton and Hove Albion) <br />Steven Hammell (Motherwell) <br />Grant Hanley (Blackburn Rovers) <br />Alan Hutton (Aston Villa) <br />Russell Martin (Norwich City) <br />Charlie Mulgrew (Celtic) <br />Andy Webster (Unattached) <br />Steven Whittaker (Norwich City) <br /><br />Charlie Adam (Stoke City) <br />Barry Bannan (Aston Villa) <br />George Boyd (Hull City) <br />Liam Bridcutt (Brighton and Hove Albion) <br />Chris Burke (Birmingham City) <br />Scott Brown (Celtic) <br />Craig Conway (Cardiff City) <br />Graham Dorrans (West Bromwich Albion) <br />James Forrest (Celtic) <br />Gary Mackay-Steven (Dundee United) <br />Shaun Maloney (Wigan Athletic) <br />James McArthur (Wigan Athletic) <br />James Morrison (West Bromwich Albion) <br />Robert Snodgrass (Norwich City) <br /><br />Leigh Griffiths (Wolverhampton Wanderers) <br />Steven Naismith (Everton) <br />Kenny Miller (Vancouver Whitecaps) <br />Jordan Rhodes (Blackburn Rovers)', 'Squad', '2016-05-21 10:16:37', '2016-05-21 10:16:37', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('161', '2013-07-22 00:00:00', 'Strachan Wants Regular England Match', 'Gordon Strachan wants the Scotland - England match to be a regular occurance.  He also wants the money raised from the match to go to funding grassroots football. ', 'News', '2016-05-21 10:16:36', '2016-05-21 10:16:36', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('162', '2013-08-14 00:00:00', 'Scotland Suffer Narrow Defeat At Wembley', 'The first Auld Enemy clash in 14 years ended 3-2 to England with substitute Rickie Lambert scoring England\'s winner.  Scotland led twice through Morrison and Miller, with Walcott and Welbeck equalising.', 'News', '2016-05-21 10:16:35', '2016-05-21 10:16:35', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('163', '2013-08-15 00:00:00', 'Auld Enemy Clash Could Return', 'There have been talks between the SFA and the English FA to play a return friendly at Hampden following the match at Wembley.  Talks will commence after the draw for the Euro 2016 qualifiers as they may be drawn in the same group.', 'News', '2016-05-21 10:16:35', '2016-05-21 10:16:35', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('164', '2013-08-23 00:00:00', 'Miller Retires From International Duty', 'After 12 years and 69 caps, Kenny Miller has decided to retire from international duty.  With 18 goals he is also one of Scotland\'s highest goalscorers, his last being against England at Wembley.', 'News', '2016-05-21 10:16:34', '2016-05-21 10:16:34', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('165', '2013-08-23 00:00:00', 'Scotland Squad For Belgium and Macedonia Matches', 'Matt Gilks (Blackpool), <br />David Marshall (Cardiff City), <br />Allan McGregor (Hull City), <br />Craig Samson (Kilmarnock) <br /><br />Ikechi Anya (Watford), <br />Gordon Greer (Brighton and Hove Albion), <br />Grant Hanley (Blackburn Rovers), <br />Alan Hutton (Aston Villa), <br />Russell Martin (Norwich City), <br />Charlie Mulgrew (Celtic), <br />Steven Whittaker (Norwich City)<br /><br />Charlie Adam (Stoke City), <br />Barry Bannan (Aston Villa), <br />George Boyd (Hull City), <br />Scott Brown (Celtic), <br />Craig Conway (Cardiff City), <br />Graham Dorrans (West Bromwich Albion), <br />James Forrest (Celtic), <br />James McArthur (Wigan Athletic), <br />James Morrison (West Bromwich Albion), <br />Shaun Maloney (Wigan Athletic), <br />Robert Snodgrass (Norwich City) <br /><br />Leigh Griffiths (Wolverhampton Wanderers), <br />Jamie Mackie (Nottingham Forest), <br />Steven Naismith (Everton), <br />Ross McCormack (Leeds United), <br />Jordan Rhodes (Blackburn Rovers)', 'Squad', '2016-05-21 10:16:33', '2016-05-21 10:16:33', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('166', '2013-09-06 00:00:00', 'Scots Are Outclassed By The Belgians', 'A fighting Scotland side were outplayed and comprehensively beaten 2-0 by a class Belgium side at Hampden. Goals by Defour and Mirallas in either half took Belgium within a point of qualification.', 'News', '2016-05-21 10:16:33', '2016-05-21 10:16:33', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('167', '2013-09-10 00:00:00', 'Scots Impress In Skopje', 'An impressive performance from Scotland saw them record a 2-1 away victory in Macedonia.  A second half strike by Ikechi Anya was cancelled out by a late equaliser by Kostovski, before Shaun Maloney scored a free kick with a couple of minutes remaining.  This gave Scotland only their second victory of the campaign and took them to fourth in the group.', 'News', '2016-05-21 10:16:31', '2016-05-21 10:16:31', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('168', '2013-10-03 00:00:00', 'Scotland Squad For Croatia Match', 'Matt Gilks (Blackpool), <br />David Marshall (Cardiff City), <br />Allan McGregor (Hull City) <br /><br />Gordon Greer (Brighton and Hove Albion), <br />Grant Hanley (Blackburn Rovers), <br />Alan Hutton (Aston Villa), <br />Russell Martin (Norwich City), <br />Charlie Mulgrew (Celtic), <br />Lee Wallace (Rangers) <br /><br />Charlie Adam (Stoke City), <br />Ikechi Anya (Watford), <br />Barry Bannan (Crystal Palace), <br />Scott Brown (Celtic), <br />Craig Bryson (Derby County), <br />Chris Burke (Birmingham City), <br />Graham Dorrans (West Bromwich Albion), <br />James Morrison (West Bromwich Albion), <br />James McArthur (Wigan Athletic), <br />Robert Snodgrass (Norwich City) <br /><br />George Boyd (Hull City), <br />Leigh Griffiths (Wolverhampton Wanderers), <br />Ross McCormack (Leeds United), <br />Steven Naismith (Everton), <br />Jordan Rhodes (Blackburn Rovers)', 'Squad', '2016-05-21 10:16:30', '2016-05-21 10:16:30', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('169', '2013-10-15 00:00:00', 'Scotland Do The Double Over Croatia', 'Scotland ended a disappointing campaign with an impressive 2-0 win over Croatia at Hampden.  Goals from Snodgrass and Naismith added to Snodgrass\'s goal in Zagreb to help Scotland do the double over the Croats.', 'News', '2016-05-21 10:16:29', '2016-05-21 10:16:29', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('170', '2013-10-17 00:00:00', 'Scotland Arrange Friendly In Norway', 'Scotland will be travelling to Norway for a friendly four days after the game at home to USA.  The game will be played at Molde\'s Aker Stadion.', 'News', '2016-05-21 10:16:29', '2016-05-21 10:16:29', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('171', '2013-11-04 00:00:00', 'Scotland Squad For USA & Norway', 'Scott Fox (Partick Thistle)<br />Matt Gilks (Blackpool)<br />David Marshall (Cardiff City)<br /><br />Christophe Berra (Ipswich Town)<br />Gordon Greer (Brighton & Hove Albion)<br />Grant Hanley (Blackburn Rovers)<br />Alan Hutton (Aston Villa)<br />Russell Martin (Norwich City)<br />Charlie Mulgrew (Celtic)<br />Lee Wallace (Rangers)<br />Steven Whittaker (Norwich City)<br /><br />Charlie Adam (Stoke City)<br />Ikechi Anya (Watford)<br />Barry Bannan (Crystal Palace)<br />Scott Brown (Celtic)<br />Craig Bryson (Derby County)<br />Chris Burke (Birmingham City)<br />James Forrest (Celtic)<br />James Morrison (West Bromwich Albion)<br />James McArthur (Wigan Athletic)<br />Matt Phillips (Queens Park Rangers)<br />Robert Snodgrass (Norwich City)<br /><br />Steven Fletcher (Sunderland)<br />Steven Naismith (Everton)<br />Jordan Rhodes (Blackburn Rovers)  ', 'Squad', '2016-05-21 10:16:28', '2016-05-21 10:16:28', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('172', '2013-11-15 00:00:00', 'Scotland Have Goalless draw with USA', 'Scotland and USA both played out a uninspiring goalless draw, which was the last game to be played at Hampden until after the 2014 Commonwealth Games.', 'News', '2016-05-21 10:16:27', '2016-05-21 10:16:27', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('173', '2013-11-17 00:00:00', 'Boyd Is Recalled To The Scotland Squad', 'Kilmarnock striker Kris Boyd has been recalled to the Scotland squad after a three year absence.  This follows the withdrawl of Steven Fletcher and Charlie Mulgrew.', 'News', '2016-05-21 10:16:26', '2016-05-21 10:16:26', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('174', '2013-11-19 00:00:00', 'Victory In Norway For The Scots', 'Scotland got a good victory away to Norway in a game that the Norwegians should have won.  A second half goal from Scott Brown was the only goal of the game that ended 2013 on a high.', 'News', '2016-05-21 10:16:25', '2016-05-21 10:16:25', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('175', '2014-02-19 00:00:00', 'Fletcher Returns To The Scotland Squad', 'Scotland Captain Darren Fletcher has been recalled to the squad for the friendly in Poland.  Fletcher, who gained the last of his caps in 2012, has returned to first team football following his absence through illness.', 'News', null, null, null);
INSERT INTO `news` VALUES ('176', '2014-02-19 00:00:00', 'Scotland Squad For Friendly In Poland', 'Matt Gilks (Blackpool)<br />David Marshall (Cardiff City)<br />Allan McGregor (Hull City)<br /><br />Phil Bardsley (Sunderland)<br />Christophe Berra (Ipswich Town)<br />Gordon Greer (Brighton and Hove Albion)<br />Grant Hanley (Blackburn Rovers)<br />Alan Hutton (Aston Villa)<br />Russell Martin (Norwich City)<br />Andrew Robertson (Dundee United)<br />Steven Whittaker (Norwich City)<br /><br />Charlie Adam (Stoke City)<br />Ikechi Anya (Watford)<br />Barry Bannan (Crystal Palace)<br />Scott Brown (Celtic)<br />Chris Burke (Birmingham City)<br />Darren Fletcher (Manchester United)<br />James Forrest (Celtic)<br />James Morrison (West Bromwich Albion)<br />Charlie Mulgrew (Celtic)<br />Robert Snodgrass (Norwich City)<br /><br />Steven Fletcher (Sunderland)<br />Ross McCormack (Leeds United)<br />Steven Naismith (Everton)', 'Squad', '2016-05-21 10:17:45', '2016-05-21 10:17:45', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('177', '2014-02-23 00:00:00', 'Scotland Drawn With The Germans', 'The draw for the Euro 2016 qualifiers has seen Scotland drawn with Germany, Republic of Ireland, Poland, Georgia, and Gibraltar.', 'News', null, null, null);
INSERT INTO `news` VALUES ('178', '2014-03-05 00:00:00', 'Scotland Gain Victory In Warsaw', 'An impressive display from the Scots saw them defeat the Poles in their own back yard.  A late strike from Scott Brown gave Strachan\'s team their fourth win in five games.', 'News', null, null, null);
INSERT INTO `news` VALUES ('179', '2014-03-07 00:00:00', 'Scotland Arrange Friendly With Nigeria', 'Scotland have arranged a friendly against Nigeria to be played at Fulham\'s Craven Cottage in London.  The match will be on 28th May and will be Scotland\'s final match before the 2016 qualification process starts.', 'News', null, null, null);
INSERT INTO `news` VALUES ('180', '2014-03-27 00:00:00', 'New \"League of Nations\" Tournament For 2018', 'A new competitive competition is going to start in 2018 to replace most friendlies in Europe.  The competition will be split into 4 divisions based on rankings and each division split into 4 pools.  The best 4 teams in each division will then play-off and the 4 winners will qualify for the European Championships.  The full details have not been agreed yet.', 'News', null, null, null);
INSERT INTO `news` VALUES ('181', '2014-04-30 00:00:00', 'Talks Of Scotland - England Friendly', 'The SFA is having talks with the English FA about having a friendly in Glasgow later in the year.', 'News', null, null, null);
INSERT INTO `news` VALUES ('182', '2014-05-28 00:00:00', 'Scots Draw With Nigerians', 'Scotland drew 2-2 with Nigeria at Craven Cottage, after leading twice. Charlie Mulgrew put Scotland ahead, before Uchebo equalised before half time. An own goal gave Scotland a 2-1 lead, but a 90th minute equaliser by Nwofor meant the match finished all square.', 'News', null, null, null);
INSERT INTO `news` VALUES ('183', '2014-05-12 00:00:00', 'Scotland Squad For Nigeria Friendly', 'Cammy Bell (Rangers), <br />Matt Gilks (Blackpool), <br />David Marshall (Cardiff City), <br />Allan McGregor (Hull City)<br /><br />Christophe Berra (Ipswich Town), <br />Gary Caldwell (Wigan Athletic), <br />Craig Forsyth (Derby County), <br />Gordon Greer (Brighton and Hove Albion), <br />Grant Hanley (Blackburn Rovers), <br />Alan Hutton (Bolton Wanderers), <br />Charlie Mulgrew (Celtic), <br />Andrew Robertson (Dundee United), <br />Steven Whittaker (Norwich City) <br /><br />Ikechi Anya (Watford), <br />Barry Bannan (Crystal Palace), <br />George Boyd (Hull City), <br />Scott Brown (Celtic), <br />Craig Bryson (Derby County), <br />Chris Burke (Birmingham City), <br />Graham Dorrans (West Bromwich Albion), <br />Darren Fletcher (Manchester United), <br />James McArthur (Wigan Athletic), <br />James Morrison (West Bromwich Albion)<br /><br />Leigh Griffiths (Celtic), <br />Shaun Maloney (Wigan Athletic), <br />Chris Martin (Derby County), <br />Ross McCormack (Leeds United), <br />Steven Naismith (Everton)', 'Squad', '2016-05-21 10:17:47', '2016-05-21 10:17:47', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('184', '2014-07-14 00:00:00', 'Scotland Arrange Rematch With England At Parkhead', 'Following the friendly at Wembley last year, Scotland and England have agreed a friendly on 18th November.&nbsp; The match will be played at Parkhead, while Hampden is being refitted after the Commonwealth Games.', 'News', null, null, null);
INSERT INTO `news` VALUES ('185', '2014-08-25 00:00:00', 'Scotland Squad For Germany Match', 'Craig Gordon (Celtic)<br />David Marshall (Cardiff City)<br />Alan McGregor (Hull City)<br /><br />Christophe Berra (Ipswich Town)<br />Craig Forsyth (Derby County)<br />Gordon Greer (Brighton and Hove Albion)<br />Grant Hanley (Blackburn Rovers)<br />Alan Hutton (Aston Villa)<br />Russell Martin (Norwich City)<br />Andrew Robertson (Hull City)<br />Steven Whittaker (Norwich City)<br /><br />Ikechi Anya (Watford)<br />Barry Bannan (Crystal Palace)<br />Craig Bryson (Derby County)<br />Chris Burke (Nottingham Forest)<br />Graham Dorrans (West Bromwich Albion)<br />Darren Fletcher (Manchester United)<br />Shaun Maloney (Wigan Athletic)<br />James McArthur (Wigan Athletic)<br />Kevin McDonald (Wolverhampton Wanderers)<br />Callum McGregor (Celtic)<br />James Morrison (West Bromwich Albion)<br />Charlie Mulgrew (Celtic)<br /><br />Steven Fletcher (Sunderland)<br />Chris Martin (Derby County)<br />Steven Naismith (Everton)', 'Squad', '2016-05-21 10:17:49', '2016-05-21 10:17:49', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('186', '2014-08-20 00:00:00', 'Snodgrass Out For Six Months', 'There was a major blow for Scotland when Robert Snodgrass picked up an injury playing for Hull.&nbsp; This means he will miss Scotland\'s opening four Euro qualifiers, plus the friendly against England.', 'News', null, null, null);
INSERT INTO `news` VALUES ('187', '2014-09-07 00:00:00', 'Scotland Suffer Narrow Defeat To World Champions', 'In their opening Euro 2016 qualifier, Scotland suffered a 2-1 defeat at the hands of World Champions Germany in their own back garden.&nbsp; In a gallant display, Ikechi Anya equalised a Thomas Muller goal, before Muller got his second.&nbsp; Charlie Mulgrew was sent off late on for a double booking.', 'News', null, null, null);
INSERT INTO `news` VALUES ('188', '2014-09-19 00:00:00', 'Hampden Chosen As Euro 2020 Venue', 'Hampden Park has been chosen as one of the venues for Euro 2020.&nbsp; It will host three group matches, plus a last 16 game.', 'News', null, null, null);
INSERT INTO `news` VALUES ('189', '2014-09-30 00:00:00', 'Scotland Squad For Georgia and Poland', 'Craig Gordon (Celtic)<br />David Marshall (Cardiff City)<br />Allan McGregor (Hull City) <br /><br />Christophe Berra (Ipswich Town)<br />Craig Forsyth (Derby County)<br />Gordon Greer (Brighton and Hove Albion)<br />Grant Hanley (Blackburn Rovers)<br />Alan Hutton (Aston Villa)<br />Russell Martin (Norwich City)<br />Mark Reynolds (Aberdeen)<br />Andrew Robertson (Hull City)<br />Steven Whittaker (Norwich City)<br /><br />Ikechi Anya (Watford)<br />Barry Bannan (Crystal Palace)<br />Scott Brown (Celtic)<br />Craig Bryson (Derby County)<br />Chris Burke (Nottingham Forest)<br />Graham Dorrans (West Bromwich Albion)<br />Darren Fletcher (Manchester United)<br />Ryan Gauld (Sporting Lisbon)<br />Shaun Maloney (Wigan Athletic)<br />James McArthur (Crystal Palace)<br />James Morrison (West Bromwich Albion)<br /><br />Steven Fletcher (Sunderland)<br />Steven May (Sheffield Wednesday)<br />Chris Martin (Derby County)<br />Steven Naismith (Everton)', 'Squad', '2016-05-21 10:17:54', '2016-05-21 10:17:54', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('190', '2014-10-11 00:00:00', 'Scotland Get First Win of Euro Campaign', 'Scotland put in an impressive display against a Georgia team that were hard to crack.&nbsp; A deflected shot from Shaun Maloney was enough to give Scotland a 1-0 win at Ibrox.', 'News', null, null, null);
INSERT INTO `news` VALUES ('191', '2014-10-14 00:00:00', 'Scotland Battle To Impressive 2-2 Draw In Warsaw', 'Scotland put in an impressive display to draw 2-2 with Poland in Warsaw.&nbsp; Maczynski gave the Poles an early lead before Maloney equalised.&nbsp; Naismith gave Scotland the lead in the second half, before Milik scored a late equaliser.', 'News', null, null, null);
INSERT INTO `news` VALUES ('192', '2014-11-04 00:00:00', 'Scotland Squad For Ireland and England', 'Matt Gilks (Burnley)<br />Craig Gordon (Celtic)<br />David Marshall (Cardiff City) <br /><br />Phil Bardsley (Stoke City)<br />Christophe Berra (Ipswich Town)<br />Craig Forsyth (Derby County)<br />Gordon Greer (Brighton and Hove Albion)<br />Grant Hanley (Blackburn Rovers)<br />Russell Martin (Norwich City)<br />Andrew Robertson (Hull City)<br />Steven Whittaker (Norwich City)<br /><br />Ikechi Anya (Watford)<br />Barry Bannan (Crystal Palace)<br />Scott Brown (Celtic)<br />Craig Bryson (Derby County)<br />Chris Burke (Nottingham Forest)<br />Graham Dorrans (West Bromwich Albion)<br />Darren Fletcher (Manchester United)<br />Lewis MacLeod (Rangers)<br />Shaun Maloney (Wigan Athletic)<br />James McArthur (Crystal Palace)<br />James Morrison (West Bromwich Albion)<br />Charlie Mulgrew (Celtic)<br /><br />Steven Fletcher (Sunderland)<br />Chris Martin (Derby County)<br />Steven May (Sheffield Wednesday)<br />Steven Naismith (Everton)', 'Squad', '2016-05-21 10:17:37', '2016-05-21 10:17:37', '2016-05-21 00:00:00');
INSERT INTO `news` VALUES ('193', '2014-11-14 00:00:00', 'Scotland Get Vital Victory Over The Irish', 'Scotland put in an impressive display in a hard fought match to record a 1-0 victory over Republic of Ireland.&nbsp; A second half goal from Shaun Maloney was enough to keep Scotland\'s qualification hopes alive.', 'News', null, null, null);
INSERT INTO `news` VALUES ('194', '2014-11-18 00:00:00', 'Poor Scotland Are Defeated By The Auld Enemy', 'A tired Scotland side put in a poor performance to lose 3-1 to England at Parkhead.&nbsp; In the first home match against England since 1999, Oxlade-Chamberlain and Rooney (2) scored for England while Andrew Robertson got Scotland\'s consolation goal.', 'News', null, null, null);
INSERT INTO `news` VALUES ('195', '2015-03-25 00:00:00', 'Scotland Scrape 1-0 Victory Over Northern Irish', 'Scotland got a late winner from substitute Christope Berra to win a game that they dominated from start to finish.&nbsp; In a dull game, it was McGovern who made numerous saves to prevent Scotland from getting a greater victory.', 'News', null, null, null);
INSERT INTO `news` VALUES ('196', '2015-03-29 00:00:00', 'Scotland Thrash Minnows Gibraltar', 'Scotland recorded their biggest victory in nine years by defeating Gibraltar 6-1. Steven Fletcher scored a hat-trick, which was the first time in 46 years that someone scored at least three goals for Scotland.&nbsp; The thing that will be talked about the most though is the fact that Gibraltar scored their first competitive goal ever.', 'News', null, null, null);
INSERT INTO `news` VALUES ('197', '2015-06-05 00:00:00', 'Scotland Defeat Qatar in Edniburgh', 'Scotland defeated Qatar 1-0 in a friendly match to win the Qatar Airways Cup.&nbsp; A first half strike from Matt Ritchie was enough to seal the victory for Scotland.', 'News', null, null, null);
INSERT INTO `news` VALUES ('198', '2015-06-13 00:00:00', 'Scotland Gain Valuable Point In Dublin', 'A deflected shot by Shaun Maloney cancelled out a first half goal from Jon Walters to earn Scotland a 1-1 draw in Dublin.', 'News', null, null, null);
INSERT INTO `news` VALUES ('199', '2015-07-25 00:00:00', 'Scotland Are Drawn With Auld Enemy', 'Scotland received a favourable draw for the World Cup qualifiers when they where drawn in a group with England, Slovakia, Slovenia, Lithuania, and Malta.&nbsp; It will be the first time they have played England in a competitive match since 1999.', 'News', null, null, null);
INSERT INTO `news` VALUES ('200', '2015-09-04 00:00:00', 'Poor Scotland Loose In Georgia', 'A poor performance from Scotland in Georgia resulted in a 1-0 defeat to a country rated 147 in the world. This meant that Ireland overtook Scotland and left Scotland\'s qualification hopes haning by a thread.', 'News', null, null, null);
INSERT INTO `news` VALUES ('201', '2015-09-07 00:00:00', 'Brave Scots Lose To The Germans', 'Scotland put on a promising performance to narrowly loose 3-2 at home to the world champions. A Hummels OG and a fine strike by McArthur cancelled out two Muller goals in the first half, but a second half strike from Gundogan gave the win to the Germans.', 'News', null, null, null);
INSERT INTO `news` VALUES ('202', '2015-10-08 00:00:00', 'Scots Euro 2016 Hopes Are Over', 'All of Scotland\'s chances of qualifying for Euro 2016 ended as they conceded a 94th minute equaliser from Poland to draw 2-2, and in Dublin Republic of Ireland pulled off a shock to defeat Germany 1-0.', 'News', null, null, null);
INSERT INTO `news` VALUES ('203', '2015-10-11 00:00:00', 'Scotland End Campaign With Record Win', 'Scotland\'s Euro 2016 campaign ended with a 6-0 win away to Gibraltar. Goals by Chris Martin, Shaun Maloney and Steven Naismith, along with Steven Fletcher\'s second hat-trick of the campaign, gave Scotland their highest away win since 1949.', 'News', null, null, null);
INSERT INTO `news` VALUES ('204', '2015-10-16 00:00:00', 'Strachan Stays On As Boss', 'Gordon Strachan signed a 2 year extension to his contract, which made him in charge until the end of the 2018 World Cup campaign.', 'News', null, null, null);
INSERT INTO `news` VALUES ('205', '2016-01-06 00:00:00', 'Scotland Arrange Friendly In Prague', 'Scotland will travel to Prague for a friendly on 24th March.  It will be the first time both sides have met since a 2-2 draw at Hampden in the Euro 2012 qualification campaign.', 'News', null, null, null);
INSERT INTO `news` VALUES ('206', '2016-01-07 00:00:00', 'Scotland To Play Denmark In Friendly', 'Five days after the friendly away to Czech Republic, Denmark will travel to Hampden for a friendly on 29th March.', 'News', null, null, null);
INSERT INTO `news` VALUES ('207', '2016-02-09 00:00:00', 'Scotland Arrange Glamour Friendlies Against Italy and France', 'Scotland have arranged friendlies against Italy and France at the end of the season.&nbsp; The first match against Italy will take place on Sunday 29th May at Ta\' Qali Stadium in Malta. Six days later, they will play France in Metz.', 'News', null, null, null);
INSERT INTO `news` VALUES ('208', '2016-03-24 00:00:00', 'Scotland Record Victory in Prague', 'A weakened Scotland team recorded an impressive 1-0 victory over Czech Republic in Prague.  A fine performance by Allan McGregor plus a solitary goal by Ikechi Anya gave the Scots the victory.', 'News', null, null, null);
INSERT INTO `news` VALUES ('209', '2016-03-29 00:00:00', 'Ritchie Goal Defeats The Danes', 'An 8th minute goal by Matt Ritchie was enough to defeat Denmark 1-0 at Hampden. A team with young debutants and fringe players played well in the first half, but had to rely on some great saves by Gordon in the second half to keep the danes out.', 'News', null, null, null);
INSERT INTO `news` VALUES ('210', '2016-05-12 00:00:00', 'Scotland Squad For Italy and France', 'Scott Bain (Dundee)<br />David Marshall (Cardiff)<br />Allan McGregor (Hull)<br /><br />Christophe Berra (Ipswich)<br />Gordon Greer (Brighton)<br />Grant Hanley (Blackburn)<br />Alan Hutton (Aston Villa)<br />Russell Martin (Norwich)<br />Charlie Mulgrew (Celtic)<br />Callum Paterson (Hearts)<br />Andrew Robertson (Hull)<br />Lee Wallace (Rangers)<br /><br />Ikechi Anya (Watford)<br />Barry Bannan (Sheffield Wednesday)<br />Oliver Burke (Nottingham Forest)<br />Darren Fletcher (West Brom)<br />Shaun Maloney (Hull)<br />James McArthur (Crystal Palace)<br />John McGinn (Hibernian)<br />Barry McKay (Rangers)<br />Matt Phillips (QPR)<br />Matt Ritchie (Bournemouth)<br />Robert Snodgrass (Hull)<br /><br />Steven Fletcher (Marseille)<br />Chris Martin (Derby)<br />Ross McCormack (Fulham)<br />Steven Naismith (Norwich)', 'Squad', null, null, null);
INSERT INTO `news` VALUES ('211', '2016-06-01 00:00:00', 'Poor Scotland suffer defeat to Italy', 'A poor performance by Scotland ensured that the Italians won 1-0 in the end of season friendly in Malta.&nbsp; A second half goal by Pelle was the only goal of the game.', 'News', null, null, null);
INSERT INTO `news` VALUES ('212', '2016-06-04 00:00:00', 'Scots hammered by the French', 'Another poor performance against Euro favourites France, resulted in a 3-0 defeat.  Three first half goals by Giroud(2) and Koscielny were enough to defeat Scotland in a poor performance.', 'News', null, null, null);
INSERT INTO `news` VALUES ('213', '2016-08-19 00:00:00', 'Brown retires from International Football', 'Scott Brown decided to retire from international football.  The 31 year old believes that he can no longer play for both club and country.', 'News', null, null, null);
INSERT INTO `news` VALUES ('214', '2016-08-22 00:00:00', 'Scotland Squad For Malta', 'Craig Gordon (Celtic)<br />Jack Hamilton (Hearts)<br />David Marshall (Cardiff City)<br /><br />Christophe Berra (Ipswich Town)<br />Gordon Greer (Blackburn Rovers)<br />Grant Hanley (Newcastle United)<br />Alan Hutton (Aston Villa)<br />Russell Martin (Norwich City)<br />Callum Paterson (Hearts)<br />Andrew Robertson (Hull City)<br />Kieran Tierney (Celtic)<br /><br />Ikechi Anya (Watford)<br />Barry Bannan (Sheffield Wednesday)<br />Oliver Burke (Nottingham Forest)<br />Darren Fletcher (West Bromwich Albion)<br />James Forrest (Celtic)<br />James McArthur (Crystal Palace)<br />Kevin McDonald (Fulham)<br />John McGinn (Hibernian)<br />Barrie McKay (Rangers)<br />James Morrison (West Bromwich Albion)<br />Matt Ritchie (Newcastle United)<br />Robert Snodgrass (Hull City)<br /><br />Steven Fletcher (Sheffield Wednesday)<br />Leigh Griffiths (Celtic)<br />Chris Martin (Derby County)<br />Steven Naismith (Norwich City)', 'Squad', null, null, null);
INSERT INTO `news` VALUES ('215', '2016-09-04 00:00:00', 'Scotland Start Campaign With Win In Malta', 'Scotland\'s World Cup qualification began with a 5-1 victory in Malta.  A Snodgrass hat-trick and goals from Chris Martin and Steven Fletcher got Scotland off to a flyer.', 'News', null, null, null);
INSERT INTO `news` VALUES ('216', '2016-09-28 00:00:00', 'Scotland Squad For Lithuania and Slovakia', 'Craig Gordon (Celtic)<br />Jack Hamilton (Hearts)<br />David Marshall (Hull City)<br /><br />Christophe Berra (Ipswich Town)<br />Gordon Greer (Blackburn Rovers)<br />Grant Hanley (Newcastle United)<br />Alan Hutton (Aston Villa)<br />Russell Martin (Norwich City)<br />Callum Paterson (Hearts)<br />Andrew Robertson (Hull City)<br />Kieran Tierney (Celtic)<br />Lee Wallace (Rangers)<br /><br />Ikechi Anya (Derby County)<br />Barry Bannan (Sheffield Wednesday)<br />Oliver Burke (RB Leipzig)<br />Darren Fletcher (West Bromwich Albion)<br />James Forrest (Celtic)<br />James McArthur (Crystal Palace)<br />John McGinn (Hibs)<br />Barrie McKay (Rangers)<br />Shaun Maloney (Hull City)<br />James Morrison (West Bromwich Albion)<br />Matt Ritchie (Newcastle United)<br />Robert Snodgrass (Hull City)<br /><br />Steven Fletcher (Sheffield Wednesday)<br />Leigh Griffiths (Celtic)<br />Chris Martin (Fulham)<br />Steven Naismith (Norwich City)', 'Squad', null, null, null);
INSERT INTO `news` VALUES ('217', '2016-10-08 00:00:00', 'Scotland Suffering Embarassing Draw', 'Scotland needed an 89th minute equaliser from James McArthur to prevent a humiliating defeat at home to Lithuania, who are ranked 117th in the world.&nbsp; Scotland were close to losing 1-0, which would have been possibly their worst result in recent years.&nbsp; This puts their chances of qualifying on a knife edge, meaning they will need a victory in Slovakia.', 'News', '2016-10-08 22:46:17', '2016-10-08 22:46:17', null);
INSERT INTO `news` VALUES ('218', '2016-10-11 00:00:00', 'Scotland Lose In Slovakia', 'Scotland\'s chances of qualification for the World Cup finals look to be very unlikely after only three games, as they were hammered 3-0 away to Slovakia.&nbsp; The result leaves Scotland fourth in the group with their next match against England at Wembley.', 'News', '2016-10-11 21:49:36', '2016-10-11 21:49:36', null);
INSERT INTO `news` VALUES ('219', '2016-11-02 00:00:00', 'Brown Back in Scotland Team', 'Scott Brown has performed a u-turn on his international retirement, to be named in Gordon Strachan\'s squad for the match at Wembley.&nbsp; Brown retired in the summer but returns after just three games.', 'News', '2016-11-03 18:45:48', '2016-11-03 18:45:48', null);
INSERT INTO `news` VALUES ('220', '2016-11-02 00:00:00', 'Scotland Squad for England Game', 'Craig Gordon (Celtic)<br />Jack Hamilton (Heart of Midlothian)<br />David Marshall (Hull City)<br /><br />Christophe Berra (Ipswich Town)<br />Gordon Greer (Blackburn Rovers)<br />Grant Hanley (Newcastle United)<br />Stephen Kingsley (Swansea City)<br />Russell Martin (Norwich City)<br />Callum Paterson (Heart of Midlothian)<br />Lee Wallace (Rangers)<br /><br />Ikechi Anya (Derby County)<br /> Barry Bannan (Sheffield Wednesday)<br />Scott Brown (Celtic)<br />Oliver Burke (RB Leipzig)<br />Darren Fletcher (West Bromwich Albion)<br />James Forrest (Celtic)<br />James McArthur (Crystal Palace)<br />John McGinn (Hibernian)<br />James Morrison (West Bromwich Albion)<br />Matt Ritchie (Newcastle United)<br />Robert Snodgrass (Hull City)<br /><br />Steven Fletcher (Sheffield Wednesday)<br />Leigh Griffiths (Celtic)<br />Chris Martin (Fulham)<br />Steven Naismith (Norwich City)', 'Squad', '2016-11-03 18:48:50', '2016-11-03 23:10:36', null);
INSERT INTO `news` VALUES ('221', '2016-11-03 00:00:00', 'Scotland and England To Defy FIFA', 'Both Scotland and England are set to go against FIFA\'s rules and wear poppy armbands on Armistice Day.&nbsp; FIFA has banned them as they prohibit teams from displaying political, religious or commercial messages.&nbsp; If Scotland go against FIFA, they risk punishment, which could be a points deduction from their World Cup qualification campaign.', 'News', '2016-11-03 18:53:30', '2016-11-03 18:53:30', null);
INSERT INTO `news` VALUES ('222', '2016-11-06 00:00:00', 'Hutton Retires From International Duty', 'Aston Villa full back Alan Hutton has withdrawn from international duty according to manager Gordon Strachan. His last appearance was against Czech Republic in March when he won his 50th cap.', 'News', '2016-11-08 19:34:59', '2016-11-08 19:34:59', null);
INSERT INTO `news` VALUES ('223', '2016-11-11 00:00:00', 'Scotland Suffer Unlucky Defeat At Wembley', 'Scotland were beaten 3-0 by England at Wembley, in the first competitive match against the Auld Enemy since 1999.&nbsp; Goals by Daniel Sturridge, Adam Lallana, and Gary Cahill gave England a flattering victory as Scotland put in a good performance, but couldn\'t take their chances.', 'News', '2016-11-11 22:45:56', '2016-11-11 22:45:56', null);
INSERT INTO `news` VALUES ('224', '2016-11-17 00:00:00', 'Strachan To Remain as Boss', 'Gordon Strachan has been given the backing of the SFA to stay on as manager, after the poor start to the World Cup 2018 Qualification campaign.', 'News', '2016-11-17 19:16:49', '2016-11-17 19:16:49', null);
INSERT INTO `news` VALUES ('225', '2016-11-17 00:00:00', 'FIFA to Take Action Over Poppy Armbands', 'FIFA has decided to take action against Scotland and England following their defiance over the wearing of poppy armbands.&nbsp; It is still unknown what the punishment could be.&nbsp; This could be as much as a points deduction, which would surely end their chances of qualification.', 'News', '2016-11-17 19:22:54', '2016-11-17 19:22:54', null);
INSERT INTO `news` VALUES ('226', '2016-12-19 00:00:00', 'Home Nations Fined Over Poppies', 'Each of the home nations have received a fine from FIFA with regards to the wearing or display of poppies during their World Cup Qualifiers.&nbsp; England were fined &pound;35,311, Scotland and Wales were fined &pound;15,694, and Northern Ireland were fined &pound;11,770.', 'News', '2016-12-25 14:17:08', '2016-12-25 14:17:08', null);
INSERT INTO `news` VALUES ('227', '2017-01-23 00:00:00', 'Scotland Line Up Friendly With Canada', 'Scotland will play Canada fro the first time since 2002, in a friendly to be played at Easter Road on 22nd March, 4 days before the qualifier against Slovenia.', 'News', '2017-02-23 23:02:48', '2017-02-23 23:02:48', null);
INSERT INTO `news` VALUES ('228', '2017-03-22 00:00:00', 'Poor Scotland Are Held By Canada', 'Scotland put in a poor performance to come from behind to get a 1-1 draw at home to Canada.&nbsp; Steven Naismith cancelled out an early strike by Fraser Aird.&nbsp; Strachan had left most of the Celtic players out, to keep them fit for Sunday\'s match with Slovenia.', 'News', '2017-03-22 22:02:44', '2017-03-22 22:02:44', null);
INSERT INTO `news` VALUES ('229', '2017-03-26 00:00:00', 'Martin Grabs Late Winner Against Slovenia', 'An 88th minute goal by substitute Chris Martin earned Scotland a 1-0 victory in a must win game against Slovenia.&nbsp; Scotland put in an impressive display that included Griffiths hitting the woodwork twice, but needed a late winner.', 'News', '2017-03-27 18:36:56', '2017-03-27 18:36:56', null);
INSERT INTO `news` VALUES ('230', '2017-06-10 00:00:00', 'Late Kane Goal Prevents Famous Victory Over England', 'A 93rd minute equaliser from Harry Kane prevented Scotland from recording a famous victory over England at Hampden.&nbsp; Two late goals from Leigh Griffiths put Scotland 2-1 ahead after Oxlade-Chamberlain had put England ahead with 20 minutes remaining, but Kane\'s injury time equaliser made it 2-2.', 'News', '2017-06-10 22:27:58', '2017-06-10 22:27:58', null);
INSERT INTO `news` VALUES ('231', '2017-08-21 00:00:00', 'Scotland Squad for Lithuania and Malta', 'Jordan Archer (Millwall) <br />Craig Gordon (Celtic)<br />Allan McGregor (Hull City)<br /><br />Ikechi Anya (Derby County)<br />Christophe Berra (Heart of Midlothian)<br />Grant Hanley (Newcastle United)<br />Russell Martin (Norwich City)<br />Charlie Mulgrew (Blackburn Rovers)<br />Andrew Robertson (Liverpool)<br />Kieran Tierney (Celtic)<br />Steven Whittaker (Hibernian)<br /><br />Stuart Armstrong (Celtic)<br />Barry Bannan (Sheffield Wednesday)<br />Scott Brown (Celtic)<br />Tom Cairney (Fulham)<br />Darren Fletcher (Stoke City)<br />James Forrest (Celtic)<br />Ryan Fraser (Bournemouth)<br />James McArthur (Crystal Palace)<br />John McGinn (Hibernian)<br />Matt Phillips (West Bromwich Albion)<br />Matt Ritchie (Newcastle United)<br />Robert Snodgrass (West Ham United)<br /><br />Steven Fletcher (Sheffield Wednesday)<br />Leigh Griffiths (Celtic)<br />Chris Martin (Derby County)<br />Steven Naismith (Norwich City)', 'Squad', '2017-08-21 19:53:51', '2017-08-21 19:53:51', null);
INSERT INTO `news` VALUES ('232', '2017-09-01 00:00:00', 'Impressive Scots Blow Lithuania Away', 'A great performance from Scotland resulted in a 3-0 victory away to Lithuania.&nbsp; First half goals from Stuart Armstrong and Andrew Robertson, and a second half strike from James McArthur moved Scotland into third place in Group F.', 'News', '2017-09-02 18:09:46', '2017-09-02 18:09:46', null);
INSERT INTO `news` VALUES ('233', '2017-09-04 00:00:00', 'Scots Secure Victory Over Malta', 'Goals from Christophe Berra and Leigh Griffiths were enough to give Scotland a 2-0 win at home to Malta.&nbsp; This result, along with England\'s 2-1 victory over Slovakia set up a decisive match at home to Slovakia next month.', 'News', '2017-09-04 22:02:17', '2017-09-04 22:02:17', null);
INSERT INTO `news` VALUES ('234', '2017-10-05 00:00:00', 'Late Own Goal Keeps Scotland\'s Hopes Alive', 'An 89th minute own goal by Martin Skrtel gave Scotland a deserved 1-0 victory, in a must win match.&nbsp; Slovakia went down to 10 men in the first half, but the crossbar and some great saves from their keeper kept it at 0-0 until the 89th minute.', 'News', '2017-10-05 22:10:48', '2017-10-05 22:10:48', null);
INSERT INTO `news` VALUES ('235', '2017-10-01 00:00:00', 'Scotland Squad for Slovakia and Slovenia', 'Jordan Archer (Millwall)<br />Craig Gordon (Celtic)<br />Allan McGregor (Hull City)<br /><br />Ikechi Anya (Derby County)<br />Christophe Berra (Heart of Midlothian)<br />Grant Hanley (Norwich City)<br />Liam Cooper (Leeds United)<br />Charlie Mulgrew (Blackburn Rovers)<br />Andrew Robertson (Liverpool)<br />Kieran Tierney (Celtic)<br />Steven Whittaker (Hibernian)<br /><br />Barry Bannan (Sheffield Wednesday)<br />Darren Fletcher (Stoke City)<br />Ryan Fraser (Bournemouth)<br />James Forrest (Celtic)<br />James McArthur (Crystal Palace)<br />John McGinn (Hibernian)<br />Callum McGregor (Celtic)<br />Matt Phillips (West Bromwich Albion)<br />James Morrison (West Bromich Albion)<br />Robert Snodgrass (Aston Villa)<br /><br />Steven Fletcher (Sheffield Wednesday)<br />Leigh Griffiths (Celtic)<br />Chris Martin (Derby County)', 'Squad', '2017-10-07 12:48:25', '2017-10-07 12:48:25', null);
INSERT INTO `news` VALUES ('236', '2017-10-08 00:00:00', 'Scotland\'s World Cup Dream Is Over', 'Scotland\'s hopes of reaching their first World Cup in 20 years are over, after a poor performance saw them draw 2-2 in Slovenia.&nbsp; Griffiths game Scotland a 1-0 lead at half time, but two second half goals by Bezjak put Slovenia 2-1 ahead.&nbsp; A late equaliser by Snodgrass was not enough to take Scotland to the play-offs.', 'News', '2017-10-08 19:15:45', '2017-10-08 19:15:45', null);
INSERT INTO `news` VALUES ('237', '2017-10-12 00:00:00', 'Scotland and Strachan Part Company', 'Gordon Strachan has left the Scotland job by mutual consent after 2 failed campaigns and almost 5 years in charge.&nbsp; David Moyes is the bookmakers favourite at 5/2 to take over.', 'News', '2017-10-12 18:47:50', '2017-10-12 18:47:50', null);
INSERT INTO `news` VALUES ('238', '2017-10-13 00:00:00', 'Mackay Takes Charge For Holland Friendly', 'SFA Performance Director, Malky Mackay is taking interim charge for the friendly that has been arranged for 9th November at Pittodrie.&nbsp; The former Cardiff City manager is one of the bookies favourites to be given the job on a full time basis.', 'News', '2017-10-13 18:49:20', '2017-10-13 18:49:20', null);
INSERT INTO `news` VALUES ('239', '2017-11-05 00:00:00', 'Scotland Squad for Holland Friendly', 'Jordan Archer (Millwall)<br />Craig Gordon (Celtic)<br />David Marshall (Hull City)<br /><br />Callum Paterson (Cardiff City)<br />Kieran Tierney (Celtic)<br />Andrew Robertson (Liverpool)<br />Liam Cooper (Leeds United)<br />Paul Hanlon (Hibernian)<br />Charlie Mulgrew (Blackburn Rovers)<br />Christophe Berra (Hearts)<br /><br />Stuart Armstrong (Celtic)<br />Scott Brown (Celtic)<br />Callum McGregor (Celtic)<br />James Forrest (Celtic)<br />Ryan Fraser (Bournemouth)<br />Ryan Jack (Rangers)<br />John McGinn (Hibernian)<br />Kenny McLean (Aberdeen)<br />Matt Phillips (West Bromwich Albion)<br />Graeme Shinnie (Aberdeen)<br /><br />Ryan Christie (Aberdeen)<br />Jason Cummings (Nottingham Forest)', 'Squad', '2017-11-07 21:12:03', '2017-11-07 21:12:03', null);
INSERT INTO `news` VALUES ('240', '2017-11-09 00:00:00', 'SFA Rule Out Mackay as next Scotland Manager', 'Just hours prior to kick-off against Holland, SFA chief executive Stewart Regan, rules Malky Mackay out of the running for the Scotland Manager\'s job.  The timing of the announcement has been criticised as he needs to take charge for the Holland friendly.', 'News', '2017-11-09 00:00:00', '2017-11-09 00:00:00', null);
INSERT INTO `news` VALUES ('241', '2017-11-09 00:00:00', 'Young Scots Side suffer narrow defeat to the Dutch', 'A young inexperienced Scotland side, managed by caretaker Malky Mackay, put in an impressive performance against the Dutch, and were unlucky to lose 1-0 because of a first half goal by Memphis Depay.', 'News', '2017-11-09 00:00:00', '2017-11-09 00:00:00', null);
INSERT INTO `news` VALUES ('242', '2017-11-15 00:00:00', 'Scotland Make Approach for Michael O\'Neil', 'The SFA have made a move for Northern Ireland Manager Michael O\'Neil.  O\'Neil, who lives in Edinburgh was made the bookies favourite after Northern Ireland failed to make the World Cup finals.  Northern Ireland are trying to convince him to stay.  He is in contract until 2020.', 'News', '2017-11-15 00:00:00', '2017-11-15 00:00:00', null);
