INSERT INTO `opponents` VALUES ('3', 'Austria', 'Scotland 2-0 Austria, 1997', 'Outside of the UK, Austria is the country that Scotland have faced the most times, including three qualification campaigns and the 1954 World Cup Finals.', 'Austria', '2', null, 'austria', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1920620\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:68.013468% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1920620?et=r4p1cA8FSZRf9g7HGLvceg&viewMoreLink=off&sig=1A-MoLzn_Vk9nCKOQLfbqeSMpwyQlQmDkgXd1gAlU5I=\" width=\"594\" height=\"404\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', null, null, null);
INSERT INTO `opponents` VALUES ('4', 'Belarus', 'Scotland 4-1 Belarus, 1997', 'Belarus are a former Soviet country that Scotland have faced in two World Cup campaigns.', 'Belarus', '2', null, 'belarus', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1918972\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:70.370370% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1918972?et=NW5rMYe3QAteY_g0wJk6fg&viewMoreLink=on&sig=_lz0pdpB36iXhfJ-HLeZERuucPTsvu44E0FgtXIsD6Y=\" width=\"594\" height=\"418\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', null, null, null);
INSERT INTO `opponents` VALUES ('5', 'Belgium', null, 'Belgium is the country that Scotland have played the most competitive games against.  This includes four World Cup Qualifiers and eight European Championship Qualifiers.', 'Belgium', '2', null, 'belgium', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/154229962\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:60.269360% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/154229962?et=mR2y-SvFRJllSxr2bncEsw&viewMoreLink=on&sig=R18SMBTbL_8GPXoP1EaDRekBh4mwZ6GxUd8jfONFrNc=\" width=\"594\" height=\"358\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', null, null, null);
INSERT INTO `opponents` VALUES ('6', 'Bosnia Herzegovina', 'Scotland 1-0 Bosnia, 1999', null, 'Bosnia', '2', null, 'bosnia', '<div class=\"getty embed image\" style=\"background-color:#fff;display:inline-block;font-family:\'Helvetica Neue\',Helvetica,Arial,sans-serif;color:#a7a7a7;font-size:11px;width:100%;max-width:594px;\"><div style=\"padding:0;margin:0;text-align:left;\"><a href=\"http://www.gettyimages.com/detail/1236471\" target=\"_blank\" style=\"color:#a7a7a7;text-decoration:none;font-weight:normal !important;border:none;display:inline-block;\">Embed from Getty Images</a></div><div style=\"overflow:hidden;position:relative;height:0;padding:66.329966% 0 0 0;width:100%;\"><iframe src=\"//embed.gettyimages.com/embed/1236471?et=htPHrHb4SqJWEYvRXbdDxQ&viewMoreLink=on&sig=hBJ5T4-c7nhf4X6hGyLIrGOOZpjKte2T58tFILW__v8=\" width=\"594\" height=\"394\" scrolling=\"no\" frameborder=\"0\" style=\"display:inline-block;position:absolute;top:0;left:0;width:100%;height:100%;margin:0;\"></iframe></div><p style=\"margin:0;\"></p></div>', null, null, null);
