INSERT INTO `pastevents` VALUES ('1', '1954-02-01 00:00:00', 'Andy Beattie was appointed as Scotland\'s first ever manager.', null, null, null);
INSERT INTO `pastevents` VALUES ('2', '1954-06-19 00:00:00', 'Andy Beattie resigned as Scotland Manager before they were humiliated in a 7-0 defeat by Uruguay in the 1954 World Cup Finals.', null, null, null);
INSERT INTO `pastevents` VALUES ('3', '1958-02-06 00:00:00', 'Scotland\'s trainer Dawson Walker took charge of the national side after manager Matt Busby was injured in the Munich Air Disaster.', null, null, null);
INSERT INTO `pastevents` VALUES ('4', '1958-01-15 00:00:00', 'Matt Busby was appointed as Scotland Manager, but could not take charge until September, due to the Munich Air Disaster. ', null, null, null);
INSERT INTO `pastevents` VALUES ('5', '1971-09-12 00:00:00', 'Tommy Docherty took charge of the national team as a caretaker role.  He was appointed as manager in November.', null, null, null);
INSERT INTO `pastevents` VALUES ('6', '1972-12-22 00:00:00', 'Tommy Docherty resigned as Scotland manager to take over at Manchester Utd.', null, null, null);
INSERT INTO `pastevents` VALUES ('7', '1973-01-05 00:00:00', 'Willie Ormond was appointed as Scotland manager.', null, null, null);
INSERT INTO `pastevents` VALUES ('8', '1977-05-06 00:00:00', 'Willie Ormond resigned as Scotland manager.', null, null, null);
INSERT INTO `pastevents` VALUES ('9', '1977-05-18 00:00:00', 'Ally MacLeod was appointed as Scotland manager.', null, null, null);
INSERT INTO `pastevents` VALUES ('10', '1978-09-26 00:00:00', 'Ally MacLeod resigned as Scotland manager.', null, null, null);
INSERT INTO `pastevents` VALUES ('11', '1978-10-04 00:00:00', 'Jock Stein was appointed as Scotland manager.', null, null, null);
INSERT INTO `pastevents` VALUES ('12', '1985-09-10 00:00:00', 'Manager Jock Stein collapsed and died of a heart attack, after Scotland drew 1-1 with Wales and qualified for the play-offs for the 1986 World Cup Finals.', null, null, null);
INSERT INTO `pastevents` VALUES ('13', '1986-07-16 00:00:00', 'Andy Roxburgh was appointed as Scotland manager.', null, null, null);
INSERT INTO `pastevents` VALUES ('14', '1993-09-11 00:00:00', 'Andy Roxburgh resigned as Scotland manager. Craig Brown took charge as caretaker manager.', null, null, null);
INSERT INTO `pastevents` VALUES ('15', '1993-11-17 00:00:00', 'Craig Brown was appointed as Scotland manager.', null, null, null);
INSERT INTO `pastevents` VALUES ('16', '2001-10-06 00:00:00', 'Craig Brown resigned as Scotland manager after they failed to qualify for the 2002 World Cup Finals.', null, null, null);
INSERT INTO `pastevents` VALUES ('17', '2002-03-01 00:00:00', 'Berti Vogts was appointed as Scotland\'s first foreign manager.', null, null, null);
INSERT INTO `pastevents` VALUES ('18', '2004-11-01 00:00:00', 'Berti Vogts resigned as Scotland manager.', null, null, null);
INSERT INTO `pastevents` VALUES ('19', '2004-12-02 00:00:00', 'Walter Smith was appointed as Scotland manager.', null, null, null);
INSERT INTO `pastevents` VALUES ('20', '2007-01-10 00:00:00', 'Walter Smith resigned as Scotland manager, to take over as Rangers manager for a second time.', null, null, null);
INSERT INTO `pastevents` VALUES ('21', '2007-01-29 00:00:00', 'Alex McLeish was appointed as Scotland manager.', null, null, null);
INSERT INTO `pastevents` VALUES ('22', '2007-11-27 00:00:00', 'Alex McLeish resigned as Scotland manager, to take over at Birmingham City.', null, null, null);
INSERT INTO `pastevents` VALUES ('23', '2008-01-24 00:00:00', 'George Burley was appointed as Scotland manager.', null, null, null);
