INSERT INTO `players` VALUES ('1171', 'Cummings', 'Jason', '2017', '', '1995-08-01 00:00:00', '', '', '00000000000', null, '2017-11-09 21:26:16', '2017-11-09 21:26:16', null);
INSERT INTO `playerstatistics` VALUES ('1', 'SFA Hall Of Fame', 'The SFA Hall Of Fame is a list of every player who has gained at least 50 caps for Scotland.  What is also \r\n			called the International Roll of Honour, was set up in February 1988, and at that stage it only comprised of 11 \r\n			players.  There are now 28 players in the \r\n			SFA Hall Of Fame.<br /><br />\r\n			When a player is entered into the SFA Hall Of Fame, they are awarded with a gold cap and their portrait is \r\n			hung in the Scottish Football Museum at Hampden Park.  It is often a tradition for the player to wear the \r\n			captain\'s armband on their 50th cap, but it is not always the case.<br /><br />\r\n			This page contains a record of every player who is in the SFA Hall Of Fame.', 'The SFA Hall Of Fame is a list of every player who has gained at least 50 caps for Scotland. What is also called the International Roll of Honour, was set up in February 1988, and at that stage it only comprised of 11 players. There are now [HOF_COUNT] players in the SFA Hall Of Fame. When a player is entered into the SFA Hall Of Fame, they are awarded with a gold cap and their portrait is hung in the Scottish Football Museum at Hampden Park. It is often a tradition for the player to wear the captain\'s armband on their 50th cap, but it is not always the case.', 'sfa-hall-of-fame', 'Details of Scotland\'s SFA Hall Of Fame. This includes details of the players and match details of their international appearances.');
INSERT INTO `playerstatistics` VALUES ('2', 'Silver Caps (25-49)', 'Similar to the SFA Hall Of Fame, where a player receives a gold cap for winning 50 caps, if a player wins 25 caps\r\n			they are awarded a silver cap.<br /><br />\r\n			There are many great Scotland players who have not made the SFA Hall Of Fame.  Jim Baxter, Jimmy Johnstone \r\n			and Archie Gemmill have all missed out as have many other great players.<br /><br />\r\n			This page contains a record of every player who has won 25-49 caps.', 'Similar to the SFA Hall Of Fame, where a player receives a gold cap for winning 50 caps, if a player wins 25 caps they are awarded a silver cap.  There are many great Scotland players who have not made the SFA Hall Of Fame. Jim Baxter, Jimmy Johnstone and Archie Gemmill have all missed out as have many other great players.', 'silver-caps', 'Details of Scotland\'s Silver Caps (25-49). This includes details of the players and match details of their international appearances.');
INSERT INTO `playerstatistics` VALUES ('3', 'Leading Goalscorers', 'There have been may great goalscorers for Scotland over the years, and this page contains a record of every \r\n			player who has scored 5 or more goals for Scotland, which is shown on the right.<br /><br />\r\n			Furthermore, in-depth details of every player and their goalscoring record, can be viewed by selecting that player.', 'There have been may great goalscorers for Scotland over the years, and this page contains a record of every player who has scored 5 or more goals for Scotland.', 'leading-goalscorers', 'Details of Scotland\'s leading goalscorers. This includes details of the players and match details of their international appearances.');
INSERT INTO `playerstatistics` VALUES ('4', 'Current Players', 'To have details of the more up to date players, this section lists every player who has played for Scotland in the last two years.  Furthermore this section contains details of every game that the player has played, not just those in the last two years.', 'This section contains a list of all of the players who are currently playing for Scotland.  This also includes players who may be called up to the squad but may not have been capped recently.', 'current-players', 'Details of Scotland\'s current players. This includes details of the players and match details of their international appearances.');
INSERT INTO `playerstatistics` VALUES ('5', 'Players A-Z', null, 'This page contains a record of every player who has played for Scotland in order from A-Z.', 'a-z', 'An A-Z of every player who has played for Scotland, including in-depth details of every player and match that they played in.');
