  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) DEFAULT NULL,
  `sub_title` varchar(255) DEFAULT NULL,
  `summary` varchar(255) DEFAULT NULL,
  `match_id` int(11) DEFAULT '0',
  `type_id` int(11) NOT NULL DEFAULT '0',
  `featured` tinyint(1) DEFAULT '0',
  `classic` tinyint(1) DEFAULT '0',
  `history` tinyint(1) DEFAULT '0' COMMENT 'Not Needed',
  `filename` varchar(255) DEFAULT NULL,
  `url` varchar(255) DEFAULT NULL,
  `youtube` varchar(255) DEFAULT NULL,
  `Extended` tinyint(4) DEFAULT NULL,
  `AllGoals` tinyint(4) DEFAULT NULL,
  `ScotlandGoals` tinyint(4) DEFAULT NULL,
  `English` tinyint(4) DEFAULT NULL,
  `LocalQuality` int(11) DEFAULT NULL COMMENT '1 - Perfect, 2 - Good, 3 - could be better, 4 poor quality / not english',
  `YouTubeQuality` int(11) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NULL DEFAULT '0000-00-00 00:00:00',
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `MatchID` (`match_id`)
) ENGINE=MyISAM AUTO_INCREMENT=403 DEFAULT CHARSET=utf8;

